INSERT INTO `actor_actor` VALUES (1,'John Wayne','Winterset, Iowa, USA ','Marion Mitchell Morrison (born Marion Robert Morrison; May 26, 1907 – June 11, 1979), known professionally as John Wayne and nicknamed Duke, was an American actor and filmmaker. An Academy Award-winner for True Grit (1969), Wayne was among the top box office draws for three decades.\n\nBorn in Winterset, Iowa, Wayne grew up in Southern California. He was president of Glendale High class of 1925. He found work at local film studios when he lost his football scholarship to the University of Southern California as a result of a bodysurfing accident. Initially working for the Fox Film Corporation, he appeared mostly in small bit parts. His first leading role came in Raoul Walsh\'s The Big Trail (1930), which led to leading roles in numerous B movies throughout the 1930s, many of them in the Western genre.\n\nWayne\'s career took off in 1939, with John Ford\'s Stagecoach making him an instant star. He went on to star in 142 pictures. Biographer Ronald Davis said, \"John Wayne personified for millions the nation\'s frontier heritage. Eighty-three of his movies were Westerns, and in them, he played cowboys, cavalrymen, and unconquerable loners extracted from the Republic\'s central creation myth.\"\n\nWayne\'s other well-known Western roles include a cattleman driving his herd north on the Chisholm Trail in Red River (1948), a Civil War veteran whose young niece is abducted by a tribe of Comanches in The Searchers (1956), and a troubled rancher competing with a lawyer for a woman\'s hand in marriage in The Man Who Shot Liberty Valance (1962). He is also remembered for his roles in The Quiet Man (1952), Rio Bravo (1959), and The Longest Day (1962). In his final screen performance, he starred as an aging gunfighter battling cancer in The Shootist (1976). He appeared with many important Hollywood stars of his era, and his last public appearance was at the Academy Awards ceremony on April 9, 1979.','1907-05-26','1979-06-11'),(2,'Tyrese Gibson','Los Angeles, California, USA','Tyrese Darnell Gibson (born December 30, 1978), also known mononymously as Tyrese, is an American Grammy-nominated R&B singer, songwriter, actor, author, television producer, former fashion model and MTV VJ. He is best known for his role as Roman Pearce in the The Fast and the Furious series.','1978-12-30',NULL),(3,'Allen Richard Perada',NULL,'',NULL,NULL),(4,'Ahn Kil-kang','South Korea','Ahn Gil-kang (Korean: 안길강; born August 24, 1966) is a South Korean actor. His role in the popular period drama Queen Seon Duk earned him the Golden Acting Award at the 2009 MBC Drama Awards.','1966-08-24',NULL),(5,'Shane Rowe','Kingston, Jamaica','','1984-01-12',NULL),(6,'Kristian Beazley',NULL,'',NULL,NULL),(7,'Julia Butters','Los Angeles, California, USA','Julia Butters (born April 15, 2009) is an American actress. She\'s best known for her role as Anna-Kat Otto on the sitcom American Housewife. She received critical acclaim for her role as Trudi Fraser in Quentin Tarantino\'s Once Upon a Time in Hollywood and as Reggie Fabelman in Steven Spielberg\'s The Fabelmans (2022).','2009-04-15',NULL),(8,'Seiyo Uchino','Kanagawa, Japan','Born 1968 in Kanagawa, Japan, Seiyo Uchino is a Japanese actor. Before taking his current stage name Seiyo Uchino in July 2013, he was known by his birth name Masaaki Uchino (both spelled 内野聖陽 in Japanese). He has received numerous awards, including the 39th Japan Academy Film Prize as Excellent Actor for his performance in the Japanese-Turkish co-production 125 Years Memory. He was married to actress Maki Ichiro from 2006 to 2011.','1968-09-16',NULL),(9,'Saranya Ponvannan','Alappuzha, Kerala, India','Sheela better known by her stage name Saranya is an Indian film actress who has predominantly appeared in Tamil language films. Saranya made her debut in a lead role in Mani Ratnam\'s Nayagan and went on to play lead roles in a few films during the late 1980s. Following an eight-year sabbatical, she returned to feature films as a character artiste, essaying supporting roles, particularly playing mother characters to lead artists. For her performances in films including Raam (2005), Thavamai Thavamirundhu (2005), Em Magan (2006) and Kalavani (2010), she has received notable critical praise and several accolades, including three Filmfare Awards for Best Supporting Actress, while her performance in Thenmerku Paruvakaatru fetched her the National Film Award for Best Actress in 2011.Saranya is the daughter of Malayalam film director A. B. Raj. She is married to a fellow actor, Ponvannan.','1970-04-26',NULL),(10,'Shaun Wilson',NULL,'',NULL,NULL),(11,'Zach Rose',NULL,'',NULL,NULL),(12,'James Badge Dale',' New York City, New York, USA','James Badge Dale  (born May 1, 1978) is an American actor who starred in the AMC drama series Rubicon. He is most famous for his role of Chase Edmunds in the third season of 24 and Robert Leckie in the HBO miniseries The Pacific.\n\nDescription above from the Wikipedia article James Badge Dale, licensed under CC-BY-SA, full list of contributors on Wikipedia','1978-05-01',NULL),(13,'Azure Parsons','New Orleans, Louisiana, USA','Azure Parsons is an American actress. She has appeared in a number of film\'s, including 2 Guns, Paradise, and Dark Places, and television shows like Death Valley, Castle, and True Detective. In 2014, Parsons was cast as a recurring character in the first season of the fantasy drama series Salem on WGN America. In 2016, she returned to appear in the third season of Salem. She starred as Annie Glenn on the ABC drama series The Astronaut Wives Club.','1984-10-04',NULL),(14,'Bradley Paterson',NULL,'',NULL,NULL),(15,'Mark Adam',NULL,'',NULL,NULL),(16,'Andrew Tiernan','Ladywood, Birmingham,  England, UK','Andrew James Tiernan is an English film and television actor.','1965-11-30',NULL),(17,'Efosa Otuomagie',NULL,'',NULL,NULL),(18,'J. Nathan Simmons','Edmond, Oklahoma, USA','','1968-05-06',NULL),(19,'Gabriel Casseus','New York, New York, USA','From Wikipedia, the free encyclopedia. Gabriel Casseus (born April 28, 1972) is an American actor and screenwriter of Haitian descent, born in Roosevelt, New York.\n\nCasseus was nominated for the 1995 Independent Spirit Award for Best Debut Performance in the film New Jersey Drive. He has appeared in the films Get on the Bus, Fallen, and Black Dog.\n\nHe had roles as pool-playing Freddie in the 50 Cent movie Before I Self Destruct (2009), as Elliot\'s cellmate in Bedazzled, and as Army Ranger Kurth in Black Hawk Down.\n\nCasseus has appeared on television shows including Grey\'s Anatomy, CSI: Miami, CSI: NY, The Practice, Law & Order and 24.\n\nHe is a co-writer of the 2010 film Takers.','1972-04-28',NULL),(20,'Sushma Seth','Delhi, India','Sushma Seth (born 20 June 1936) is an Indian  stage, film and television actress. She started her career in the  1950s, and was a founder member of the Delhi-based theatre group Yatrik.  Her first movie was Junoon  in 1978. She is known for playing the mother and the grandmother in  movies and television, and is best remembered for her role of Dadi in  the pioneering TV soap Hum Log (1984–1985).She has worked with famous directors like Dev Raj Ankur, Ram Gopal Bajaj, Manish Joshi Bismil, Chander Shekhar Sharma','1936-06-20',NULL),(21,'Bill Paxton','Fort Worth, Texas, USA','Bill Paxton (May 17, 1955 - February 25, 2017) was an American actor. He appeared in films including Aliens and Titanic and starred as practising polygamist Bill Henrickson in the HBO series Big Love. On February 25, 2017 he died from complications following heart surgery.','1955-05-17','2017-02-25'),(22,'Brian Smyj',NULL,'Brian Smyj (pronounced Smy) is a highly trained Stunt Coordinator and Stunt man with over 20 years in the business. From Gladiator (2000) to The Pink Panther (2006) he\'s crashed and burned his way across the big screen time and time again. When he\'s not launching someone off a building or lighting them on fire, he\'s designing and fabricating one-of-a-kind rigs, machines, and safety systems to make his stunts the best and safest in the business. Brian is one of the most creative, accomplished stunt rigger in the United States. Brian knows how to flex the rules of physics to defy the laws of gravity.',NULL,NULL),(23,'William Welsh','Philadelphia, Pennsylvania, USA','','1870-02-08','1946-07-16'),(24,'Tasen Chou',NULL,'',NULL,NULL),(25,'Cristalle C. Leonard',NULL,'',NULL,NULL),(26,'Dana Kimmell','Texarkana, Texas, USA','Dana Kimmell is an American actress who has starred in films and on television. She played Dawn Marshall on Texas and appeared on Days of Our Lives as Diane Parker from 1983–1984.','1959-10-25',NULL),(27,'Sean Harris','London, England, UK','Sean Harris (born 1966, Bethnal Green, London, England) is a British actor, best known for his film roles in 24 Hour Party People (2002), Prometheus (2012), The King (2019), The Green Knight (2021), Spencer (2021), The Stranger (2022), and the Mission: Impossible franchise (2015-2018). As a stage actor, Harris was a member of the Glasgow Citizens Theatre, where he performed in stage productions such as Tybalt in Romeo and Juliet directed by Giles Havergal and as Carino in Don Juan directed by Robert David MacDonald. He also appeared as Lysander in a production of A Midsummer Night\'s Dream, directed by Matthew Lloyd at the Haymarket Theatre (Leicester) and as Johnny in a Nottingham Playhouse production of Angels Rave On, directed by Jonathan Church. Harris won a British Academy Television Award for Best Actor for his role in the miniseries Southcliffe (2013) and received three consecutive BAFTA nominations for Best Supporting Actor for his roles in ‘71 (2014), Macbeth (2015), and Trespass Against Us (2016).  Description above from the Wikipedia article Sean Harris, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-01-01',NULL),(28,'Jenna Upton','Cape Town, South Africa','',NULL,NULL),(29,'Richard Edson','New Rochelle, New York, USA','Richard Edson (born January 1, 1954) is an American actor and musician. He was born in New Rochelle, New York to a Jewish family. Edson was a founding member of the San Francisco art rock band The Alterboys.\n\nHe started his acting career on screen in the feature film, Stranger Than Paradise (1984). Since then, he has been known for his roles in Ferris Bueller\'s Day Off (1986), Do The Right Thing (1989), Super Mario Bros. (1993) and Strange Days (1995).','1954-01-01',NULL),(30,'Steven Badawi',NULL,'',NULL,NULL),(31,'Salvatore Furnari',NULL,'',NULL,NULL),(32,'Stephania Gambaroff',NULL,'',NULL,NULL),(33,'Gautham',NULL,'',NULL,NULL),(34,'Henry Hall','Washington Township, Buchanan County, Missouri, US','','1876-11-04','1954-12-11'),(35,'David Wilmot','Dublin, Ireland','David Wilmot is an award-winning Irish stage, screen, and television actor. Wilmot\'s theatre credits include Six Characters in Search of an Author at the Abbey Theatre in Dublin, As You Like It with the Druid Theatre Company in Galway, and Juno and the Paycock in London\'s West End. He originated the role of Padraic in The Lieutenant of Inishmore at The Other Place in Stratford-upon-Avon in 2001, played it at the Barbican Center in 2002, then joined the 2006 off-Broadway Atlantic Theater Company production, which later transferred to Broadway. He was nominated for the 2006 Tony Award for Best Performance by a Leading Actor in a Play, the Drama League Award for Distinguished Performance, and the Outer Critics Circle Award for Outstanding Actor in a Play and won the Lucille Lortel Award for Outstanding Lead Actor and the Theatre World Award for his performance.\n\nWilmot portrayed Dr. Ed Costello in sixteen episopdes of The Clinic on RTÉ. He was nominated for the Irish Film and Television Award for Best Actor in a TV Drama. Wilmot\'s screen credits include Michael Collins (1996), I Went Down (1997), The Devil\'s Own (1997), The Tale of Sweeney Todd (1998), Intermission (2003), Laws of Attraction (2004), King Arthur (2004), and Six Shooter (2006). He was named Best Supporting Actor in Film and nominated Best New Talent for Intermission at the 2003 Irish Film and Television Awards.\n\nDescription above from the Wikipedia article David Wilmot, licensed under CC-BY-SA, full list of contributors on Wikipedia.',NULL,NULL),(36,'Khalid Rivera',NULL,'',NULL,NULL),(37,'Sophie Lui',NULL,'','1975-08-15',NULL),(38,'Taylor Kitsch','Kelowna, British Columbia, Canada','Taylor Kitsch is a Canadian actor and model best known for his portrayal of football player Tim Riggins on the NBC series \"Friday Night Lights\". He was in many movies including the supernatural film \"The Covenant\", the X-Men spin-off \"X-Men Origins: Wolverine\", the Disney film \"John Carter\", the war film \"Lone Survivor\" and HBO\'s lgbt drama \"The Normal Heart\". In November 2014, he was cast in the second season of HBO\'s popular anthology crime series \"True Detective\" which costarred fellow Canadian Rachel McAdams. He plays the lead role of David Koresh, founder of the Branch Davidians in the 6-part mini-series Waco.','1981-04-08',NULL),(39,'Anjel Alcaraz',NULL,'',NULL,NULL),(40,'Ruan Vibegaard',NULL,'',NULL,NULL),(41,'Treat Williams','Stamford, Connecticut, USA','Richard Treat Williams (December 1, 1951 – June 12, 2023) was an American actor, author, and aviator. Williams\' accolades include nominations for two Screen Actors Guild Awards, three Golden Globes, a Primetime Emmy, two Satellite Awards, and an Independent Spirit Award. He appeared in over 75 films and several television series. Williams\' career included numerous stage roles.\n\nOn June 12, 2023, Williams was involved in a motorcycle crash on Vermont Route 30, near Dorset. According to the Vermont State Police, a 2008 Honda Element in the southbound lane turned into the path of Williams\' motorcycle in the northbound lane, who was unable to avoid colliding with it. He was airlifted to Albany Medical Center, where he was pronounced dead at the age of 71.\n\n[biography (excerpted) from Wikipedia]','1951-12-01','2023-06-12'),(42,'Sue Scadding',NULL,'',NULL,NULL),(43,'Camille Rizkallah',NULL,'',NULL,NULL),(44,'Anna Kanakis','Messina','','1962-02-01',NULL),(45,'Michael Rainey Jr.','Louisville, Kentucky, USA','','2000-09-22',NULL),(46,'David Thomas',NULL,'',NULL,NULL),(47,'Anna Jackson',NULL,'',NULL,NULL),(48,'Mikaela Piedrahita',NULL,'',NULL,NULL),(49,'Vincent Walsh','Dublin, Ireland','','1972-02-04',NULL),(50,'Michael Teh','Sydney, New South Wales, Australia','','1969-04-17',NULL),(51,'Morgan Paull','West Virginia, USA','','1944-12-15','2012-07-17'),(52,'Joe Nin Williams','Alexandria, Virginia, USA','','1982-10-18',NULL),(53,'Lauren Elyse Buckley',NULL,'',NULL,NULL),(54,'Corinne Nobili',NULL,'',NULL,NULL),(55,'Elliot Baxter',NULL,'',NULL,NULL),(56,'Ariadne Bourbonnière',NULL,'',NULL,NULL),(57,'Daniel Theodore',NULL,'',NULL,NULL),(58,'Jacob James Beswick',NULL,'',NULL,NULL),(59,'Elizabeth Shapiro','USA','',NULL,NULL),(60,'Eli Harris',NULL,'',NULL,NULL),(61,'Scott Sayers',NULL,'',NULL,NULL),(62,'Errik Tustenuggee',NULL,'',NULL,NULL),(63,'Eve Harlow','Moscow, Russian SFSR, USSR [now Russia]','','1989-06-20',NULL),(64,'Gregor Truter',NULL,'',NULL,NULL),(65,'William Stanton',NULL,'',NULL,NULL),(66,'Dwayne Adway','Saginaw, Michigan, USA','','1969-02-01',NULL),(67,'Mario Van Peebles','Mexico City, Mexico','Mario Cain Peebles Marx (born January 15, 1957) is a Mexican-born American director and actor who has appeared in numerous Hollywood films. He is son of filmmaker Melvin Van Peebles.\n\nDescription above from the Wikipedia article Mario Van Peebles, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1957-01-15',NULL),(68,'George Wallace','Atlanta, Georgia, USA','George Henry Wallace (born July 21, 1952) is an American comedian and actor. Wallace has had supporting roles in a number of films, including 3 Strikes and the Coen Brothers film The Ladykillers (2004, as Sheriff Wyner). Wallace also appeared in Batman Forever (1995) as the Mayor of Gotham City. Other film credits include A Rage in Harlem (1991), The Wash (2001), Punchline (1988), Things Are Tough All Over (1982), Postcards from the Edge (1990), and Mr. Deeds (2002).\n\nWallace made a brief appearance in the sitcom Scrubs episode \"My Words of Wisdom\" (2007), and in the sitcom Seinfeld episode \"The Checks\", where he played the doctor that was distracted by the song \"Witchy Woman\". He also appeared in the introduction scene to the home video release of Jerry Seinfeld: I\'m Telling You for the Last Time - Live on Broadway (1999) as a fictionalized version of himself. He portrayed a man in a retirement home in The Last Laugh (2019) and starred as the Mayor in Hubie Halloween (2020).','1948-07-21',NULL),(69,'Corrado Gaipa','Palermo, Sicily, Italy','Corrado Gaipa was an Italian actor and voice actor.\n\nBorn in Palermo, Sicily, Gaipa enrolled in the Silvio d’Amico Academy of Dramatic Arts, graduating in 1946. He appeared in many Italian films, notably playing Don Tommasino in Francis Ford Coppola\'s The Godfather.\n\nAlso active on stage, radio and television, he was mainly active as a voice actor and a dubber. He was in a wheelchair.  At the time of his death, he had just signed to reprise the role of Don Tommasino in The Godfather Part III.','1924-03-13','1989-09-21'),(70,'Wayne Dalglish','St. Paul, Minnesota, USA','','1990-09-12',NULL),(71,'Osama Bin Laden','Riyadh, Saudi Arabia','Osama bin Mohammed bin Awad bin Laden was the founder of al-Qaeda, the terrorist organization responsible for the September 11 attacks on the United States and numerous other mass-casualty attacks against civilian and military targets. He was a member of the wealthy Saudi bin Laden family, and an ethnic Yemeni Kindite. Bin Laden was on the American Federal Bureau of Investigation\'s (FBI) lists of Ten Most Wanted Fugitives and Most Wanted Terrorists for his involvement in the 1998 U.S. embassy bombings. From 2001 to 2011, bin Laden was a major target of the War on Terror, with a US$25 million bounty by the Federal Bureau of Investigation. After being placed on the FBI\'s Most Wanted list, bin Laden remained in hiding during three U.S. presidential administrations. On May 2, 2011, bin Laden was shot and killed inside a private residential compound in Abbottabad, Pakistan, by U.S. Navy SEALs and CIA operatives in a covert operation ordered by U.S. President Barack Obama. Shortly after his death, bin Laden\'s body was buried at sea. Al-Qaeda acknowledged his death on May 6, 2011, vowing to retaliate.','1957-03-10','2011-05-02'),(72,'Dwayne Carrington',NULL,'',NULL,NULL),(73,'Brooks Benedict','New York City, New York, USA','Brooks Benedict (born Harold J. Mann, February 6, 1896 – January 1, 1968) was an American actor of the silent and sound film era, where he played supporting and utility roles in over 300 films, mostly uncredited.','1896-02-05','1968-01-01'),(74,'Jazy Berlin','Los Angeles, California, USA','Jazy Berlin was born Jessica Elizabeth Gruber on April 17, 1986 in Minneapolis, Minnesota. From age 10 she had theatrical training and starred in numerous plays. She attended college to study acting, and later decided to move from Minneapolis to Los Angeles to pursue her dreams. Things quickly fell into place, and her professional adult film career began in 2009. She retired in 2015.','1986-04-17',NULL),(75,'Mackenzie Evans',NULL,'',NULL,NULL),(76,'Sophie Skelton','Woodford, England, UK','Sophie Alexandra Skelton was born and raised in Woodford, Cheshire, UK. She is the youngest of three, with two older brothers Sam and Roger. Her parents, Simon and Ruth Skelton, are both toy inventors. Having completed her A-Levels in Biology, Chemistry, English Literature and Maths she turned down her University offers to pursue her career as an actor, being the first in the family to go into acting.','1994-03-07',NULL),(77,'Gary Brichetto',NULL,'',NULL,NULL),(78,'Vitaly Zdorovetskiy','Murmansk, Russia','Vitaly Zdorovetskiy, better known by his YouTube username VitalyzdTv, is a Russian-born YouTube personality whose main channel videos, as of November 2015, had garnered more than 1 billion views','1992-03-08',NULL),(79,'John Heffernan','New York City, New York, USA','John Heffernan (May 30, 1934 – December 3, 2018) was an American film, stage and television actor. He was perhaps best known for playing Eddie Niles in the 1973 film The Sting.','1934-05-30','2018-12-03'),(80,'Jamie Burton-Oare','USA','',NULL,NULL),(81,'Jon Lovitz','Tarzana, California, USA','Jonathan \"Jon\" Lovitz is an American comedian, actor, and singer. He is best known as a cast member of the NBC sketch comedy show Saturday Night Live from 1985 to 1990.','1957-07-21',NULL),(82,'Casey Sander','Washington, D.C., USA','Clinton O. \"Casey\" Sander (born July 6, 1956) is an American actor known as the character \"Captain\" Jimmy Wennick on the short-lived TV series Tucker. His television credits also include Criminal Minds, The Golden Girls, Grace Under Fire, Home Improvement, Malcolm in the Middle, Rules of Engagement, Sons of Anarchy, Mad Men, Silicon Valley, The Newsroom, Buffy the Vampire Slayer Hunter, NCIS,NCIS: Los Angeles and Marvin Marvin, among other shows. He more recently had a recurring role on the TV sitcom The Big Bang Theory as Bernadette\'s father, Mike, and also appeared in four episodes of The Ranch as Roger Hollister.','1956-07-06',NULL),(83,'Diplo','Tupelo, Mississippi, USA','Thomas Wesley Pentz Jr., known professionally as Diplo, is an American DJ and record producer based in Los Angeles, California.','1978-11-10',NULL),(84,'Katherine Harold',NULL,'',NULL,NULL),(85,'Daren A. Herbert','Bermuda','Born and raised on the island of Bermuda, Daren began studying as a dancer in Philadelphia. He soon switched to Theatre/Musical Theatre and never looked back. Daren also worked as a nursing assistant, dietary technician, high school teacher and a reservist in the Bermuda Regiment and trained with them in Jamaica, The U.S. and Kenya.  IMDb Mini Biography By: Daren Herbert','1976-01-17',NULL),(86,'Kane Hodder','Auburn, California, USA','From Wikipedia, the free encyclopedia.\n\nKane Warren Hodder (born April 8, 1955) is an American actor and stuntman. Standing 6 ft 2.5 in (189.2 cm), he is best known for his portrayal of Jason Voorhees in four films from the Friday the 13th film series (parts VII through X). He is also known for his role as Victor Crowley in Hatchet.\n\nDescription above from the Wikipedia article Kane Hodder, licensed under CC-BY-SA, full list of contributors on Wikipedia','1955-04-08',NULL),(87,'Howie Weisbrod',NULL,'',NULL,NULL),(88,'Lauren Vera',NULL,'',NULL,NULL),(89,'Yûsuke Iseya','Tokyo, Japan','From Wikipedia, the free encyclopedia.\n\nYūsuke Iseya (伊勢谷 友介 Iseya Yūsuke, born 29 May 1976) is a Japanese actor.\n\nHe was born in Tokyo, Japan. With his modeling career (Japan), Yūsuke is known for Loreal (Japan), Men\'s Nonno magazine, Prada (Milan), and Asahi Aqua Blue.\n\nYūsuke extended his career from modeling and being an artist to director and actor. He made his directorial debut in 2003 with Kakuto. He is also known for his performance in Casshern. His works include Sinking Moon in 2002, a movie collaboration with J-pop superstar Ayumi Hamasaki in which he stars as her lover.\n\nDescription above from the Wikipedia article Yûsuke Iseya, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-05-29',NULL),(90,'Thomas Parkinson',NULL,'',NULL,NULL),(91,'Sigourney Weaver','Manhattan, New York City, New York, USA','Susan Alexandra \"Sigourney\" Weaver (born October 8, 1949) is an American actress. Weaver is considered to be a pioneer of action heroines in science fiction films. She is known for her role as Ellen Ripley in the Alien franchise, which earned her an Academy Award nomination in 1986 and is often regarded as one of the most significant female protagonists in cinema history.\n\nA seven-time Golden Globe Award nominee, Weaver won both Best Actress in Drama and Best Supporting Actress in 1988 for her work in the films Gorillas in the Mist and Working Girl, becoming the first person to win two acting Golden Globes in the same year. She also received Academy Award nominations for both films. For her role in the film The Ice Storm (1997), she won the BAFTA Award for Best Actress ina Supporting Role. She also received a Tony Award nomination for her work in the 1984 Broadway play Hurlyburly.\n\nWeaver\'s other film roles include Ghostbusters (1984), Ghostbusters II (1989), Dave (1993), Galaxy Quest (1999), Holes (2003), WALL-E (2008), Avatar (2009), Prayers for Bobby (2009), Paul (2011), The Cabin in the Woods (2012), and A Monster Calls (2016); and the television miniseries Political Animals (2012) and The Defenders (2017).\n\nDescription above from the Wikipedia article Sigourney Weaver, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1949-10-08',NULL),(92,'Andrew Lin','Taipei, Taiwan','Andrew Lin is a Hong Kong actor, born in Taiwan, graduated from the Fine Arts Department of the University of California, Changdi, and went to Hong Kong in 1996 to develop his skills. He has participated in many movies and TV dramas. Starting his acting career in 1997, Lian Kai has acted in 30 films and 18 TV series. This versatile and handsome actor can play both hero and villain. Before coming to Hong Kong in 1996, he was a special effects costume and makeup artist in the United States, where he helped many local film workers including Tsui Hark.','1969-08-07',NULL),(93,'Jeb Ellis-Brown',NULL,'',NULL,NULL),(94,'Fred Williamson','Gary, Indiana, USA','Fred \"The Hammer\" Williamson (born March 5, 1938) is an American actor, architect, and former professional American football defensive back who played mainly in the American Football League during the 1960s.\n\nDescription above from the Wikipedia article Fred Williamson, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1938-03-05',NULL),(95,'McKenzie Westmore','San Fernando, California, USA','McKenzie Kate Westmore is an American actress and singer most popular for having played the role of Sheridan Crane Lopez-Fitzgerald on the television soap opera Passions from 1999 to 2008.','1977-04-26',NULL),(96,'Claudine Acs',NULL,'',NULL,NULL),(97,'Joshua Peters',NULL,'',NULL,NULL),(98,'Kalabhavan Haneef',NULL,'',NULL,'2023-11-09'),(99,'Rayford Barnes','Whitesboro, Texas, USA','Rayford Barnes was born on October 23, 1920 in near Whitesboro, Texas, USA as Rayford K. Barnes.\n\nHe died on November 11, 2000 in Santa Monica, California, USA','1920-10-23','2000-11-11'),(100,'Jacques Stany','Minsk, Belarus','','1930-04-04',NULL),(101,'Christophe Vandevelde',NULL,'',NULL,NULL),(102,'Surya Bhagawan Das','Pune, Maharashtra, India','Surya Kumar Bhagvandas is a performing artist in the Telugu film industry depicting characters in supporting roles.','1957-06-27',NULL),(103,'Daisy McCrackin','Marin County, California, USA','','1979-11-12',NULL),(104,'Donald Cerrone','Columbus, Ohio, USA','Professional mixed martial artist competing in the UFC Welterweight division.\n\nDonald Anthony Cerrone (born March 29, 1983) is an American professional mixed martial artist and former professional kickboxer currently signed with the Ultimate Fighting Championship (UFC). He competes in their welterweight division. Cerrone is tied with Georges St-Pierre and Michael Bisping for the most wins in UFC history with 20 and tied for the most finishes in UFC history with Anderson Silva and Vitor Belfort with 14. As of 26 July 2018, he is the #12 ranked contender in the official UFC welterweight rankings.\n\nFrom Wikipedia, the free encyclopedia','1983-03-29',NULL),(105,'Michael E. Stogner',NULL,'',NULL,NULL),(106,'Ayesha Mansur Gonsalves','Toronto, Ontario, Canada','',NULL,NULL),(107,'Adam Nagaitis','Chorley, Lancashire, England, UK','From Wikipedia, 