ries (born August 14, 1969) is an American actress.  Jefferies is known for her recurring role on Eastbound & Down. In 2012, Jefferies was cast in a recurring role on Nashville. She also appeared in films The Notebook, Halloween II, 96 Minutes, and guest starred on One Tree Hill and Surface.','1969-08-14',NULL),(121,'Sunivy Thipsiakhom',NULL,'',NULL,NULL),(122,'Massimo Vanni','Rome, Lazio, Italy','A cousin of director Enzo G. Castellari and nephew of director Marino Girolami, Massimo Vanni became involved in the Italian film industry at a young age both as a bit-part player and stuntman before slowly graduating to larger more dramatic roles toward the end of the decade. A skilled acrobat and fight choreographer, Vanni himself became known as the Italian Jackie Chan of the 1980\'s, usually getting a good fight scene in before meeting with an inevitable demise.','1946-07-08',NULL),(123,'Daniel Torres','Rio de Janeiro, Rio de Janeiro, Brazil','','1993-05-10',NULL),(124,'David Pevsner','Skokie, Illinois, USA','','1958-12-31',NULL),(125,'John LoFranco',NULL,'',NULL,NULL),(126,'David Michael Paul',NULL,'',NULL,NULL),(127,'Brenda Pressley',NULL,'',NULL,NULL),(128,'Joseph Adams','Concord - California - USA','Joseph Adams is an actor.','1956-02-04',NULL),(129,'Raymond Hatton','Red Oak, Iowa, USA','The son of a physician, Raymond Hatton entered films in 1909, eventually appearing in almost 500 other pictures. In early silents he formed a comedy team with big, burly Wallace Beery. He was best known as the tobacco-chewing, rip-snorting Rusty Joslin in the Three Mesquiteers series. He was also in the Rough Riders series and appeared as Johnny Mack Brown\'s sidekick as well. His last Western was, fittingly, Requiem for a Gunfighter (1965). Passed away only five days after the death of his wife, on October 21, 1971. They had been married for 62 years.\n\nSpouse 	Frances Hatton (17 April 1909 - 16 October 1971)  (her death)','1887-07-06','1971-10-21'),(130,'Tómas Lemarquis','Reykjavik, Iceland','Tómas Lemarquis (born August 3, 1977) is a French–Icelandic actor.\n\nLemarquis was born in Reykjavík, the son of an Icelandic mother and a French father, Gérard Lemarquis, who is a schoolteacher. His most distinguishing physical feature—a complete lack of hair of any kind—is the result of alopecia universalis, which made him completely hairless by the age of 14. He grew up between Iceland and France, and studied theater at the Cours Florent in Paris, where he was a classmate of actress Audrey Tautou. He also attended the Reykjavík School of Fine Arts in Iceland.\n\nLemarquis is possibly best known for his starring role in the 2003 Icelandic film Nói Albínói (e. Noi the Albino). Lemarquis\' played a lead role in the 2018 Berlinale Film Festival winner, Touch Me Not. He has also appeared in films such as Snowpiercer, X-Men: Apocalypse and Blade Runner 2049.','1977-08-03',NULL),(131,'Ériq Ebouaney','Angers, Maine-et-Loire, France','From Wikipedia, the free encyclopedia.\n\nEriq Ebouaney is a French film actor. He is best known for his portrayal as the Congolese President Patrice Lumumba in the 2000 film Lumumba, as \"Blacktie\" in Brian De Palma\'s Femme Fatale and as \"Ice\" in the 2008 action film Transporter 3 in which he starred opposite Jason Statham.\n\nDescription above from the Wikipedia article Eriq Ebouaney, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1967-10-03',NULL),(132,'Jackson Gallagher','	Melbourne, Australia','Jackson Gallagher is an Australian actor and professional photographer from Victoria, Australia. Gallagher began his career starring in the Nine Network children\'s series The Saddle Club and later ventured into film playing the titular character in the 2013 horror film Patrick. He gained wider recognition for his role as Josh Barrett in the soap opera Home and Away. He left the series in 2016 and soon secured more television roles including AFL player Connor Marrello in the Network Ten drama series Playing for Keeps. He has also completed additional film roles scheduled for release in 2019. Aside from acting Gallagher has worked as a stills photographer for the Australian Broadcasting Corporation network.',NULL,NULL),(133,'Nathanael Baring',' London, England, UK','','1990-07-30',NULL),(134,'Giacomo Andrea Bottoni',NULL,'',NULL,NULL),(135,'Matthew Harrison','Montreal, Quebec, Canada','','1968-12-17',NULL),(136,'Fritzi Burr','Philadelphia, Pennsylvania, USA','','1924-05-31','2003-01-17'),(137,'Thora Birch','Los Angeles, California, USA','Thora Birch (born March 11, 1982) is an American actress. She was a child actor in the 1990s, starring in movies such as All I Want for Christmas (1991), Patriot Games (1992), Hocus Pocus (1993), Now and Then (1995), and Alaska (1996). She came to prominence in 1999 after earning worldwide attention and praise for her performance in American Beauty. She then starred in the well received film Ghost World (2001), which earned her a Golden Globe nomination.\n\nDescription above from the Wikipedia article Thora Birch, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1982-03-11',NULL),(138,'Alison Valence',NULL,'',NULL,NULL),(139,'Arturo Hernandez',NULL,'',NULL,NULL),(140,'Sergei Nasibov',NULL,'','1958-06-30',NULL),(141,'Jeff Sanders',NULL,'Jeff Sanders is known for Showtime (2002), National Security (2003) and The Last Stand (2013).',NULL,NULL),(142,'Gilu Joseph','Idukki, Kerala, India','','1990-03-14',NULL),(143,'Geretta Geretta','Portland, Oregon','','1958-07-14',NULL),(144,'Joshua Hill','Walthamstow, Regno Unito','Joshua Hill is a film and television actor.','1991-01-09',NULL),(145,'Ashley Kinser',NULL,'',NULL,NULL),(146,'Matt Holbrook',NULL,'',NULL,NULL),(147,'William Guirola',NULL,'',NULL,NULL),(148,'Faizon Love','Santiago de Cuba, Cuba','Faizon Andre Love was born June 14, 1968. An actor and comedian, he is best known for roles in the films Friday, Elf, and Couples Retreat. Love got his start as a stand-up comedian and made his acting debut Off-Broadway at the age of nineteen. His motion picture debut, Bebe\'s Kids had him providing the voice of late comedian Robin Harris. He then had a role in The Meteor Man starring Robert Townsend. Townsend then cast Love in a co-starring role on his sitcom The Parent \'Hood. He followed up this role with a breakout performance as the drug dealer Big Worm in the 1995 film Friday. Follow-up films have included Elf, Don\'t Be a Menace to South Central While Drinking Your Juice in the Hood, Money Talks, Wonderland, The Fighting Temptations, and Idlewild. Love gained wider appeal when he co-starred in the 2009 film, Couples Retreat, a comedy chronicling four couples who partake in therapy sessions at a tropical island resort. His most recent role is that of Kurtis Kool in 2011’s Big Mommas: Like Father, Like Son. Many gamers may also know Love for his role as Sean \"Sweet\" Johnson, simply known as Sweet, in the Rockstar North game Grand Theft Auto: San Andreas.','1968-06-14',NULL),(149,'Adrian Morris','Mount Vernon, New York, USA','Adrian Michael Morris (January 12, 1907 – November 30, 1941) was an American actor of stage and film, and a younger brother of Chester Morris.\n\nAs a child, Morris performed with his family in a vaudeville act. In his short 10-year career as a Hollywood character actor, he appeared in over 70 films, including Dirigible (1931), Me and My Gal (1932), Bureau of Missing Persons (1933), The Big Shakedown (1934), The Fighting Marines (1935), The Petrified Forest (1936), There Goes the Groom (1937), Angels with Dirty Faces (1938), Gone With the Wind (1939), The Grapes of Wrath (1940), and Blood and Sand (1941).','1907-01-12','1941-11-30'),(150,'Roger Groh',NULL,'',NULL,NULL),(151,'Beckie King','Birmingham, Alabama, USA','','1979-10-02',NULL),(152,'Sean Rogerson','Sherwood Park, Alberta, Canada','Sean Rogerson (born September 30, 1977) is a Canadian actor and former photomodel, known for his role as Lance Preston in the horror films, Grave Encounters[1][2] and Grave Encounters 2.\n\nFrom Wikipedia, the free encyclopedia','1977-09-30',NULL),(153,'Lisa Raziano',NULL,'',NULL,NULL),(154,'Pradeep Ram Singh Rawat','Jabalpur, Madhya Pradesh, India','Pradeep Ram Singh Rawat is an Indian actor. He is notable for playing villainous roles in Telugu, Hindi, Tamil and Malayalam film.','1952-01-21',NULL),(155,'Hristo Birbochukov',NULL,'',NULL,NULL),(156,'Steve Cell','Highland Park - Illinois - USA','Steve Cell is an actor.','1970-05-09',NULL),(157,'Maxim Peshkov',NULL,'',NULL,NULL),(158,'Aurélien Recoing','Paris, France','Aurélien Recoing (born 5 May 1958) is a French actor and stage director.\n\nAurélien Recoing is the son of Alain Recoing (puppeteer), and the brother of Éloi Recoing (director and translator), Blaise Recoing (actor and musician), and David Recoing (pianist, composer).\n\nBorn in Paris on May 5, 1958, Aurélien Recoing began training to be an actor in 1974 at Cours Florent, and studied at Quartier d\'Ivry. In 1977, the actor-in-training, who spoke fluent English and a little Russian, joined the Conservatoire national supérieur d\'art dramatique in Paris, where he studied under Jean-Pierre Miquel and Antoine Vitez. He has appeared in more than 30 plays and has directed stage performances of works by Thomas Bernhard, Fernando Pessoa and Paul Claudel. He was awarded the Prix Gérard Philipe in 1989.\n\nIn 1980, Aurélien Recoing took his first steps into the world of cinema, in Exploits of a Young Don Juan. Finding art-house cinema appealing to him, he worked with Philippe Garrel on Emergency Kisses (Les baisers de secours), and with Laurence Ferreira Barbosa on Modern Life. The actor rose to fame in 2001 thanks to Laurent Cantet\'s Time Out (L\'Emploi du Temps), in which he plays a man who invents a false life to avoid having to tell his friends and family that he has been fired from his job. As he became more and more in demand, he alternated between blockbusters such as Ruby & Quentin and That Woman and art-house films like L\'Ennemi naturel and Orlando Vargas. Lending his talents to a number of unusual projects, in 2006 he portrayed a gamblers in 13 Tzameti, Géla Babluani\'s black-and-white thriller, and also appeared in Forgive Me (Pardonnez-moi), Maïwenn\'s home-movie style drama. In the same year, the physically imposing actor found himself transported back to 1914 France in Fragments of Antonin, and then to 1959 Kabylia in Florent Emilio Siri\'s Intimate Enemies. In 2008, he starred in Franck Llopis\' Paris Nord-Sud and in La Saison des Orphelins. The following year, he was cast in Gilles Béhat\'s crime thriller Diamant 13 with Gérard Depardieu, and in Denis Dercourt\'s Tomorrow at Dawn (Demain dès l\'aube).\n\nHe has made appearances in The Horde, directed by Yannick Dahan and Benjamin Rocher, Xavier de Choudens\' Joseph and the Girl with Jacques Dutronc, and Léon Desclozeaux\'s Cargo, the Lost Men in 2010. He appeared in Frédéric Schoendoerffer\'s Switch, as well as in Olias Barco\'s Kill Me Please, which won the Marc\'Aurelio d\'Oro for best film at Rome Film Festival in 2010. He also appeared in Abdellatif Kechiche\'s Blue is the Warmest Colour, which took the Palme d\'Or at Cannes. In 2020 he appeared in Adults in the room. An upcoming appearance is in Grand Ciel an Arte Film.\n\nHe made his first short film as a director The Rifleman (Un Bon Tireur) which won an Award Winner for Best Drama in 2021. He is developing his first feature film Naked Hands (À Mains Nues) with Sensito Films Productions.\n\nSource: Article \"Aurélien Recoing\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1958-05-05',NULL),(159,'Didier Ferrari',NULL,'',NULL,NULL),(160,'Lee Seung-jin',NULL,'',NULL,NULL),(161,'Norman Schleiffer',NULL,'',NULL,NULL),(162,'Justin Hires','St. Petersburg, Florida, USA','Justin Hires (born June 24, 1985) is an American actor.','1985-06-24',NULL),(163,'Errik T. Williams',NULL,'',NULL,NULL),(164,'Suchada Poonpattanasuk','Bangkok, Thailand','','1977-01-01',NULL),(165,'Richard Fitzpatrick','Boston, Massachusetts, USA','Richard Fitzpatrick is an American actor.','1947-01-01',NULL),(166,'Pramod Moutho',NULL,'',NULL,NULL),(167,'José Luis Ferrer',NULL,'',NULL,NULL),(168,'Carlo Valli',NULL,'',NULL,NULL),(169,'Romane Ferreira',NULL,'',NULL,NULL),(170,'Norihito Yagami',NULL,'',NULL,NULL),(171,'Michael Jibson','Hull, Humberside, England, UK','Michael Jibson is an English movie, television and theatre actor born in Hull, East Yorkshire. He is married to the stage actress Caroline Sheen. His father, Tim Jibson, is the programme director of KCFM in Hull. His brother is the actor Paul Jibson. He trained with the National Youth Music Theatre, appearing in their productions of Bugsy Malone, Tin Pan Ali and The Kissing Dance. He made his West End debut at the age of 14 in Oliver at the London Palladium, directed by Sam Mendes. He later trained at Guildford School of Acting.\n\nJibson\'s film work includes Lyle Porter in Flyboys; Eddie Burton in The Bank Job; Lecture 21; Steve Maddox in Red Mist and Adam in Devils Bridge.','1980-12-16',NULL),(172,'Rooster McConaughey','Houston, Texas, U.S.A.','','1954-08-02',NULL),(173,'Michael Chiklis','Lowell, Massachusetts, USA','Michael Charles Chiklis (born August 30, 1963) is an American actor, voice actor, occasional director and television producer. Some of the previous roles for which he is best known include Commissioner Tony Scali on the ABC police drama The Commish, LAPD Detective Vic Mackey on the FX police drama The Shield, Thing in the Fantastic Four film series, and Jim Powell on the science-fiction, comedy-drama No Ordinary Family.','1963-08-30',NULL),(174,'Duffy Hambleton',NULL,'',NULL,NULL),(175,'Charles Paraventi','New York, New York, USA','','1969-07-04',NULL),(176,'Kolby Pistak',NULL,'',NULL,NULL),(177,'Melissa Cordero',NULL,'',NULL,NULL),(178,'Courteney Cox','Birmingham, Alabama, USA','Courteney Bass Cox (previously Courteney Cox-Arquette; born June 15, 1964) is an American actress, director, and producer. She gained recognition for her starring role as Monica Geller on the NBC sitcom Friends, which aired from 1994 to 2004. For her performance in the series, she received seven Screen Actors Guild Award nominations, of which she won one. She received further recognition for starring as Gale Weathers in the horror film franchise Scream (1996–present). She also starred as Lauren Miller in the NBC sitcom Family Ties (1987–1989), Lucy Spiller in the FX drama series Dirt (2007–2008), and as Jules Cobb in the ABC/TBS sitcom Cougar Town (2009–2015), the lattermost of which earned her nominations at the Golden Globe Awards and the Critics\' Choice Awards.\n\nCox\'s other films include the action fantasy Masters of the Universe (1987), the comedy Ace Ventura: Pet Detective (1994), the animated comedy Barnyard (2006), the fantasy comedy Bedtime Stories (2008), and the independent drama Mothers and Daughters (2016). She owns the production company Coquette Productions, which was created by Cox and her then-husband David Arquette. She also worked as a director on her sitcom Cougar Town, the television drama film TalhotBlond (2012), and the black comedy drama film Just Before I Go (2014).','1964-06-15',NULL),(179,'Tokala Black Elk',NULL,'',NULL,NULL),(180,'Willow Hale',NULL,'',NULL,NULL),(181,'David Orth','Kitchener - Ontario - Canada','From Wikipedia, the free encyclopedia.\n\n David Orth (born March 13, 1965) is a Canadian actor.  Orth was born and raised in Kitchener, Ontario. His most notable role was as Edward \'Ned\' Malone in the TV series The Lost World, which was shot in Australia. He played this part from 1999 until 2002. During the shooting of The Lost World, he purchased a home in Australia and soon after met his wife there. Orth voiced Blizzard in Iron Man: Armored Adventures. He has also starred in Beyond Reality, The Ray Bradbury Theatre and in the episode \"Scarecrow\" on the CW\'s horror/drama series Supernatural.  He has hinted that although he enjoys his acting career, he would like to become a director in the future, \"I\'d like to work toward both producing and directing. Directing really interests me as it does many actors\".','1965-03-13',NULL),(182,'Michele Scarabelli','Montreal, Quebec, Canada','Michele Scarabelli (born April 11, 1955) is a Canadian actress.','1955-04-11',NULL),(183,'Katie Manning',NULL,'',NULL,NULL),(184,'Fabian Wolfrom','France','','1991-06-01',NULL),(185,'S P Sreekumar',NULL,'S. P. Sreekumar is an Indian film actor who is doing Malayalam films and Malayalam TV series.\n\nHis first TV show was Chirikidathom on Amrita TV and later his character as Lolithan in Marimayam gave him the big break. Within a short span of time in film industry, Sreekumar has played a variety of roles. He played a tribal youth Sankaran, in Papilio Buddha, but in his next outing ABCD: American-Born Confused Desi, he played Lloyd, a typical Kochiite with the local slang, and a serial killer in the super hit Memories',NULL,NULL),(186,'Najarra Townsend','Santa Barbara, California, USA','','1989-12-05',NULL),(187,'David Banuelos',NULL,'',NULL,NULL),(188,'Nao Omori','Tokyo, Japan','Nao Omori (大森 南朋, Ōmori Nao) is a Japanese actor and musician, with his most notable role as Ichi in Ichi the Killer directed by Takashi Miike. He is the son of Japanese actor Akaji Maro. Nao is sometimes credited under the romanization Nao Ohmori. He was given the Best Supporting Actor award at the 2004 Yokohama Film Festival.','1972-02-19',NULL),(189,'Will Green',NULL,'',NULL,NULL),(190,'Kelly Dorji',NULL,'',NULL,NULL),(191,'Justin Edwards','Stratford-Upon-Avon, Warwickshire, England, UK','Justin Edwards (born July 21, 1972) is an English actor and writer.','1972-07-21',NULL),(192,'Jody Barton',NULL,'',NULL,NULL),(193,'Stephen Blackehart','New York City, New York, USA','From Wikipedia, the free encyclopedia.\n\nStephen Blackehart (born 1 December 1967 in New York City) is an American actor and producer from Hell\'s Kitchen, New York. It has been reported that Blackehart was born Stefano Brando and is the son of actor Marlon Brando. A graduate of the London Academy of Music and Dramatic Art, Blackehart is most known for playing Benny Que in the cult classic film Tromeo and Juliet, though he has also acted in many other B-movies, such as Rockabilly Vampire, Retro Puppet Master and 100 Million BC.\n\nIn addition to his film work, Blackehart has acted in such TV series as Grey\'s Anatomy, The Big Apple, and as Lt. Pa\'ak in Star Trek: Deep Space Nine. He was a regular on the BBC\'s The Tromaville Cafe, where he originated the role of Felix, the French Trickster.\n\nIn 2004, Blackehart produced Jenna Fischer\'s mockumentary film LolliLove, and was among the first ever producers to make extensive use of social networking sites like MySpace to aggressively promote a feature film.[citation needed] It was subsequently picked up for distribution by Troma and garnered DVD Talk\'s distinction as a \"Collector\'s Series\" disc immediately upon its video release. It was also voted #2 by the editors of Amazon in their list of Best DVDs of the Year - Comedy, and completely sold out of all copies within the first day of release.\n\nMost recently, he has produced hit comedy web series like James Gunn\'s PG Porn and Humanzee!\n\nDescription above from the Wikipedia article Stephen Blackehart, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1967-12-01',NULL),(194,'Garrett O\'Brien','Escondido, California, USA','','1980-02-13',NULL),(195,'Carl L. Williams',NULL,'',NULL,NULL),(196,'Nancy Locke',NULL,'',NULL,NULL),(197,'Tony Skinner','Tunbridge Wells, Kent, England, UK','','1997-04-05',NULL),(198,'Brooke Hogan','Tampa, Florida','Brooke Ellen Bollea (born May 5, 1988), better known by her stage name Brooke Hogan, is an American singer, actress, model, socialite, and television personality, and the oldest child of professional wrestler Hulk Hogan (Terry Gene Bollea). She appeared on the reality-television series \"Hogan Knows Best\", which focused on her family, and which premiered on July 10, 2005 on VH1. Since the cancellation of \"Hogan Knows Best\", she\'s starred in a spin-off reality series called \"Brooke Knows Best\" which focuses on her life now independent from her parents and living with two roommates. She released her debut album \"Undiscovered\" in 2006. In 2009, she released her second studio album, \"The Redemption\", and appeared in a second season of \"Brooke Knows Best\".','1988-05-05',NULL),(199,'Joe De Stefani',NULL,'',NULL,NULL),(200,'Loren Dean','Las Vegas, Nevada, USA','From Wikipedia, the free encyclopedia\n\nLoren Dean (born July 31, 1969) is an American actor. He has appeared onstage and in feature films.\n\nDescription above from the Wikipedia article Loren Dean, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1969-07-31',NULL),(201,'Jay Moore',NULL,'',NULL,NULL),(202,'Lochlyn Munro','Lac La Hache, British Columbia, Canada','Lochlyn Munro is a Canadian actor. His most notable film roles include A Night at the Roxbury, Scary Movie, Freddy vs. Jason, White Chicks, The Predator and Cosmic Sin. For television, he is perhaps best known for his roles in the Canadian series Northwood, supernatural drama Charmed, and teen drama Riverdale.','1966-02-12',NULL),(203,'Verona Pooth','La Paz, Bolivia','','1968-04-30',NULL),(204,'Mike Ching','Vancouver, British Columbia, Canada','','1967-10-02',NULL),(205,'Cristina Sato',NULL,'',NULL,NULL),(206,'Mack-b','Long Island, New York, USA','',NULL,NULL),(207,'Frank Bull',NULL,'',NULL,NULL),(208,'Jérôme Le Banner','Le Havre, France','','1972-12-26',NULL),(209,'Christina Orjalo',NULL,'',NULL,NULL),(210,'Callan Mulvey','Auckland, Dominion of New Zealand','Mulvey was born in New Zealand, and is of Maori and European heritage. His family moved to Sydney, Australia when he was eight years old. He is best known for his roles as Mark Moran on the popular Australian drama Underbelly, and as Bogdan \'Draz\' Drazic in Heartbreak High. Mulvey attended Beacon Hill High School (New South Wales) along with other Heartbreak High cast members Jon Pollard and Alle Brunning.\n\nMulvey was injured in a serious car accident in 2003, in a head-on collision at 100 km/h. He was trapped in the vehicle for almost an hour until he could be freed from the wreckage. The midsection of his face collapsed, an incision was made from ear to ear over the top of his scalp, his face \"pulled down\" and 17 titanium plates were then inserted to repair the fractures to his face and jaw. His left knee and ankle were badly fractured and he lost vision in one eye.','1975-02-23',NULL),(211,'Ian M. Kronenberg',NULL,'',NULL,NULL),(212,'Taichi Ishimaru',NULL,'',NULL,NULL),(213,'Jeremy J. Sullivan',NULL,'',NULL,NULL),(214,'Kai Portman',NULL,'',NULL,NULL),(215,'Mark Aaron Wagner','Fullerton, California, USA','','1975-11-03',NULL),(216,'Thom Barry','Cincinnati, Ohio, USA','Thom Barry  is an actor and producer.','1950-12-06',NULL),(217,'Christopher Dempsey',NULL,'',NULL,NULL),(218,'Carlos Henrique Lessa',NULL,'',NULL,NULL),(219,'Lana Titov',NULL,'',NULL,NULL),(220,'Ace Christensen',NULL,'',NULL,NULL),(221,'Angelo Ragusa','Roma, Lazio, Italia','Angelo Ragusa was an actor, stuntman, and stunt coordinator who resided in Rome, Italy. He was active since the late 1970\'s and eventually came to own his own stunt academy. He died in 2018.','1952-09-10','2018-03-14'),(222,'Chin Han','Singapore','Chin Han is a Singaporean American actor known for his roles in Dark Knight, Ghost in the Shell and  televisions series such as Marco Polo. Beginning as a teen actor in stage classics like Moliere\'s L\'Ecole des femmes and Shakespeare\'s Twelfth Night, he went on to star in Singapore\'s first English language television series Masters of the Sea. In 1998 Chin Han made his US film debut in Blindness and has been active in both film and television since the late-2000s. He is currently based in Los Angeles.','1969-11-27',NULL),(223,'Loni Anderson','Saint Paul, Minnesota, USA',' From Wikipedia, the free encyclopedia\n\nLoni Kaye Anderson (born August 5, 1945) is an American actress who played the role of Jennifer Marlowe on the television sitcom WKRP in Cincinnati.\n\nAnderson was born in St. Paul, Minnesota, August 5, 1945, the daughter of Maxine Hazel (née Kallin), a model, and Klaydon Carl \"Andy\" Anderson, an environmental chemist and grew up in suburban Roseville.\n\n As a senior at Alexander Ramsey Senior High School in Roseville in 1963, she was voted Valentine Queen of Valentine\'s Day Winter Formal. She attended the University of Minnesota. As she says in her autobiography, My Life in High Heels, her father was originally going to name her \"Leiloni,\" but then realized to his horror that when she got to her teen years it was liable to be twisted into \"Lay Loni.\" So it was changed to just plain \"Loni.\"\n\n Anderson\'s most famous acting role came as receptionist Jennifer Marlowe on WKRP in Cincinnati. Her pinup photo in a bikini became one of the best-selling wall posters of the 1970s. She and husband Burt Reynolds made one film together, the 1983 stock-car racing comedy Stroker Ace, a huge box-office failure.  Shortly after her divorce from Reynolds, she appeared as a regular in the final season (1993–1994) on the NBC sitcom Nurses. Anderson portrayed actress Jayne Mansfield in a made-for-TV biopic with Arnold Schwarzenegger as her husband, Mickey Hargitay. She teamed with Lynda Carter in a 1984 television series, Partners in Crime.  Anderson made a series of cameo appearances on television shows in the late 1990s and early 2000s, such as the Spellmans\' \"witch-trash\" cousin on Sabrina, the Teenage Witch and Vallery Irons\' mother on V.I.P.  Anderson has been married four times; her first three marriages were to: Bruce Hasselberg (1964–1966), Ross Bickell (1973–1981), and actor (and one-time co-star) Burt Reynolds (1988–1993). On May 17, 2008, Anderson married musician Bob Flick, one of the founding members of the folk band The Brothers Four. The couple had met at a movie premiere in Anderson\'s native Minneapolis a few years after Flick\'s group hit No. 2 on the pop charts with \"Greenfields\" in 1960. The ceremony was attended by friends and family, including son Quinton Reynolds.  She has two children: a daughter, Deidra Hoffman (from her first marriage), who is a school administrator in California; and a son, Quinton Anderson Reynolds (born August 31, 1988), whom she and Burt Reynolds adopted. Her autobiography, My Life in High Heels, was published in 1997. Anderson is currently a practicing Lutheran.  Description above from the Wikipedia article Loni Anderson, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1945-08-05',NULL),(224,'Kevin Sumethasorn',NULL,'',NULL,NULL),(225,'Stephen Medvidick',NULL,'',NULL,NULL),(226,'Keith David','Harlem, Manhattan, New York City, New York, USA','Keith David (born June 4, 1956) is an American film, television, and voice actor, and singer. He is perhaps most known for his live-action roles in such films as Crash, There\'s Something About Mary, Barbershop and Men at Work. He has also had memorable roles in numerous cult favorites, including John Carpenter\'s films The Thing (as Childs) and They Live (as Armitage), the Riddick films Pitch Black and The Chronicles of Riddick (as the Imam), the General in Armageddon, King in Oliver Stone\'s Platoon, and Big Tim in Darren Aronofsky\'s Requiem for a Dream. David is also well known for his voice over career, primarily his Emmy winning work as the narrator of numerous Ken Burns films. Characters that he has voiced include Goliath on the Disney series Gargoyles, the Arbiter in Halo 2 and Halo 3, David Anderson in Mass Effect and Mass Effect 2, the Decepticon Barricade in Transformers: The Game, Julius Little in Saints Row and Saints Row 2, Sgt. Foley in Call of Duty: Modern Warfare 2, Dr. Facilier in The Princess and the Frog, and Chaos in Dissidia: Final Fantasy and Dissidia 012 Final Fantasy.\n\nFrom Wikipedia, the free encyclopedia','1956-06-04',NULL),(227,'Colin Firth','Grayshott, Hampshire, England, UK','Colin Andrew Firth (born September 10, 1960) is an English actor and producer. He was identified in the mid-1980s with the \"Brit Pack\" of rising young British actors, undertaking a challenging series of roles, including leading roles in A Month in the Country (1987), Tumbledown (1988) and Valmont (1989). His portrayal of Mr. Darcy in the 1995 television adaptation of Jane Austen\'s Pride and Prejudice led to widespread attention, and to roles in more prominent films such as The English Patient (1996), Shakespeare in Love (1998), Bridget Jones\'s Diary (2001), The Importance of Being Earnest (2002), Girl with a Pearl Earring (2003), Richard Curtis\'s romantic comedy ensemble film Love Actually (2003), and the musical comedy Mamma Mia! (2008) and its sequel, Mamma Mia! Here We Go Again! (2018).\n\nIn 2009, Firth received international acclaim for his performance in Tom Ford\'s A Single Man, for which he won a BAFTA Award and received his first Academy Award nomination. In 2010, his portrayal of King George VI in Tom Hooper\'s The King\'s Speech won him the Academy Award for Best Actor. He subsequently appeared as MI6 agent Bill Haydon in Tinker Tailor Soldier Spy (2011), and as secret agent Harry Hart in Kingsman: The Secret Service (2014) and its sequel Kingsman: The Golden Circle (2017). He has since appeared in the musical fantasy Mary Poppins Returns (2018), and Sam Mendes\' war film 1917 (2019), and Supernova (2020). He is also known for his performances in television including the BBC film Conspiracy (2001), and HBO\'s The Staircase (2022), receiving Primetime Emmy Award nominations for each.\n\nIn 2012, he founded the production company Raindog Films, where he served as a producer for Eye in the Sky (2015) and Loving (2016). His films have grossed more than $3 billion from 42 releases worldwide. Firth has campaigned for the rights of indigenous tribal people and is a member of Survival International. He has campaigned on issues of asylum seekers, refugees\' rights and the environment. He commissioned and co-authored a scientific paper on a study of the differences in brain structure between people of differing political orientations.\n\nHe is the recipient of various accolades, including an Academy Award, two British Academy Film Awards, a Golden Globe Award, and three Screen Actors Guild Awards. In 2011, Firth was appointed a CBE by Queen Elizabeth II at Buckingham Palace for his services to drama. That same year, he received a star on the Hollywood Walk of Fame, and appeared in Time magazine\'s 100 most influential people in the world.','1960-09-10',NULL),(228,'Hailee Steinfeld','Tarzana, Los Angeles, California, USA','Hailee Steinfeld (born December 11, 1996) is an American actress and singer. Known for her acting versatility and musical prowess, she is the recipient of various accolades, including a Peabody Award, a Critics\' Choice Movie Award, a Billboard Music Award, and nominations for an Academy Award, a British Academy Film Award, a Golden Globe Award, three Critics\' Choice Movie Awards and a Screen Actors Guild Award.\n\nShe had her breakthrough with the western drama film True Grit (2010), which earned her Academy Award and Screen Actors Guild Award nominations for Best Supporting Actress, and a BAFTA Award nomination for Best Actress. Steinfeld then rose to mainstream prominence for her lead roles in Ender\'s Game (2013), Romeo & Juliet (2013), Begin Again (2013), and 3 Days to Kill (2014). She received critical acclaim for her roles in the Pitch Perfect film series (2015–2017) and the coming-of-age comedy-drama film The Edge of Seventeen (2016), the latter of which earned her a Golden Globe Award and Critics\' Choice Movie Award nomination.\n\nSteinfeld has since provided the voice of Gwen Stacy / Spider-Woman in the animated film Spider-Man: Into the Spider-Verse (2018) and Vi in Netflix\'s animated TV series Arcane (2021–present), based on the League of Legends video game franchise. She also starred as Charlie Watson in the Transformers film Bumblebee (2018) and Emily Dickinson in the Apple TV+ comedy-drama series Dickinson (2019–2021). She played Kate Bishop / Hawkeye, appearing in the 2021 Disney+ series Hawkeye, set in the Marvel Cinematic Universe.\n\nSteinfeld gained recognition in music after performing \"Flashlight\" in Pitch Perfect 2 (2015). She signed with Republic Records soon after and released her debut single, \"Love Myself\", followed by her debut extended play Haiz (2015). She went on to release a series of successful singles, including \"Starving\", \"Most Girls\" and \"Let Me Go\". In 2020, she released her second extended play, Half Written Story.\n\nDescription above from the Wikipedia article Hailee Steinfeld, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1996-12-11',NULL),(229,'Natalie Stone',NULL,'','1976-11-17',NULL),(230,'Travis McKenna','Lutherville, Maryland, USA','','1960-07-18',NULL),(231,'James Lye','Singapore','James Lye (Chinese: 赖兴祥; pinyin: Lài Xìngxiáng, born 17 June 1969), born Lai Hing Cheung, is a former MediaCorp Singaporean television and Raintree Pictures movie actor. Lye first entered the entertainment industry during the 1990s with the former Television Corporation of Singapore and has starred in both English and Chinese shows. He left the industry after a brief acting career and is currently working as a Cluster Head with Citibank in Singapore.','1969-06-17',NULL),(232,'Law Man-Daat',NULL,'',NULL,NULL),(233,'David Healy',NULL,'David Healy is known for 2081 (2009).',NULL,NULL),(234,'Michael Lockwood Crouch',NULL,'',NULL,NULL),(235,'Regis Toomey','Pittsburgh, Pennsylvania, USA','From Wikipedia, the free encyclopedia\n\nJohn Regis Toomey (August 13, 1898 – October 12, 1991) was an American film and television actor.\n\nBorn in Pittsburgh, Pennsylvania, USA, he was one of four children of Francis X. and Mary Ellen Toomey and attended Peabody High School. He initially pondered a law career, but acting won out and he established himself as a musical stage performer.\n\nEducated in dramatics at the University of Pittsburgh, where he became a brother of Sigma Chi, Toomey began as a stock actor and eventually made it to Broadway. Toomey was a singer on stage until throat problems (acute laryngitis) while touring in Europe stopped that aspect of his career. In 1929, Toomey first began appearing in films. He initially started out as a leading man, but found more success as a character actor (sans his toupee).\n\nToomey appeared in over 180 films, including classics such as The Big Sleep with Humphrey Bogart. In 1956, he appeared as a judge, with Chuck Connors as \"Andy\", in the third episode, \"The Nevada Nightingale\", of the NBC anthology series The Joseph Cotten Show. Toomey thereafter appeared in another anthology series too as the character \"Harry\" in the 1960 episode \"The Doctor and the Redhead\", with Dick Powell and Felicia Farr, of CBS\'s The DuPont Show with June Allyson. In the 1961–1962 television season, he appeared in a supporting role with George Nader in the syndicated crime drama Shannon about insurance investigators. From 1963–1966, Toomey was one of the stars of the ABC crime drama, Burke\'s Law, starring Gene Barry. He played Sergeant Les Hart, one of the detectives assisting the murder investigations of the millionaire police captain Amos Burke. He also guest-starred on dozens of television programs, including the \"Shady Deal at Sunny Acres\" episode of Maverick.\n\nIn 1941, Toomey appeared in You\'re in the Army Now, in which he and Jane Wyman had the longest screen kiss in cinema history: 3 minutes and 5 seconds.','1898-08-11','1991-10-12'),(236,'Ayumi Shimozono','Präfektur Kagoshima, Japan','Ayumi Shimozono is a Japanese actress and stuntwoman. As a member of Japan Action Enterprise she frequently works with Toei on Kamen Rider and Super Sentai, portraying the costumed versions of Kyoryu Violet and Zyuoh Tiger.','1984-01-06',NULL),(237,'Jon Voight','Yonkers, New York, USA','Jonathan Vincent \"Jon\" Voight is an American actor. He has received an Academy Award, out of four nominations, and three Golden Globe Awards, out of nine nominations.\n\nVoight came to prominence in the late 1960s with his performance as a would-be gigolo in Midnight Cowboy (1969). During the 1970s, he became a Hollywood star with his portrayals of a businessman mixed up with murder in Deliverance (1972), a paraplegic Vietnam veteran in Coming Home (1978), for which he won an Academy Award for Best Actor, and a penniless ex-boxing champion in The Champ (1979).\n\nAlthough his output slowed during the 1980s, Voight received critical acclaim for his performance as a ruthless bank robber in Runaway Train (1985). During the 1990s, he most notably starred as an unscrupulous showman attorney in The Rainmaker (1997).\n\nVoight gave critically acclaimed biographical performances during the 2000s, appearing as sportscaster Howard Cosell in Ali (2001), as Nazi officer Jürgen Stroop in Uprising (2001), and as Pope John Paul II in the television film of the same name (2005).\n\nVoight is the father of actress Angelina Jolie.','1938-12-29',NULL),(238,'Arthur Holden','Montréal, Québec, Canada','Arthur Holden (born August 28, 1959) is a Canadian voice actor. He voices Baba-Miao in Sagwa, the Chinese Siamese Cat, Mr. Ratburn in Arthur, and Mr. Larkin from What\'s With Andy.','1959-08-28',NULL),(239,'Michael Fassbender','Heidelberg, Baden-Wurttemburg, Germany','Michael Fassbender (born 2 April 1977) is an Irish actor. He is the recipient of various accolades, including a Screen Actors Guild Award, a Critics\' Choice Movie Award, and nominations for two Academy Awards, four British Academy Film Awards and three Golden Globe Awards.\n\nBorn in Heidelberg and raised in Killarney, Fassbender made his feature film debut as a Spartan warrior in the fantasy war epic 300 (2006). His earlier roles included various stage productions, as well as starring roles on television such as in the HBO miniseries Band of Brothers (2001) and the Sky One fantasy drama Hex (2004–05). He first came to prominence for his role as IRA volunteer Bobby Sands in Hunger (2008), for which he won a British Independent Film Award. Subsequent roles include the independent film Fish Tank (2009), as a Royal Marines lieutenant in Inglourious Basterds (2009), as Edward Rochester in the 2011 film adaptation of Jane Eyre, as Carl Jung in A Dangerous Method (2011), as the sentient android, David 8, in Ridley Scott\'s Prometheus (2012) and its sequel, Alien: Covenant (2017), and in the musical comedy drama Frank (2014) as an eccentric musician loosely inspired by Frank Sidebottom.\n\nThe actor’s former girlfriend, Sunawin “Leasi” Andrews, says she was the victim of domestic abuse at the hands of Fassbender in 2009. Andrews filed a restraining order in March 2010, requesting Fassbender stay at least 100 yards away from her and her two children. She also sought $24,000 to pay for medical bills that were the result of the injuries she says she suffered after Fassbender abused her on multiple occasions.\n\nOne instance of abuse allegedly occurred after Fassbender and Andrews were having dinner with friends at a restaurant. The court filings say Fassbender became angry with Andrews after one of her ex-boyfriends came over to their table to say hello. The actor’s anger carried over to the car ride home.\n\n“I went to the hospital and had a twisted left ankle, blown out left knee cap and a bursted ovarian cyst,” Andrews’ filing reads. “Lots of internal bleeding.”\n\nA second instance of abuse reportedly occurred at a July 2009 film festival. Fassbender had been partying late and came back to his hotel room with a friend and the two tried to get into bed with Andrews. She says she ended up checking into another room so she could avoid the two men. The next morning Andrews found Fassbender “sleeping in urine” and when she tried to wake him up, he allegedly threw her over a chair and broke her nose.','1977-04-02',NULL),(240,'Lilyan McBride',NULL,'','1919-08-03','2001-03-11'),(241,'Zhu Pengcheng','Huai\'an, Jiangsu Province, China','','1954-02-07',NULL),(242,'Philippe Duquesne','Béthune, Pas-de-Calais, France','Philippe Duquesne (born 30 June 1965) is a French actor. He is best known for playing in the cult TV series Les Deschiens (1993–2002), in which he plays alongside Yolande Moreau.\n\nSource: Article \"Philippe Duquesne\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1965-06-30',NULL),(243,'Luke Roberts','Suffolk, England, United Kingdom','Luke Roberts (born 1977) is an English actor, known for his role as Joseph Byrne in the BBC One medical drama series Holby City. He had a principal role in the short-lived third series of the soap opera Crossroads, and appeared as Captain Dan Pieterson in the Sky1 drama Mile High and in the third season of Black Sails. He currently stars as Eric Beaumont in Global\'s Ransom.','1977-10-05',NULL),(244,'Xu Wenguang','Luoyang，Henan Province，China','','1960-01-01',NULL),(245,'Phillip Andre Botello',NULL,'Phillip Andre Botello is an actor, known for The Art of Self-Defense (2019), Pledge (2018) and Funny People (2009).',NULL,NULL),(246,'Takayuki Yamada','Naha, Okinawa Prefecture, Japan','Takayuki Yamada (山田 孝之 Yamada Takayuki, born October 20, 1983) is a Japanese actor and singer. He has two elder sisters and one son. At age 15, he was discovered by talent agency Stardust and made his debut in his acting career in the TV drama Psychometrer Eiji 2 in 1999.\n\nOne of his first big roles was starring as Matsumoto Sakutaro in Sekai no Chuushin de, Ai wo Sakebu in the 2004 TBS series. In 2005, he made his name known with the movie Densha Otoko. His recent projects include Taiyou no Uta and the Japanese movie The Letter (Tegami) with co-star Erika Sawajiri.\n\nDescription above from the Wikipedia article Takayuki Yamada, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1983-10-20',NULL),(247,'Ted Monte','Denver, Colorado, USA','','1963-12-22',NULL),(248,'Sshivada Nair','Trichy, Tamil Nadu, India','Sshivada Nair is a film actress, who has appeared in Tamil and Malayalam films. Sshivada was born as Sreelekha Nair in Tiruchirappalli, Tamil Nadu. After fifth standard her family moved to Kerala. She is married to malayalam actor Murali Krishnan.','1986-04-27',NULL),(249,'Joe Lisi','New York City, New York, USA','Joe Lisi (born September 9, 1950), also credited as Joe Lissi, is an American television actor. He appeared in the NBC television show Third Watch as NYPD Lieutenant Swersky from 2000 to 2005. He also appeared on the NBC television show Law & Order: Special Victims Unit as Craig Lennon, a parole officer and briefly appeared in the 1995 comedy/crime film The Jerky Boys: The Movie as a construction worker.','1950-09-09',NULL),(250,'Sharron Leigh',NULL,'',NULL,NULL),(251,'Liza Mircheva',NULL,'',NULL,NULL),(252,'Chris Angerdina',NULL,'',NULL,NULL),(253,'Jason Kirkpatrick',NULL,'',NULL,NULL),(254,'Jin Laiqun',NULL,'',NULL,NULL),(255,'Frank Hall Crane','San Francisco, California, USA','','1873-01-01','1948-09-01'),(256,'Eric Berris',NULL,'',NULL,NULL),(257,'Chanel Celaya','La Jolla, California, USA','','1991-12-12',NULL),(258,'Poon An-Ying',NULL,'',NULL,NULL),(259,'Jack Rockwell','Veracruz, Mexico','','1890-10-06','1947-11-10'),(260,'Brian Glover','Sheffield, South Yorkshire, England, UK','Brian Glover was an English character actor, writer and wrestler. Glover was a professional wrestler (as \'Leon Arras the Man From Paris\'), teacher, and finally a film, television and stage actor, and the voice of Tetley Tea. He was married to writer Tara Prem from 1954 until his death in 1997.','1934-04-02','1997-07-24'),(261,'Barry Keoghan','Dublin, Ireland','Barry Keoghan (born 18 October 1992) is an Irish actor. He has appeared in the films Dunkirk; The Killing of a Sacred Deer, for which he won an Irish Film and Television Award for Best Supporting Actor and was nominated for the Independent Spirit Award for Best Supporting Male; and Calm with Horses, for which he was nominated for the BAFTA Award for Best Actor in a Supporting Role, and the RTÉ drama Love/Hate. He also played Druig in Eternals and the Joker in The Batman.','1992-10-18',NULL),(262,'Matthew Cooke',NULL,'',NULL,NULL),(263,'Jody Thompson',' Vancouver, British Columbia, Canada','A 2018 Academy Nicholl Fellowship Semifinalist, and 2017 PAGE Award winner, Jody Thompson is an optioned screenwriter and actress most widely known for her recurring characters on The 4400, Blade: The Series, Terminal City, Flash Gordon and Cold Squad, as well as for television appearances on Fringe, the Stargate franchises, Smallville and ...A 2018 Academy Nicholl Fellowship Semifinalist, and 2017 PAGE Award winner, Jody Thompson is an optioned screenwriter and actress most widely known for her recurring characters on The 4400, Blade: The Series, Terminal City, Flash Gordon and Cold Squad, as well as for television appearances on Fringe, the Stargate franchises, Smallville and ...','1976-08-13',NULL),(264,'David Gallegos',NULL,'',NULL,NULL),(265,'Mark Boone Junior','Cincinnati, Ohio, USA','Mark Boone Junior (born March 17, 1955) is an American actor perhaps best known for his roles as Bobby Munson in FX\'s Sons of Anarchy and in two films by Christopher Nolan, Memento and Batman Begins. He frequently portrays a crooked cop or other authority figure, and has had a prolific career, appearing in over 70 movies, which also include 2 Fast 2 Furious, Get Carter, The General\'s Daughter, The Thin Red Line, Seven, and Die Hard 2. He has also made guest appearances on TV in Law & Order, Seinfeld, Curb Your Enthusiasm, and several other shows. He had a one-second appearance as \"New York Guy\" in Armageddon when Eddie Griffin\'s character asked him what the news on TV was all about.\n\nBoone started his career beside long time friend Steve Buscemi. Together the two provided audiences in the New York and Jersey area with stand up comedy. He has appeared in some of Steve\'s directorial work, including Trees Lounge and most recently (2004) as \"Evil\" in Lonesome Jim. He is a regular cast member on Sons of Anarchy, where he plays Bobby Munson. In 2010 he played the role of Vincent Dooly\'s father in The Mother of Invention.\n\nBoone has written and produced some films of his own. He currently resides in Isla Vista, California.\n\nFrom Wikipedia, the free encyclopedia','1955-03-17',NULL),(266,'Ami Dolenz','Burbank, California, USA','From Wikipedia, the free encyclopedia.  \n\nAmi Dolenz (born January 8, 1969) is an American television and film actress and producer.\n\nDescription above from the Wikipedia article Ami Dolenz, licensed under CC-BY-SA, full list of contributors on Wikipedia','1969-01-08',NULL),(267,'Harshavardhan',NULL,'Harsha Vardhan is an Indian film character actor, comedian and screenwriter known for his works predominantly in Telugu cinema. He is also known for his works in a few Tamil, Malayalam, Hindi language films, and on Television. He is known for his performance in Telugu TV serials such as Ruthu Raagalu and Amrutham and has appeared in more than thirty films in a variety of roles. He turned into script and dialogue writer with the Telugu hits Gunde Jaari Gallanthayyinde and Manam.','1974-10-09',NULL),(268,'Steven Afrikaner',NULL,'',NULL,NULL),(269,'Nassar','Chengalpattu, Tamil Nadu, India','M. Nassar is an Indian film actor, director and producer, who mainly works in the South Indian film industry. He is the incumbent president of the Nadigar Sangam.\n\nNassar made his acting debut in K. Balachander\'s Kalyana Agathigal (1985) portraying a secondary supporting role, before moving on to play villainous roles in S. P. Muthuraman\'s Velaikaran (1987) and Vanna Kanavugal. He played the protagonist in Yuhi Sethu\'s Kavithai Paada Neramillai, though his breakthrough role came through his performance as a police officer in Mani Ratnam\'s Nayakan. He subsequently became a regular in Mani Ratnam and Kamal Haasan\'s ventures, appearing in pivotal character roles in Roja, Thevar Magan (1992), Bombay (1994) and Kuruthipunal (1995).\n\nNassar made his directorial debut with Avatharam (1995), a film based on the backdrop of a folk art troupe. The film won critical acclaim, but failed to become a commercially successful venture.','1958-03-05',NULL),(270,'Angie Russo',NULL,'',NULL,NULL),(271,'Betsy Soo',NULL,'',NULL,NULL),(272,'Nancy Harding',NULL,'',NULL,NULL),(273,'Stephanie Zongker',NULL,'',NULL,NULL),(274,'Charlize Theron','Benoni, Gauteng, South Africa','Charlize Theron (born August 7, 1975) is a South African-American actress and producer. One of the world\'s highest-paid actresses, she is the recipient of various accolades, including an Academy Award, a Screen Actors Guild Award, and a Golden Globe Award. In 2016, Time named her one of the 100 most influential people in the world.\n\nTheron came to international prominence in the 1990s by playing the leading lady in the Hollywood films The Devil\'s Advocate (1997), Mighty Joe Young (1998), and The Cider House Rules (1999). She received critical acclaim for her portrayal of serial killer Aileen Wuornos in Monster (2003), for which she won the Silver Bear and Academy Award for Best Actress, becoming the first South African to win an Oscar in an acting category. She received another Academy Award nomination for playing a sexually abused woman seeking justice in the drama North Country (2005).\n\nTheron has starred in several commercially successful action films, including The Italian Job (2003), Hancock (2008), Snow White and the Huntsman (2012), Prometheus (2012), Mad Max: Fury Road (2015), The Huntsman: Winter\'s War (2016), The Fate of the Furious (2017), Atomic Blonde (2017), The Old Guard (2020) and F9 (2021). She received praise for playing troubled women in Jason Reitman\'s comedy-dramas Young Adult (2011) and Tully (2018), and for portraying Megyn Kelly in the biographical drama Bombshell (2019), receiving a third Academy Award nomination for the last.\n\nSince the early 2000s, Theron has ventured into film production with her company Denver and Delilah Productions. She has produced numerous films, in many of which she had a starring role, including The Burning Plain (2008), Dark Places (2015), and Long Shot (2019). Theron became an American citizen in 2007, while retaining her South African citizenship. She has been honoured with a motion picture star on the Hollywood Walk of Fame.\n\nDescription above from the Wikipedia article Charlize Theron, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1975-08-07',NULL),(275,'Jack Pearson','Strathewen, Victoria, Australia','','1989-09-03',NULL),(276,'Agatha Souza',NULL,'',NULL,NULL),(277,'Martin Blencowe','Brighton, England, UK','Martin Blencowe was born on April 11, 1986 in Brighton, England. He is a producer and actor, known for Suspect (2013), Fire with Fire - Vengeance par le feu (2012) and Braqueurs (2011).','1986-04-11',NULL),(278,'Kevin Haaland',NULL,'',NULL,NULL),(279,'Harrison Muller Jr.',NULL,'','1954-10-19',NULL),(280,'Heath Freeman',NULL,'','1980-06-23','2021-11-14'),(281,'William Baldwin','Massapequa, New York, USA','William Joseph \'Billy\' Baldwin (born February 21, 1963) is an American actor, producer, and writer, known for his starring roles in such films as Flatliners (1990), Backdraft (1991), Sliver (1993), Fair Game (1995), Virus (1999), Double Bang (2001), as Johnny 13 in Danny Phantom (2004–2007), Art Heist (2004), The Squid and the Whale (2005), as Senator Patrick Darling  on the ABC drama Dirty Sexy Money (2007–2009), Justice League: Crisis on Two Earths (2010), and was a regular guest on Gossip Girl as William van der Woodsen and Parenthood as Gordon Flint. He also starred as lead detective Brian Albert in the Lifetime Original Movie The Craigslist Killer.\n\nHe is brother to actors Alec Baldwin, Stephen Baldwin, and Daniel Baldwin. He is married to singer Chynna Phillips (Wilson Phillips) and they have 3 children.  Description above from the Wikipedia article William Baldwin, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1963-02-21',NULL),(282,'Heru Prasetyo',NULL,'',NULL,NULL),(283,'Srinivasa Reddy','Khammam, Telangana, India','Srinivas Reddy is a Telugu comedian and actor. He was born in Khammam, Telangana, India.','1973-02-23',NULL),(284,'George Georgiou','London, England','',NULL,NULL),(285,'Kerry Rossall','Los Angeles, California, USA','Kerry Darrell Rossall (born June 23, 1947) is an American stunt coordinator, stuntman, actor and film producer known for three Taurus World Stunt nominations for Apocalypse Now Redux. He appeared in the films Apocalypse Now, They Live, The Crow: City of Angels, Tomorrow You\'re Gone and produced Friend of the World and Movin\' Too Fast.\n\nThis article uses material from the Wikipedia article \"Kerry Rossall\", which is released under the Creative Commons Attribution-Share-Alike License 3.0.','1947-06-23',NULL),(286,'Don Wilson','Cocoa Beach, Florida, USA','Don \"The Dragon\" Wilson (born September 10, 1954) is an American champion kickboxer and actor. He is most famous for his acting roles in action/adventure films, including eight titles in Roger Corman\'s Bloodfist series.\n\nDescription above from the Wikipedia article Don \"The Dragon\" Wilson, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1954-09-10',NULL),(287,'Luca De Massis','Italy','','1983-04-07',NULL),(288,'Rick Avery','New York City, New York, USA','Rick Avery is an American stuntman, stunt coordinator, actor, director and author. He has worked on more than 400 films and television projects, including The Crow, The Prestige, The Dark Knight Rises, Gangster Squad, and American Sniper. He is also notable for having doubled for Robert De Niro, Dustin Hoffman, Richard Gere and John Travolta.',NULL,NULL),(289,'Paul Tuerpe',NULL,'Paul Tuerpe is known for Superman (1978), The Goonies (1985) and Lethal Weapon (1987).',NULL,NULL),(290,'Ludacris','Champaign, Illinois, USA','Christopher Brian Bridges (born September 11, 1977), known professionally as Ludacris, is an American rapper and actor. After forming his own label, Disturbing tha Peace, in the late 1990s, he later signed with Def Jam South and would go on to become one of the first Dirty South rappers to achieve mainstream success with his subsequent releases. For his music, Ludacris has won an MTV Video Music Award and three Grammy Awards.\n\nAs an actor, he is best known for his role as Tej Parker in the Fast and Furious film franchise. His other notable roles include Crash (2004), Gamer (2009), New Year\'s Eve (2011), and End of the Road (2023). For his performance in the ensemble of Crash, he was co-awarded a Screen Actors Guild Award and a Critic\'s Choice Award for Best Cast.\n\nHis daughter Karma Bridges is an actress.','1977-09-11',NULL),(291,'Ryan McDonald',' New Westminster, British Columbia, Canada','','1984-08-05',NULL),(292,'J.D. Nicholsen',NULL,'',NULL,NULL),(293,'Stowe Blankenship',NULL,'',NULL,NULL),(294,'Paul Kennedy',NULL,'Paul Kennedy is a Belfast-based actor, writer and director working in television, film and stage.',NULL,NULL),(295,'Lee Kyu-ho','South Korea','Korean actor.','1985-03-05',NULL),(296,'Yuma Ishigaki','Gifu, Japan','Yuma Ishigaki (石垣 佑磨 Ishigaki Yūma, born August 28, 1982) is a Japanese actor from Gifu Prefecture and raised in Nerima, Tokyo.','1982-08-02',NULL),(297,'Yasushi Asaya',NULL,'Yasushi Asaya is an actor and a stunt performer.',NULL,NULL),(298,'Rae Latt','Los Angeles, California, USA','',NULL,NULL),(299,'Manny Cortez Tuazon',NULL,'',NULL,NULL),(300,'Jonathan Yunger',NULL,'',NULL,NULL),(301,'Jessica DeBonville',NULL,'',NULL,NULL),(302,'Catharina Dahlin','Sundsvall, Västernorrlands län, Sweden','Swedish actress, born in Sundsvall on July 31, 1944. She always dreamed of being an actress and after landing a small role in an Italian film, she ended up living and working in Italy, playing uncredited roles in many films during the 1970s and 80s.\n\nFor many years, she lived with a director named Roberto Carnicci, who was friends with Fellini, and Catharina was able to get small roles in four of Fellini\'s films: Satyricon (1969), Roma (1972), Amarcord (1973) and La città delle donne (1980). Amidst her many small roles, she also had quite a few speaking parts, such as in Delitto sull\'autostrada (1982), where she\'s jokingly seduced by Tomas Milian who asks her: «Do you have a license for these pair of eyes?».\n\nCatharina moved back to Sweden in 1983 and began to work with astrology. She also studied to be a healer and has continued her acting career by appearing in some films by Swedish director Lars Mohlin.','1944-07-31',NULL),(303,'Masako Katsuki','Hachinohe, Aomori, Japan','Masako Katsuki (勝生 真沙子), born Masako Shiiono (塩野 雅子), is a Japanese voice actress.  She has also worked under the names Ai Nekomi (猫魅愛) and Masami Kawashita (川下雅美).','1958-10-15',NULL),(304,'Tamás Deák','Hungary','','1969-08-09',NULL),(305,'Scott Douglas',NULL,'',NULL,NULL),(306,'Martin Balsam','Bronx, New York, USA','Martin Henry Balsam (November 4, 1919 – February 13, 1996) was an American character actor. He is best known for a number of film roles, including detective Milton Arbogast in Alfred Hitchcock\'s Psycho (1960), Arnold Burns in A Thousand Clowns (1965), which earned him the Academy Award for Best Supporting Actor, Juror #1 in 12 Angry Men (1957), and Mr. Green in The Taking of Pelham One Two Three (1974), as well as for his role as Murray Klein in the television sitcom Archie Bunker\'s Place (1979–1983).','1919-11-04','1996-02-13'),(307,'Michaël Vander-Meiren',NULL,'Michaël Vander-Meiren is known for From Paris with Love (2010), 3 Days to Kill (2014) and Mesrine: Public Enemy No. 1 (2008).',NULL,NULL),(308,'Dorothy Vernon','Norddorf, Amrum island, Germany','From Wikipedia, the free encyclopedia\n\nDorothy Vernon (November 11, 1875 – October 28, 1970) was a German-born American film actress. Born Dorothy Baird, she appeared in 131 films between 1919 and 1956. She died in Granada Hills, California from heart disease, aged 94. Her son was actor and entertainer Bobby Vernon.','1875-11-09','1970-10-28'),(309,'Sabrina Siani','Roma, Italy','Sabrina Siani is an Italian actress whose career began shortly after winning a beauty contest as a teenager. She swiftly found a modicum of success acting as leading ladies in several Spanish and Italian exploitation films by the likes of Jess Franco, Joe D\'Amato, and Umberto Lenzi. Often criticized for her lack of acting, she apparently had few qualms about appearing nude and managed to get some leading roles anyway. She may be best remembered for her career-best performance as the villain \"Okron\" in CONQUEST in which she wears little more than a gold mask and a G-string throughout.','1963-01-01',NULL),(310,'John Torres',NULL,'',NULL,NULL),(311,'Kunchacko Boban','Alappuzha, Kerala, India','Kunchacko Boban is an Indian film actor and producer who appears in Malayalam films.\n\nHe is the grandson of producer Kunchacko, who established the film production studio Udaya Pictures.\n\nKunchacko Boban made his acting debut in Fazil\'s Aniyathipraavu  (1997) which turned out to be a blockbuster and made him into an  overnight sensation. He became a popular lead star in the late-1990s  with successful films such as Mayilpeelikkavu (1998), Nakshatratharattu (1998), and Niram (1999). He continued his success with Dhosth (2001), Swapnakoodu (2003), and Kasthooriman (2003). After a couple of commercial failures, his career took a set back in the mid-2000s. He made a comeback with Gulumaal (2009) which was well received. Later, he went on to act in successful films such as Elsamma Enna Aankutty (2010), Traffic (2011), Seniors (2011), Ordinary (2012), Romans (2013), Pullipulikalum Aattinkuttiyum (2013), How Old Are You? (2014), and Vettah (2016). Kunchacko Boban was awarded the Special Jury Award for his performance in Ee Snehatheerathu at the 2004 Kerala State Film Awards.\n\nKunchacko Boban, son of actor, director Boban Kunchacko and grand son  of legendary Kunchacko, was introduced into Malayalam film industry by  versatile director Fazil. His debut movie Aniathipravu (1997), co-starring Shalini, and directed by Fazil [9]  was a block buster. Kunchacko Boban\'s performance as Sudhi, the lead  character got him good reception across young audience and the family  crowd. Kunchacko Boban- Shalini pair was considered as a lucky pair in  late nineties. Following the success of Aniathipravu, Kunchacko Boban was cast in movies like Nakshathrathaarattu, Mayilpeelikkavu  and Niram (1999). \"Niram\" was one of the biggest grossers of 1999.  Songs of \"Niram\" are still very popular. His performance in hit movies  \"Kasthuriman\" and \"Swapnakoodu\" was also appreciated by critics.\n\nHe played a cameo in Fazil\'s Harikrishnans, which marked the reunion of Mohanlal and Mammootty after 9 years. Then came a streak of Chandamama, an average film at the box office, and he went on to do Ingane Oru Nilapakshi, Prem Poojari, Sahayathrikakku Snehapoorvam etc.\n\nAfter Niram, Dosth and Narendran Makan Jayakanthan Vaka, his next films included Kasthooriman, and Swapnakkoodu. The movie Ee Snehatheerathu earned him a Special Jury Award at the 2004 Kerala State Film Awards.\n\nKunchacko was born in Alappuzha, Kerala. He is the grandson of film producer Kunchacko of the erstwhile Udaya Studios,  the first film studio in Kerala. His father Boban Kunchacko was also an  actor and producer who acted in a few films produced by Udaya and his  mother Molly is a housewife. He has two younger sisters, Anu and Mini. Boban Kunchacko later ventured into direction with the films Palattu Kunhikkannan, Sanchari and Aazhi. Kunchacko Boban is also the grandnephew of Navodaya Appachan of the Navodaya Studios.\n\nKunchako Boban married Priya Ann Samuel on 2 April 2005 at Little Flower Syro-Malabar Catholic Church, Ernakulam','1976-11-02',NULL),(312,'Francis Ng','Hong Kong, British Crown Colony [now China]','Francis Ng Chun-yu (born 21 December 1961) is a Hong Kong actor and director. He is known for his roles in the TVB series Triumph in the Skies and in films such as Young and Dangerous, Once Upon a Time in Triad Society and The Mission.','1961-12-21',NULL),(313,'Meredith Thomas','Keene, New Hampshire, USA','',NULL,NULL),(314,'Andrea Madison',NULL,'',NULL,NULL),(315,'Hillel M. Sharman',NULL,'',NULL,NULL),(316,'Brooke Stacy Mills','USA','Brooke Stacy Mills was born on September 21, 1967.','1967-09-21',NULL),(317,'Leo Chiang','Taipei, Taiwan','','1976-01-20',NULL),(318,'Robert Racki',NULL,'',NULL,NULL),(319,'James Sinclair',NULL,'',NULL,NULL),(320,'Robin Rieger',NULL,'',NULL,NULL),(321,'Seth Rogen','Vancouver, British Columbia, Canada','Seth Aaron Rogen (born April 15, 1982) is a Canadian-American actor, comedian, producer and filmmaker. Originally a stand-up comedian in Vancouver, he moved to Los Angeles for a part in Judd Apatow\'s series Freaks and Geeks, and then got a part on the sitcom Undeclared, which also hired him as a writer. After landing his job as a staff writer on the final season of Da Ali G Show, Apatow guided Rogen toward a film career. As a staff writer, he was nominated for a Primetime Emmy Award for Outstanding Writing for a Variety Series.\n\nHis first movie appearance was a minor role in Donnie Darko (2001). Rogen was cast in a supporting role and credited as a co-producer in Apatow\'s directorial debut, The 40-Year-Old Virgin. Universal Pictures subsequently cast him as the lead in Apatow\'s films Knocked Up and Funny People. Rogen co-starred as Steve Wozniak in Universal\'s Steve Jobs biopic in 2015. In 2016, he developed the AMC television series Preacher with his writing partner Evan Goldberg and Sam Catlin. He also serves as a writer, executive producer, and director, with Goldberg.\n\nRogen and Goldberg co-wrote the films Superbad, Pineapple Express, The Green Hornet, This Is the End, and directed both This Is the End and The Interview, all of which Rogen starred in. He has also done voice work for the films Shrek the Third, Horton Hears a Who!, the Kung Fu Panda trilogy, The Spiderwick Chronicles, Monsters vs. Aliens, Paul, Sausage Party, the 2019 version of The Lion King, and The Super Mario Bros. Movie.','1982-04-15',NULL),(322,'Philippe Hartmann','Montreal, Quebec, Canada','','1970-12-18',NULL),(323,'Collin Carmouze',NULL,'',NULL,NULL),(324,'Robert Flores',NULL,'',NULL,NULL),(325,'Edward James Olmos','Los Angeles, California, USA','Edward James Olmos (born February 24, 1947) is an American actor, director, producer, and activist.  He is best known for his roles as Lieutenant Martin \"Marty\" Castillo in Miami Vice (1984–1989), actor in and director of American Me (1992), William Adama in the re-imagined Battlestar Galactica (2004–2009), teacher Jaime Escalante in Stand and Deliver (1988), and Detective Gaff in Blade Runner (1982), and its sequel Blade Runner 2049 (2017). In 2018, he played the father of two members of an outlaw motorcycle club in the FX series Mayans MC.\n\nFor his work in Miami Vice, Olmos won the 1985 Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series, as well as the Golden Globe Award for Best Supporting Actor – Series, Miniseries or Television Film. For his performance in Stand and Deliver, Olmos was nominated for a Golden Globe Award and the Academy Award for Best Actor in a Leading Role.\n\nHe is also known for his roles as patriarch Abraham Quintanilla in the film Selena, narrator El Pachuco in both the stage and film versions of Zoot Suit, and the voice of Chicharrón in Coco.\n\nOver the course of his career, Olmos has been a pioneer for more diversified roles and images of Hispanics in the U.S. media. His notable direction, production, and starring roles for films, made-for-TV movies, and TV shows include Wolfen, Triumph of the Spirit, Talent for the Game, American Me, The Burning Season, My Family/Mi Familia, Caught, 12 Angry Men, The Disappearance of Garcia Lorca, Walkout, The Wonderful Ice Cream Suit, American Family, and Dexter.  Description above from the Wikipedia article Edward James Olmos, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1947-02-24',NULL),(326,'Kim Richard Draves',NULL,'',NULL,NULL),(327,'Shaylee Mansfield','Burbank, California, USA','','2009-04-06',NULL),(328,'Xu Xiangdong',NULL,'','1961-12-20',NULL),(329,'Jonathan Nation',NULL,'',NULL,NULL),(330,'Jacob Palacio',NULL,'',NULL,NULL),(331,'Reem Kherici','Neuilly sur Seine, France','Reem Kherici fit d\'abord ses débuts à la radio en 2002 sur Fun Radio, avant d\'animer en 2003, l\'émission de télévision Les Filles du week-end sur Fun TV. C\'est sur cette chaine qu\'elle rencontra l\'animateur Philippe Lacheau, alias Fifi1. En 2004, elle prend part en tant que comédienne récurrente à l\'émission La Cave à l\'info, orchestrée par Fifi et sa bande d\'acolytes. En 2005, la Bande à Fifi se retrouve dans Le Grand journal de Canal+, tous les soirs avec ses Anniversaires du jour et se fait surtout remarquer lors du 59e Festival de Cannes avec ses sketchs en direct. Durant la saison 2006-2007, la Bande à Fifi était présente tous les soirs de la semaine en direct au sein du Grand Journal de Canal+2. Fin 2008, ils étaient au Café-théâtre le Splendid dans la pièce intitulée Qui a tué le mort ?, une comédie produite par l\'ex-Nuls Dominique Farrugia. En 2009, elle participe au programme de W9 Chut, chut, chut toujours avec la même troupe, mais aussi sur France 4 en tant qu\'invitée récurrente dans La porte ouverte à toutes les fenêtres, émission présentée par l\'animateur de télévision et de radio Cyril Hanouna. Reem a tourné avec Jean Dujardin dans OSS 117 : Rio ne répond plus, sorti en avril 2009, et dans Neuilly sa mère ! en août 2009. Elle a été à l\'affiche avec Michaël Youn dans le film Fatal, dans lequel elle incarne une journaliste, en juin 2010. Elle a embarqué sur le film Bienvenue à bord avec Franck Dubosc, Gérard Darmon et Valérie Lemercier. Reem réalise, pendant l\'été 2012, son premier film, Paris à tout prix, un film qu\'elle a écrit, qui est produit par Mandarin Cinema et distribué par la société Gaumont, elle y tient le rôle principal.','1983-02-13',NULL),(332,'Patrick John Walton',NULL,'',NULL,NULL),(333,'Jonas Bloquet','Brussels, Belgium','Jonas Bloquet (born 10 July 1992) is a Belgian actor and film director. He made his film debut at the age of 15 in the drama Private Lessons (2008), which earned him a Magritte Award nomination for Most Promising Actor. He has starred in Belgian, French, and American films and is known for his roles such as Vincent Leblanc in the psychological thriller Elle (2016), for which he was nominated for a César Award for Most Promising Actor, and Maurice \"Frenchie\" Theriault in the horror film The Nun (2018) and its sequel The Nun II (2023).\n\nOn television, he has starred in the mystery-science fiction series 1899 (2022), and portrayed Joseph II, Holy Roman Emperor in the historical drama series Marie Antoinette (2023).\n\nDescription above from the Wikipedia article Jonas Bloquet, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1992-07-10',NULL),(334,'Rutger Hauer','Breukelen, Utrecht, Netherlands','Rutger Oelsen Hauer (23 January 1944 - 19 July 2019) was a Dutch film actor. He was well known for his roles in Flesh + Blood, Blind Fury, Blade Runner, The Hitcher, Nighthawks, Sin City, Ladyhawke, The Blood of Heroes and Batman Begins.\n\nHauer was born in Breukelen, Netherlands, to drama teachers Arend and Teunke, and grew up in Amsterdam. Since his parents were very occupied with their careers, he and his three sisters (one older, two younger) were raised mostly by nannies. At the age of 15, Hauer ran off to sea and spent a year scrubbing decks aboard a freighter. Returning home, he worked as an electrician and a carpenter for three years while attending acting classes at night school. He went on to join an experimental troupe, with which he remained for five years before he was cast in the lead role in the very successful 1969 television series Floris, a Dutch Ivanhoe-like medieval action drama. The role made him famous in his native country.\n\nHauer\'s career changed course when director Paul Verhoeven cast him as the lead in Turkish Delight (1973) (based on the Jan Wolkers book of the same name). The movie found box-office favour abroad as well as at home, and within two years, its star was invited to make his English-language debut in the British film The Wilby Conspiracy (1975). Set in South Africa and starring Michael Caine and Sidney Poitier, the film was an action melodrama with a focus on apartheid. Hauer\'s supporting role, however, was barely noticed in Hollywood, and he returned to Dutch films for several years. Hauer made his American debut in the Sylvester Stallone vehicle Nighthawks (1981), cast as a psychopathic and cold-blooded terrorist named \"Wolfgar\" (after a character in the Old English poem Beowulf). The following year, he appeared in arguably his most famous and acclaimed role as the eccentric, violent, yet sympathetic replicant Roy Batty in Ridley Scott\'s 1982 sci-fi thriller, Blade Runner.\n\nHauer was a dedicated environmentalist. He fought for the release of Greenpeace\'s co-founder, Paul Watson, who was convicted in 1994 for sinking a Norwegian whaling vessel. Hauer has also established an AIDS awareness foundation called the Rutger Hauer Starfish Foundation. He married his second wife, Ineke, in 1985 (they had been together since 1968); and he has one child, actress Aysha Hauer, who was born in 1966 and who made him a grandfather in 1988. In April 2007, he published his autobiography All Those Moments: Stories of Heroes, Villains, Replicants, and Blade Runners (co-written with Patrick Quinlan) where he discussed many of his movie roles. Proceeds of the book go to Hauer\'s Starfish Foundation.','1944-01-23','2019-07-19'),(335,'Ashley Scott','Metairie, Louisiana, USA','Ashley McCall Scott (born July 13, 1977) is an American actress. She is known for her work on television and in film, including her roles in the television series Birds of Prey, Dark Angel and Jericho. Description above from the Wikipedia article Ashley Scott, licensed under CC-BY-SA, full list of contributors on Wikipedia. ','1977-07-13',NULL),(336,'Ian Wilson',NULL,'',NULL,NULL),(337,'Trevante Rhodes','Ponchatoula, Louisiana, USA','Trevante Rhodes is an American film and television actor, best known for starring as Adult Chiron in the Academy Award winning feature film \"Moonlight\".','1990-02-10',NULL),(338,'Amber English',NULL,'',NULL,NULL),(339,'Tiffney Wagoner',NULL,'',NULL,NULL),(340,'Ivan Porodnov',NULL,'',NULL,NULL),(341,'Brock Kelly','New Orleans, Louisiana, USA','','1985-08-17',NULL),(342,'Turner Crumbley',NULL,'',NULL,NULL),(343,'Austin Stowell','Kensington - Connecticut - USA','Austin Miles Stowell (born December 24, 1984) is an American actor. He is best known for his role as Kyle Connellan in Alcon Entertainment\'s Dolphin Tale and Dolphin Tale 2, and as Dalton Joiner in the Vietnam romantic drama Love and Honor with Liam Hemsworth.\n\n Austin Stowell was born in Kensington, Connecticut, where he was raised by his father, Robert, a retired steelworker, and his mother, Elizabeth, a schoolteacher.  He graduated from Berlin High School in 2003 with the intention of pursuing a professional career in acting. Upon acceptance at the University of Connecticut in Storrs, Connecticut, he studied with the Department of Dramatic Arts, a division of the School of Fine Arts. He performed in several productions with the Connecticut Repertory Theatre, including Julius Caesar, It Can\'t Happen Here, and As You Like It.  Stowell graduated with a Bachelor of Fine Arts in 2007.','1984-12-24',NULL),(344,'Sam Reid','New South Wales, Australia','Sam Reid was born on February 19, 1987 in New South Wales Australia. He relocated to London where he graduated from the London Academy of Music and Dramatic Art as the \'star\' student in 2010. During his final semester at LAMDA, he was cast in Anonymous (2011). He has worked with some of the biggest names in the British film industry including Vanessa Redgrave, Tom Wilkinson and Miranda Richardson. - IMDb Mini Biography By: PChou','1987-02-19',NULL),(345,'Doug Boethin',NULL,'',NULL,NULL),(346,'Jeon Bae-soo','South Korea','Jeon Bae-soo, born in North Jeolla Province, is a South Korean actor. He debuted as an actor in 2004, but took a long hiatus from the profession, returning with roles in the series “The K2” and “Becky\'s Back” in 2016.','1970-06-02',NULL),(347,'Rupert Wynne-James',NULL,'',NULL,NULL),(348,'David Zayas','Puerto Rico','David Zayas (born 31 December 1962) is a Puerto Rican theatrical, film, and television actor. He is best known for his roles as Angel Batista on Showtime\'s series Dexter and as Enrique Morales on the HBO prison drama Oz.','1962-08-15',NULL),(349,'Ben Turner','London, England, UK','','1980-02-03',NULL),(350,'Jack Lowden','Chelmsford, Essex, England, UK','Jack Andrew Lowden (born 2 June 1990) is a Scottish actor. Following a four-year stage career, his first major international onscreen success was in the 2016 BBC miniseries War & Peace, which led to starring roles in feature films. His most recent project is that of portraying Siegfried Sassoon in the 2022 biopic Benediction.','1990-06-02',NULL),(351,'Don Yesso','New Orleans, Louisiana, USA','','1954-11-27',NULL),(352,'Vervi Mauricio',NULL,'',NULL,NULL),(353,'Victor Filgueiras',NULL,'',NULL,NULL),(354,'Jack Doke',NULL,'',NULL,NULL),(355,'Jonathan Hale','Hamilton, Ontario, Canada','From Wikipedia, the free encyclopedia\n\nJonathan Hale (born Jonathan Hatley, March 21, 1891 – February 28, 1966) was a Canadian-born film and television actor.\n\nHale was born in Hamilton, Ontario, Canada. Before his acting career, Hale worked in the Diplomatic Corps. Hale is most well known as Dagwood Bumstead\'s boss, Julius Caesar Dithers, in the Blondie film series in the 1940s. He is also notable for playing Inspector Fernack in various The Saint films by RKO Pictures.\n\nIn 1950 he made two appearances in The Cisco Kid as Barry Owens. He also appeared in two different episodes of Adventures of Superman: \"The Evil Three\", in which he played a murderous \"Southern Colonel\"-type character, and \"Panic in the Sky\", one of the most famous episodes, in which he played the lead astronomer at the Metropolis Observatory, actually a California observatory.\n\nAmong the relatively few television programs on which Hale appeared are the religion anthology series Crossroads, The Loretta Young Show, Brave Eagle, Schlitz Playhouse, The Joey Bishop Show, and Walt Disney Presents: \"A Tribute to Joel Chandler Harris\".\n\nHale committed suicide on February 28, 1966. He was found dead that evening in his room at the Motion Picture & Television Country House and Hospital in Woodland Hills, California. Hale had taken his own life with a .38 caliber pistol, which was found near his body. He was 74. Hale was interred at Valhalla Memorial Park Cemetery in North Hollywood, California. Sadly, Hale\'s grave went unmarked for more than four decades, until a proper headstone was erected by donations from the \"Dearly Departed\" fan-based group in 2013; he is now honored with the inscription, \"We Remembered You\".','1891-03-20','1966-02-28'),(356,'Toru Okawa','Kagoshima Prefecture, Japan','Tōru Ōkawa (大川 透, Ōkawa Tōru, born Feb 28, 1960) is a Japanese actor, voice actor and narrator. While he went to a College of Art, Nihon University, he started his career as a stage actor, but after he moved to Mausu Promotion, his current agency, he came to focus on voice acting.','1960-02-28',NULL),(357,'Jeff Krebs',NULL,'',NULL,NULL),(358,'Tommy French',NULL,'Tommy French is an actor, known for Luther (2010), I Love My Mum (2018) and 1917 (2019).',NULL,NULL),(359,'Rebecca Cox',NULL,'',NULL,NULL),(360,'Killer Khan',NULL,'Masashi Ozawa is a Japanese retired professional wrestler. Popularly known as Killer Khan, he was billed from Mongolia and had numerous high-profile matches with André the Giant in the World Wrestling Federation during the 1980s, including a high profile \"Mongolian stretcher match\".','1947-03-06',NULL),(361,'Nestor Fuentes',NULL,'',NULL,NULL),(362,'Raniero Dorascenzi',NULL,'',NULL,NULL),(363,'Clara Lee','Bern, Switzerland','Lee Sung Min, born in Switzerland, is a British model and actress, based in South Korea, represented by EYAGI Entertainment.\n\nLee Sung Min made her entertainment debut under her birth name in 2005 and starred in her first film in 2009, called Five Senses of Eros. In January of 2012, she announced at a press conference for the drama series, Take Care of Us, Captain that she will be going by her new stage name Clara. The reason for such a choice was because Clara felt that her birth name Sung Min was too \"male-sounding\" and that her English name had always been Clara.\n\nIn May 2013, Clara became an overnight sensation online after throwing a ceremonial first pitch in a professional baseball game dressed in form-fitting leggings. She has since been hailed as an up-and-coming star. Afterward, she again played supporting roles in the television series Goddess of Marriage (2013) and Emergency Couple (2014), followed by a leading role in the romance comedy film Casa Amor: Exclusive for Ladies (2015).\n\nClara is the daughter of singer Lee Seung Kyu, a former member of the bilingual band, Koreana. In January 2019, she announced her marriage to a Korean-American businessman Samuel Huang.','1986-01-15',NULL),(364,'J. J. Soria',NULL,'','1986-08-28',NULL),(365,'Sreeja Ravi','Kannur, Kerala, India','Sreeja Ravi is an Indian voice artist who has lent her dubbing voice to over 1500 films in total and also performed voices for numerous commercial ads. She started her dubbing career in the year 1975 for the movie Utharayanam, directed by G. Aravindan. She can speak English, Hindi, Tamil, Telugu, Bengali, Malayalam and also Kannada, as she used those six major Indian languages to perform dubbing roles in foreign productions.',NULL,NULL),(366,'Tammy Bruce','Los Angeles, California, USA','Tammy Bruce was born on August 19, 1962 in Los Angeles, California, USA. She is a writer and producer, known for 2081 (2009), Get Tammy Bruce (2019) and Women of the Bible Speak (2021).','1962-08-19',NULL),(367,'Manuel Tapia',NULL,'',NULL,NULL),(368,'Tom McCarthy','New Providence, New Jersey, USA','Thomas Joseph McCarthy (born 1966) is an American actor, writer, and film director who has appeared in several movies, including Meet the Parents and Good Night, and Good Luck, and television shows such as The Wire, Boston Public, Law & Order, and the Hallmark Hall of Fame presentation of Saint Maybe. McCarthy has received critical acclaim for his writing/direction work for the independent films The Station Agent, The Visitor, and Win Win. He currently resides in Manhattan. He is the silent partner in a chain of successful Papaya Dogs throughout the greater metropolitan area.\n\nDescription above from the Wikipedia article Thomas McCarthy (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-06-07',NULL),(369,'Shenina Cinnamon','Jakarta, Indonesia','Shenina Cinnamon is an Indonesian actress.','1999-02-01',NULL),(370,'Shawn Sarmeidani',NULL,'',NULL,NULL),(371,'Ananth Narayan Mahadevan',NULL,'',NULL,NULL),(372,'Dawn Merrick',NULL,'',NULL,NULL),(373,'Robert Phillips','Chicago, Illinois, USA','Played pro football for the Washington Redskins and the Chicago Bears, before becoming an actor.','1925-04-10','2018-11-05'),(374,'Robin Wilcock',NULL,'Robin Wilcock is an actor.',NULL,NULL),(375,'Rasko Relic',NULL,'',NULL,NULL),(376,'Guillaume Labbé','Paris, France','','1983-01-26',NULL),(377,'Raymond J. Barry','Hempstead, Long Island, New York, USA','Raymond John Barry (born March 14, 1939) is an American film, television, and stage actor. He was nominated for the Independent Spirit Award for Best Supporting Male for his performance in the film Steel City.','1939-03-14',NULL),(378,'Alessandra Mastronardi','Naples, Italy','Alessandra Carina Mastronardi (born February 18, 1986) is an Italian actress. She is best known for her roles in the film To Rome with Love and the television series Master of None the latter for which she garnered a nomination for the Critics\' Choice Television Award for Best Supporting Actress in a Comedy Series in 2017.','1986-02-18',NULL),(379,'Eduardo Gomez',NULL,'',NULL,NULL),(380,'John Cusack','Evanston, Illinois, USA','John Paul Cusack (born June 28, 1966) is an American actor. Cusack began acting in films during the 1980s, starring in coming-of-age dramedies such as Sixteen Candles (1984), Better Off Dead (1985), The Sure Thing (1985), Stand by Me (1986), and Say Anything... (1989). In the 1990s, he then started appearing in independent films and had leading men roles in Bullets Over Broadway (1994), Con Air (1997), Grosse Pointe Blank (1997), The Thin Red Line (1998), Being John Malkovich (1999), High Fidelity (2000), America\'s Sweethearts (2001), Max (2002), and Runaway Jury (2003).\n\nCusack has been nominated for several awards, including a Golden Globe for his role starring in High Fidelity. He won the 2014 Canadian Screen Awards for Best Performance by an Actor in a Supporting Role for his performance in Maps to the Stars. He is a son of filmmaker Dick Cusack and the younger brother of actresses Joan and Ann Cusack.\n\nIn 2012, Cusack was awarded a star on the Hollywood Walk of Fame.\n\nDescription above from the Wikipedia article John Cusack, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-06-28',NULL),(381,'Kristen Dalton','San Diego County, California, USA','Kristen Dalton (born Kristen V. Hocking; February 14, 1973) is an American actress who has appeared in television shows, especially USA Network\'s The Dead Zone.','1973-02-14',NULL),(382,'John D. Hickman','Tuscaloosa - Alabama - USA','John D Hickman got his start in acting from a donated Walk On Role at a Charity Auction for LA Children\'s hospital back in 2011. In 2014 John landed a role in the Michael W Gordon film BlackWater Wilderness as a former military private contractor that has lost his mind and goes on a killing spree.',NULL,NULL),(383,'Allura Lee',NULL,'',NULL,NULL),(384,'Sergey Aprelsky','Ukhta, Russia','Sergey Aprelsky (Сергей Апрельский) is a Russian actor.','1967-04-14',NULL),(385,'Greg Sproles',NULL,'',NULL,NULL),(386,'Neil Napier','Montreal, Quebec, Canada','Born and raised in Montreal, Neil now resides in Los Angeles where, when not at work on a set or in a studio, he can be found playing hockey, practicing yoga and trying to get better at guitar.','1970-04-02',NULL),(387,'Judit Fekete',NULL,'Born and raised in Pecs, Hungary, Judit Fekete has been working actively on various film and theater projects. She moved to the United States to gain a BA in Acting then moved to London, UK, to get her Masters degree in Acting for Screen from the prestigious Central School of Speech and Drama. Having completed that she then moved to the west coast and resides in Los Angeles, California.',NULL,NULL),(388,'Cathy White',NULL,'',NULL,NULL),(389,'Sheila Terry','Warroad, Minnesota, USA','From Wikipedia, the free encyclopedia\n\nSheila Terry (March 5, 1910 – January 19, 1957) was an American film actress. She was born Kay Clark in Warroad, Minnesota.  Terry first studied dramatics at Dickson-Kenwin academy, a school affiliated with London\'s Royal Academy. Later she moved to New York, where she continued her studies and appeared in a number of plays. While appearing on Broadway in The Little Racketeer, she was spotted by an alert film scout and given a test which led to a contract with Warner Bros.\n\nShe played in 1930s for Warner Bros. She appeared with John Wayne in the Western films Haunted Gold (1932); Neath the Arizona Skies and The Lawless Frontier (1934). She appeared with Bette Davis, Louis Calhern and Spencer Tracy in 20,000 Years in Sing Sing (1932). She appeared with Cary Grant and Sylvia Sidney in Marion Gering\'s film Madame Butterfly (1932). In 1933 she left Hollywood briefly for the New York stage.  She married Major Laurence E. Clark, a wealthy Toronto socialite on August 16, 1928. She divorced him February 16, 1934. In 1937, she married William Magee of San Francisco, and retired from show business. After his death, Terry wanted to return to show business, but couldn\'t find a job.\n\nIn 1947, she said in a newspaper-interview: \"I\'m going back into show business and I need an act, I can\'t sing, I can\'t dance and I can\'t play the piano. I should be terrific in night clubs\". She worked as a press agent for 15 years.\n\nIn January 1957, her body was discovered in the third floor apartment, which was both her home and office. A friend and neighbour, Jerry Keating, went to the apartment when he failed to reach her on the telephone. The door was locked, and Terry did not answer the bell. Keating called the police; they broke in and found Terry\'s body on the bedroom floor, her back leaning against the bed. Five capsules, their contents gone, were on the floor beside her.\n\nFriends told the police that she returned from a trip to Mexico a few days before her death and that she was ill when she came home. It was later discovered that she died broke; she left only a scanty wardrobe. She was buried in Potter\'s Field in New York City.','1910-03-05','1957-01-19'),(390,'Matheus Fagundes','São Paulo, São Paulo, Brazil','','1997-06-23',NULL),(391,'John Michael Herndon',NULL,'',NULL,NULL),(392,'Franco Ukmar','Rome, Italy','','1936-03-29','2016-08-10'),(393,'William Harrigan','New York City, New York, USA','William Harrigan was an American stage, screen, and television actor.','1894-03-26','1966-02-01'),(394,'Asher Samuel',NULL,'',NULL,NULL),(395,'David Furr',NULL,'David Furr is an actor and director.',NULL,NULL),(396,'Dave Franco','Palo Alto, California, USA','David John Franco (born June 12, 1985) is an American actor and director. He began his career with small roles in films such as Superbad (2007) and Charlie St. Cloud (2010). Following a starring role in the ninth season of the comedy series Scrubs, Franco had his film breakthrough as a supporting role in the buddy comedy film 21 Jump Street (2012).\n\nFranco has also starred in Fright Night (2011), Now You See Me (2013) and its sequel Now You See Me 2 (2016), Neighbors (2014), Nerve (2016), and The Disaster Artist (2017). In 2020, he made his directorial debut with The Rental, which starred his wife Alison Brie.\n\nFrom Wikipedia, the free encyclopedia','1985-06-12',NULL),(397,'Edgar Mayradze',NULL,'',NULL,NULL),(398,'Heather Sossaman',NULL,'Heather Sossaman is a California native actress known for her role as Laura Barns in Universal and Blumhouse picture\'s Unfriended.\n\nShe began acting at a young age alongside her two sisters. Heather immediately landed small roles in popular shows like Beverly Hills, 90210 (1990), for which she was hand-picked by producer Aaron Spelling when she was just ten years old. A versatile artist, Heather taught herself to play guitar at a young age, and was featured on MTV by the age of 18 for her singing/songwriting skills. Shortly after Heather attended a mass audition of over 3500 performers to join the first ever Disneyland cast in Paris, France. She was selected as one of only three girls to spend a year training and performing in Paris.\n\nAfter visiting over 16 countries, Heather returned home to focus on a film and television career in Los Angeles. Since, she has landed recurring roles on NBC\'s Days of Our Lives, appeared in three CSI series in major guest starring roles, as well as NCIS, NCIS: LA, Fox\'s Breaking In with Christian Slater, Hawaii Five-0 as the god daughter of James Caan, among others. Her television roles have ranged diversely from strong comedic roles, to intense, dramatic roles.\n\nAlong with Television, Heather has garnered some notable roles in films. 2015 brought the release of Desecrated, starring along side Haylie Duff & Michael Ironside, and Earth Quake 10.0 with a noteworthy ensemble cast, Heather playing the daughter of Lost\'s Henry Ian Cusick. Universal Studios, and Blumhouse Pictures\' Unfriended marked Her first wide theatrical release, playing widely discussed Villain, Laura Barns in April of 2015.\n\nHeather is a talented and skilled young artist, steadily making a mark with her diverse range in acting, singing, and performing.','1987-04-25',NULL),(399,'Rick Taff',NULL,'',NULL,NULL),(400,'Dan Hanlon',NULL,'',NULL,NULL),(401,'Ma weifu',NULL,'','1957-02-26',NULL),(402,'Blas Sien Diaz',NULL,'',NULL,NULL),(403,'Beverley Elliott','Listowel, Ontario, Canada','','1960-12-31',NULL),(404,'Patrick Labyorteaux','Los Angeles, California, USA','','1965-07-22',NULL),(405,'OvaJean Siemens',NULL,'',NULL,NULL),(406,'Edna Pendleton',NULL,'',NULL,NULL),(407,'Nanami Sakuraba','Izumi, Kagoshima Prefecture, Japan','Nanami Sakuraba is a Japanese gravure idol and actress who won \"Miss Magazine 2008\".','1992-10-17',NULL),(408,'Sun Jingji','Changchun, Jilin, China','','1985-10-27',NULL),(409,'Louis Mandylor',' Melbourne, Australia','From Wikipedia, the free encyclopedia.  \n\nLouis Mandylor (born 13 September 1966) is an Australian film and television actor.Mandylor has enjoyed success in US television shows, such as a prominent guest appearance on Relic Hunter with Tia Carrere. Louis is probably most famous for his role in the movie My Big Fat Greek Wedding. Other major roles include playing Louis Malone in Martial Law alongside Sammo Hung. However, the show only lasted two seasons, with Mandylor being dropped at the end of its first season. Mandylor appeared in the sitcom Friends, pretending to be Joey\'s twin in \"The One With Unagi\". Additionally, he appeared in the third season of CSI: Miami as a robber/killer. He and his brother Costas have acted alongside each other in the Charmed episode \"Saving Private Leo\" and a short movie written and produced by Louis entitled My Brother Cicero. Louis portrayed Deputy Lloyd in the Syfy thriller film The Cursed, he stars alongside his brother Costas. One of his more popular roles was that of Bobby DeLuca in the cult-classic Suckers, where he plays a good-guy turned car salesman.\n\nDescription above from the Wikipedia article Louis Mandylor, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-09-13',NULL),(410,'Alina Faye',NULL,'',NULL,NULL),(411,'Bleona','Albania','BLEONA, the International pop icon, redeﬁnes the word “DIVA” in her uncontainable rise to stardom  Her powerful vocals, charmingly brash persona and reputation as an electrifying performer, have lifted her to the Top of the Billboard music charts.  BLEONA is a multiple award-winning, multi-lingual recording artist. She’s sold more than 5million records, graced over FORTY magazine covers, and performed for millions of fans — all while operating as a completely independent artist.  In the past few years alone, Bleona has broken the Top Ten Billboard Dance Club Songs chart with her #1 Hit “I Don’t Need Your Love” and #3 Hit “Take You Over”.\n\nThe track “Wicked Love,” spotlighted and scored the #12 spot in 2018 as well.\n\nBLEONA additionally made her “directorial debut” with two stunning videos, one for her 2018 single “I Don’t Need Your Love” and another for the epic, smoldering, follow-up ballad “Monster”.\n\nA beloved luminary, drawing record crowds of up to 70,000 in her native Albania, she continues to perform to consistent sold-out shows.  Through it all, Bleona has embraced the thrill of playing by her own rules, while at the same time, respecting her craft, and embracing her ever-growing fan base.  BLEONA’s native creative ability has transformed her into a triple-threat phenomenon that has presented no limits to her larger-than-life talents.  For more information visit https://www.bleona.com and follow @BLEONA','1985-05-14',NULL),(412,'Mary Treen','Saint Louis, Missouri, USA','From Wikipedia, the free encyclopedia:\n\nMary Treen (born Mary Louise Summers, March 27, 1907 – July 20, 1989) was an American film and television actress, a familiar face who brought levity to the screen. A minor actress for much of her career, she managed to secure a plain, unassuming niche for herself in the Hollywood of the 1940s, 1950s, and 1960s.\n\nEarly years\n\nShe was born in St. Louis, Missouri, the daughter of attorney Don. C. Summers and actress Helene Sullivan Summers. In 1908, when Mary Louise was 11 months old, her mother sued her father for divorce on the grounds that he failed to provide for her. Her father died while she was an infant. She was reared in California by her mother and her stepfather, a physician. Treen attended the Westlake School for Girls and a convent where she tried out successfully in school plays.\n\nCareer\n\nDuring her career, Treen was seen in over 40 films. Among her film roles were Tilly, the secretary of the Building and Loan, in It\'s a Wonderful Life (1946) and the role of Pat in the drama Kitty Foyle (1940) starring Ginger Rogers.\n\nHer longest-running role was as Hilda, the maid and baby nurse, in 64 episodes from 1962 to 1965 of the NBC and CBS sitcom The Joey Bishop Show. Earlier, in the 1954–1955 season, she was cast in thirty-eight episodes as Emily Dodger on the CBS sitcom Willy.\n\nDeath\n\nTreen died of cancer in Newport Beach, California, July 20, 1989. She was 82. Her only survivors were distant cousins. One of her cousins was actor Mort Mills.','1907-03-27','1989-07-20'),(413,'Stuart Quan','Fresno, California, USA','Stuart Quan was born on October 17, 1962 in Fresno, California, USA. He was an actor, known for Licence to Kill (1989), Escape from L.A. (1996) and Mighty Morphin Power Rangers (1995). He died on January 9, 2006 in Fresno, California, USA.','1962-10-17','2006-01-09'),(414,'Celeste Gregoire',NULL,'',NULL,NULL),(415,'Rajinikanth','Bangalore, Karnataka, India','Shivaji Rao Gaekwad, known by his mononymous stage name Rajinikanth, is an immensely popular actor in Tamil film industry of South India. He received the coveted Padma Vibhushan Award in 2016.  At the 45th International Film Festival of India (2014), he was conferred with the \"Centenary Award for Indian Film Personality of the Year\". At the 50th edition of the International Film Festival of India (2019), he was honoured with the Icon of Global Jubilee award. At the 67th National Film Awards, he was awarded the Dadasaheb Phalke Award.','1950-12-12',NULL),(416,'Laith Nakli','Plymouth, Devon, England, UK','Laith Nakli (born December 1, 1969) is a British actor and producer best known for his role in the 2017 movie The Wall as the voice of the mythical sniper named Juba, the 2017 miniseries The Long Road Home and 2018 movie 12 Strong as Commander Ahmed Lal. His parents are from Syria.','1969-12-01',NULL),(417,'Philippe Haussmann',NULL,'',NULL,NULL),(418,'Li Dongxue','中国,河南,郑州','','1982-11-27',NULL),(419,'Rose Colasanti',NULL,'',NULL,NULL),(420,'Cory Hardrict','Chicago, Illinois, USA','Cory D. Hardrict (born November 9, 1979) is an American actor and film producer.\n\nDescription above from the Wikipedia article Cory Hardrict, licensed under CC-BY-SA, full list of contributors on Wikipedia  ','1979-11-09',NULL),(421,'Caroline Aspirot',NULL,'',NULL,NULL),(422,'Tommy Nash',NULL,'',NULL,NULL),(423,'Daniele Pinheiro',NULL,'',NULL,NULL),(424,'Leo Vargas',NULL,'',NULL,NULL),(425,'Carlo Ettorre',NULL,'',NULL,NULL),(426,'Sam Lee','Hong Kong, British Crown Colony [now China]','Sam Lee Chan-Sam (born September 27, 1975) is an actor from Hong Kong, China. He started his film career when he was first spotted by director Fruit Chan who cast him in Made in Hong Kong. Since his debut, Sam has been working hard on many films. In 1999, he made thirteen films in that year alone. He appeared in a Japanese film Ping Pong as one of the contestants in the movie. Sam Lee is best known for the role of Sha Jang in the epic series of The Monkey King: Quest for the Sutra (2002).\n\nOutside of his film career, Sam is a seasonal member of a metal/hip-hop band Lazy Mutha Fucka (LMF) where he is the rapper. Sam Lee is also known as DJ Becareful.','1975-09-27',NULL),(427,'Cindi Arrata',NULL,'',NULL,NULL),(428,'Paul J.Q. Lee','New York City, New York, USA','','1950-03-19','2014-01-18'),(429,'Anny Rosario',NULL,'Anny Rosario is a multi cultural actress known for her portrayal of complex, fearless, and vivacious women. She was born in Dominican Republic and came to the US at the age of 9, and had a rich and dual upbringing that has given her a great perspective that she uses to build her characters. After spending most of her life in a little witch city called Salem, in MA, she finally made the leap to the City of Angels in 2012. Since then, she has forged a niche for herself playing strong women who aren\'t afraid of showing vulnerability.',NULL,NULL),(430,'Lucy Faust','New Orleans, Louisiana, USA','Lucy Faust is an American actress born in New Orleans, Louisiana.','1986-05-12',NULL),(431,'Goffredo Unger','Oslo, Norway','','1933-06-06','2009-05-01'),(432,'Casey Grisham',NULL,'',NULL,NULL),(433,'Masaki Kiryu',NULL,'',NULL,NULL),(434,'Makar Zaporozhskiy','Russia','As one of Russia\'s most promising actors, Makar recently starred in the key role of ‘Nikolai’ in RED SPARROW, a feature film starring Jennifer Lawrence, and Joel Edgerton. Before this, he played ‘Ryabov’ in MATA HARI and leading roles in the Russian films 22 MINUTES, and DARK WORLD: EQUILIBRIUM.','1989-09-05',NULL),(435,'Frank Powers','Hornell, New York, U.S.A.','','1975-07-16',NULL),(436,'Kelly Dealyn',NULL,'',NULL,NULL),(437,'Robert Duvall','San Diego, California, USA','Robert Selden Duvall (born January 5, 1931) is an American actor and filmmaker. He is the recipient of an Academy Award, four Golden Globe Awards, a BAFTA Award, two Primetime Emmy Awards and a Screen Actors Guild Award.\n\nDuvall began appearing in theater in the late 1950s, moving into television and film roles during the early 1960s, playing Boo Radley in To Kill a Mockingbird (1962) and appearing in Captain Newman, M.D. (1963), as Major Frank Burns in the blockbuster comedy M*A*S*H (1970) and the lead role in THX 1138 (1971), as well as Horton Foote\'s adaptation of William Faulkner\'s Tomorrow (1972), which was developed at The Actors Studio and is his personal favorite. This was followed by a series of critically lauded performances in commercially successful films.\n\nHe has starred in numerous films and television series, including The Twilight Zone (1963), The Outer Limits (1964), The F.B.I. (1966), Bullitt (1968), True Grit (1969), Joe Kidd (1972), The Godfather (1972), The Godfather Part II (1974), The Conversation (1974), Network (1976), Apocalypse Now (1979), The Great Santini (1979), Tender Mercies (1983) (which earned him the Academy Award for Best Actor), The Natural (1984), Colors (1988), Lonesome Dove (1989), The Handmaid\'s Tale (1990), Days of Thunder (1990), Rambling Rose (1991), Falling Down (1993), Secondhand Lions (2003), The Judge (2014), and Widows (2018).\n\nFrom Wikipedia, the free encyclopedia','1931-01-05',NULL),(438,'Velimir Velev',NULL,'',NULL,NULL),(439,'Wei Xiaojun','中国,黑龙江,哈尔滨','','1978-03-14',NULL),(440,'Grid Margraf',NULL,'',NULL,NULL),(441,'Oliver Rayon','Puebla, Puebla, Mexico','','1983-08-18',NULL),(442,'Dick Rush','Austria','From Wikipedia, the free encyclopedia\n\nRichard T. Rush (born 1884) was an Austrian-born American character actor of the silent and sound film eras. During his 28-year career, he would appear in between 160-300 films (depending on the source). The large majority of his parts were smaller roles, although he would occasionally be cast in a smaller featured role.\n\nHis first part was in the silent 1920 film, Three Gold Coins, starring Tom Mix. His final appearance would be in 1948\'s Devil\'s Cargo, part of \"The Falcon\" film series.',NULL,NULL),(443,'Mitsuki Tanimura','Osaka, Osaka Prefecture, Japan','Mitsuki Tanimura (谷村 美月 Tanimura Mitsuki) is a Japanese actress.\n\nTanimura was born in Sakai, Osaka. She starred in Akihiko Shiota\'s Canary and Norio Tsuruta\'s Orochi. She has also appeared in films such as Takashi Miike\'s God\'s Puzzle, Junji Sakamoto\'s Strangers in the City, and Kazuyoshi Kumakiri\'s Sketches of Kaitan City.\n\nDescription above from the Wikipedia article Mitsuki Tanimura, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1990-06-19',NULL),(444,'Rolando De Santis',NULL,'',NULL,NULL),(445,'Kevin Costner','Lynwood, California, USA','Kevin Michael Costner (born January 18, 1955) is an American actor and filmmaker. He has received two Academy Awards, two Golden Globe Awards, a Primetime Emmy Award, and two Screen Actors Guild Awards.\n\nCostner starred in Fandango, American Flyers, Silverado and many other films. He rose to prominence with his starring roles in The Untouchables and No Way Out (1987). He then starred in Bull Durham (1988), Field of Dreams (1989), Dances with Wolves (1990), for which he won two Academy Awards, JFK (1991), Robin Hood: Prince of Thieves (1991), The Bodyguard (1992), A Perfect World (1993), and Wyatt Earp (1994). In 1995, Costner starred in and co-produced Waterworld. His second directorial feature, The Postman, was released in 1997.\n\nHe later starred in Message in a Bottle (1999), For Love of the Game (1999), Thirteen Days (2000), 3000 Miles to Graceland (2001), Dragonfly (2002), Rumor Has It (2005), The Guardian (2006), Mr. Brooks (2007), 3 Days to Kill (2014), McFarland, USA (2015), Draft Day (2014), and Criminal (2016). He has also played supporting parts in such films as The Upside of Anger (2005), Man of Steel (2013), Hidden Figures (2016), Molly\'s Game (2017), and Let Him Go (2020).\n\nOn television, Costner portrayed Devil Anse Hatfield in the miniseries Hatfields & McCoys (2012), winning the Primetime Emmy Award for Outstanding Lead Actor in a Limited Series or Movie. Since 2018, he has starred as John Dutton on the drama series Yellowstone for which he received a Screen Actors Guild Award nomination.','1955-01-18',NULL),(446,'Marcus Giamatti','New Haven - Connecticut - USA','Marcus Giamatti is an American actor, best known for being a regular member of the cast of the CBS drama series Judging Amy. He is the younger brother of actor Paul Giamatti.','1961-10-03',NULL),(447,'Bill Dow','Sault Sainte Marie, Ontario, Canada','Bill Dow is an actor, director and writer in theatre, film, and television. He is best known for playing Bill Lee in the StarGate franchise.','1951-10-17',NULL),(448,'Angela Sabrina',NULL,'',NULL,NULL),(449,'Dominic \'Taz\' Alexander',NULL,'',NULL,NULL),(450,'Thomas Hudak',NULL,'',NULL,NULL),(451,'Powers Boothe','Snyder, Texas, U.S.','From Wikipedia, the free encyclopedia.\n\nPowers Allen Boothe (June 1, 1948 – May 14, 2017) was an American television and film actor. He won an Emmy in 1980 for his portrayal of Jim Jones in Guyana Tragedy: The Story of Jim Jones. He also played saloon owner Cy Tolliver on Deadwood, \"Curly Bill\" Brocius in Tombstone, President Noah Daniels on 24, and Lamar Wyatt in Nashville.\n\nDescription above from the Wikipedia article Powers Boothe, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1948-06-01','2017-05-14'),(452,'Lara Grice','New Orleans, Louisiana, USA','Lara Grice was born on August 11, 1971 in New Orleans, Louisiana, USA. Lara is an actor, known for Girls Trip (2017), Logan (2017) and Queen Sugar (2016).','1971-08-11',NULL),(453,'Nick Court',NULL,'',NULL,NULL),(454,'Samuel Smith',NULL,'Samuel Smith is an actor.',NULL,NULL),(455,'Amy Jackson','Douglas, Isle of Man, UK','Amy Louise Jackson is a British model and actress, who appears in Indian films, primarily in Tamil, Hindi and Telugu films. After college, she began modelling at age 16, going on to win the 2009 Miss Teen World competition and the 2010 Miss Liverpool title. Subsequently, Tamil film director A L Vijay spotted her and introduced Jackson as an actress in the 2010 Tamil period-drama Madrasapattinam. While further pursuing her modelling career in the UK, Jackson continued working in India and went on to début in other film industries in the next years. She had her first Bollywood release in 2012, the romantic drama Ekk Deewana Tha while 2012 saw the release of her first Telugu film Yevadu.','1992-01-31',NULL),(456,'Isabelle Champeau','Montreal, Quebec, Canada','Isabelle was born in Montreal, Quebec, Canada on April 19 to Marie-Anne and Jean-Pierre Champeau. She is the middle child of three girls. Isabelle\'s natural charm and beauty propelled her into the world of acting and modeling at the tender age of 17. Before long, she was hired for a series of commercials and she guest starred on several TV Shows. Isabelle\'s acting career began with a bang when she was handpicked from a crowd of over 500 teenagers to roller-blade in a McDonald\'s commercial. When Isabelle was 19, a talent scout selected her for a three-month modeling stint in Japan and later on in Spain. Although most of the assignments were print work, Isabelle spent one memorable week riding motorcycles for Kawasaki near Mount Fuji in Japan. Isabelle has always been a girl on the go. She loves yoga, soccer, swimming, rock climbing, skating, snorkeling, and dancing. She developed her team spirit through gymnastics and volleyball games. When Isabelle was in her early 20s, her parents divorced. A few years later, while she was completing a university degree, her estranged father developed cancer. Isabelle dedicated herself to nursing her ailing father. Education has always been a priority in her agenda. After a brief foray in science with a view to pursue veterinary studies, Isabelle took some courses in scriptwriting at Quebec University. Then she decided to pursue this passion and completed her BA in Communications Studies at Concordia University in Montreal. Isabelle further developed her interest in film by working as an assistant to her mentor Father Marc Gervais, a film analysis teacher, author and judge at the Cannes Film Festival. Next, she attended, The International Film and Video workshops in Rockport, Maine, USA. Three weeks after her arrival, Isabelle was offered an assistant teaching position. Shortly thereafter, she went to Los Angeles to study script analysis and acting with Judith Weston. In 2002, she acted and danced in \"The Best of Billy Joel\" music video, which appeared in Canada and the USA. She has been attending Warren Robertson theater workshops since 2002. In addition to acting, Isabelle is also interested in other facets of the entertainment industry. She has worked in casting for children\'s television shows (Caillou for PBS). And Isabelle has written, directed and produced documentaries, corporate videos, short films and a music video \"Red light\". She also is an assistant and location manager for photographers, TV Shows and films. In early 2007, Isabelle wrote, produced and had the lead role in The Valley - a short film based on a true story.',NULL,NULL),(457,'George F. Miller','Yonkers, New York, USA','','1961-10-21',NULL),(458,'Fernando Rey','A Coruña, Galicia, Spain','Fernando Rey  (September 20, 1917 – March 9, 1994) — best known as Fernando Rey — was a Spanish film, theatre, and TV actor, who worked in both Europe and the United States. A suave, international actor best known for his roles in the films of surrealist director Luis Buñuel (Tristana, 1970; Discreet Charm of the Bourgeoisie, 1972; That Obscure Object of Desire, 1977) and as a drug lord in The French Connection (1971), he appeared in more than 150 films over half a century.\n\nThe debonair Rey was described by French Connection producer Philip D\'Antoni as \"the last of the Continental guys\". He achieved his greatest notoriety after he turned 50: \"Perhaps it is a pity that my success came so late in life\", he told The Times of Madrid in 1973. \"It might have been better to have been successful while young, like El Cordobes in the bullring. Then your life is all before you to enjoy it.\"','1917-09-20','1994-03-09'),(459,'Alude Mahali',NULL,'',NULL,NULL),(460,'Daphne Matthews','USA','',NULL,NULL),(461,'Tammy Klein',NULL,'','1963-10-07',NULL),(462,'Scott Burn','Pittsburgh, Pennsylvania, USA','',NULL,NULL),(463,'Dewi Irawan','Jakarta, Indonesia','Ia adalah putri ketiga dari pasangan aktris Ade Irawan dengan almarhum aktor Bambang Irawan dan kakak dari Ria Irawan. Biarpun Bambang Irawan (1932-1979) punya 5 anak, tetapi yang menonjol dalam dunia film hanyalah Dewi dan Ria Irawan. Dibawah \"asuhan\" ayahnya, Dewi yang berdarah Minang Jawa ini sudah mengenal dunia akting sejak Taman Kanak-kanak. Selain itu ia juga menguasai beberapa tarian tradisional dan olahraga, sebelum mulai dikenal ketika bermain dalam film Belas Kasih (1973). Sesudah ayahnya meninggal, Dewi masih bermain dalam beberapa film bertema remaja seperti Anak-Anak Buangan (1979) dan lain-lain. Dewi sempat cukup lama meninggalkan Indonesia untuk tinggal bersama dengan suami dan anaknya di Milan, Italia. Pada saat ini ia telah kembali dan menetap di Indonesia.','1963-06-13',NULL),(464,'Leigh Burrows',NULL,'',NULL,NULL),(465,'Eabha MacCabe',NULL,'',NULL,NULL),(466,'Pisarn Srimunkhong',NULL,'',NULL,NULL),(467,'Hideki Chiba',NULL,'',NULL,NULL),(468,'Benjamin Poe',NULL,'',NULL,NULL),(469,'Hirotaro Honda','Ibaraki, Japan','','1951-02-08',NULL),(470,'Zena Marie Ghanney',NULL,'',NULL,NULL),(471,'Jimmy Fu Git-Ming',NULL,'',NULL,NULL),(472,'Qu Yang',NULL,'',NULL,NULL),(473,'Gennady Gorbachev','Moscow, USSR (Russia)','','1980-01-25',NULL),(474,'Henry Ian Cusick','Trujillo, Peru','From Wikipedia, the free encyclopedia.\n\nHenry Ian Cusick (born April 17, 1967) is a Scottish-Peruvian actor of stage, television, and film. He is well-known for his role as Desmond Hume on the United States television series Lost, for which he received a Primetime Emmy Award nomination.','1967-04-17',NULL),(475,'Brett Gelman','Highland Park, Illinois, USA','Brett Clifford Gelman is an American actor and comedian. He was born on October 6, 1976, in Highland Park, Illinois. He is best known for his roles as Murray Bauman in the Netflix series Stranger Things and Martin on the BBC series Fleabag.\n\nGelman began his career as a comedian in the early 2000s. He performed in numerous comedy clubs and improv theaters in New York City. In 2009, he was a writer and performer on the sketch comedy series Eagleheart. He also had a recurring role on the comedy series Another Period.\n\nIn 2016, Gelman was cast as Murray Bauman in the third season of Stranger Things. His character is a conspiracy theorist who helps the main characters investigate the supernatural events in Hawkins, Indiana. Gelman has since appeared in all four seasons of the show.\n\nIn 2016, Gelman also starred in the BBC series Fleabag. He played Martin, the boyfriend of the show\'s main character, Fleabag. Gelman\'s performance was critically acclaimed, and he was nominated for a Primetime Emmy Award for Outstanding Supporting Actor in a Comedy Series.\n\nGelman has also appeared in numerous films, including The Other Guys (2010), 30 Minutes or Less (2011), and A Very Harold & Kumar 3D Christmas (2011). He has also had recurring roles on the television shows Go On, Married, and Camping.','1976-10-06',NULL),(476,'Mateo Herreros',NULL,'',NULL,NULL),(477,'Aleksandr Bible',NULL,'',NULL,NULL),(478,'Susan Ling Young',NULL,'',NULL,NULL),(479,'Janine Manuel',NULL,'',NULL,NULL),(480,'Adolfo Celi',NULL,'From Wikipedia, the free encyclopedia\n\nAdolfo Celi (27 July 1922 –19 February 1986) was an Italian film actor and director.','1922-07-27','1986-02-19'),(481,'Bob DeCastro',NULL,'',NULL,NULL),(482,'Sara Malakul Lane','Thailand','Sara Malakul Lane is a successful Thai model and actress. She began modeling at the age of 14, and has also been in a number of big screen movies. Sara is of Thai-English descent.','1983-02-01',NULL),(483,'Ángela Molina','Madrid, Madrid, Spain','Ángela Molina (born 5 October 1955) is a Spanish actress, and a daughter of Antonio Molina, Spanish singer and actor.','1955-10-05',NULL),(484,'Sal Priadi',NULL,'Salmantyo Ashrizky Priadi or also known as Sal Priadi is an Indonesian singer, songwriter, and actor.','1992-04-30',NULL),(485,'James T. Mack','Chicago, Illinois, USA','','1871-05-16','1948-08-12'),(486,'Sylvia Lopez',NULL,'',NULL,NULL),(487,'Shane Woodward',NULL,'',NULL,NULL),(488,'Valerie Tian','Vancouver, British Columbia, Canada','Valerie Tian (born April 21, 1989) is a Canadian actress. She is known for her role as Su-Chin in Juno. Tian auditioned for Canadian director Mina Shum in the summer of 2001, while Shum was casting for Long Life, Happiness and Prosperity, and won the leading role of Mindy Ho. The film premiered at the Toronto International Film Festival in 2002, and was shown at the Sundance Film Festival and LA Asian American Film Festival in 2003. In 2004, she played alongside Jean-Claude Van Damme in the action movie Wake of Death. She also had a cameo appearance inThe Sisterhood of the Traveling Pants, and leading roles in the Wake of Death and the short film, Chika\'s Bird. She also appeared as an X kid in X2 and X-Men United, and as an elf in Disney’s Santa Clause 2. Tian was a series regular on the Warner Brothers\' television series, Black Sash, and appeared in a cameo role in the ABC seriesThe Days. She is currently a series regular on the CTV series, \"Motive.\"','1989-04-21',NULL),(489,'Robert Bizik','Philadelphia, Pennsylvania, USA','','1947-03-04',NULL),(490,'Billy Blair','El Paso, Texas, USA','Born in El Paso, TX and related to the great Edgar Allan Poe, Billy knew what he wanted to do at the ripe age of 5 after experiencing Sesame Street and KISS. He comes from a musical background. His great grandfather led his big band during the early 1900\'s in Mexico performing for some of history\'s greatest figures such as Pancho Villa. He also had uncles and cousins, all which played in big bands and symphonies.\n\nFor all of Billy\'s life, he was dedicated to music and still proceeds to endeavor this lifestyle. Being in numerous bands, he would experience touring the nation, playing in clubs, theaters, arenas and amphitheaters; fulfilling the dream and opening for some of the biggest names of rock.\n\nBy the mid 90\'s, Billy decided to pursue in acting. He would develop his skills in theater at Richland College in Richardson, TX and would resume with taking private lessons from the greatest acting coaches in Texas. Building his resume with small, local indie films. Landing in a national commercial, then booking roles in bigger films like Jonah Hex starring Josh Brolin. He is known for some of his great work in films like The Last Stand starring Arnold Schwarzenegger and Robert Rodriguez\'s Machete, Machete Kills and Sin City: A Dame To Kill For.  - IMDb Mini Biography','1986-05-12',NULL),(491,'John Teal Jr.',NULL,'',NULL,NULL),(492,'Eka Tioda',NULL,'',NULL,NULL),(493,'Pat Flaherty','Washington, District of Columbia, USA','Edmund Joseph Flaherty (March 8, 1897 – December 2, 1970) was an American film actor who appeared in about 200 films.','1897-03-08','1970-12-02'),(494,'J. Omar Castro','Metairie, Louisiana, USA','','1974-11-20',NULL),(495,'Kwasi Songui',NULL,'',NULL,NULL),(496,'Mona Hammond','Clarendon, Jamaica, British West Indies [now Jamai','From Wikipedia, the free encyclopedia\n\nMavis Chin OBE (born January 1, 1931), known professionally as Mona Hammond is a Jamaican-British actress of Chinese descent and co-founder of the Talawa Theatre Company. Born in Jamaica, Hammond emigrated to the United Kingdom in 1959, where she has lived ever since. Hammond has had a long and distinguished stage career.  She is best known for her work on British television, most notably playing Blossom Jackson in the BBC soap opera EastEnders.\n\nDescription above from the Wikipedia article Mona Hammond, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1931-01-01','2022-07-04'),(497,'Billy Postlethwaite',NULL,'','1989-01-01',NULL),(498,'Christopher Dingli',NULL,'',NULL,NULL),(499,'Paul Tierney',NULL,'',NULL,NULL),(500,'Ittoku Kishibe','Kyoto, Kyoto Prefecture, Japan','Ittoku Kishibe (岸部一徳) is a Japanese actor, bassist, and lyricist.  He originally entered showbusiness as the bassist for the Japanese rock bands The Tigers, PYG, and Inoue Takayuki Band, but later switched to acting. The veteran of over 115 films, he won the Japanese Academy Award for Outstanding Actor in a Leading Role in 1991 for \"The Sting of Death,\" and was nominated for the Best Supporting Actor award in 1994. He has an agency, UN et NEUF, and he is the president of Kenji Sawada\'s private office \"Kokoro Co., Ltd.\"','1947-01-08',NULL),(501,'Austin Shook',NULL,'',NULL,NULL),(502,'Tamara Jones','Miami, Florida, USA','',NULL,NULL),(503,'James Joseph Pulido',NULL,'',NULL,NULL),(504,'Flávio Belinni',NULL,'',NULL,NULL),(505,'Sergio Testori','Italy','Sergio Testori was an Italian actor and Stuntman, most active from the 1960\'s to the 1980\'s. He is retired and lived out his retirement in Argentina. Reportedly he passed away in 2007.','1935-04-30','2007-09-24'),(506,'Nataliya Makhrova','Moscow, USSR (Russia)','','1953-06-10',NULL),(507,'Maï Anh Le','Paris, France','Maï Anh Le is a French actress. She studied economics and management, while supporting herself by working as a model. She began her acting career in 2002 with the role of Akemi in Giodano Gederlini\'s feature film Samourais. In 2003, she acted with Sandrine Bonnaire in the TV series La Maison des Enfants. She also starred in 2004 Jean-Jacques Annaud film Two Brothers.\n\nSource: Article \"Maï Anh Le\" from Wikipedia in English, licensed under CC-BY-SA 3.0.',NULL,NULL),(508,'Cindy Busby','Montreal, Quebec, Canada','Cindy Busby was born on March 18, 1983 in Montreal, Quebec, Canada. Cindy is an actress, known for The Big Year (2011), Diary of a Wimpy Kid (2010) and Supernatural (2005). Ms. Busby is the female lead, Elizabeth Scott, in the Hallmark romance, Unleashing Mr. Darcy (2016), (homage to Jane Austen\'s \"Pride and Prejudice\").','1983-03-18',NULL),(509,'Bradley Connor',NULL,'',NULL,NULL),(510,'Brian Wagner',NULL,'',NULL,NULL),(511,'Angelo Casadei',NULL,'',NULL,NULL),(512,'Matt Callan',NULL,'',NULL,NULL),(513,'Amber Stevens West','Los Angeles, California, USA','Amber Dawn West is an American actress and model. She is best known for her roles as Ashleigh Howard in the ABC Family series Greek and Maya in 22 Jump Street. She is also professionally known as Amber Stevens West.','1986-10-07',NULL),(514,'Keith D. Evans',NULL,'',NULL,NULL),(515,'Norival Rizzo','São Paulo, São Paulo, Brazil','','1952-04-28',NULL),(516,'Jason Griffith',NULL,'',NULL,NULL),(517,'Shebin Benson','Nilambur, Kerala,India','Shebin Benson is an Indian film actor who predominantly features in Malayalam movies. He made his debut in the 2013 film Idukki Gold, under the direction of Aashiq Abu. Revolving around a group of friends who are on the lookout for their old friends, Shebin was cast to play the younger self of Maniyanpilla Raju\'s character in the film. He then went on to feature in the Mammootty starrer drama film Varsham, followed by the role of teen Aloshy in the Amal Neerad movie IyobintePustakam and also did the teen Dawood in the action comedy film Inspector Dawood Ibrahim (2016). His other project in 2016 was Don Max\'s directorial venture 10 Kalpanakal, in which he starred as part of the supporting cast, whereas Anoop Menon and Prashant Narayanan played the lead roles. His 2017 movie includes Kaattu, which stars Asif Ali, Murali Gopy, Varalaxmi Sarathkumar and Manasa Radhakrishnan in the lead roles, under the direction of Arun Kumar Aravind. In 2018 he did his first lead movie Kaly which is directed by Najeem Koya and produced by August CInemas and he also played the younger version of Sethu Madhavan in the movie Mohanlal directed by Sajid Yahiya. His upcoming movies are Paviettante Madhurachooral and Oronnonnara Pranaya Kadha.','1995-11-27',NULL),(518,'Sam Stone',NULL,'',NULL,NULL),(519,'Narci Regina',NULL,'',NULL,NULL),(520,'Denis McKeown',NULL,'',NULL,NULL),(521,'Merlin Leonhardt',NULL,'',NULL,NULL),(522,'Alex Beh',NULL,'',NULL,NULL),(523,'David Morse','Hamilton, Massachusetts, USA','David Bowditch Morse (born October 11, 1953) is an American stage, television, and film actor. He first came to national attention as Dr. Jack Morrison in the medical drama St. Elsewhere from 1982 to 1988. Morse continued his movie career with roles in Dancer in the Dark, The Negotiator, The Green Mile, Disturbia, The Long Kiss Goodnight, The Crossing Guard, The Rock, Extreme Measures, Twelve Monkeys, 16 Blocks, and Hounddog.\n\nIn 2006, Morse had a recurring role as Detective Michael Tritter on the medical drama House for which he received an Emmy Award nomination.  Morse portrayed George Washington in the 2008 HBO Miniseries John Adams, which garnered him a second Emmy nomination. Morse has received acclaim for his portrayal of Uncle Peck on the Off-Broadway play How I Learned to Drive for which he earned a Drama Desk and Obie Award. He also had success on Broadway, portraying James \"Sharky\" Harkin in The Seafarer. As of 2011, Morse is a regular on the HBO series, \"Treme\".\n\nFrom Wikipedia, the free encyclopedia','1953-10-11',NULL),(524,'Emilio Roso',NULL,'','1976-08-22',NULL),(525,'David Adams',NULL,'',NULL,NULL),(526,'Gerard Butler','Paisley, Scotland, UK','Gerard James Butler (born 13 November 1969) is a Scottish actor and film producer. After studying law, he turned to acting in the mid-1990s with small roles in productions such as Mrs Brown (1997), the James Bond film Tomorrow Never Dies (1997), and Tale of the Mummy (1998). In 2000, he starred as Count Dracula in the gothic horror film Dracula 2000 with Christopher Plummer and Jonny Lee Miller.\n\nHe played Attila the Hun in the miniseries Attila (2001), then appeared in the films Reign of Fire with Christian Bale (2002) and Lara Croft: Tomb Raider – The Cradle of Life with Angelina Jolie (2003) before playing André Marek in the adaptation of Michael Crichton\'s science fiction adventure Timeline (2003). He then was cast as Erik, The Phantom in Joel Schumacher\'s 2004 film adaptation of the musical The Phantom of the Opera, with Emmy Rossum; it earned him a Satellite Award nomination for Best Actor.\n\nButler gained worldwide recognition for his portrayal of King Leonidas in Zack Snyder\'s fantasy war film 300. That role earned him nominations for an Empire Award for Best Actor and a Saturn Award for Best Actor and a win for MTV Movie Award for Best Fight. He voiced Stoick the Vast in the critically and commercially successful How to Train Your Dragon franchise (2010–2019). Also in the 2010s, he portrayed Secret Service agent Mike Banning in the action thriller series Olympus Has Fallen, London Has Fallen, Angel Has Fallen and the upcoming Night Has Fallen. He played military leader Tullus Aufidius in the 2011 film Coriolanus, a modern adaptation of Shakespeare\'s tragedy of the same name, and Sam Childers in the 2011 action biopic Machine Gun Preacher.','1969-11-13',NULL),(527,'Dee Wallace','Kansas City, Kansas, USA','Dee Wallace (born 14 December 1948) is an American actress and comedienne. She is perhaps best known for her roles in several popular films. These include the starring role as Elliot\'s mother in the Steven Spielberg film E.T. the Extra-Terrestrial (1982), her most widely seen role. She also played key roles in popular cult films The Hills Have Eyes (1977) and The Howling (1981) and appeared in The Stepford Wives in 1975 and 10 (1979). In total, Wallace has appeared in more than 85 films.','1948-12-14',NULL),(528,'Nancy Linehan Charles','New York City, New York, USA','','1942-12-11',NULL),(529,'Jack Fulton','Canada ','Jack Fulton is a Canadian film and television child actor.','2006-01-12',NULL),(530,'Jeff Swearingen',NULL,'',NULL,NULL),(531,'Wayne Crawford','Geneva, New York, USA','From Wikipedia, the free encyclopedia.\n\nWayne Crawford is an American film and television actor, and film producer, screenwriter, and director. Crawford has appeared in nearly thirty films, produced 15, written 9, and directed 7.\n\nCrawford received his Bachelor of Arts degree from Florida Atlantic University and has served at the University of North Carolina School of the Arts teaching directing for their School of Filmmaking .\n\nThe Variety Movie Guide called his portrayal of the title character in the film Jake Speed \"well played\" and stated he delivered his lines \"as an old-fashioned paperback hero would - in cliches\". He directed and starred in Crime Lords, which was called \"predictable\" by DVD & video guide 2005 while the Variety TV Review called it unpretentious and entertaining.\n\nHe co-wrote and co-produced the film Valley Girl with Andrew Lane He fought against the studio to ensure that Martha Coolidge was maintained as the director.\n\nDescription above from the Wikipedia article Wayne Crawford, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1947-02-11','2016-04-30'),(532,'Gary Carr','London, England, UK','Gary Carr (born 11 December 1986) is an English actor, dancer, singer, and musician known for his works on screen and stage. He has had main character roles in BBC TV series Death in Paradise and US TV series The Deuce. He is also known for playing an American jazz singer named Jack Ross in the ITV historical drama Downton Abbey.\n\nFrom Wikipedia, the free encyclopedia','1986-12-11',NULL),(533,'Billy Franey','Chicago, Illinois, USA','','1889-06-23','1940-12-06'),(534,'Christina Bach','Miami, Florida, USA','',NULL,NULL),(535,'David Sparrow','Sollihull, England, UK','','1962-03-04',NULL),(536,'Shvan Aladdin',NULL,'',NULL,NULL),(537,'Pablo Schreiber','Ymir, British Columbia, Canada','Pablo Tell Schreiber (born April 26, 1978) is a Canadian actor known for his dramatic stage work and for his portrayal of Nick Sobotka on The Wire and for his Emmy nominated role of George Mendez on Orange Is the New Black. He was nominated for a Tony Award for his performance in Awake and Sing! on Broadway. He also narrated the American Psycho audiobook. He also starred in the HBO series The Brink as Lieutenant Commander Zeke “Z-Pak” Tilson, a Naval pilot who is also a drug dealer, and played a leading role in the Michael Bay film 13 Hours: The Secret Soldiers of Benghazi (2016). He also played William Lewis on Law and Order Special Victims Unit.','1978-04-26',NULL),(538,'Marcos Adamantiadis',NULL,'',NULL,NULL),(539,'Margaret Lindsay','Dubuque, Iowa, USA','From Wikipedia, the free encyclopedia\n\nMargaret Lindsay (born Margaret Kies; September 19, 1910 – May 9, 1981) was an American film actress. Her time as a Warner Bros. contract player during the 1930s was particularly productive. She was noted for her supporting work in successful films of the 1930s and 1940s such as Jezebel (1938) and Scarlet Street (1945) and her leading roles in lower-budgeted B movie films such as the Ellery Queen series at Columbia in the early 1940s. Critics regard her portrayal of Nathaniel Hawthorne\'s Hepzibah Pyncheon in the 1940 film adaptation of The House of the Seven Gables as Lindsay\'s standout career role.','1910-09-19','1981-05-09'),(540,'Al Hill','New York City, New York, USA','Al Hill (July 14, 1892 – July 14, 1954) was an American film character actor who appeared in over 320 films between 1927 and 1954, including the 1951 film The Girl on the Bridge. Hill died in 1954 on his 62nd birthday.\n\nDescription above from the Wikipedia article Al Hill (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.','1892-07-13','1954-07-14'),(541,'George Eastman','Genoa, Italy','George Eastman (born Luigi Montefiori; August 16, 1942) is an Italian B-movie actor and screenwriter.\n\nEastman was born in Genoa, Italy. He took his Americanized alias \"George Eastman\" when he was cast as a \"heavy\" in many spaghetti westerns made in the late 1960s and early 1970s. In 1972 he performed the villain in the movie The Call of the Wild together with Charlton Heston (directed by Ken Annakin). Eastman later became a regular performer in many movies directed by Joe D\'Amato, for whom he also became a screenwriter. He was a very familiar face in Italian B-cinema in the early 1980s, being generally cast as the villain, thanks to his height (he is 6\'9\" tall) and his dark and menacing looks and exaggerated acting style. His most famous movie is the gory horror film Anthropophagous, directed by Joe D\'Amato in 1980.\n\nHe appeared in the 1985 biblical film King David as Goliath for a flashback. In 1986, he performed as Stefano in the movie Regalo di Natale, directed by Pupi Avati. Eastman quit acting in the late 1980s to concentrate on his writing assignments. He is now a decently-rated author in Italian television and only holds occasional roles. In 2003, he was one of the main characters in the movie La rivincita di Natale directed by Pupi Avati.\n\nFrom Wikipedia, the free encyclopedia','1942-08-16',NULL),(542,'Michelle Maren',NULL,'Michelle Maren was born in New Jersey. After leaving home at the tender age of 17, she sought fame and fortune in New York. In 1981, she won the titles of \"Miss Chelsea\" and \"Miss Big Apple\" and then decided to take her chances in Atlantic City. At Resorts International Casino, she worked on stage as an assistant to magician Richiardi in the show, \"Witness the Impossible.\" Her image appeared on many men\'s magazine covers and she also appeared in \"National Lampoon.\"',NULL,NULL),(543,'Robert John Burke','New York City, New York, USA','A born-and-bred New Yorker, Robert John Burke made his film debut while in his early 20s with a small part in the drama \"The Chosen\" (1981), based on the Chaim Potok story. He went on to study acting at SUNY Purchase where he met aspiring filmmaker Hal Hartley, who cast him as one of the leads in his debut feature \"The Unbelievable Truth,\" an offbeat indie tale where he played a man trying to escape his troubled past. Working with Hartley again on the charming brother-centric dark comedy \"Simple Men,\" Burke caught a major break when Hollywood producers decided that his chiseled jawline was the right one to replace Peter Weller\'s in the sci-fi/action sequel \"RoboCop 3.\" Despite Burke\'s efforts, the movie tanked, and he went on to smaller roles in major films, including the lauded Western \"Tombstone\" (1993) and the prison-break movie \"Fled\" (1996). Burke landed his second chance in a Hollywood starring role with the Stephen King adaptation \"Thinner\" (1996), but the macabre tale, which featured him under heavy makeup to depict a callous man who magically loses weight, was deemed almost universally unlikable.Though Burke\'s leading-man days were mostly behind him, his beastly role in Hartley\'s \"No Such Thing\" (2001) aside, he soldiered on, and began increasingly working on television with recurring roles on the grim prison drama \"Oz\" and the police procedural \"Law & Order: Special Victims Unit\" (NBC, 1999- ). Appearing in George Clooney\'s first two movies as director, \"Confessions of a Dangerous Mind\" (2002) and \"Good Night, and Good Luck.\" (2005), Burke nonetheless became more familiar to TV audiences, particularly when he signed on to play Mickey Gavin, the ex-priest cousin of Denis Leary\'s lead character on the firefighter series \"Rescue Me,\" a part that dovetailed with Burke\'s real-life second job as a New York State fireman.Often cast as a tough guy, the ruggedly handsome and tall actor continued to play imposing figures such as Major General James \"Chaos\" Mattis in the Iraq War miniseries \"Generation Kill\" (HBO, 2008) and Bart Bass, the controlling billionaire father of Chuck Bass (Ed Westwick) on the soapy drama \"Gossip Girl.\" Before long, he was juggling his ongoing \"Law & Order: SVU\" part with regular spots on the military drama \"Army Wives\" (Lifetime, 2007- ) and the tense crime show \"Person of Interest\" (CBS, 2011- ), while still finding time for supporting turns in films, including the Denzel Washington/Mark Wahlberg action movie \"2 Guns\" (2013).','1960-09-12',NULL),(544,'Jayakrishnan',NULL,'',NULL,NULL),(545,'Peter Cena',NULL,'',NULL,NULL),(546,'Jin Au-Yeung','Miami, Florida, USA','Jin Au-Yeung (born June 4, 1982), known professionally as MC Jin, is an American rapper, songwriter, and actor of Hakka descent. He is the first Asian American rapper to be signed to a major record label in the United States. Born in Miami, Florida, and later living in New York City, he lived in Hong Kong for several years before returning to New York in the summer of 2012.','1982-06-04',NULL),(547,'Eliseu Paranhos','Santo André, São Paulo, Brazil','','1970-05-31',NULL),(548,'Kazuaki Naruse',NULL,'',NULL,NULL),(549,'James Joseph O\'Neil',NULL,'James Joseph O\'Neil is an actor.',NULL,NULL),(550,'Tchéky Karyo','Istanbul, Turkey','Tchéky Karyo (born October 4, 1953) is a Turkish-born French actor.\n\nDescription above from the Wikipedia article Tchéky Karyo, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1953-10-04',NULL),(551,'Aidan Devine','Hitchin, Hertfordshire, England, UK','Aidan Devine is a Canadian film actor. He was born in England and immigrated with his family to Canada at the age of 15. He studied at Dawson College\'s Dome Theatre in Montreal, Quebec and began his acting career in Montreal. He would later relocate to Toronto. His 1993 breakout role came in Denys Arcand\'s, Love and Human Remains. Since then he has worked steadily in Canadian and American television and cinema capturing two Gemini Awards; a best actor award in 1997 for his performance as Ted Lindsay in Net Worth and in 1998, a best supporting actor Gemini for his performance as airframe engineer, Jim Chamberlin in The Arrow. He has been nominated three other times.\n\nDescription above from the Wikipedia article Aidan Devine, licensed under CC-BY-SA, full list of contributors on Wikipedia.\n\n','1968-08-01',NULL),(552,'Scott Subiono',NULL,'Scott Subiono is an actor and producer.',NULL,NULL),(553,'Jake Austin Walker','Hattiesburg, Mississippi, USA','Jake Austin Walker (born June 24, 1997) is an American actor.','1997-06-24',NULL),(554,'William S. Wong',NULL,'',NULL,NULL),(555,'Tom Wlaschiha','Dohna, Germany','Thomas \"Tom\" Wlaschiha (born 20 June 1973) is a German TV, film, stage, and voice actor. Internationally, he is known for his role as Jaqen H\'ghar in the second season of the TV series Game of Thrones.\n\nWlaschiha was born in Dohna, then in East Germany. His surname is of Czech origin, as his ancestors arrived from there around the beginning of the 19th century. When he was 17 years old, shortly after the fall of the Berlin Wall, he traveled to New York City as an exchange student. He remained there for a year, acting in theater and studying English.Wlaschiha was born in Dohna, then in East Germany. His surname is of Czech origin, as his ancestors arrived from there around the beginning of the 19th century.','1973-06-20',NULL),(556,'James Bodnar',NULL,'',NULL,NULL),(557,'Alberto Pinto',NULL,'',NULL,NULL),(558,'Brendan Manning',NULL,'',NULL,NULL),(559,'Rob Narke',NULL,'',NULL,NULL),(560,'Adrian Luna',NULL,'',NULL,NULL),(561,'Juan Encarnacion',NULL,'',NULL,NULL),(562,'Joseph DeBona','Philadelphia, Pennsylvania, USA','','1973-04-14',NULL),(563,'Joseph W. Girard','Williamsport, Pennsylvania, USA','Joseph W. Girard was an American screen actor. He appeared in more than 280 films between 1911 and 1944. He was born in Williamsport, Pennsylvania and died in Woodland Hills, Los Angeles.','1871-04-01','1949-08-21'),(564,'Giorgio Ubaldi',NULL,'',NULL,NULL),(565,'Neco Villa Lobos',NULL,'',NULL,NULL),(566,'De\'Aundre Bonds','Los Angeles, California, USA','','1976-03-19',NULL),(567,'Nicolas Cage','Long Beach, California, USA','Nicolas Cage (born Nicolas Kim Coppola) is an American actor and filmmaker. He is the recipient of various accolades, including an Academy Award, a Screen Actors Guild Award, and a Golden Globe Award.\n\nDuring the early years of his career, Cage starred in a variety of films such as Rumble Fish (1983), Racing with the Moon (1984), Peggy Sue Got Married (1986), Raising Arizona (1987), Vampire\'s Kiss (1989), Wild at Heart (1990), Honeymoon in Vegas (1992), and Red Rock West (1993). During this period, John Willis\' Screen World, Vol. 36 listed him as one of twelve Promising New Actors of 1984.\n\nFor his performance in Leaving Las Vegas (1995), he won the Academy Award for Best Actor. He received his second Academy Award nomination for his performance as Charlie and Donald Kaufman in Adaptation (2002). He subsequently appeared in more mainstream films, such as The Rock (1996), Con Air (1997), City of Angels (1998), 8mm (1999), Windtalkers (2002), Lord of War (2005), The Wicker Man (2006), Bangkok Dangerous (2008) and Knowing (2009).\n\nHe also directed the film Sonny (2002), for which he was nominated for Grand Special Prize at Deauville Film Festival. Cage owns the production company Saturn Films and has produced films such as Shadow of the Vampire (2000) and The Life of David Gale (2003). In October 1997, Cage was ranked No. 40 in Empire magazine\'s The Top 100 Movie Stars of All Time list, while the next year, he was placed No. 37 in Premiere\'s 100 most powerful people in Hollywood.\n\nIn the 2010s, he starred in Kick-Ass (2010), Drive Angry (2011), Joe (2013), The Runner (2015), Dog Eat Dog (2016), Mom and Dad (2017), Mandy (2018), Spider-Man: Into the Spider-Verse (2018), and Color Out of Space (2019). His participation in various film genres during this time increased his popularity and gained him a cult following.','1964-01-07',NULL),(568,'Angelique Sky',NULL,'',NULL,NULL),(569,'Panchito Gómez','New York City, New York, USA','','1963-11-02',NULL),(570,'Kevin Kent',NULL,'',NULL,NULL),(571,'Cornelius Clarke',NULL,'',NULL,NULL),(572,'Michael Kopsa','Toronto, Ontario, Canada','Michael Kopsa (January 22, 1956 – October 23, 2022) was a Canadian voice, film, television and stage actor.\n\nHe was known for his role as Char Aznable in the English dub of Mobile Suit Gundam and for his role as Commander Volcott O\'Huey in Galaxy Angel. He also provided the voice of Beast in X-Men: Evolution. He also appeared on the science fiction TV series Stargate SG-1 on several occasions, as well as The X-Files, The Net, and The Outer Limits. In the fourth and fifth season of Fringe, he played the recurring Observer villain Captain Windmark.','1956-01-22','2022-10-23'),(573,'Joe Lee Yiu-Ming','Hong Kong, China','','1956-01-01','2003-01-12'),(574,'Mao Ichimichi','Osaka, Japan','Mao Ichimichi is a Japanese actress, voice actress and a former gravure idol. When she does voice acting she uses her moniker M·A·O. In 2011 she made her major acting debut in the role of Luka Millfy/Gokai Yellow in the Super Sentai series Kaizoku Sentai Gokaiger.','1992-02-01',NULL),(575,'Jeremy Linson',NULL,'',NULL,NULL),(576,'Christopher Boyer','Hagerstown, Maryland, USA','','1960-03-10',NULL),(577,'Johann Urb','Tallinn, Estonian SSR, USSR [now Estonia]','Johann Urb (born January 24, 1977 in Tallinn, Estonia) is an Estonian-American actor and former model.\n\nJohann Urb was born in Tallinn to parents Tarmo and Maris Urb. His father is an Estonian musician and the brother of actor and singer Toomas Urb. At the age of ten, he moved to live in Finland with his mother and her new Finnish husband, where he was raised primarily in Tampere. After turning 17, Urb moved to the United States, where his father lived, and began his career in modeling in New York City, which led him later on to pursuing a career in acting. He studied drama at the Lee Strasberg Theatre and Film Institute.','1977-01-24',NULL),(578,'Brian Anglin',NULL,'',NULL,NULL),(579,'Yuris Skujins',NULL,'',NULL,NULL),(580,'Dominic Zamprogna','Hamilton, Ontario, Canada','From Wikipedia, the free encyclopedia\n\nDominic Zamprogna (born April 21, 1979) is a Canadian actor. He is perhaps best known for his roles on television series Edgemont and General Hospital.\n\nDescription above from the Wikipedia article Dominic Zamprogna, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1979-04-21',NULL),(581,'H. Jon Benjamin','Worcester, Massachusetts, USA','Harry Jon Benjamin (born May 23, 1966), known professionally as H. Jon Benjamin, is an American actor, voice actor, and comedian. He is known for his voice-over roles as Jason and Coach McGuirk on Home Movies, Ben on Dr. Katz, Professional Therapist, The Devil on Lucy, Daughter of the Devil, Carl the convenience store manager on Family Guy, and various roles on the sketch comedy series Important Things with Demetri Martin. He is the voice of Sterling Archer in FX\'s animated series Archer, and Bob Belcher in the Fox animated series Bob\'s Burgers.\n\nDescription above from the Wikipedia article H. Jon Benjamin, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-05-23',NULL),(582,'Maggie Parto',NULL,'',NULL,NULL),(583,'Doron Bell','Montreal, Quebec, Canada','Doron Bell Jr. (born December 8, 1973 in Montreal, Quebec) is a Canadian actor. He is known primarily for voice work, perhaps best known for his role as Odie in the fantasy television series Class of the Titans.\n\nDescription above from the Wikipedia article Doron Bell Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia.','1973-12-08',NULL),(584,'Timothy Jones',NULL,'',NULL,NULL),(585,'Alexandra Dinu','Bucharest, Romania','','1981-01-03',NULL),(586,'Joe Cheng',NULL,'',NULL,NULL),(587,'Lal','Kochi, Kerala, India','Paul Michael (born December 2, 1958), better known by his stage name Lal, is an Indian film director, script writer, actor, producer, and film distributor. He is most famous for teaming up with Siddique under the shared name Siddique-Lal to make films such as Ramji Rao Speaking (1989), In Harihar Nagar (1990), Godfather (1991), Vietnam Colony (1993), and Kabooliwala (1993). The duo broke off afterwards but he produced Siddique\'s Hitler (1996) and Friends (1999). Other films he has produced include Thenkasipattanam (2000), Kalyanaraman (2002), Chathikkatha Chanthu (2004), and Thommanum Makkalum (2005). Lal\'s debut as an actor came in 1997 when he played Paniyan in Jayaraj\'s Kaliyattam. He won the Kerala State Film Award for Best Actor for playing Raveendran Pillai in Madhupal\'s film Thalappavu (2008).','1958-12-02','2011-07-08'),(588,'Kata Dobó','Győr, Hungary','Kata Dobó or Kata Dobo (born Katalin Kovács, Hungarian: Kovács Katalin, Dobó Kata on 25 February 1974) is a Hungarian actress.\n\nShe was born in Győr, Hungary and emigrated to Los Angeles, USA in the summer of 1999. She currently resides in Santa Monica, California and is the sister of Réka Kovács. Her films include A miniszter félrelép (1997) and Európa expressz (1999). Recent television work includes an appearance on Lady Heather\'s Box, an episode of CSI: Crime Scene Investigation, in 2003. In January this year, she appeared in Bloodlines, the fourth episode in the 14th series of the BBC crime drama Silent Witness, along with fellow Hungarian actors Iván Kamarás and Lili Bordán.\n\nDescription above from the Wikipedia article Kata Dobó, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1974-02-25',NULL),(589,'Paco Boisson',NULL,'',NULL,NULL),(590,'Brian Schreier',NULL,'',NULL,NULL),(591,'Jonni Garro',NULL,'',NULL,NULL),(592,'Matt Moore','Fordstown Crossroads, County Meath, Ireland','','1888-01-08','1960-01-20'),(593,'Yang Kai Cheng',NULL,'','1992-05-21',NULL),(594,'Vyacheslav Anikin',NULL,'',NULL,NULL),(595,'Toni Kalem','Springfield, New Jersey, USA','Toni Kalem (born August 29, 1950) is an American actress, screenwriter and director.','1950-08-29',NULL),(596,'Kaylah Timoney',NULL,'',NULL,NULL),(597,'Inna Korobkina','Magadan, Russia','Inna Korobkina was born on 23 February 1981 in Magadan, Magadan region, RSFSR, USSR [now Russia]. She is an actress and producer, known for Dawn of the Dead (2004), Transformers: Dark of the Moon (2011) and The Mummy: Tomb of the Dragon Emperor (2008). She has been married to Steve Valentine since 28 August 2010. They have two children.','1981-02-23',NULL),(598,'Andrew Scott','Dublin, Ireland','Andrew Scott (born October 21, 1976) is an Irish actor. He made his first appearance on television in an advertisement for a brand of porridge at the age of 6. He received the Laurence Olivier Award for Best Performance in an Affiliated Theater for the play A Girl in a Car with a Man at Jerwood Theater Upstairs and the Irish Film and Television Award for Best Actor for the film Dead Bodies. He is best known for his role as  Lieutenant Leslie in 1917 (2019) and Adam in All of us Strangers (2023). For the latter, he was nominated for a Golden Globe Award for Best Actor.\n\nIn November 2013, he announced that he was gay. Scott was ranked at No. 22 on The Independent\'s Rainbow List 2014.','1976-10-21',NULL),(599,'Masataka Kubota','Kanagawa, Japan','Masataka Kubota (窪田 正孝 Kubota Masataka, born August 6, 1988, in Kanagawa Prefecture) is a Japanese actor.','1988-08-06',NULL),(600,'Darren Dolynski',NULL,'',NULL,NULL),(601,'Davi Santos','Rio de Janeiro, Rio de Janeiro, Brazil','','1990-02-01',NULL),(602,'Andy Tsang Tak-Wah',NULL,'',NULL,NULL),(603,'Ivy-I Macnamara',NULL,'',NULL,NULL),(604,'Fung Hak-On','Shaxi, Zhonghsan, Guangdong Province, China','Fung Hak-On (Chinese: 馮克安, 12 September 1948 － 2 March 2016) was a Hong Kong actor and martial arts choreographer who appeared in over 100 Hong Kong films from the 1960s to 2010s; he played villains and henchmen most of his career. He was the son of veteran Hong Kong actor Fung Fung.','1948-09-12','2016-03-02'),(605,'Steven Waddington','Leeds, West Yorkshire, England, UK ','Steven Waddington is an English film and television actor. He studied at the East 15 Acting School in Loughton, Essex and subsequently joined the Royal Shakespeare Company, first at Stratford and then at the Barbican, London.','1967-12-30',NULL),(606,'Patton Oswalt','Portsmouth, Virginia, USA','American stand-up comedian, writer and actor Patton Oswalt first began performing standup comedy in the late 1980s to early 1990s. After spending two seasons writing for MADtv, and starring in his own 1996 comedy special for HBO, he began performing in films and television shows.In January 2011, Oswalt released his first book, Zombie Spaceship Wasteland. Oswalt married writer Michelle Eileen McNamara on September 24, 2005. Their daughter, Alice Rigney Oswalt, was born on April 15, 2009.','1969-01-27',NULL),(607,'Michael Sinelnikoff',NULL,'Michael Sinelnikoff is an actor, director and writer. Among his many non-acting credits are: first Director of Quebec\'s International \"Cirque du Soleil\" (1984).','1928-08-01',NULL),(608,'Tyrone Benskin','Bristol, England, UK','Tyrone Benskin has been a significant presence in theatre, film, television and music for over 30 years. As part of the Canadian and International cultural landscape Tyrone has amassed an impressive resume and acclaim for a significant and varied body of work;, from no-nonsense cop to caring and devoted father, from ancient warrior to the characters showing the darkness of human nature. His numerous theatre credits include appearances on many of the celebrated stages across Canada.\n\nHis over 100 film and television credits include co-starring with Tori Spelling in the TV movie \"Mind over Murder\", the new Christmas classic \"The Christmas Choir\", \"The Wool Cap\" and the civil rights drama \"Deacons for Defense\" opposite Forrest Whitaker and Mr. Ossie Davis. Mr. Benskin also appeared in the NBC mini-series 10.5: Apocalypse and starred as Karl Lubinsky in the cult science fiction series \"Charlie Jade\" which aired in Canada, the US and internationally including South Africa, France, England and Japan. Feature films include the blockbuster hit \"300\", Bob Dylan bio-pic \"I\'m not There\" and acclaimed independent films \"Peepers\" and \"Adam\'s Wall.\"\n\nFor over 5 years, Mr. Benskin served as Artistic Director of Black Theatre Workshop, Canada\'s oldest Black theatre company. He served President of the Board of Creations Etc., a youth arts and outreach organization as well as serving on the board several community based non-profit organizations. Mr. Benskin was twice elected to the post of National Vice President of ACTRA, Canada\'s national film and television actors union.\n\nOn May 2nd, 2011 Mr. Benskin was elected to the 41st Parliament of Canada as the Member for the diverse riding of Jeanne-Le Ber. Mr. Benskin was subsequently appointed to the post of \"Official Opposition Critic for Canadian Heritage\" by the Honorable Jack Layton. Mr. Benskin also serves as Deputy Critic for Official Languages and served on the Sub-Committee for International Human Rights. Benskin served as a Member of Canada\'s House of Commons for four and a half years returning to the big screen in 2016 in Bad Santa 2 and the small screen as recurring character Rev. Wardell Cobb in season 2 of The Art of More opposite Denis Quaid.','1958-12-29',NULL),(609,'Martin Sheen','Dayton, Ohio, USA','Ramón Antonio Gerardo Estévez (born August 3, 1940), known professionally as Martin Sheen, is an American actor. He first became known for his roles in the films The Subject Was Roses (1968) and Badlands (1973), and later achieved wide recognition for his leading role as Captain Benjamin Willard in Apocalypse Now (1979), as U.S. President Josiah Bartlet in the television series The West Wing (1999–2006), and as Robert Hanson in the Netflix television series Grace and Frankie (2015–2022).\n\nIn film, Sheen has won the Best Actor award at the San Sebastián International Film Festival for his performance as Kit Carruthers in Badlands. Sheen\'s portrayal of Capt. Willard in Apocalypse Now earned a nomination for the BAFTA Award for Best Actor.\n\nSheen has worked with a wide variety of film directors, including Richard Attenborough, Francis Ford Coppola, Terrence Malick, David Cronenberg, Mike Nichols, Martin Scorsese, Steven Spielberg, and Oliver Stone. Sheen received a star on the Hollywood Walk of Fame in 1989. In television, Sheen has won a Golden Globe and two Screen Actors Guild awards for playing the role of President Josiah Bartlet in The West Wing, and an Emmy for guest starring in the sitcom Murphy Brown. In 2012, he portrayed Uncle Ben in The Amazing Spider-Man directed by Marc Webb.\n\nBorn and raised in the United States by a Spanish father and an Irish mother, he adopted the stage name Martin Sheen to help him gain acting parts. He is the father of four children, all of whom are actors.\n\nSheen has directed one film, Cadence (1990), in which he appears alongside his sons Charlie and Ramón. He has narrated, produced, and directed documentary television, earning two Daytime Emmy awards in the 1980s, and has been active in liberal politics.\n\nDescription above from the Wikipedia article Martin Sheen, licensed under CC-BY-SA, full list of contributors can be found on Wikipedia.','1940-08-03',NULL),(610,'Kate Adair','New Orleans, Louisiana, USA','','1986-06-30',NULL),(611,'Glen Cavender','Tucson, Arizona, USA','From Wikipedia, the free encyclopedia\n\nGlen Cavender (September 19, 1883 – February 9, 1962) was an American film actor. He appeared in 259 films between 1914 and 1949.\n\nThe Spanish–American War soldier was born in Tucson, Arizona, and died in Hollywood, California. He started his acting career in vaudeville shows. Cavender belonged to the original Keystone Cops and was a regular in numerous Mack Sennett comedies. He also worked as a director for three Mack Sennett films between 1914 and 1916. During the 1920s, Cavender worked for the film studios Educational and Christie and appeared in Buster Keaton\'s film classic The General (1926) as the antagonistic Union Captain Anderson. The advance of sound film in the late 1920s damaged his career and, formerly a well-known actor, Cavender only played minor roles until his retirement in 1949.','1883-09-18','1962-02-09'),(612,'Xing Jiadong','中国,山西,太原','','1972-07-01',NULL),(613,'Jason Burkart',NULL,'',NULL,NULL),(614,'Daryl Hannah','Chicago, Illinois, USA','Daryl Hannah was born and raised in Chicago, Illinois. She attend the University of Southern California (USC) and made her film debut in the Brian De Palma film The Fury (1978). She starred in such films as Ron Howard\'s Splash (1984) and \'Herbert Ross\' Steel Magnolias (1989). She won the Jury Award from the Berlin International Film Festival for Best Short in 1994 for a film titled The Last Supper (1993), which she directed, wrote, and produced.','1960-12-03',NULL),(615,'Nick Offerman','Joliet, Illinois, USA','Nicholas Offerman (born June 26, 1970) is an American actor, writer, comedian, producer, and woodworker. He is best known for his role as Ron Swanson in the NBC sitcom Parks and Recreation, for which he received the Television Critics Association Award for Individual Achievement in Comedy and was twice nominated for the Critics\' Choice Television Award for Best Supporting Actor in a Comedy Series. Offerman is also known for his role in The Founder, in which he portrays Richard McDonald, one of the brothers who developed the fast food chain McDonald\'s. His first major television role since the end of Parks and Recreation was as Karl Weathers in the FX series Fargo, for which he received a Critics\' Choice Television Award nomination for Best Supporting Actor in a Movie/Miniseries. Since 2018, Offerman has co-hosted the NBC reality competition series, Making It, with Amy Poehler.','1970-06-26',NULL),(616,'Zhang Qian',NULL,'',NULL,NULL),(617,'Yancey Arias','New York City, New York, USA','From Wikipedia, the free encyclopedia\n\nYancey Arias (born June 27, 1971) is an American actor, perhaps most noted for his work on television crime dramas, particularly his roles as Miguel Cadena in the NBC series Kingpin and as Gabriel Williams in the FX series Thief.\n\nDescription above from the Wikipedia article Yancey Arias, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1971-06-27',NULL),(618,'Jaren Mitchell',NULL,'Jaren Mitchell is an actor.',NULL,NULL),(619,'David Corden',NULL,'',NULL,NULL),(620,'Qayam Devji','Agra, Uttar Pradesh, India','Qayam Devji is an actor, known for 2012 (2009), Rise of the Planet of the Apes (2011) and Hulk Vs. (2009).','2000-01-01',NULL),(621,'Duane Whitaker','Abilene, Texas, USA','From Wikipedia, the free encyclopedia.\n\nDuane Whitaker  (born June 23, 1959) is an American actor.\n\nDuane Whitaker is probably best known for his role in Quentin Tarantino\'s popular 1994 film Pulp Fiction as Maynard, the sadistic pawn shop owner. He wrote and portrayed the title role in Eddie Presley (based on his own successful stage play). Whitaker also wrote, directed and appeared in Together and Alone.\n\nOther notable roles include; a racist cop in Tales from the Hood, the bouncer Roadrash in Hobgoblins, Boss Man in Feast, The Sheriff in Trailer Park of Terror, Luther in From Dusk Till Dawn 2: Texas Blood Money (which he also co-wrote), Buddy in Dead Letters (film), Winslow in Broke Sky, Mickey in Cordoba Nights and Dr. Bankhead in The Devil\'s Rejects.\n\nMost recently Duane has appeared in the feature films Albino Farm and Dozers and on TV in the Cold Case episode \"The Brush Man\" and appears in the new Rob Zombie film Halloween II. Whitaker has also written numerous screenplays including \"Stripteaser.\"\n\nOn March 31, 2010, American Cinematheque hosted a screening of Eddie Presley and \"Together and Alone\" at Grauman\'s Egyptian Theatre in Los Angeles.\n\nDuane is a graduate of Monterey High School in Lubbock, Texas.\n\nDescription above from the Wikipedia article Duane Whitaker, licensed under CC-BY-SA, full list of contributors on Wikipedia','1959-06-23',NULL),(622,'Omid Zader',NULL,'',NULL,NULL),(623,'La-Chic McWhorter',NULL,'',NULL,NULL),(624,'Dong Wenjun','Tianjin，China','Actor and popular TV host from Mainland China.','1983-03-15',NULL),(625,'Sman Tonyala',NULL,'',NULL,NULL),(626,'Dave Lapommeray',NULL,'',NULL,NULL),(627,'Huang Jinlong',NULL,'',NULL,NULL),(628,'Júlia Paes',NULL,'',NULL,NULL),(629,'Nick Gomez','Honolulu, Hawaii, USA','Nick Gomez (born October 2, 1978) is an American actor. He has acted for a number of television and filmstudios. Description above from the Wikipedia article Nick Gomez, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1978-10-02',NULL),(630,'Tony Todd','Washington, District of Columbia, USA','An American actor and producer, known for his height (6\'5\", 1.96 m) and deep voice. He is well known for playing the Candyman in the horror movie franchise of the same name, William Bludworth in Final Destination and for guest starring roles on numerous television shows.\n\nDescription above from the Wikipedia article Tony Todd, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1954-12-04',NULL),(631,'Xuan Qin','中国, 重庆','',NULL,NULL),(632,'Karin Konoval','Baltimore, Maryland, USA','Karin Konoval is a Canadian-American actress who has appeared in theatre, numerous TV series and supporting lead roles in many feature films.  Her extensive screen credits include Maurice the orangutan in the Planet of the Apes reboot franchise and Mary Leonar in Cable Beach, for which she received a Philip Borsos award, as well as supporting roles in series such as X-Files, Snowpiercer, and The Good Doctor.','1961-06-04',NULL),(633,'Fernando Alves Pinto',NULL,'','1969-05-06',NULL),(634,'Jamieson Urquhart',NULL,'',NULL,NULL),(635,'Raquel Welch','Chicago, Illinois, USA','Jo Raquel Welch (née Tejada; September 5, 1940 – February 15, 2023) was an American actress.\n\nWelch first garnered attention for her role in Fantastic Voyage (1966), after which she signed a long-term contract with 20th Century Fox. They lent her contract to the British studio Hammer Film Productions, for whom she made One Million Years B.C. (1966). Although Welch had only three lines of dialogue in the film, images of her in the doe-skin bikini became bestselling posters that turned her into an international sex symbol. She later starred in Bedazzled (1967), Bandolero! (1968), 100 Rifles (1969), Myra Breckinridge (1970), Hannie Caulder (1971), Kansas City Bomber (1972), The Last of Sheila (1973), The Three Musketeers (1973), The Wild Party (1975), and Mother, Jugs & Speed (1976). She made several television variety specials.\n\nThrough her portrayal of strong female characters, helping her break the mold of the traditional sex symbol, Welch developed a unique film persona that made her an icon of the 1960s and 1970s. Her rise to stardom in the mid-1960s was partly credited with ending Hollywood\'s vigorous promotion of the blonde bombshell.[1][2][3] Her love scene with Jim Brown in 100 Rifles also made cinematic history with their portrayal of interracial intimacy.[4] She won a Golden Globe Award for Best Motion Picture Actress in a Musical or Comedy in 1974 for her performance as Constance Bonacieux in The Three Musketeers and reprised the role in its sequel the following year. She was also nominated for a Golden Globe Award for Best Actress in Television Film for her performance in Right to Die (1987). Her final film was How to Be a Latin Lover (2017). In 1995, Welch was chosen by Empire magazine as one of the \"100 Sexiest Stars in Film History\". Playboy ranked Welch No. 3 on their \"100 Sexiest Stars of the Twentieth Century\" list.\n\nDescription above from the Wikipedia article Raquel Welch, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1940-09-05','2023-02-15'),(636,'Roy Yerbey',NULL,'',NULL,NULL),(637,'Bill Moseley','Barrington, Illinois, USA','From Wikipedia, the free encyclopedia\n\nWilliam \"Bill\" Moseley (born November 11, 1951) is an American film actor and musician who has starred in a number of cult classic horror films, including House of 1000 Corpses, Repo! The Genetic Opera and The Devil\'s Rejects. His first big role was in The Texas Chainsaw Massacre 2 as Chop Top. He has also released records with guitarist Buckethead, in the band Cornbugs.\n\nDescription above from the Wikipedia article Bill Moseley, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1951-11-11',NULL),(638,'Hakeem Kae-Kazim','Nigeria','','1962-10-01',NULL),(639,'Gao Yuanfeng',NULL,'Yuanfeng Gao is an actor.',NULL,NULL),(640,'Jing Jiang','Yangzhou, Jiangsu, China','','1984-11-09',NULL),(641,'Teresa Barnwell',NULL,'',NULL,NULL),(642,'Sean Tyson',NULL,'',NULL,NULL),(643,'Ann Dvorak','New York City, New York, USA','Ann Dvorak (born Anna McKim; August 2, 1911 – December 10, 1979) was an American stage and film actress. Asked how to pronounce her adopted surname, she told The Literary Digest: \"My fake name is properly pronounced vor\'shack. The D remains silent.\"\n\nDvorak was the daughter and only child of silent film actress Anna Lehr and director Edwin McKim. While in New York, she attended St. Catherine\'s Convent. After moving to California, she attended Page School for Girls in Hollywood.\n\nShe made her film debut when she was five years old in the silent film version of Ramona (1916), credited as \"Baby Anna Lehr\". She continued in children\'s roles in The Man Hater (1917) and Five Dollar Plate (1920), but then stopped acting in films. Her parents separated in 1916 and divorced in 1920; she did not see her father again until 13 years later, when she made a public plea to the press to help her find him.\n\nIn the late 1920s, Dvorak worked as a dance instructor and gradually began to appear on film as a chorus girl. Her friend, actress Karen Morley, introduced her to billionaire movie producer Howard Hughes, who groomed her as a dramatic actress. She was a success in such pre-Code films as Scarface (1932) as Paul Muni\'s sister; in Three on a Match (1932) with Bette Davis and Joan Blondell as the doomed, unstable Vivian; in The Crowd Roars (1932) with James Cagney; and in Sky Devils (1932) opposite Spencer Tracy. Known for her style and elegance, she was a popular leading lady for Warner Bros. during the 1930s, and appeared in numerous contemporary romances and melodramas.  At age 19, Dvorak eloped with Leslie Fenton, her English co-star from The Strange Love of Molly Louvain (1932), and they married on March 17, 1932. They left for a year-long honeymoon in spite of her contractual obligations to the studio, which led to a period of litigation and pay disputes during which she discovered she was making the same amount of money as the boy who played her son in Three on a Match. She completed her contract on permanent suspension, then worked as a freelancer. Although she worked regularly, the quality of her scripts declined sharply.  She appeared as secretary Della Street to Donald Woods\' Perry Mason in The Case of the Stuttering Bishop (1937). With her then-husband, Leslie Fenton, Dvorak traveled to England where she supported the war effort by working as an ambulance driver and acted in several British films. She appeared as a saloon singer in Abilene Town with Randolph Scott and Edgar Buchanan, released in 1946. The following year she adeptly handled comedy by giving an assured performance in Out of the Blue (1947). In 1948, Dvorak gave her only performance on Broadway in The Respectful Prostitute.\n\nDvorak\'s marriage to Fenton ended in divorce in 1946. In 1947, she married Igor Dega, a Russian dancer who danced with her briefly in The Bachelor\'s Daughters. The marriage ended two years later.\n\nDvorak retired from the screen in 1951, when she married her third and last husband, Nicholas Wade, to whom she remained married until his death in 1975. She had no children.','1911-08-02','1979-12-10'),(644,'Samson Cox-Vinell',NULL,'',NULL,NULL),(645,'Thandiwe Newton','London, England, UK','Melanie Thandiwe Newton OBE (born 6 November 1972), formerly credited as Thandie Newton, is a British actress.\n\nNewton is known for starring roles such as the title character in Beloved (1998), Nyah Nordoff-Hall in Mission: Impossible 2 (2000), Tiffany in Shade (2003), Dame Vaako in The Chronicles of Riddick (2004), Christine in Crash (2004), Linda in The Pursuit of Happyness (2006), Libby in Run Fatboy Run (2007), Stella in RockNRolla (2008), Condoleezza Rice in W. (2008), Laura Wilson in 2012 (2009), Tangie Adrose in For Colored Girls (2010), Maeve Millay in Westworld (2016–2022), Roz Huntley in Line of Duty (2017), and Val in Solo: A Star Wars Story (2018).\n\nNewton has received various awards, including an Emmy Award for Outstanding Supporting Actress in a Drama Series, a BAFTA Award for Best Actress in a Supporting Role, and two Critics\' Choice Awards, in addition to nominations for two Golden Globe Awards, a Saturn Award, a Screen Actors Guild Award, and a British Academy Television Award for Best Actress. She was appointed Officer of the Order of the British Empire (OBE) in the 2019 New Year Honours for services to film and charity.\n\nDescription above from the Wikipedia article Thandiwe Newton, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1972-11-06',NULL),(646,'Dan Rogerson',NULL,'',NULL,NULL),(647,'Freddie Stroma',' London, England, UK','Frederic Wilhelm C.J. Sjöström (born January 8, 1987), known professionally as Freddie Stroma, is a British actor and model, known for his work in roles including Cormac McLaggen in the Harry Potter film series; Adam Cromwell on the Lifetime series Unreal; Brit Vayner in 13 Hours: The Secret Soldiers of Benghazi (2016); H.G. Wells in the ABC series Time After Time; and Adrian Chase/Vigilante in Peacemaker.','1987-01-08',NULL),(648,'Pauly Valsan',NULL,'',NULL,NULL),(649,'Vincent Perez','Lausanne, Vaud, Switzerland','Born in Lausanne from a father of Spanish origin and a mother of German origin, Vincent Pérez (Vicente Pérez) spent a good part of his childhood in Penthaz and then in Cheseaux, Canton of Vaud. After studying photography at the Center Doret in Vevey, he studied dramatic art in Geneva, then at the Conservatoire and the school of Amandiers de Nanterre.\n\nVincent Pérez in 1991, at the 16th César ceremony. He is still a student when he begins the movie in 1985 in the Guardian of the Night. It is in 1990 that it imposes to the international level playing in Cyrano de Bergerac. He is quoted to the César of the best male hope. In 1991, it is found in Indochina, winner of the Oscar for the best film in foreign language. In the same year he won the Prix Jean-Gabin. Since then, he plays characters of romantic lovers in La Reine Margot, Fanfan, films that allow him to rub shoulders with major French actors. He subsequently plays in some thirty European or American films. He is quoted to the César for best actor in a supporting role 1998 for his interpretation in the Hunchback and the following year for Those who love me will take the train.\n\nVincent Pérez at the 2000 Cannes Film Festival. In 1992, he made his directorial debut with the short film \"L\'échange\", nominated for the