r (born November 2, 1944) is an American ring announcer or \"MC\" for boxing and professional wrestling matches. He is known for his trademarked catchphrase, \"Let\'s get ready to rumble!\", and for pioneering a distinctive announcing style in which he rolls certain letters and adds other inflections to a fighter\'s name. His half-brother is UFC announcer Bruce Buffer.','1944-11-02',NULL),(665,'Isabella Calthorpe',NULL,'',NULL,NULL),(666,'Patrick Bauchau','Brussels, Belgium','From Wikipedia, the free encyclopedia.\n\nPatrick Nicolas Jean Sixte Ghislain Bauchau (born 6 December 1938) is a Belgian actor best known for his roles in the films A View to a Kill, The Rapture and Panic Room, as well as the TV shows The Pretender and House.','1938-12-06',NULL),(667,'Anne Midori',NULL,'',NULL,NULL),(668,'Shannan Stewart',NULL,'',NULL,NULL),(669,'Mike Rainey',NULL,'',NULL,NULL),(670,'Kim Hak-seon','South Korea','Kim Hak-sun is a Korean actor.','1970-12-24',NULL),(671,'Sofia Vassilieva','Minneapolis, Minnesota, USA','Sofia Vassilieva (born October 22, 1992) is an American actress.\n\nShe is best known for playing Eloise in two TV movies, Ariel Dubois on Medium, and Kate Fitzgerald in My Sister\'s Keeper.','1992-10-22',NULL),(672,'Patrick Fischler','Los Angeles, California, USA','Patrick Fischler (born December 29, 1969) is an American character actor known for his roles as Jimmy Barrett on the drama series Mad Men, Dharma Initiative worker Phil on the drama series Lost and Detective Kenny No-Gun on the police drama Southland. He has more than sixty film and television credits, including the films Mulholland Drive (2001), Ghost World (2001), Old School (2003), The Black Dahlia (2006), and Dinner for Schmucks (2010).','1969-12-29',NULL),(673,'Liam James','Vancouver, Canada','','1996-08-07',NULL),(674,'Sincerely A. Ward',NULL,'',NULL,NULL),(675,'Levi Dylan',NULL,'',NULL,NULL),(676,'Andrew Stehlin','New Zealand','Andrew Stehlin is a New Zealand actor and stuntman. He started his career as a set builder and stunt performer but found a way to combine his interest in acting with his stuntwork and became a part-time actor. He received a minor cult following after playing the vicious vampire beta male Arvin in the horror film 30 Days of Night (2007). In 2019, Stehlin portrayed the X-Men mutant Ariki in Dark Phoenix (2019).',NULL,NULL),(677,'Andre Pierre',NULL,'',NULL,NULL),(678,'Ajay','Vijayawada, Andhra Pradesh, India','Ajay is an actor from the Telugu film industry, who has also worked in Tamil and Kannada movies.','1978-09-26',NULL),(679,'Chelsey Reist','Edmonton, Canada','Chelsey Marie Reist is a Canadian actress, television host, and dancer. From 2014-2018 she played Harper McIntyre in The CW\'s The 100. She starred as Rachel in the 2012 horror film No Tell Motel which screened at the Cannes Film Festival and she appeared in 12 Rounds: Reloaded starring WWE wrestler Randy Orton.','1987-01-04',NULL),(680,'Marcel Jeannin',NULL,'Marcel Jeannin is a Canadian actor based in Montreal, Quebec. He divides his time between film and television, voice work, and theatre.',NULL,NULL),(681,'Scott E. Miller','Windsor, Ontario, Canada','','1975-03-02',NULL),(682,'Bill Hader','Tulsa, Oklahoma, USA','William Thomas Hader Jr. (born June 7, 1978) is an American actor, comedian, writer, and producer. He is the creator, producer, writer, director, and star of the HBO dark comedy series Barry (2018–2023), for which he has been nominated for eight Emmy Awards, winning two.\n\nHader\'s initial success was for his eight-year stint (2005–2013) as a cast member on the long-running NBC variety series Saturday Night Live, for which he received four Primetime Emmy Award nominations and a Peabody Award. He became known for his impressions and especially for his work on the Weekend Update segments, in which he played Stefon Meyers, a flamboyant New York tour guide who recommends unusual nightclubs and parties with bizarre characters with unusual tastes. He is also the star and producer of the IFC mockumentary comedy series Documentary Now! (2015–present) which he co-created along with Fred Armisen and Seth Meyers.\n\nHader has had supporting roles in the films You, Me and Dupree (2006), Hot Rod (2007), Superbad (2007), Forgetting Sarah Marshall (2008), Night at the Museum: Battle of the Smithsonian, (2009), Paul (2011), This Is 40 (2012), and 22 Jump Street (2014), as well as leading roles in The Skeleton Twins (2014), Trainwreck (2015), and as an adult Richie Tozier in It Chapter Two (2019).\n\nHe also is known for his extensive work in voice-over, portraying both leading and supporting characters in films such as the Cloudy with a Chance of Meatballs franchise (2009–2013), Turbo (2013), Inside Out (2015), The BFG (2016), Power Rangers (2017), Toy Story 4 (2019) and Lightyear (2022).','1978-06-07',NULL),(683,'Ben Cura','Buenos Aires, Argentina.','',NULL,NULL),(684,'Victor J. Springer',NULL,'',NULL,NULL),(685,'Sean Cameron Michael','Cape Town - South Africa','From Wikipedia, the free encyclopedia.\n\nSean Cameron Michael (born 24 December 1969) is a South African actor, writer and singer. A native English speaker, he is also fluent in Afrikaans.','1969-12-24',NULL),(686,'Larissa Santiago',NULL,'',NULL,NULL),(687,'Quentin Guyon',NULL,'',NULL,NULL),(688,'Michael O\'Laskey II','Honolulu, Hawaii, USA','','1983-03-06',NULL),(689,'Don Stark','New York City, New York, USA','Don Stark was born on July 5, 1954 in New York City, New York, USA as Donald Stark. He is an actor and director.','1954-06-05',NULL),(690,'Evie Thompson','Dallas, Texas, USA','','1995-11-22',NULL),(691,'Eddie Eniel',NULL,'',NULL,NULL),(692,'Matthew Willig','La Mirada, California, USA','Matthew Joseph Willig (born January 21, 1969) is an American actor and former American football offensive tackle in the National Football League.','1969-01-21',NULL),(693,'Paula Patton','Los Angeles, California, USA','Paula Maxine Patton (born December 5, 1975) is an American actress and producer. She\'s known for her roles as Daniella Hernandez on BET’s film Sacrifice and its\' subsequent series, Brea in Traffik, Laura Price on ABC\'s series Somewhere Between, Garona Halforcen in Warcraft, Alison in the 2014 remake of About Last Night, Deb Rees in 2 Guns, Jane Carter in Mission: Impossible – Ghost Protocol, Morgan Alexander in Just Wright, Blu Rain in Precious, Claire Kuchever in Déjà Vu, Angel in Idlewild, and Mandy in Hitch.\n\nIn 1991, at age 15, she met recording artist Robin Thicke, who was then 14, at an under-21 hip-hop club called Balistyx (co-founded and co-hosted by David Faustino) on the Sunset Strip in Los Angeles, when he asked her to dance. According to Thicke, he sang Stevie Wonder\'s \"Jungle Fever\" to her as they danced. The couple did not begin dating until 1993 and married on June 11, 2005. She gave birth to their son, Julian Fuego, on April 6, 2010. They announced their separation on February 24, 2014, after 21 years together and almost nine years of marriage. On October 8, 2014, she officially filed for divorce and joint custody of their son. The divorce was finalized on March 20, 2015.','1975-12-05',NULL),(694,'Dan O\'Herlihy','Wexford, Ireland','Daniel Peter O\'Herlihy (May 1, 1919 – February 17, 2005) was an Irish film actor, known for such roles as Brigadier General Warren A. \"Blackie\" Black in Fail Safe, Marshal Ney in Waterloo, Conal Cochran in Halloween III: Season of the Witch, \"The Old Man\" in RoboCop, and Andrew Packard in Twin Peaks. He was nominated for the Academy Award for Best Actor for the 1954 film Adventures of Robinson Crusoe.','1919-05-02','2005-02-17'),(695,'David Coburn','Los Angeles, California, USA','David Coburn (born October 31, 1969) is an American actor, voice actor, and singer.\n\nHe is best known as the voice of Captain Planet in the TV series Captain Planet and the Planeteers. He has lived in Paris, France, since 2011. Coburn is not related to James Coburn, his co-star on Captain Planet.\n\nFrom Wikipedia, the free encyclopedia','1969-10-31',NULL),(696,'Olga Legrand',NULL,'',NULL,NULL),(697,'Robert Maillet','Georgetown, Ontario, Canada','Robert Maillet (born October 26, 1969) is a Canadian actor and retired professional wrestler. He is known for his time in the World Wrestling Federation (WWF) from 1997 to 1999, where he performed under the ring name Kurrgan and was a member of The Truth Commission and The Oddities. He is also known for his roles in films such as 300 (2007), Sherlock Holmes (2009), Immortals (2011), Pacific Rim (2013), Brick Mansions (2014), Hercules (2014), and Deadpool 2 (2018).\n\nDescription above from the Wikipedia article Robert Maillet, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1969-10-26',NULL),(698,'Suchao Pongwilai','Lop Buri Province, Thailand','Suchao Pongwilai is a Thai actor.','1946-01-19',NULL),(699,'Seigen Nakayama',NULL,'',NULL,NULL),(700,'Kurt Grossi',NULL,'',NULL,NULL),(701,'Gabriel Akuwudike',NULL,'',NULL,NULL),(702,'Sergey Makhovikov',NULL,'','1963-10-22',NULL),(703,'Oh Hye-won','South Korea','','1986-02-04',NULL),(704,'Antonio Barrios',NULL,'',NULL,NULL),(705,'Mohamed Naimane',NULL,'',NULL,NULL),(706,'Audrey Nevarez',NULL,'',NULL,NULL),(707,'Jang Ui-don','South Korea','Jang Eui Don is a South Korean actor.',NULL,NULL),(708,'George Cheung','Hong Kong, China','From Wikipedia, the free encyclopedia\n\nGeorge Kee Cheung (born February 8, 1949) is a Chinese-American actor, stuntman, singer, and voice actor with an extensive career in American television and film dating back to 1975, often playing Chinese, Japanese, Korean, Vietnamese, and Mongolian parts. His career has focused primarily on television work.\n\nDescription above from the Wikipedia article George Cheung, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1949-02-08',NULL),(709,'Ahmed Zakzouk',NULL,'',NULL,NULL),(710,'Wally Crowder','USA','Wally Crowder is a 2nd Unit Director and Stunt Coordinator.','1959-05-15',NULL),(711,'Cheung Wai',NULL,'',NULL,NULL),(712,'Dustin Green',NULL,'',NULL,NULL),(713,'Henry O','Shanghai, China','From Wikipedia, the free encyclopedia\n\nHenry O (simplified Chinese: 区亨利; traditional Chinese: 區亨利; pinyin: Ōu Hēnglì; born July 27, 1927) is a Chinese American actor. He is the father of Ji-li Jiang, the author of Red Scarf Girl.\n\nDescription above from the Wikipedia article Henry O, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1927-07-27',NULL),(714,'Henry Penzi',NULL,'',NULL,NULL),(715,'Kelly Craig','Montreal, Quebec, Canada','Kelly Craig is a Canadian actress and model based in Montreal, Quebec.','1984-10-01',NULL),(716,'Frédéric Smith',NULL,'',NULL,NULL),(717,'Sasha Roiz','Jaffa, Tel Aviv, Israel','Sasha Roiz (born October 21st, 1973) is a Canadian actor. He\'s best known for his roles as Jack Dayton on Chicago Med, Lt. Sean Renard on Grimm, Pavel Bartok in Departure, Sam Adama on Caprica, and Marcus Diamond on Warehouse 13.','1973-10-21',NULL),(718,'Lane Garrison','Dallas, Texas, USA','Lane Edward Garrison  is an American actor best known for the role of David \"Tweener\" Apolskis on the television series Prison Break. Garrison stars opposite Kristen Stewart in the feature film, Camp X-Ray, which premiered at Sundance Film Festival and was picked up for distribution by IFC Films. Camp X-Ray was released in late 2014.','1980-05-23',NULL),(719,'Richard Riehle','Menomonee Falls, Wisconsin, USA','Richard Riehle is an American actor. Richard attended the University of Notre Dame, where he became heavily involved with the University Theatre.','1948-05-12',NULL),(720,'Christopher Sciueref','London, England, UK','','1972-11-17',NULL),(721,'Manuel Schuster',NULL,'',NULL,NULL),(722,'Juliet Angelina Hernandez-Mark',NULL,'',NULL,NULL),(723,'Marshall Factora',NULL,'',NULL,NULL),(724,'Affif Ben Badra','Tours, Indre-et-Loire, France','Affif Ben Badra (sometimes credited as Afif Ben Badra or Ben Badra) (born 1960) is an actor and dancer currently living in France. In the United States he appeared as a warlord in the Roland Emmerich film 10,000 BC and as Tamas in Sherlock Holmes: A Game of Shadows. He also appeared in the suspense/thriller film Taken, written by Luc Besson, and in the Spanish public TV serie \"Aguila Roja\".\n\nDescription above from the Wikipedia article Affif Ben Badra, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1960-01-01',NULL),(725,'Kevin Jackson',NULL,'',NULL,NULL),(726,'Alberto Dalbés','Rosario, Santa Fe, Argentina','Alberto Dalbés (born Francisco Eduardo Eyras Martínez) was an Argentine film and television actor.','1922-04-03','1983-09-14'),(727,'Edmund Purdom','Welwyn Garden City, Hertfordshire, England, UK','Edmund Anthony Cutlar Purdom (19 December 1924 – 1 January 2009) was an English actor, voice artist, and director. He worked first on stage in Britain, performing various works by Shakespeare, then later in America on Broadway, until making his way to Hollywood, and eventually spent the remainder of his life appearing in Italian cinema. He is perhaps best known for his starring role in 1954\'s historical epic The Egyptian. By taking over important roles exited by Mario Lanza and Marlon Brando, Purdom was known by the mid-1950s as \"The Replacement Star\". Between the 1970s and 90s, he was a regular in European genre cinema, working with directors like Juan Piquer Simón, Joe D\'Amato, Sergio Martino, Ruggero Deodato.','1924-12-20','2009-01-01'),(728,'Nancy McCrumb','Ft. Collins, Colorado, USA','','1984-01-02',NULL),(729,'Ole Jansen',NULL,'',NULL,NULL),(730,'Girish Karnad','Maharashtra, India','','1938-05-19','2019-06-10'),(731,'Jason Maydew',NULL,'',NULL,NULL),(732,'Koji Yakusho','Isahaya, Japan','Kōji Hashimoto (橋本 広司, Hashimoto Kōji, born 1 January 1956), known professionally as Kōji Yakusho (役所 広司, Yakusho Kōji), is a Japanese actor. He is known internationally for his starring roles in Shall We Dance? (1996), 13 Assassins (2010), The Third Murder (2017), The Blood of Wolves (2018), Under the Open Sky (2020) and The Days (2023). For his performance in Perfect Days (2023), he was awarded the Best Actor award in the 76th Cannes Film Festival.','1956-01-01',NULL),(733,'Zhang Xiaolin',NULL,'','1960-11-14',NULL),(734,'Luke Albright',NULL,'',NULL,NULL),(735,'Bridget Colella',NULL,'',NULL,NULL),(736,'Curtis Benton','Toledo, Ohio, USA','','1885-08-26','1938-09-14'),(737,'Valentina Dineva',NULL,'',NULL,NULL),(738,'Richard Brake','Ystrad Mynach, Hengoed, Wales','Richard Brake is a Welsh/American actor.','1964-11-30',NULL),(739,'Rob Van Dam','Battle Creek, Michigan, USA','Robert Alexander Szatkowski, better known by his ring name Rob Van Dam (RVD), is an American professional wrestler and actor who is currently signed to Total Nonstop Action Wrestling (TNA). Szatkowski has held 20 championships between ECW, WWE, and TNA, as well as several regional titles in various promotions during his career. He is officially recognized by TNA as a three-time world champion having held the WWE Championship, ECW World Heavyweight Championship, TNA World Heavyweight Championship once each. On the independent scene, he has held the AWR World Heavyweight Championship twice, and he is currently the WSW World Heavyweight Championship. He the only man to hold the ECW and WWE Championships simultaneously, the only man to have won the ECW, WWE, and TNA World Heavyweight titles in his career, and the only man to win both WWE and ECW\'s version of the Triple Crown. He was also the winner of WWE\'s Money in the Bank ladder match in 2006 as part of WrestleMania 22.','1970-12-18',NULL),(740,'Trace Adkins','Springhill, Louisiana, USA','Tracy Darrell \"Trace\" Adkins (born January 13, 1962) is an American country music artist. He made his debut in 1996 with the album Dreamin\' Out Loud, released on Capitol Records Nashville. Since then, Adkins has released seven more studio albums and two Greatest Hits compilations. In addition, he has charted more than twenty singles on the Billboard country music charts, including the Number One hits \"(This Ain\'t) No Thinkin\' Thing\", \"Ladies Love Country Boys\", and \"You\'re Gonna Miss This\", which peaked in 1997, 2007, and 2008, respectively. \"I Left Something Turned on at Home\" went to #1 on Canada\'s country chart. All but one of his studio albums have received gold or platinum certification in the United States; his highest-selling to date is 2005\'s Songs About Me, which has been certified 2× Multi-Platinum for shipping two million copies.\n\nHe has also made several appearances on television, including as a panelist on the game shows Hollywood Squares and Pyramid, as a finalist on The Celebrity Apprentice, as the voice for recurring character Elvin on King of the Hill, and in television commercial voice-overs for the KFC restaurant chain. In addition, Adkins has written an autobiography entitled A Personal Stand: Observations and Opinions from a Free-Thinking Roughneck, which was released in late 2007.\n\nDescription above from the Wikipedia article Trace Adkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1962-01-13',NULL),(741,'Kyogi Kamui',NULL,'',NULL,NULL),(742,'John Saxon','Brooklyn, New York City, New York, USA','From Wikipedia, the free encyclopedia\n\nJohn Saxon (born Carmine Orrico; August 5, 1935 – July 25, 2020) was an American actor and martial artist who worked on more than 200 projects during a span of 60 years. Saxon is known for his work in Westerns and horror movies, often playing police officers and detectives.\n\nBorn and raised in Brooklyn, New York, Saxon studied acting with Stella Adler before beginning his career as a contract actor for Universal Pictures, playing in such movies as Rock, Pretty Baby (1956) and Portrait in Black (1961). During the 1970s and 1980s, he established himself as a character actor, frequently portraying law enforcement officials in horror movies such as Black Christmas (1974), Dario Argento\'s Tenebrae (1982), and A Nightmare on Elm Street (1984).\n\nIn addition to his roles in horror movies, Saxon co-starred with Bruce Lee in the martial arts movie Enter the Dragon (1973), and has supporting roles in the westerns Death of a Gunfighter (1969) and Joe Kidd (1972), as well as the adventure thriller Raid on Entebbe (1977). In the 1990s, Saxon occasionally appeared in movies, with small roles in Wes Craven\'s New Nightmare (1994) and From Dusk till Dawn (1996).\n\nSaxon died of pneumonia in Murfreesboro, Tennessee, on July 25, 2020.','1935-08-05','2020-07-25'),(743,'Richard Conte','Jersey City, New Jersey, USA','From Wikipedia, the free encyclopedia.\n\nRichard Conte (March 24, 1910 – April 15, 1975) was an American actor. He appeared in numerous films from the 1940s through 1970s, including I\'ll Cry Tomorrow and The Godfather.\n\nDescription above from the Wikipedia article Richard Conte, licensed under CC-BY-SA, full list of contributors on Wikipedia','1910-03-24','1975-04-15'),(744,'Carmen Electra','Sharonville, Ohio, USA','Tara Leigh Patrick (born April 20, 1972), professionally known as Carmen Electra is an American glamour model, actress, television personality, singer, dancer and sex symbol. She gained fame for her appearances in Playboy magazine, on the MTV game show Singled Out, on the TV series Baywatch, and dancing with the Pussycat Dolls, and has since had roles in the parody films Scary Movie, Date Movie, Epic Movie, Meet the Spartans, and Disaster Movie.\n\nElectra was born in Sharonville, Ohio, the daughter of Patricia, a singer, and Harry, a guitarist and entertainer. She attended Ann Weigel Elementary School and then studied dance at Dance Artists dance studio under Gloria J. Simpson, in Western Hills, a neighborhood of Cincinnati. Her mother died of a brain tumor in 1998. Her older sister Debbie died from a heart attack, also in 1998. Carmen graduated from Princeton High School in Sharonville. Carmen Electra also attended the School for Creative and Performing Arts (SCPA) in the Cincinnati Public School District. She has Irish, German, and Cherokee ancestry.\n\nElectra started her professional career in 1990 as a dancer at Kings Island amusement park in Mason, Ohio in the show \"It’s Magic\", one of the more popular shows in the park\'s history. In 1991, she moved to California and met Prince. Soon after meeting Prince, Electra signed a recording contract with Prince\'s Paisley Park Records and began a short-lived singing career.During her time at Paisley Park Records, she officially became known as Carmen Electra.\n\nElectra on June 3, 2008.\n\nIn 1995, Electra started appearing in television programs. In May 1996 she was featured in a nude pictorial in Playboy magazine, the first of several. This exposure led to higher profile television appearances, including Baywatch (cast member from 1997–1998, as Leilani \"Lani\" McKenzie) and MTV\'s Singled Out. She returned to Baywatch for the 2003 reunion movie, Baywatch: Hawaiian Wedding.\n\nElectra was featured in Playboy four more times, with her second appearance in June 1997, third in December 2000, fourth in April 2003 and her fifth in the January 2009 anniversary issue. She was on the cover three times, in December 2000, April 2003 and on the 55th anniversary Issue in January 2009.\n\nElectra has appeared in films such as American Vampire (1997), Good Burger (1997), The Mating Habits of the Earthbound Human (1999), the horror spoof Scary Movie (2000) and also appeared in Meet the Spartans (2008), Scary Movie 4 (2006), Epic Movie (2007), Date Movie (2006), Disaster Movie (2008), the remake of the 1970s TV show Starsky & Hutch (2004) and Cheaper by the Dozen 2. She won an MTV Movie Award (best kiss) for Starsky & Hutch. She also appeared in an episode of House in which she portrayed herself as an injured golfer and an injured farmer, playing out House\'s fantasy.\n\nIn 1999, she appeared in the Bloodhound Gang\'s music video of \"The Inevitable Return of the Great White Dope.\" In 2005, she joined the voice cast of the animated series Tripping the Rift, replacing Gina Gershon as the voice of the sexy android \"Six\". Also in 2005, she began the Naked Women\'s Wrestling League, acting as the commissioner for the professional wrestling promotion. In late 2006, Carmen began to be featured in commercials by Taco Bell.','1972-04-20',NULL),(745,'Bruce Willis','Idar-Oberstein, Germany','Walter Bruce Willis (born March 19, 1955) is a retired American actor. His career began on the off-Broadway stage in the 1970s. He achieved fame with a leading role on the comedy-drama series Moonlighting (1985–1989) and has since appeared in over 70 films, gaining widespread recognition as an action hero after his portrayal of John McClane in the Die Hard franchise (1988–2013) and other subsequent roles.\n\nWillis\'s other credits include The Last Boy Scout (1991), Pulp Fiction (1994), 12 Monkeys (1995), Last Man Standing (1996), The Fifth Element (1997), Armageddon (1998), The Sixth Sense (1999), Hart\'s War (2002), Tears of the Sun (2003), Hostage (2005), Lucky Number Slevin (2006), Surrogates (2009), Moonrise Kingdom (2012), Rock the Kasbah (2015) and Motherless Brooklyn (2019).\n\nAs a singer, Willis released his debut album The Return of Bruno in 1987, followed by two more successful albums in 1989 and 2001. He made his Broadway debut in the stage adaptation of Misery in 2015. Willis has received numerous accolades during his career, including a Golden Globe, two Primetime Emmy Awards, and two People\'s Choice Awards. He received a star on the Hollywood Walk of Fame in 2006.\n\nIn March 2022, Willis announced that he was retiring from acting after being diagnosed with aphasia, which affects his ability to communicate. In February 2023, Willis\' family announced that they had received a more accurate diagnosis and he had been diagnosed with frontotemporal dementia.','1955-03-19',NULL),(746,'Alexia Barlier','Paris, France','Alexia Barlier is a French actress born in Paris, France. She was brought up in both French and English language. She stars in the Michael Bay film 13 Hours: The Secret Soldiers of Benghazi (2016).\n\nAlexia is fully bilingual and has dual nationality. Growing up in Paris with a New Zealand ballet dancer mother and a French art dealer father exposed her not only to many cultures, but also to many languages, with French and English spoken at home in equal measure. She discovered her talent in acting at the age of 14 when she played Viola in Shakespeare\'s Twelfth Night on stage. She started taking acting classes soon after, and got her first part at 18 on the feature film 24 Hours in a Woman\'s Life by French director Laurent Bouhnik. That confirmed her love of acting and that she would definitely do it as a career.\n\nAlexia was revealed in 2007 as an Adami talent at the Cannes Film Festival for her part in the short films of Comédiennes by the Larrieu brothers and the same year for playing Magda, Daniel Auteuil\'s mistress in Conversations with My Gardener by famous French director Jean Becker.','1982-12-21',NULL),(747,'Gil Bellows','Vancouver, British Columbia, Canada','Gil Bellows (born June 28, 1967) is a Canadian film and television actor. He is best known for the roles of Tommy Williams in The Shawshank Redemption, Billy Thomas in the television series Ally McBeal and as CIA agent Matt Callan in the television series The Agency.','1967-06-28',NULL),(748,'Nick Toth',NULL,'Nick Toth is an actor.',NULL,NULL),(749,'Bill Stinchcomb',NULL,'Actor / Talent.',NULL,NULL),(750,'James Poule',NULL,'',NULL,NULL),(751,'Janet Tracy Keijser','Calgary, Alberta, Canada','From Wikipedia, the free encyclopedia.\n\nJanet Tracy Keijser is a Canadian actress known for her comedy and horror films.\n\nKeijser has appeared in such films as Zombie Chronicles filmed in 3D, Dead Seven and Killer Story. She has three feature films scheduled for release in 2010: Cold Ones, aka Dead Letters Schism, and Parasomnia.\n\nKeijser penned the tongue and cheek column for the Independent Film Quarterly magazine titled Blood Babe - My adventures in the trenches of low budget film making.\n\nKeijser is a regular in the improvisation shows scheduled at the LA Connection Comedy Theatre in Hollywood.\n\nDescription above from the Wikipedia article Janet Tracy Keijser, licensed under CC-BY-SA, full list of contributors on Wikipedia.',NULL,NULL),(752,'Ryan Francis','Los Angeles County, California, USA','','1977-01-08',NULL),(753,'Robin Shou','Hong Kong, British Crown Colony [now China]','Shou Wan Por  (born July 17, 1960), known professionally as Robin Shou, is a Hong Kong martial artist and actor. Frequently appearing in numerous martial arts films, Shou was most successful for playing the role of Liu Kang in Mortal Kombat & Gobei with the late Chris Farley in Beverly Hills Ninja.\n\nDescription above from the Wikipedia article Robin Shou, licensed under CC-BY-SA, full list of contributors on Wikipedia','1960-07-17',NULL),(754,'Samuel Baca-Garcia',NULL,'',NULL,NULL),(755,'Osric Chau','Vancouver, British Columbia, Canada','','1986-07-20',NULL),(756,'Robert Larriviere','Louisiana, USA','','1972-07-30',NULL),(757,'Tom Bui',NULL,'',NULL,NULL),(758,'Kim Yip Kwong-Kim',NULL,'',NULL,NULL),(759,'Albert Vidal',NULL,'',NULL,NULL),(760,'Iván Kamarás','Pécs, Hungary','Ivan Kamarás (born 22 December 1972) is a Hungarian actor best known worldwide for his role as Agent Steel in the 2008 superhero fantasy thriller Hellboy II: The Golden Army, directed by Guillermo del Toro. In January this year, he played a Hungarian detective, Tibor Orban, in Bloodlines, the fourth episode in the 14th series of the BBC crime drama Silent Witness. He lives in Santa Monica, California.\n\nDescription above from the Wikipedia article Iván Kamarás, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1972-12-22',NULL),(761,'Hootan Atefyekta',NULL,'',NULL,NULL),(762,'Danie Coleman',NULL,'',NULL,NULL),(763,'Jimmy Tatro','California, USA','James Richard Tatro (born February 16, 1992) is an American actor, voice actor, comedian, writer and YouTube personality. He is the creator and star of the YouTube channel LifeAccordingToJimmy, which has more than 3.4 million subscribers and over 713 million video views. He writes, produces and directs each of his video sketches with his friend, Christian A. Pierce.\n\nHe has appeared in Grown Ups 2, 22 Jump Street, Boo: A Madea Halloween, Super Troopers 2, Stuber, Bad Education, The King of Staten Island, and the music video for \"Freaky Friday\". He also starred in the first season of the true-crime mockumentary American Vandal, as Dylan Maxwell which garnered him critical acclaim. He also voiced for the animated films Smallfoot and Rumble as well as the cartoon The Mighty Ones.\n\nHe created, wrote, produced, directed, and starred in The Real Bros of Simi Valley on Facebook Watch.\n\nHe had a recurring role on Modern Family and The Guest Book. He has a lead role as Connor on the ABC comedy Home Economics.','1992-12-16',NULL),(764,'Kiefer Sutherland','Paddington, London, England, UK','Kiefer Sutherland is a British-Canadian actor, producer and director, best known for his portrayal of Jack Bauer on the Fox thriller drama series 24. He has won an Emmy Award and Golden Globe award. He is the son of Canadian actors Donald Sutherland and Shirley Douglas.','1966-12-21',NULL),(765,'Russell Hopton','New York City, New York, USA','','1900-02-17','1945-04-07'),(766,'Chrissy Cannone',NULL,'',NULL,NULL),(767,'Gastone Moschin','San Giovanni Lupatoto, Veneto, Italy','Italian stage, television and film actor perhaps best known for playing Don Fanucci in THE GODFATHER: PART II (1974). From 1970 until his death, he was married to actress Marzia Ubaldi.','1929-06-08','2017-09-04'),(768,'Texas Battle','Houston, Texas, USA','Texas Quency Battle (born August 9, 1980) is an American film and television actor, known for his role as Marcus Forrester on the CBS soap opera The Bold and the Beautiful.','1980-08-09',NULL),(769,'Orion Ben',NULL,'',NULL,NULL),(770,'George \'Gabby\' Hayes','Wellsville, New York, USA','George Hayes is an American character actor, the most famous of Western-movie sidekicks of the 1930s and 1940s. He worked in a circus and played semi-pro baseball while a teenager. In 1914, he married Olive Ireland and the pair became successful on the vaudeville circuit. Retired in his forties, he lost much of his money in the 1929 stock market crash and was forced to return to work. He played scores of roles in Westerns and non-Westerns alike, finally in the mid-1930s settling in to an almost exclusively Western career. He gained fame as Hopalong Cassidy\'s sidekick Windy Halliday in films between 1936 and 1939. Leaving the Cassidy films in a salary dispute, he was legally precluded from using the Windy nickname, and so took on the sobriquet Gabby, and was so billed from about 1940.  In his early films, he alternated between whiskered comic-relief sidekicks and clean-shaven bad guys, but by the later 1930s, he worked almost exclusively as a Western sidekick to stars such as John Wayne, Roy Rogers, and Randolph Scott. After his last film in 1950, he starred as the host of The Gabby Hayes Show.  He died on February 9, 1969.','1885-05-06','1969-02-09'),(771,'Tuks Tad Lungu',NULL,'',NULL,NULL),(772,'Keith Kurtz',NULL,'',NULL,NULL),(773,'Susan Young','Sydney, Australia.','Susan Young is an actress and director, known for 24 Hours to Live (2017), UNindian (2015) and Mary in the Locker Room (2014).','1968-02-29',NULL),(774,'Salah Bensalah','Casablanca, Morocco','Moroccan artist Saleh Bensalah, joined the Higher Institute of Dramatic Arts in Rabat, and studied theater for four years and obtained a diploma in diagnosis in 2003. He began working in the theater and the play Don Quixote with a Moroccan-style quote was the first play in which he participated, then he played limited roles on television until it came The experience of industrial film in 2005, and he also worked with international directors such as Florence Siri, director of the movie “The Intimate Enemy” with the great actor Benno Magimil. He also worked in documentaries produced by German companies specializing in topics related to the history of the Pharaohs. He played starring roles in several films, including the movie “The End.” This is his first starring in a movie with Moroccan director Hicham Lasri.',NULL,NULL),(775,'John Jezior',NULL,'',NULL,NULL),(776,'Sivuyile Ngesi',NULL,'Sivuyile Ngesi is an actor, known for 24 (2008), Invictus (2009) and Copposites (2012).',NULL,NULL),(777,'Tomas Boykin',NULL,'',NULL,NULL),(778,'Nimiah Rodgers',NULL,'',NULL,NULL),(779,'Kazue Fukiishi','Osaka, Osaka Prefecture, Japan','Kazue Fukiishi (吹石 一恵 Fukiishi Kazue) is a Japanese actress. She won the award for best supporting actress at the 28th Yokohama Film Festival for What the Snow Brings, Tegami, and Memories of Tomorrow.','1982-09-28',NULL),(780,'Sandrine Merette-Attiow',NULL,'',NULL,NULL),(781,'Barry Alexander',NULL,'',NULL,NULL),(782,'Staci Lynn Fletcher','Chicago, Illinois, USA','',NULL,NULL),(783,'Carmen López',NULL,'',NULL,NULL),(784,'Ralph Maizza',NULL,'',NULL,NULL),(785,'Beatriz Yuste',NULL,'',NULL,NULL),(786,'Laara Sadiq',NULL,'Laara Sadiq is a Canadian stage, film and television actress. She holds a BFA from the University of British Columbia, Vancouver, Canada.',NULL,NULL),(787,'Ed Anderson',NULL,'',NULL,NULL),(788,'Kiko Ellsworth','South Central - Los Angeles - California - USA','From Wikipedia, the free encyclopedia.\n\nKiko Ellsworth (born January 2, 1973) is an American actor. Ellsworth is best known for his portrayal of Jamal Woods in the now defunct ABC daytime drama, Port Charles. In March 2007, Ellsworth returned to daytime television in the role of Stan Johnson on another ABC daytime drama, General Hospital. In the Summer of 2008, he appeared as sound manipulator Echo De Mille in \"Going Postal\", a series of webisodes spun off from the NBC series Heroes.','1973-01-02',NULL),(789,'David Hemmings','Guildford, Surrey, England, UK','David Edward Leslie Hemmings (18 November 1941 – 3 December 2003) was an English film, theatre and television actor as well as a film and television director and producer.\n\nHe is noted for his role as the photographer in the drama mystery-thriller film Blowup (1966), directed by Michelangelo Antonioni. Early in his career, Hemmings was a boy soprano appearing in operatic roles. In his later acting career, he was known for his distinctive eyebrows and gravelly voice.\n\nDescription above from the Wikipedia article David Hemmings, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1941-11-18','2003-12-03'),(790,'Kyle Clements','Hammond, Louisiana, USA','Kyle Clements was born in Hammond, LA. He attended St. Thomas Aquinas High School where he was a standout athlete in both football and baseball. His football career continued in college where he was a wide receiver at Southeastern Louisiana University. During his freshman season he began nurturing his aspirations of a career in film and television. Kyle built a strong résumé throughout his collegiate and graduate school years, appearing in such films as 12 Rounds, and Bad Lieutenant: Port of Call New Orleans. Upon graduating from Southeastern Louisiana University with a Masters degree, Kyle began acting full time. He continues to build a solid career in the industry.','1984-08-20',NULL),(791,'Eric Lively','Atlanta, Georgia, USA','Eric Lawrence Lively (born July 31, 1981) is an American actor. He played the role Nick Larson in The Butterfly Effect 2.\n\nDescription above from the Wikipedia article Eric Lively, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1981-07-31',NULL),(792,'Ben Fiore','New York City, New York, USA','','1959-08-18',NULL),(793,'Tony Ho','Hong Kong, China','','1964-11-04',NULL),(794,'Noel Gugliemi','Santa Monica, California, USA','Noel Gugliemi is an American actor and producer.','1970-10-15',NULL),(795,'Veronica Ricci','Sacramento, California, USA','Veronica Ricci is a native of Sacremento, California. She describes herself as a \"latebloomer\" in how she developed during her teenage years as socially awkward and shy. Veronica eventually broke away from her strongly-shy nature, during her freshman year of college. The wild, party-going scenes she deeply involved herself in, suggestively helped Veronica realize how much she enjoyed being in front of people and how she enjoyed putting on a show for them. This early period of the young life of Veronica Ricci included go-go dancing at nightclubs as well as chance photo submitted to Hustler which led to her modeling career. She also spent a 3-year period in the adult film industry with 9 credits to her name. She specialized mostly in girl-on-girl content or solo scenes. Recently, Veronica returned to college, however she supports herself with part-time modeling on the side.','1988-04-17',NULL),(796,'Ron White','Fritch, Texas, USA','From Wikipedia, the free encyclopedia.\n\nRonald \"Tater Salad\" White (born December 18, 1956) is an American stand up comedian who has had two Grammy Award-nominations, and is RIAA certified 10x Platinum for CD and DVD sales of over 10 million units. He is a charter member of the Blue Collar Comedy Tour and authored the book I Had the Right to Remain Silent But I Didn\'t Have the Ability (Dutton 2006, ISBN 978-0525949619), which appeared on the New York Times best seller list. White is well-known for his famous punchline, \"...You can\'t fix stupid.\"\n\nDescription above from the Wikipedia article Ron White, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1956-12-18',NULL),(797,'Larry Pine','Tucson, Arizona, USA','Larry Pine (born March 3, 1945) is an American film, television and theatre actor.\n\nHe began his professional acting career Off-Broadway, then appeared in Cyrano de Bergerac at the Vivian Beaumont Theatre in 1968 as Fop. A founding member of the avant-garde theater company the Manhattan Project, Pine appeared with the group in Alice in Wonderland, directed by Andre Gregory, in 1970 (Manhattan Project 1973).\n\nHe made his film debut in 1978 in James Ivory\'s Hullabaloo Over Georgie and Bonnie\'s Pictures, which was made for television, but later was released theatrically. Since then, he has performed in Louis Malle\'s Vanya on 42nd Street, Woody Allen\'s Celebrity, Small Time Crooks, Melinda and Melinda, and other films.\n\nHe appears in the book Are You Dave Gorman? as the first actor encountered by the writer to have played a fictional Dave Gorman (in The Ice Storm). He has appeared twice as a \"Charlie Rose type\" interviewer in the films The Royal Tenenbaums and The Door in the Floor, featuring him in a dark studio conducting a one-on-one interview in Rose\'s distinctive format.\n\nHe appeared in All My Children as Max Jeffries (1992) and as Barry Shire #1 (1997–1999).\n\nMost recently, he appeared in Russ Emanuel\'s \"Chasing the Green\" alongside Jeremy London, Ryan Hurst, William Devane, and Robert Picardo.\n\nHe is married to composer and sound designer Margaret Pine.','1945-03-03',NULL),(798,'Na Gyeong-cheol',NULL,'','1986-09-05',NULL),(799,'Alex Bilbrey','Dallas, Texas, USA','',NULL,NULL),(800,'Bob Orrison','Bakersfield, California, USA','Bob Orrison was born on July 28, 1928 in Bakersfield, California, USA as Robert P. Orrison. As a stuntman he worked on 41 movies from 1968 to 2005. He is known for his stunt work on Rambo III (1988) and Die Hard 2 (1990). His stunt work was also done on a regular basis for eleven episodes of Harry O (1974-1975); 144 episodes of The Dukes of Hazzard where he was the stunt driver for the General Lee car (1979-1985); and 72 episodes of the A-Team where he doubled for George Peppard in performing stunts (1983-1986).\n\nHe died on October 11, 2014 when a pickup truck he was driving made a U-turn and was broadsided by a Jeep Cherokee in Rancho Cordova, California. Both Orrison and Gary McLarty, a passenger in the truck and Orrison\'s best friend, were killed. Both men were Hollywood Hall of Fame stuntmen. Orrison had lived in Rancho Cordova since 2007.','1928-07-28','2014-10-11'),(801,'Richard McCabe','Glasgow, Scotland, UK','From Wikipedia, the free encyclopedia.\n\nRichard McCabe (born 1960) is a Scottish actor.\n\nDescription above from the Wikipedia article Richard McCabe, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1960-08-18',NULL),(802,'Adil Hussain','Goalpara, Assam, India','Adil Hussain is an Indian actor who has worked in Indian cinema, including art house cinema and mainstream Bollywood, as well as international cinema, in films such as The Reluctant Fundamentalist and Life of Pi (both 2012). He received National Film Awards (Special Jury) at the 2017 National Film Awards for Hotel Salvation and Maj Rati Keteki. He has starred in English, Hindi, Assamese, Bengali, Tamil, Marathi, Malayalam, Norwegian and French films.\n\nBorn in Goalpara, Assam in 1963, where his father was the headmaster of a high secondary school, Hussain was the youngest of seven children.\n\nIn an interview he described his multiethnic background, as his maternal grandfather was Iraqi while his maternal grandmother had Assamese, English and Italian roots.\n\nHussain acted in school plays.\n\nHe left home at age 18 to study philosophy at B. Borooah College, Guwahati, he started acting in college plays and performing as a stand-up comedian.\n\nHe also mimicked popular Bollywood actors in between the performances of a local stand-up comedian group, the Bhaya Mama Group. He worked as a stand-up comedian for six years, joined a mobile theatre and also did some local cinema, before moving to Delhi, where he studied at National School of Drama (1990–1993).\n\nHe also studied at the Drama Studio London on a Charles Wallace India Trust Scholarship.\n\nAfter his return to India in 1994, Hussain joined the mobile \'Hengul Theater\' in Assam, where he worked for three years, before moving to Delhi. He started his stage career in Delhi, though he continued training under Khalid Tyabji. After Tyabji he trained with Swapan Bose at Sri Aurobindo Ashram, Puducherry, before starting training with Dilip Shankar in Delhi.\n\nAs an actor, he first received acclaim in Othello: A Play in Black and White (1999), which was awarded the Edinburgh Fringe First, and later Goodbye Desdemona also directed by Roysten Abel. He remained the artistic director and Trainer of the Society for Artists and Performers in Hampi from 2004 to 2007, and a visiting faculty at Royal Conservatory of Performing Arts, The Hague. He is also a visiting faculty at his alma mater, the National School of Drama.\n\nIn 2004, he made his Bengali film debut along with Soha Ali Khan in the period drama Iti Srikanta, where he played the lead role.\n\nOn television, he appeared in the lead role, in the detective series Jasoos Vijay (2002–2003), produced by BBC World Service Trust.\n\nThough he had appeared in a few Assamese films, did a small roles in Vishal Bhardwaj\'s Kaminey and Sona Jain\'s For Real, it was his role in Abhishek Chaubey\'s Ishqiya (2010) that got him attention in Bollywood, though his first major role was in Saif Ali Khan-Kareena Kapoor Khan starrer Agent Vinod released in early 2012. In the same year, he appeared in Italian director Italo Spinelli\'s Gangor, Mira Nair\'s The Reluctant Fundamentalist, and Ang Lee\'s Life of Pi.\n\nHe next appeared alongside Sridevi in the comedy drama English Vinglish (2012), and also received critical acclaim for his role in Lessons in Forgetting at the New Jersey Independent South Asian Cine Fest. After these he acted in Aditya Bhattacharya\'s Bombay Most Wanted and Partho Sen-Gupta\'s Sunrise. ...\n\nSource: Article \"Adil Hussain\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1963-10-05',NULL),(803,'DJ Pooh',NULL,'DJ Pooh is an American record producer, rapper, screenwriter and film director.','1969-04-14',NULL),(804,'Fred Ward','San Diego, California, USA','Fred Ward (December 30, 1942 - May 5, 2022) was an American actor. He began his career in 1979 alongside Clint Eastwood in Escape from Alcatraz. He was best known for his starring roles in the motion pictures Remo Williams, Tremors, Henry & June, Short Cuts, The Right Stuff and Exit Speed. Ward also acted in European movies.','1942-12-30','2022-05-08'),(805,'Mikki Val',NULL,'',NULL,NULL),(806,'Koen Kondo','Nishio, Aichi, Japan','Koen Kondo (Kôen Kondô; 近藤公園; born 11 October 1978) is a Japanese actor. He made his debut in the popular 2001 film Waterboys.','1978-10-11',NULL),(807,'Stephen Schneider','Sharon, Massachusetts, U.S.','From Wikipedia, the free encyclopedia\n\nStephen Schneider (born August 9, 1980) is an American actor, writer and entrepreneur, best known for his role as Jeremy Santos on Broad City.','1980-08-09',NULL),(808,'Jang Ji-gun','South Korea','Korean actor.','1988-01-01',NULL),(809,'Fred Ulysse','Sannois, Val-d\'Oise, France','Fred Ulysse (c. 1934 – 24 October 2020) was a French actor. He was known for his role of Martin Féral, brother of Jacquou le Croquant in the television series Jacquou le Croquant, based on the novel of the same name by Eugène Le Roy.\n\nSource: Article \"Fred Ulysse\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1934-09-12','2020-10-24'),(810,'Akshay Kumar','Amritsar, Punjab, India','Akshay Kumar is an Indian film actor, producer and martial artist who has appeared in over a hundred Hindi films. When he began his acting career in the 1990s, he primarily starred in action films and was particularly known for his appearances in feature films commonly called the \"Khiladi series\", which included Khiladi (1992), Sabse Bada Khiladi (1995), Khiladiyon Ka Khiladi (1996), and Khiladi 420 (2000), as well as other action films such as Mohra (1994). As a stunt actor, he often performed many dangerous stunts in his films, which earned him a reputation as the \"Indian Jackie Chan\". He later gained more fame for his drama, romance and comedy roles. He started becoming known for his performances in romance films like Yeh Dillagi (1994) and Dhadkan (2000) as well as drama films such as Ek Rishtaa (2001). His comic performances in comedy films such as Hera Pheri (2000), Mujhse Shaadi Karogi (2004), Garam Masala (2005) and Waqt: The Race Against Time (2005) met with acclaim. His success further rose in 2007, when he starred in four consecutive commercial hits. In 2008, the University of Windsor in Ontario, Canada conferred an Honorary Doctorate of Law on Kumar in recognition of his contribution to Indian cinema. In 2009, he was awarded the Padma Shri by the Government of India. He has thus established himself as one of the leading actors in Hindi cinema. In 2009, Kumar founded the Hari Om Entertainment production company.','1967-09-09',NULL),(811,'Gil Prather',NULL,'',NULL,NULL),(812,'Colm Feore','Boston, Massachusetts, USA','Colm Joseph Feore OC (/ˈkɒləm ˈfjɔːr/; born August 22, 1958) is a Canadian actor. A 15-year veteran of the Stratford Festival, he is known for his Gemini-winning turn as Prime Minister Pierre Trudeau in the CBC miniseries Trudeau (2002), his portrayal of Glenn Gould in Thirty Two Short Films About Glenn Gould (1993), and for playing Detective Martin Ward in Bon Cop, Bad Cop (2006) and its sequel Bon Cop, Bad Cop 2 (2017).\n\nHis other roles include Martin Harrison in Chicago (2002), Lord Marshal Zhylaw in The Chronicles of Riddick (2004), First Gentleman Henry Taylor on 24 (2009), Cardinal Della Rovere on The Borgias (2011–2013), Laufey in Thor (2011), General Ted Brockhart on House of Cards (2016–2017), Declan Gallard on 21 Thunder (2017), Wernher von Braun in For All Mankind (2019), and Sir Reginald Hargreeves on The Umbrella Academy (2019–present). Feore is also a Prix Iris and Screen Actors Guild Award winner and a Genie Award nominee.','1958-08-22',NULL),(813,'Tiziana Fibi',NULL,'',NULL,NULL),(814,'Armand Assante','New York City, New York, USA','Armand Anthony Assante is an American actor. He is best known for his roles as mobster John Gotti in the 1996 HBO television film Gotti, Nietzsche in When Nietzsche Wept and Mickey Spillane\'s Mike Hammer in 1982\'s I, the Jury.','1949-10-04',NULL),(815,'Aaron Lynch',NULL,'',NULL,NULL),(816,'Claire Berlein',NULL,'',NULL,NULL),(817,'Joey Travolta','Englewood, New Jersey, USA','Joseph Allen Travolta (born October 14, 1950) is an American actor, singer, producer, director and screenwriter. He is the older brother of actor John Travolta.','1950-10-14',NULL),(818,'Kyle Schmid','Mississauga, Ontario, Canada','From Wikipedia, the free encyclopedia\n\nKyle Schmid (born August 3, 1984 in Mississauga, Ontario) is a Canadian actor who starred as Henry Fitzroy in Lifetime\'s series Blood Ties. He has also guest starred in a number of television series including Degrassi: The Next Generation, Odyssey 5, The Zack Files and CSI: Miami.\n\nIn addition he has also appeared in a number of films like The Covenant, A History of Violence, The Sisterhood of the Traveling Pants, The Pacifier, and Zerophilia. He also had a recurring role as Evan Frasier in the ABC Family original series Beautiful People and co-starred in the Disney Channel Original Movies Alley Cats Strike and The Cheetah Girls with Raven-Symoné acting as Galleria\'s love interest, Derek. Currently residing in Los Angeles, CA, Kyle spends some of his free time playing his favorite sport, soccer. Other hobbies include swimming, horseback riding and mountain biking. He played on the Erin Mills soccer team, and attended Port Credit Secondary School in Mississauga, Ontario.\n\nDescription above from the Wikipedia article Kyle Schmid, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1984-08-03',NULL),(819,'Yudi Ahmad Tajudin',NULL,'Yudi is a prominent Indonesian theater director who has brought his works to prestigious international venues and festivals. He also involved in numerous feature films as actor.',NULL,NULL),(820,'Tait Fletcher','Alpena, Michigan, USA','Tait Fletcher is known for Jumanji: Welcome to the Jungle (2017), Breaking Bad (2008) and Westworld (2016).','1971-02-07',NULL),(821,'Atanas Srebrev','Sofia, Bulgaria','','1971-04-19',NULL),(822,'Jiang Wu','Tangshan, Hebei, China','Wu Jiang was born on November 14, 1967 in Tangshan, China. He has graduated from Beijing Film Academy.\n\nHe starred in Zhang Yimou\'s To Live (1994), and Zhang Yang\'s Shower (1999). He is the younger brother of director, screenwriter and actor Jiang Wen.','1969-11-04',NULL),(823,'Mayuko Iwasa','Nerima, Tokyo Prefecture, Japan','Iwasa Mayuko is a former Japanese actress and entertainer born in Tokyo. She formerly belonged to Platinum Productions. As an actress, she is best known for her roles in \"Galcir\" and \"Deep Love\".\n\nShe was scouted in Shibuya in 2003. At the age of 16, she was selected as \"Miss Magazine 2003\" and made her debut in the entertainment world. She was an active and popular gravure model for a time.\n\nAs an actress, she starred in the 2004 TV series \"Deep Love\". That same year, she won the 42nd Golden Arrow Graph Award for her success as a gravure model. In 2014, she won the 23rd Japanese Professional Movie Awards for Emerging Actress for her performance in \"Passion (Junan)\".\n\nOn October 1, 2020, she reported on her own Instagram her retirement from the entertainment world. At the end of September of the same year, she revealed that after retiring, she would work towards being a long-term care worker.','1987-02-24',NULL),(824,'Kristo Immanuel',NULL,'Kristo Immanuel is an Indonesian internet personality. His signature on social media is a comedy impersonation.',NULL,NULL),(825,'James Lee Guy','Indiana, USA','','1968-06-25',NULL),(826,'Lee Phelps','Philadelphia, Pennsylvania, USA','From Wikipedia, the free encyclopedia\n\nLee Phelps (May 15, 1893 – March 19, 1953) was an American film actor. He appeared in over 600 films between 1917 and 1953, mainly in uncredited roles. He also appeared in three films - Grand Hotel, You Can\'t Take It with You, and Gone with the Wind - that won the Academy Award for Best Picture.\n\nPhelps appeared in the 1952 episode \"Outlaw\'s Paradise\" as a judge in the syndicated western television series The Adventures of Kit Carson, starring Bill Williams in the title role. He also appeared in a 1952 TV episode (#90) of The Lone Ranger.','1893-05-14','1953-03-19'),(827,'John Corbett','Toronto, Canada','John Corbett was born on March 24, 1954 in Toronto, Canada. He is an actor, known for Lost Girl (2010), People of Earth (2016) and Utilities (1983).','1954-03-24',NULL),(828,'Barbara Frey',NULL,'','1941-11-17',NULL),(829,'Atif Y. Siddiqi',NULL,'Atif Y. Siddiqi is a Canadian actor and director based in Montreal, Quebec.',NULL,NULL),(830,'Michael Madsen','Chicago, Illinois, USA','An American actor, poet, and photographer. He has starred in central roles in such films as Reservoir Dogs, Free Willy, Donnie Brasco, and Kill Bill, in addition to a supporting role in Sin City. Madsen is also credited with voice work in several video games, including Grand Theft Auto III, True Crime: Streets of L.A. and DRIV3R.','1957-09-25',NULL),(831,'Marc Macaulay','Millinocket, Maine, USA','Marc Macaulay is an American character actor and occasional stuntman with nearly 160 credits to his name. He was born in Millinocket, Maine, in 1957. He graduated with a BFA in theater from the University of Maine. Macaulay began his acting career in the early 1980s. He has appeared in numerous films and television shows, including Edward Scissorhands (1990), Passenger 57 (1992), Cop and a Half (1993), The Real McCoy (1993), and Burn Notice (2007-2013). Macaulay is also a skilled stuntman. He has performed stunts in films such as The Punisher (2004), Monster (2003), and The Jacket (2005). In addition to his work in film and television, Macaulay has also appeared in several stage productions. He has won numerous awards for his work, including a Drama Desk Award for Outstanding Featured Actor in a Play for his performance in the 1997 production of The Last Days of Judas Iscariot. Macaulay is a versatile actor who is known for his strong presence and his ability to bring complex characters to life. He is a respected member of the acting community and continues to work in film, television, and theater.','1957-10-13',NULL),(832,'Jack Kesy','New York City, New York, USA','Jack Kesy  is an American actor. On television, he has portrayed Gabriel Bolivar on the FX horror drama The Strain (2014–2016) and Roller Husser on the TNT dark comedy Claws (2017–present). He also played Black Tom Cassidy in the Marvel Comics film Deadpool 2 (2018).','1986-08-27',NULL),(833,'Augustin Legrand','La Neuville-aux-Bois, France','Augustin Legrand is a French actor. He replaced Jonathan Goldsmith as Dos Equis\' Most Interesting Man in the World in 2016.','1975-07-21',NULL),(834,'Spencer Boldman','Dallas, Texas, USA','','1992-07-28',NULL),(835,'Sam Medina','Ho Chi Minh City, Vietnam','Sam Medina is an actor, producer and stuntman.',NULL,NULL),(836,'Sebastian Spence',' St. Johns, Newfoundland, Canada','Sebastian Spence (born December 9, 1969) is a Canadian actor best known for his roles as Cliff Harting on Hallmark\'s series Cedar Cove (2013-2015), and as Cade Foster in the Space Channel scifi series, First Wave (1998–2001).\n\nHis first on-camera role was in the second part of the Canadian TV miniseries, The Boys of St. Vincent. His next role was in the trilogy of A Family of Cops TV movies with Charles Bronson, playing Eddie Fein the younger son of Bronson\'s character. His first leading role was as Cade Foster, in the Space Channel (and later Sci-Fi Channel) original series, First Wave, which ran between 1998 and 2001. He later played the role of Cliff Harting on the Hallmark Channel drama Cedar Cove, between 2013 and 2015.','1969-12-09',NULL),(837,'Naoki Fuji',NULL,'',NULL,NULL),(838,'Eddie Hassell','Corsicana, Texas, USA','Eddie Hassell was born on July 16, 1990 in Corsicana, Texas, USA as Ed Taylor Hassell. He is known for his work on The Kids Are All Right (2010), Surface (2005) and 2012 (2009).','1990-07-16','2020-11-01'),(839,'Tseng Chang','Beijing，China','Tseng Chang was an actor and assistant director. He has appeared in more than 100 films and has directed 7 feature films. He spoke five languages: Mandarin, Cantonese, English, Japanese and some Korean. His father was Chang Der Lou, a famous star of the Peking opera.\n\nHe became an actor in 1951, when the air transport company he worked for shut down. A noted Chinese actress met him, felt he had great potential as an actor and helped him get started. In 1994, he made Vancouver, British Columbia his home.\n\nHe was honored in 2000 by the Hong Kong government for his lifetime achievements.','1931-05-18','2021-01-25'),(840,'Shinoburyû',NULL,'',NULL,NULL),(841,'Fléu Tanabe',NULL,'',NULL,NULL),(842,'Bailey Roberts',NULL,'',NULL,NULL),(843,'Mikhail Belsky',NULL,'',NULL,NULL),(844,'David Kency',NULL,'',NULL,NULL),(845,'Bret Aaron Knower',NULL,'',NULL,NULL),(846,'Francesco Salvi','Luino, Lombardy, Italy','Francesco Salvi was born on February 7, 1953 in Luino, Lombardy, Italy. He is an actor and writer, known for La rentrée (2001), Talent High School - Il sogno di Sofia(2012) and Streets of Philadelphia - Unter Verrätern(2006). He is married to Angela.','1953-02-07',NULL),(847,'Dylan Smith','The Hague, South Holland, the Netherlands','Dylan Smith is a actor and teacher.',NULL,NULL),(848,'Mark Basnight',NULL,'',NULL,NULL),(849,'Lorenzo Lamas','Santa Monica, California, USA','Lorenzo de Santos-Lamas (born January 20, 1958) is an American-Argentinian actor and reality television participant. Lamas is known for playing Lance Cumson, the irresponsible grandson of Angela Channing (played by Jane Wyman) on the popular 1980s soap opera Falcon Crest, Reno Raines on the 1990s crime drama Renegade, and Hector Ramirez on the daytime soap opera The Bold and The Beautiful. Lamas also served as a judge on ABC television\'s short-lived reality show Are You Hot?. Presently, he stars in his own reality show, Leave it to Lamas, a series about his real-life family.\n\nDescription above from the Wikipedia article Lorenzo Lamas, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1958-01-20',NULL),(850,'Libby Blake',NULL,'',NULL,NULL),(851,'Caroline Aaron','Richmond, Virginia, USA','Caroline Aaron (born August 7, 1952) is an American actress. She is best known for her role as acid-tongued talk show host Mary Pat Lee on Wings.\n\nDescription above from the Wikipedia article Caroline Aaron, licensed under CC-BY-SA, full list of contributors on Wikipedia','1952-08-07',NULL),(852,'Sharon Canovas',NULL,'',NULL,NULL),(853,'Starletta DuPois','Philadelphia, Pennsylvania, USA','','1941-07-18',NULL),(854,'Bruno Ricci',NULL,'Bruno Ricci is an French actor and and production manager who portrayed Jacques Dernier in Captain America: The First Avenger. He is well-known for playing roles in movies such as 3 Days to Kill, The Apartment, and My Afternoons with Margueritte.',NULL,NULL),(855,'Louis F. Garcia',NULL,'',NULL,NULL),(856,'Arnold Chon','Alexandria, Virginia, USA','Arnold Chon is an actor and a stunt performer.','1980-10-09',NULL),(857,'Raveena Ravi','Chennai, Tamil Nadu, India','Raveena Ravi is an Indian voice actress. She debuted as an actress on-screen with Oru Kidayin Karunai Manu (2017).','1993-12-11',NULL),(858,'Phil Jordan',NULL,'',NULL,NULL),(859,'Mei Ting','Nanjing，Jiangsu Province，China','Mei Ting (Chinese: 梅婷) is an award-winning Chinese actress.','1975-04-30',NULL),(860,'David Dennis',NULL,'',NULL,NULL),(861,'Ken Aldrich',NULL,'',NULL,NULL),(862,'Gerald Webb','West Los Angeles, California, USA','Gerald Webb is an American actor, stuntman, writer and producer.',NULL,NULL),(863,'Peter MacNicol','Dallas, Texas, USA','Peter MacNicol is an American actor. He received a Theatre World Award for his 1981 Broadway debut in the play Crimes of the Heart. His film roles include Galen in Dragonslayer (1981), Stingo in Sophie\'s Choice (1982), Janosz Poha in Ghostbusters II (1989), camp counselor Gary Granger in Addams Family Values (1993), and David Langley in Bean (1997).\n\nMacNicol was born in Dallas, Texas, on April 10, 1954. He attended the University of Dallas and the University of Minnesota, where he studied theater. After graduating, he moved to New York City to pursue an acting career.\n\nMacNicol made his Broadway debut in 1981 in the play Crimes of the Heart. He won a Theatre World Award for his performance. He went on to appear in a number of other Broadway productions, including The Real Thing (1984), The Crucible (1996), and The Pillowman (2005).\n\nMacNicol has also had a successful career in film and television. He has appeared in a number of films, including Sophie\'s Choice (1982), Ghostbusters II (1989), Addams Family Values (1993), and Bean (1997). He is best known for his role as the eccentric lawyer John Cage in the FOX comedy-drama Ally McBeal (1997–2002), for which he won a Primetime Emmy Award for Outstanding Supporting Actor in a Comedy Series in 2001.\n\nMacNicol has also appeared in a number of other television shows, including 24 (2001), Numbers (2005), and Veep (2012-2019). He is a versatile actor who has shown his range in a variety of roles.\n\nMacNicol is married to Martha Cumming, and they have two children. He is a member of the Actors\' Equity Association and the Screen Actors Guild.','1954-04-10',NULL),(864,'Gérard Depardieu','Châteauroux, Indre, France','Gérard Xavier Marcel Depardieu (born 27 December 1948) is a French actor, film-maker, businessman and vineyard owner. He is one of the most prolific character actors in film history, having completed approximately 170 movies since 1967. He has twice won the César Award for Best Actor as well as the Golden Globe award for Best Actor in Green Card. After he garnered huge critical acclaim for the title role in Cyrano de Bergerac, which landed him a nomination for an Academy Award, Depardieu acted in many big budget Hollywood movies. He is a Chevalier of the Légion d\'honneur and Chevalier of the Ordre national du Mérite. He was granted citizenship of Russia in January 2013 and the same month became a cultural ambassador of Montenegro. In 2015 he left Russia declaring that he intends to give up the citizenship and to live in Belgium.','1948-12-27',NULL),(865,'Sonny Vellozzi','Philadelphia, Pennsylvania, USA','','1953-04-14',NULL),(866,'Peter Facinelli','Queens, New York, USA','Peter Facinelli is an American actor and producer. He is best known for his role as Dr. Carlisle Cullen in the Twilight Saga.','1973-11-26',NULL),(867,'Chris Ghaffari',NULL,'',NULL,NULL),(868,'Sebastian Roché','Paris, France','Sebastian Roché is a Scottish-French actor and writer known for his roles as Kurt Mendel on Odyssey 5, , Thomas Jerome Newton on Fringe, Balthazar on Supernatural, and Mikael Mikaelson on both The Vampire Diaries and The Originals.','1964-08-04',NULL),(869,'Stefan Ivanov',NULL,'',NULL,NULL),(870,'Big John',NULL,'',NULL,NULL),(871,'Lori Eastside',NULL,'',NULL,NULL),(872,'Kim Hyun-woo','South Korea','Korean actor.','1996-01-01',NULL),(873,'Dean Redman',NULL,'Dean Redman is a British-born Canadian actor and stuntman. His past work includes Godzilla, Rise of the Planet of the Apes, TRON: Legacy and Warcraft: The Beginning, where he played two roles. He is also well-known for his voice work in the animated series \"Black Lagoon\" and \"Iron Man: Armored Adventures\". Dean currently has a recurring role in the Disney hit series \"MECHX4\" and appears as XO Stone in the third installment of the Planet of the Apes reboot series, War for the Planet of the Apes.',NULL,NULL),(874,'Lee Lik-Chi','Hong Kong, British Crown Colony [now China]','Lee Lik-chi is a Hong Kong-based actor, director, and screenwriter. He is best known for his collaborations with Stephen Chow before disassociating each other due to frequent clashes. He is also an active contributor to local education, lecturing and organising filmmaking programs to students.','1961-05-10',NULL),(875,'Hiroki Matsukata','Tokyo, Tokyo Prefecture, Japan','Kōju Meguro (Japanese: 目黒 浩樹 Hepburn: Meguro Kōju, July 23, 1942 – January 21, 2017), better known by his stage name Hiroki Matsukata (松方 弘樹 Matsukata Hiroki), was a Japanese actor. He was the son of jidaigeki actor Jūshirō Konoe and actress Yaeko Mizukawa and has a younger brother, Yūki Meguro, who is also an actor. With ex-wife actress Akiko Nishina he had two children; son Masaki Nishina and daughter Hitomi Nishina are both in the entertainment industry.','1942-07-23','2017-01-21'),(876,'Miodrag Stevanović',NULL,'',NULL,NULL),(877,'Liam Cunningham','Dublin, Ireland','Liam Cunningham (born 2 June 1961) is an Irish actor. He has appeared in numerous film and television productions including A Little Princess, First Knight, Jude and the BBC One science-fiction drama series Outcasts.\n\nDescription above from the Wikipedia article Liam Cunningham (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.','1961-06-02',NULL),(878,'Jackie Shroff','Bombay, India','Jai Kishan Kakubhai \"Jackie\" Shroff is an Indian actor. He has been in the Hindi cinema (Bollywood) industry for almost four decades and as of 2017 has appeared in more than 220 films in thirteen languages. (Hindi, Konkani, Kannada, Marathi, Oriya, Punjabi, Bengali, Malayalam, Tamil, Telugu, Bhojpuri, Gujarati, and English language). He has won four Filmfare Awards among other accolades. He has also appeared in several successful short films.','1957-02-01',NULL),(879,'Nick Alachiotis',NULL,'',NULL,NULL),(880,'Amanda Banffy',NULL,'',NULL,NULL),(881,'Henrique Figueiras',NULL,'',NULL,NULL),(882,'Michael Treanor','Los Angeles, California, USA','From Wikipedia, the free encyclopedia.\n\nMichael Treanor (born April 17, 1979) is an actor and martial artist who starred in 3 Ninjas and 3 Ninjas Knuckle Up. He is the third son of Richard and Peggy Treanor.\n\nTreanor was discovered by casting agents for 3 Ninjas in his martial arts class. After encouragement from friends and family, he auditioned for and successfully landed the role of eldest brother Rocky.\n\nTreanor is a black belt and continues to practice as an adult.\n\nDescription above from the Wikipedia article Michael Treanor, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1979-04-17',NULL),(883,'Wallace Clarke',NULL,'',NULL,'1920-01-30'),(884,'Sergio Rizzuto',NULL,'Sergio Rizzuto is a film actor and producer.',NULL,NULL),(885,'Brian Stanton','El Paso, Texas, USA','','1979-05-28',NULL),(886,'Lawrence Gilligan',NULL,'',NULL,NULL),(887,'Scott Haze','Dallas, Texas, USA','Scott Haze (born June 28, 1983) is an American actor and filmmaker.','1993-06-28',NULL),(888,'Carol Sutton','New Orleans, Louisiana, USA','Carol Sutton was an actress known for her work on Steel Magnolias (1989), Ray (2004) and Monster\'s Ball (2001). She was married to Archie Sutton . She died on December 10, 2020 in Louisiana due to Covid-19 complications.','1933-06-29','2020-12-10'),(889,'Ming Wang',NULL,'',NULL,NULL),(890,'Harry Hudson',NULL,'',NULL,NULL),(891,'Christine Aldrich',NULL,'',NULL,NULL),(892,'Khalil McMillan',NULL,'',NULL,NULL),(893,'Felissa Rose','Greenwich Village, New York City, New York, USA','Felissa Rose (born May 23, 1969) is an American actress and producer.','1969-05-23',NULL),(894,'Chris Parnell','Memphis, Tennessee, USA','Thomas Christopher \"Chris\" Parnell (born February 5, 1967) is an American comic actor best known as a cast member on Saturday Night Live from 1998–2006 and currently for his recurring role as Dr. Leo Spaceman on NBC\'s Emmy Award-winning comedy series 30 Rock. Parnell is currently one of the lead voices on the FX animated comedy Archer. In 2010, Parnell starred alongside his former SNL castmate Horatio Sanz in the Comedy Central series Big Lake.\n\nAfter performing as a company player with The Groundlings for a number of years, Parnell was hired to join the cast of Saturday Night Live as a featured player on September 26, 1998, and was promoted to repertory player the following season. In the summer of 2001, budget cuts and hiring four new cast members required Lorne Michaels to dismiss two cast members; he chose to lay off Parnell and Jerry Minor over Horatio Sanz, Rachel Dratch, and Maya Rudolph.\n\nWhile on SNL, Parnell appeared in numerous sketches, and commercial parodies, and performed memorable impressions of various celebrities. One of his most popular sketches is Lazy Sunday, a rap video he shot with Andy Samberg about buying cupcakes and going to see The Chronicles of Narnia. He has also performed raps about hosts Jennifer Garner, Britney Spears, Kirsten Dunst and Ashton Kutcher.\n\nIn the summer of 2006, Lorne Michaels announced that four cast members would be fired due to budget cuts, but he did not say who. On September 22, 2006 it was announced that three cast members had been fired: Parnell, Horatio Sanz, and Finesse Mitchell. This effectively made him the only SNL performer to have been fired twice by Lorne Michaels, though Parnell did say in a 2008 interview with The Sound of Young America podcast that he was okay with being let go this time, because he was considering leaving after that season anyway, but added that he probably would have stayed one last season if he was asked back. He had been with SNL for eight seasons; at the time only four people (Darrell Hammond, Tim Meadows, Kevin Nealon, and Al Franken) have been cast members longer. He has since made uncredited cameo appearances on the show, most recently in 2008 parodying newscasters Tom Brokaw, Jim Lehrer, and Bob Schieffer.\n\nParnell and his former SNL castmate Horatio Sanz recently starred together in Big Lake, a 2010 sitcom on Comedy Central from executive producers Will Ferrell and Adam McKay.\n\nHe also recently appeared as Dr. Drummer/Santa in the SyFy Holiday Special episode from the television show Eureka, which aired on December 7, 2010 (Season 4 Episode 10).','1967-02-05',NULL),(895,'Kwan Yung',NULL,'Kwan Yung started his film career as one of the many factory henchman in Dragons Forever (1988). He featured in over fifty movies, mostly as a stuntman and in smaller roles including several projects with the world famous Jackie Chan Stunt Team.',NULL,NULL),(896,'Raymond Steers',NULL,'',NULL,NULL),(897,'Rebecca Marshall','Toronto, Ontario, Canada','',NULL,NULL),(898,'Keegan Bouton','North Carolina, USA','',NULL,NULL),(899,'Zhu Zhenyu',NULL,'',NULL,NULL),(900,'Sam Moses','Bangalore, India','Sam Moses is an actor.','1944-03-19','2016-06-21'),(901,'Huey White','Chicago, Illinois, USA','','1897-08-28','1938-06-23'),(902,'John Rhys-Davies','Ammanford, Wales, UK','John Rhys-Davies (born 5 May 1944) is a Welsh actor and vocal artist. He is perhaps best known for playing the charismatic Arab excavator Sallah in the Indiana Jones films and the dwarf Gimli in The Lord of the Rings trilogy, in which he also voiced the ent, Treebeard. He also played Agent Michael Malone in the 1993 remake of the 1950s television series The Untouchables, Professor Maximillian Arturo in Sliders, King Richard I in Robin of Sherwood, General Leonid Pushkin in the James Bond film The Living Daylights, and Macro in I, Claudius. Additionally, he provided the voices of Cassim in Disney\'s Aladdin and the King of Thieves, Man Ray in SpongeBob SquarePants, and Tobias in the computer game Freelancer. He is also the narrator for the TV show Wildboyz.\n\nDescription above from the Wikipedia article John Rhys-Davies, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1944-05-05',NULL),(903,'Jim Sturgeon',NULL,'',NULL,NULL),(904,'Devanandha',NULL,'',NULL,NULL),(905,'Nazzareno Cardinali',NULL,'',NULL,NULL),(906,'Sammy Maloof',NULL,'Sammy Maloof is a professional stuntman, stunt driver, tech advisor, and coordinated stunts. Sammy has been a professional stuntman for over 25 years.',NULL,NULL),(907,'Schuster Vance',NULL,'',NULL,NULL),(908,'Gary A. Hecker','Akron, Ohio, USA','Gary Allan Hecker (born August 25, 1960) is a foley artist who has provided physical sound effects and creature vocals for nearly 200 films and television series.','1960-08-25',NULL),(909,'Clint Howard','Burbank, California, USA','An American film and television actor. He is a character actor with numerous brief appearances on television and films, usually noted for his unusual appearance. He has played many bit parts in movies directed by his brother, actor-turned-director Ron Howard. He is also the uncle of actress Bryce Dallas Howard.\n\nDescription above from the Wikipedia article Clint Howard, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1959-04-20',NULL),(910,'Isabelle Fournel',NULL,'',NULL,NULL),(911,'Andray Johnson','Chicago, Illinois, USA','','1961-03-10',NULL),(912,'Joseph Brutsman',NULL,'',NULL,NULL),(913,'Hennely Jimenez',NULL,'',NULL,NULL),(914,'Christian Slater','New York City, New York, USA','Christian Michael Leonard Slater (born August 18, 1969) is an American actor. He made his film debut playing a leading role in the 1985 film The Legend of Billie Jean. He then played a monk\'s apprentice alongside Sean Connery in The Name of the Rose before gaining recognition for his breakthrough role in the cult film Heathers. In the 1990s Slater featured in many big budget films including Robin Hood: Prince of Thieves, Interview with the Vampire: The Vampire Chronicles, Broken Arrow and Hard Rain. He was also featured in the cult film True Romance. Since 2000 Slater has combined work in the film business with television, including appearances in The West Wing and Alias. Slater was married to Ryan Haddon between 2000 and 2005; they had two children together. Slater has had widely publicized brushes with the law, including being sentenced to three months in jail for assault in 1997.','1969-08-18',NULL),(915,'Carl Singleton',NULL,'',NULL,NULL),(916,'Stewart Myiow',NULL,'',NULL,NULL),(917,'Courtney Hojenski',NULL,'',NULL,NULL),(918,'Alban Lenoir','Dijon, Côte-d\'Or, France','Alban Lenoir (born 16 December 1980) is a French actor, screenwriter and stuntman. He was nominated for a Lumières Award for his leading role in the film French Blood (2015). As a stuntman, he has worked on Les Brigades du Tigre (2006), Taken (2008), Hero Corp (2008-2010), The Princess of Montpensier (2010), Outside the Law (2010), Point Blank (2010), Erased (2012).','1980-12-16',NULL),(919,'Gary Combs','Los Angeles, California, USA','','1935-12-13',NULL),(920,'Sarah Smyth','Nova Scotia, Canada','Sarah Smyth was born on October 12, 1982 in Nova Scotia, Canada. She is an actress, known for Bad Times at the El Royale (2018), 50/50 (2011) and Cedar Cove (2013). She is married to Andrew Dunbar. They have one child.  RK','1982-10-12',NULL),(921,'Romano Puppo',' Rome, Italy','Romano Puppo was an Italian stuntman and actor who found himself cast in many \"tough guy\" roles from the 1960\'s through to the 1980\'s. He doubled for Lee Van Cleef  in his Spaghetti Western outings and was one of the pallbearers at Van Cleef\'s funeral. Puppo died having a heart attack while riding his motorcycle outside of Trieste, Italy in 1994.','1933-03-25','1994-05-11'),(922,'Gianluca Petrazzi','Roma, Lazio, Italy','','1966-09-02','2017-10-31'),(923,'James Marsden','Stillwater, Oklahoma, USA','James Paul Marsden (born September 18, 1973) is an American actor, singer, and former model. Marsden began his acting career guest starring in the television shows Saved by the Bell: The New Class (1993), Touched by an Angel (1995), Party of Five (1995), and miniseries Bella Mafia (1997). He gained prominence in the early 2000s with his portrayal of Scott Summers / Cyclops in the X-Men film series (2000–2014), and starred in Superman Returns (2006). Other works during this period include The Notebook (2004), 10th & Wolf (2006), and The Alibi (2006).\n\nFollowing his breakthrough in comic book films, Marsden went on to star in various genre films, including Hairspray (2007), which was a critical and commercial success and won many awards for its ensemble cast. As Corny Collins, he sang two songs for the film\'s soundtrack which has been certified Platinum by the RIAA. He subsequently appeared in the films Sex Drive (2008), The Box (2009), and Straw Dogs (2011). Marsden has also had starring roles in family-friendly films such as Enchanted (2007), Hop (2011), and Disenchanted (2022), and leading roles in 27 Dresses (2008), The Best of Me (2014), and Tom Wachowski in Sonic the Hedgehog (2020) and Sonic the Hedgehog 2 (2022).\n\nIn 2012, Marsden starred in a range of independent films such as Small Apartments, Bachelorette, and Robot & Frank. He later returned to television guest-starring in Modern Family (2011), and playing Liz Lemon\'s love interest, Criss Chros in 30 Rock (2012–2013) in a supporting role. In 2013, Marsden portrayed President John F. Kennedy in Lee Daniels\'s The Butler, and had a supporting role in Anchorman 2: The Legend Continues. He starred as gunslinging sentient android Teddy Flood in the first two seasons HBO science fiction series Westworld (2016–2022), a role he reprised in the fourth season. Since 2019, Marsden has starred as Steve and Ben Wood in the Netflix black comedy series Dead to Me. In 2020, Marsden played Stu Redman in the Paramount+ miniseries The Stand. He also has a role in Netflix\'s upcoming film Unfrosted: The Pop Tart Story.','1973-09-18',NULL),(924,'Settimio Scacco','Rome, Lazio, Italy','','1944-10-16','2007-03-24'),(925,'Shakes Myeko',NULL,'',NULL,NULL),(926,'Toby Stephens','Fitzrovia, London, England, UK','Toby Stephens (born 21 April 1969) is an English stage, television