York City, New York, USA','',NULL,NULL),(936,'Danny Denzongpa','Sikkim, India','From Wikipedia, the free encyclopedia.\n\nTshering Phintso Denzongpa, widely known by his acting name \"Danny\" Denzongpa (born 25 February 1948) is an Indian actor of Sikkimese ancestry working in Bollywood films.\n\nDenzongpa was born in the state of Sikkim, at that time an independent Bhutia monarchy. He is an ethnic Bhutia and speaks Bhutia as his mother tongue.\n\nHe started his career by singing Indian and Nepali songs and acting in Indian and Nepali movies. His nepali song \"Kaanchi lai ghumaune Kathmandu Sahara\" is still famous among Nepali people after 2 decades. He has acted in numerous Hindi films such as Asoka and 16 December. He has also starred in some international projects, the most famous being Seven Years in Tibet where he acted alongside Hollywood actor Brad Pitt. In 2003, Denzongpa was awarded the Padma Shree, India\'s fourth highest civilian honour. Denzongpa is noted for his villainous and character roles.\n\nHe started dabbling in the brewing industry after 1982, and in 2009, his company Yuksom Breweries, which has three breweries in Sikkim, Orissa and Assam, and sells over three million cases, acquired Rhino Breweries in Assam, to thwart industry leader United Breweries’ (UB) plans to take over the North East market.\n\nDescription above from the Wikipedia article Danny Denzongpa, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1948-02-25',NULL),(937,'Heather Johansen',NULL,'',NULL,NULL),(938,'Adam Hugill','Yorkshire, England, UK','Adam Hugill is an actor, known for 1917 (2019), The Banishing (2020) and Pennyworth (2019).','1997-07-22',NULL),(939,'Brian Schacter',NULL,'',NULL,NULL),(940,'Ken Garito','Brooklyn, New York, USA','','1968-12-27',NULL),(941,'Christian De Sica','Roma, Lazio, Italy','','1951-01-05',NULL),(942,'Heberth Somaeb',NULL,'',NULL,NULL),(943,'Joe Finfera',NULL,'',NULL,NULL),(944,'Kasugia',NULL,'',NULL,NULL),(945,'Jarrett Furst',NULL,'',NULL,NULL),(946,'Daisuke Ono','Sakawa, Kochi Prefecture, Japan','Daisuke Ono is a Japanese voice actor and singer who won the 4th and 9th Seiyu Awards for best lead actor for his role as Sebastian Michaelis in Black Butler, Jotaro Kujo in JoJo\'s Bizarre Adventure and Shukuro Tsukishima in Bleach, as well as \"Best Personalities\" at the 9th Seiyu Awards. Other notable roles include Erwin Smith in Attack on Titan, Shizuo Heiwajima in Durarara!!, Jyushimatsu in Osomatsu-san, Shintarō Midorima in Kuroko\'s Basketball, Killer T Cell in Cells at Work! and Ushiromiya Battler in Umineko When They Cry and Nobuyuki Sanada in Samurai Warriors 4 and Warriors Orochi 4. He hosts radio show Dear Girl Stories along with voice actor Hiroshi Kamiya.','1978-05-04',NULL),(947,'Stephen Baldwin','Massapequa, New York, USA','Stephen Baldwin (born May 12, 1966) is an American actor, director, producer and author. He is best known as the youngest of the Baldwin brothers and for his roles as William F. Cody in the western show The Young Riders (1989–1992) and as Stuart in the movie Threesome (1994). Other notable films Baldwin starred in were Posse (1993), 8 Seconds (1994), The Usual Suspects (1995), Fall Time (1995), Bio-Dome (1996), Fled (1996), One Tough Cop (1998), The Flintstones in Viva Rock Vegas (2000), The Harpy (2007), and The Flyboys (2008). He is also well known for his public display of evangelical Christian ideology as well as for his recent appearances on numerous reality television shows.\n\nDescription above from the Wikipedia article Stephen Baldwin, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1966-05-12',NULL),(948,'Jonathan Riggio',NULL,'',NULL,NULL),(949,'Declan Joyce','Cleveland, Ohio, USA','Declan Joyce was born on October 14, 1970 in Cleveland, Ohio, USA. He is an actor and producer, known for April 29, 1992, Silent Twins (2022) and La última (2022).','1970-10-14',NULL),(950,'Yoshiko Kamiya',NULL,'',NULL,NULL),(951,'Megan Perrin',NULL,'',NULL,NULL),(952,'Donna Yamamoto','Vancouver, British Columbia, Canada','Donna Yamamoto was born in August 1962 in Vancouver, British Columbia, Canada. She is an actress.','1962-01-01',NULL),(953,'Braden Balazik','Grapevine, Texas, USA','','2006-01-27',NULL),(954,'Clifton Powell','Washington, District of Columbia, USA','From Wikipedia, the free encyclopedia.\n\nClifton Powell (born March 16, 1956) is an American actor and comedian.\n\nDescription above from the Wikipedia article Clifton Powell, licensed under CC-BY-SA, full list of contributors on Wikipedia','1956-03-16',NULL),(955,'Shobha Mohan',NULL,'',NULL,NULL),(956,'James Sampson',NULL,'',NULL,NULL),(957,'Kevin Sommerfield',NULL,'',NULL,NULL),(958,'Bill Elliott','Pattonsburg, Missouri, USA','From Wikipedia, the free encyclopedia\n\nWild Bill Elliott (October 16, 1904 – November 26, 1965) was an American film actor. He specialized in playing the rugged heroes of B Westerns, particularly the Red Ryder series of films.  By 1925, he was getting occasional extra work in films. He took classes at the Pasadena Playhouse and appeared in a few stage roles there. By 1927, he had made his first Western, The Arizona Wildcat, playing his first featured role. Several co-starring roles followed, and he renamed himself Gordon Elliott. But as the studios made the transition to sound films, he slipped back into roles as an extra and bit parts, as in Broadway Scandals, in 1929. For the next eight years, he appeared in over a hundred films for various studios, but almost always in unbilled parts as an extra.\n\nElliott began to be noticed in some minor B Westerns, enough so that Columbia Pictures offered him the title role in a serial, The Great Adventures of Wild Bill Hickok (1938). The serial was so successful, and Elliott so personable, that Columbia promoted him to starring in his own series of Western features, replacing Columbia\'s number-two cowboy star Robert \"Tex\" Allen. Henceforth Gordon Elliott would be known as Bill Elliott. Within two years, he was among the Motion Picture Herald\'s Top Ten Western Stars, where he would remain for the next 15 years.\n\nIn 1943, Elliott signed with Republic Pictures, which cast him in a series of Westerns alongside George \"Gabby\" Hayes. The first of these, Calling Wild Bill Elliott, gave Elliott the name by which he would be best known and by which he would be billed almost exclusively for the rest of his career.\n\nFollowing several films in which both actor and character shared the name Wild Bill Elliott, he took the role for which he would be best remembered, that of Red Ryder in a series of sixteen movies about the famous comic strip cowboy and his young Indian companion, Little Beaver (played in Elliott\'s films by Bobby Blake). Elliott played the role for only two years but would forever be associated with it. Elliott\'s trademark was a pair of six guns worn butt-forward in their holsters.\n\nElliott\'s career thrived during and after the Red Ryder films, and he continued making B Westerns into the early 1950s. He also had his own radio show during the late 1940s. His final contract as a Western star was with Monogram Pictures, where budgets declined as the B Western lost its audience to television. When Monogram became Allied Artists Pictures Corporation in 1953, it phased out its Western productions, and Elliott finished out his contract playing a homicide detective in a series of five modern police dramas, his first non-Westerns since 1938.\n\nElliott retired from films (except for a couple of TV Western pilots which were not picked up). He worked for a time as a spokesman for Viceroy cigarettes and hosted a local TV program in Las Vegas, Nevada, which featured many of his Western films.','1904-10-16','1965-11-26'),(959,'Kimberly Battista',NULL,'',NULL,NULL),(960,'Shakti Singh',NULL,'',NULL,NULL),(961,'Vivian Lee',NULL,'',NULL,NULL),(962,'Martin Palmer','Binghamton, New York, USA','','1959-11-04',NULL),(963,'Peter J. Chaffey',NULL,'',NULL,NULL),(964,'Dawn Hamil',NULL,'',NULL,NULL),(965,'Carlos Antonio','Washington, District of Columbia, USA','','1972-01-25',NULL),(966,'JT Alexander',NULL,'',NULL,NULL),(967,'Sean Fox',NULL,'','1979-04-26',NULL),(968,'Vicki Peters',NULL,'',NULL,NULL),(969,'Roger Cross','Christiana, Jamaica','Roger Cross is a Jamaican-born Canadian film and television actor, best known for playing recurring and leading television characters CTU Agent Curtis Manning on \"24\", Travis Verta on \"Continuum\", Staff Sergeant Boyd Bloom on \"Motive\", and Six / Griffin Jones on \"Dark Matter\". He is a graduate in Aviation and General Studies from Trinity Western University in Langley, B.C., Canada.','1969-10-19',NULL),(970,'Rachel Maxwell',NULL,'',NULL,NULL),(971,'Margarita Franco','Indio, California, USA','Margarita Franco (born November 10, 1960) is a Mexican-American actress.','1960-11-10',NULL),(972,'Nando Gazzolo','Savona, Liguria, Italy','Ferdinando \'Nando\' Gazzolo (October 16, 1928 – November 16, 2015) was an Italian actor and voice actor.\n\nBorn in Savona, the son of the actor and voice actor Lauro Gazzolo and EIAR radio announcer Aida Ottaviani, Nando debuted at young age on radio, and in 1948, at twenty years old, he started his acting career entering the stage company led by Antonio Gandusio.\n\nFrom Wikipedia, the free encyclopedia','1928-10-16','2015-11-16'),(973,'Michael Dicarluccio',NULL,'',NULL,NULL),(974,'Tom Wisdom','Swindon, Wiltshire, England','Tom Wisdom (born 18 February 1973) is an English actor of theatre, film and television. His film roles includes the downtrodden hero of Danny Patrick\'s Hey Mr DJ (2005) and Astinos in 300 (2007), based on Frank Miller\'s graphic novel about the Battle of Thermopylae.\n\nDescription above from the Wikipedia article Tom Wisdom, licensed under CC-BY-SA,full list of contributors on Wikipedia.','1973-02-18',NULL),(975,'Lee Tomaschefski',NULL,'',NULL,NULL),(976,'Enrico Ribulsi',NULL,'',NULL,NULL),(977,'Chen Kuan-Tai','Guangdong, China','From Wikipedia, the free encyclopedia.\n\nChen Kuan-Tai (Chinese: 陳觀泰, born 24 September 1945 in Guangdong, China) is a Chinese martial arts film star. He has primarily appeared in Shaw Brothers productions, and was one of the first solid trained, martial arts stars employed by the company. His first appearance in a Shaw work was in the 1969 film The Chinese Boxer, alongside Jimmy Wang Yu and Ben McDonald.\n\nChen branched out as an actor with his tender roles in The Tea House and its sequel Big Brother Cheng, both directed by Chih-hung Kwei. These films gave Chen status as a \"legitimate actor\". After starring in the box office successes Challenge of the Masters and Executioners from Shaolin, both helmed by the legendary martial arts director Lau Kar-leung, Chen left the Shaw Brothers Studio.\n\nWhile away from Shaw, Chen directed and starred in the 1977 film Iron Monkey (not to be confused with the 1993 film by Yuen Woo-Ping). Chen later returned to the Shaw Brothers in the films Crippled Avengers (directed by Chang Cheh), Killer Constable (directed by Chih-hung Kwei), and 3 Evil Masters (co-starring Yuen Tak of the Seven Little Fortunes).\n\nTo date Chen has starred in over 100 films, around 80 of which were with Shaw Brothers. His latest appearances were in Wilson Yip\'s 2006 martial arts-fantasy Dragon Tiger Gate, and in the 2007 remake of the King Hu classic, The Valiant Ones New.\n\nDescription above from the Wikipedia article Chen Kuan-tai, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1945-09-24',NULL),(978,'Randal Reeder',NULL,'Randal Reeder is an actor and producer.',NULL,NULL),(979,'Steven Williams','Memphis, Tennessee, USA','Steven Lloyd Williams (born January 7, 1949) is an American actor. He has been nominated for a Screen Actors Guild Award and one NAACP Image Award.\n\nHe is best known for his roles as Captain Adam Fuller on 21 Jump Street, Lt. Jefferson Burnett on CBS\'s original drama The Equalizer (1989), Det. August Brooks on TNT\'s short-lived series L.A. Heat, Mr. X on FOX\'s scifi series The X-Files, Russell \"Linc\" Lincoln in Linc\'s, and Rufus Turner in Supernatural.\n\nHe appeared as Trooper Mount in The Blues Brothers (1980), Nester in the 1985 sequel film Missing in Action 2: The Beginning, and bounty hunter Creighton Duke in the 1993 horror film Jason Goes to Hell: The Final Friday.\n\nHe has also had many guest appearances on television shows including The Dukes of Hazzard, The A-Team, Booker, MacGyver, Veronica Mars, Stargate SG-1, Martin, The Bernie Mac Show, and Criminal Minds.\n\nHe is the uncle of cartoonist Aaron Williams.\n\nDescription above from the Wikipedia article Steven Williams, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1949-01-07',NULL),(980,'Shari Watson','St. Louis, Missouri, USA','','1971-10-10',NULL),(981,'Jeff Daniel Phillips','Westwood, New Jersey, USA','He is best known for playing a caveman in a popular series of GEICO commercials. He played the part of Maurice in the short-lived Cavemen sitcom on ABC. Other credits to him are Hide (2003), for which he was the director, producer, and co-author in addition to being a cast member; parts in Sneakers and Rob Zombie\'s Halloween II as Uncle Seymour, The Lords of Salem and 31; and roles in TV series Flaked, Arrest and Trial, Philly, and Profiler. He appeared in the second season of Agents of S.H.I.E.L.D. as David Angar, the Marvel Cinematic Universe version of Angar the Screamer.\n\nDescription above from the Wikipedia article Jeff Daniel Phillips licensed under CC-BY-SA, full list of contributors on Wikipedia.','1968-07-03',NULL),(982,'Andrew Herr',' London, Ontario, Canada','','1991-01-01',NULL),(983,'Jesse Aragon','Los Angeles, California, USA','','1956-03-21','1988-11-08'),(984,'Dennis Hopper','Dodge City, Kansas, USA','Dennis Lee Hopper (May 17, 1936 – May 29, 2010) was an American actor, filmmaker and artist. As a young man, Hopper became interested in acting and eventually became a student of the Actors\' Studio. He made his first television appearance in 1954, and appeared in two films featuring James Dean, Rebel Without a Cause (1955) and Giant (1956). During the next 10 years, Hopper appeared frequently on television in guest roles, and by the end of the 1960s had played supporting roles in several films. He directed and starred in Easy Rider (1969), winning an award at the Cannes Film Festival and was nominated for an Academy Award for Best Original Screenplay as co-writer. \"With its portrait of counterculture heroes raising their middle fingers to the uptight middle-class hypocrisies, Easy Rider became the cinematic symbol of the 1960s, a celluloid anthem to freedom, macho bravado and anti-establishment rebellion.\" Film critic Matthew Hays notes that \"no other persona better signifies the lost idealism of the 1960s than that of Dennis Hopper.\" He was unable to build on his success for several years, until a featured role in Apocalypse Now (1979) brought him attention. He subsequently appeared in Rumble Fish (1983) and The Osterman Weekend (1983), and received critical recognition for his work in Blue Velvet and Hoosiers, with the latter film garnering him an Academy Award nomination for Best Supporting Actor. He directed Colors (1988) and played the villain in Speed (1994). Hopper\'s later work included a leading role in the television series Crash. Hopper\'s last performance was filmed just before his death: The Last Film Festival, slated for a 2011 release. Hopper was also a prolific and acclaimed photographer, a profession he began in the 1960s.\n\nFrom Wikipedia, the free encyclopedia','1936-05-17','2010-05-29'),(985,'Tommy Truex',NULL,'',NULL,NULL),(986,'Tori Griffith','New York, United States','Tori Griffith started her acting career at the age of 11 in community theatre in the Conejo Valley. She began her work in TV and film at the age of 14. In a short span of time, she has accumulated an impressive body of work, including 20+ plays, commercials and short films. Tori is also one of the lead presenters in Disney\'s \"World of English,\" and is a lead in a new web series on IFC called \"The Fergusons.\" While acting is her primary passion, Tori is also a singer and was featured in a Nickelodeon promo for the movie, \"Annie.\" In addition, she loves to write and has completed many short stories.',NULL,NULL),(987,'Benedict Cumberbatch','London, England, UK','Benedict Timothy Carlton Cumberbatch (born 19 July 1976) is an English actor. Known for his roles on the screen and stage, he has received various accolades throughout his career, including a Primetime Emmy Award, a British Academy Television Award, and a Laurence Olivier Award. Cumberbatch won the Laurence Olivier Award for Best Actor in a Leading Role in a Play for Frankenstein and a Primetime Emmy Award for Outstanding Lead Actor in a Miniseries or Movie for Sherlock. His performances in the dramas The Imitation Game (2014) and The Power of the Dog (2021) earned him nominations for an Academy Award, a BAFTA Award, a Screen Actors Guild Award, and a Golden Globe Award, all for Best Actor in a Leading Role. For playing the title role in five-part drama miniseries Patrick Melrose, he won a BAFTA TV Award for Best Actor in a Leading Role.\n\nIn 2014 Time magazine included him in its annual list of the 100 most influential people in the world, and in 2015 he was appointed a CBE by Queen Elizabeth II in the 2015 Birthday Honours for services to the performing arts and to charity. A graduate of the Victoria University of Manchester, Cumberbatch continued his training at the London Academy of Music and Dramatic Art, obtaining a Master of Arts in Classical Acting. He first performed at the Open Air Theatre, Regent\'s Park in Shakespearean productions and made his West End debut in Richard Eyre\'s revival of Hedda Gabler in 2005. Since then, he has starred in the Royal National Theatre productions After the Dance (2010) and Frankenstein (2011). In 2015, he played the title role in Hamlet at the Barbican Theatre.\n\nCumberbatch\'s television work includes his performance as Stephen Hawking in the television film Hawking in 2004. He gained worldwide recognition for his performance as Sherlock Holmes in the BBC series Sherlock from 2010 to 2017. He has also headlined Tom Stoppard\'s adaptation of Parade\'s End (2012), The Hollow Crown: The Wars of the Roses (2016), Patrick Melrose (2018), and Brexit: The Uncivil War (2019). In films, Cumberbatch has starred in Amazing Grace (2006) as William Pitt the Younger, Star Trek Into Darkness (2013) as Khan, 12 Years a Slave (2013) as William Prince Ford, The Fifth Estate (2013) as Julian Assange, and The Imitation Game (2014) as Alan Turing. He also acted in the historical dramas The Current War (2017), 1917 (2019) and The Courier (2020), and received critical acclaim for his performance in Jane Campion\'s Western drama The Power of the Dog (2021). From 2012 to 2014, through voice and motion capture, he played the characters of Smaug and Sauron in The Hobbit film series. Cumberbatch portrays Dr. Stephen Strange in the Marvel Cinematic Universe films, beginning with Doctor Strange (2016), and also voiced the character in the animated series What If...? (2021).','1976-07-19',NULL),(988,'Gaia Ottman',NULL,'',NULL,NULL),(989,'Josiane Balasko','Paris, France','Josiane Balasko (born 15 April 1950) is a French actress, writer and director.\n\nShe was born Josiane Balašković in Paris. One of Balasko\'s most recognized roles among English speakers is as a lesbian in 1995\'s Gazon maudit (French Twist). She won the 1996 César Award (shared with Telsche Boorman) for best writing for this film, for which she was also nominated as best director. The movie itself was nominated for best film.\n\nBalasko\'s other César nominations for best actress were for Trop belle pour toi (1989), Tout le monde n\'a pas eu la chance d\'avoir des parents communistes (1993), Cette femme-là (2003).\n\nShe is married to George Aguilar, who is also an actor.\n\nDescription above from the Wikipedia article Josiane Balasko, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1950-04-15',NULL),(990,'Erin Killean',NULL,'',NULL,NULL),(991,'Jerry Hardin','Dallas, Texas, USA','Jerry Hardin (born November 20, 1929) is an American actor.','1929-11-20',NULL),(992,'Craig Newman',NULL,'',NULL,NULL),(993,'Austin Stoker','Trinidad, West Indies','From Wikipedia, the free encyclopedia.\n\nAustin Stoker (October 7, 1930 – October 7, 2022) was a Trinidadian-American actor known for his role as Lt. Ethan Bishop, the police officer in charge of the besieged Precinct 9, Division 13, in John Carpenter\'s Howard Hawks-inspired 1976 film, Assault on Precinct 13. This was one of the few heroic starring roles for a black actor in an action film of the 1970s outside of the blaxploitation genre.\n\nStoker was born in Port of Spain, Trinidad and Tobago on October 7, 1930. He started his career on stage, including the 1954 Broadway production of Truman Capote\'s House of Flowers, where he met his future wife, Enid Mosier (acting name Vivian Bonnell). Prior to his role as Lt. Bishop, Stoker appeared in several blaxploitation films, often playing police detectives. Among these films were Abby (1974), Combat Cops (1974), and Sheba, Baby (1975), in which he played Pam Grier\'s love interest. Some of Stoker\'s other notable acting roles were in Battle for the Planet of the Apes (1973), Horror High (1974), Airport 1975 (1974), Victory at Entebbe (1976), and the 1977 television mini-series Roots.\n\nStoker is known to Mystery Science Theater 3000 fans for his role as Dr. Ken Melrose in the 1982 B-movie, Time Walker, in which he appeared with Darwin Joston, his co-star from Assault on Precinct 13.\n\nStoker died of renal failure at the Cedars-Sinai Medical Center in Los Angeles, California on October 7, 2022, his 92nd birthday.\n\nDescription above from the Wikipedia article Austin Stoker, licensed under CC-BY-SA, full list of contributors on Wikipedia','1943-10-07','2022-10-07'),(994,'Aleksander Sacha',NULL,'',NULL,NULL),(995,'Avery Brooks','Evansville, Indiana, USA','Avery Franklin Brooks (born October 2, 1948) is an American actor, director, singer, narrator and educator. He is best known for his television roles as Captain Benjamin Sisko on Star Trek: Deep Space Nine, as Hawk on Spenser: For Hire and its spinoff A Man Called Hawk, and as Dr. Bob Sweeney in the Academy Award–nominated film American History X.  Brooks was born in Evansville, Indiana, and raised in Gary, Indiana. He attended Oberlin College, where he studied music and theater. After graduating from Oberlin, he moved to New York City to pursue his acting career.\n\nBrooks\'s first professional acting role was in the play \"The Great White Hope\" in 1970. He went on to appear in a number of Broadway productions, including \"The Wiz\" and \"A Chorus Line\". He also starred in the television miniseries \"Roots\" in 1977.\n\nIn 1993, Brooks was cast as Captain Benjamin Sisko on Star Trek: Deep Space Nine. The series ran for seven seasons, and Brooks\'s performance as Sisko was critically acclaimed. He won a Saturn Award for Best Actor on Television in 1995.\n\nAfter Star Trek: Deep Space Nine ended, Brooks continued to work in television and film. He starred in the series \"Shark\" from 2006 to 2008, and he appeared in the films \"American History X\" and \"The Score\".\n\nBrooks is also a talented singer and musician. He has released two albums, \"Song of My People\" and \"The Way I Feel\". He is also a gifted director, and he has directed a number of theater productions and television episodes.','1948-10-02',NULL),(996,'Jaffer Idukki',NULL,'',NULL,NULL),(997,'Matthew Bolton',NULL,'',NULL,NULL),(998,'Perla Daoud',NULL,'',NULL,NULL),(999,'Shane Aaron',NULL,'',NULL,NULL),(1000,'Merrilyn Gann','Vancouver, British Columbia, Canada','Merrilyn Gann (born January 3, 1963) is a Canadian actress.','1963-01-03',NULL),(1001,'Davide Tucci','Sora, Frosinone, Lazio, Italy','Davide Tucci was born on 14th September 1987 in Isola Del Liri (FR), later his family moved to the exotic Maltese Islands. Attending St Aloysius College, he developed a love for being a creative, which was followed by studying software and web design. Having always felt the urge to perform and entertain from a young age, Davide drew his inspiration from the actors, singers and public figures throughout his upbringing.\n\nSinging was always Davide’s passion and helped him break into the industry. His first role was in the hit musical “Spring Awakening” (2010) at St James Theatre as Georg. A successful run of the award winning show confirmed his love for the arts, as well as launched him unexpectedly into  a modeling career.\n\n“La Famiglia” (2011) the Maltese television crime drama was Davide’s first small screen role, portraying Valentino Saraceni. Later in 2012 he was involved in the very successful prime-time TVM (Television Malta) series “Katrina” (2012- 14) where he played the role of the visually impaired Clyde Montaldo, who was received warmly by the audience. Also taking on roles in theatre such as, “Jiena Nhobb, Inti Thobb” (2014) an original Maltese play by Simon Bartolo that deals with sexuality, religion and morality - in which Davide plays the controversial role of Devin. Later that year, he also worked in the Maltese/ Canadian eOne production of “A Dangerous Arrangement” (2015), working alongside actors such as Colm Meaney and Deborah Kara Unger. This film saw Davide take on the character of Tommaso - a young farmer working for the wealthy Vreeland family, who saves his co-star from drowning and deals with a father looking for vengeance.\n\nIn 2015, Davide starred in TVM most watched prime-time television programme, ‘Ic-Caqqufa’ (2015- 16), he played the role of Alex, a loner who finds refuge from the materialism of society with his love for horses. Also on the stage, ‘Faith, Hope and Charity’ (2015), set in Second World War Malta has seen Davide portraying the injured Italian pilot Francesco Cavalli, who after an emergency landing, falls in love with the nurse who takes care of him.\n\nThe following year, he took on the role of John in “Limestone Cowboy” (2016), who goes through a rollercoaster of emotions throughout the film, as he is torn between the relationship with his delusional father and that of his growing child as a single parent. This role allowed him to feature in a film that truly showed off Malta’s home grown cultural aspect. An on-going demand in theatre has seen him undertake a role in Malcolm Gelea’s “Marti Martek, Martek Marti” - a theatrical sex-comedy, where Davide portrays a cocky, sexually adventurous Owen, then dove straight into the iconic Demetrius, an arrogant, self-centred youth, who then falls in love with the woman he initially despises in William Shakespeare\'s “A Midsummer Night’s Dream” (2016), performed in the presidential gardens of San Anton in honour of William Shakespeare’s 400th anniversary from his death.\n\nBetween projects he loves travelling, adventuring, horse riding and enjoys any kind of sport and cooking. Davide works in English, Maltese and Italian.','1987-09-14',NULL),(1002,'Payman Maadi','New York City, New York, USA','Peyman Maadi (پیمان معادی) was born in 1970 in New York City to an Iranian couple. His father was a lawyer. Peyman Maadi\'s family moved back to Iran when he was 5 years old. He graduated in Metallurgical Engineering from Karaj Azad University. Maadi started his film career as a screenwriter in late 2000s. He is the writer of several famous Iranian films. Peyman Maadi started his acting career in Asghar Farhadi\'s film About Elly (2009). Two years later, he received the Silver Bear award for Best Actor in Leading Role for his performance as Nader in Farhadi\'s A Separation (2011) from the Berlin International Film Fest.','1970-07-30',NULL),(1003,'Ralph Choate',NULL,'',NULL,NULL),(1004,'Chase Badawi',NULL,'',NULL,NULL),(1005,'Petr Korolev','Томск, СССР (Россия)','','1985-06-05',NULL),(1006,'Aleksandar Belovski',NULL,'',NULL,NULL),(1007,'Jean Michel Paré',NULL,'',NULL,NULL),(1008,'Cameron Richardson','Baton Rouge, Louisiana, USA','Cameron Richardson (born September 11, 1979) is an American actress and model, who portrayed Chloe Carter on the CBS television series Harper\'s Island.','1979-09-11',NULL),(1009,'Oliver Platt','Windsor, Ontario, Canada','Oliver Platt (born January 12, 1960) is a Canadian-born American actor. He is known for his starring roles in many films such as Flatliners (1990), Beethoven (1992), Indecent Proposal, The Three Musketeers (both 1993), Executive Decision, A Time to Kill (both 1996), Dangerous Beauty, Bulworth, The Impostors, Dr. Dolittle (all 1998), Ready to Rumble, Gun Shy (both 2000), Don\'t Say a Word (2001), Zig Zag (2002), Pieces of April (2003), The Ice Harvest (2005), Martian Child (2007), Frost/Nixon (2008), Year One, 2012 (both 2009), Please Give, Love & Other Drugs (both 2010), X-Men: First Class, The Oranges (both 2011), Legends of Oz: Dorothy\'s Return (2013), Frank and Cindy and One More Time (both 2015).','1960-01-12',NULL),(1010,'Rocco Lerro',NULL,'',NULL,'2005-08-21'),(1011,'Lara Jean Sullivan',NULL,'',NULL,NULL),(1012,'Fábio Turíbio',NULL,'',NULL,NULL),(1013,'Idalina Takara',NULL,'',NULL,NULL),(1014,'Farshad Farahat',NULL,'',NULL,NULL),(1015,'Steve Kim','Seoul, Korea','','1971-02-04',NULL),(1016,'Gregory Shelby','San Diego, California, USA','Gregory Shelby is an actor and San Diego native. Well-traveled and a lifelong athlete, he also earned a degree in political science from UC Santa Barbara. He has lived in Ireland, published poems, and traveled over the world for film. His unusual background has lent itself to a wide range of roles, including priests, mixed martial artists, baseball players, and swashbuckling sword fighters. In addition to his continuous acting work, Gregory has stepped into producing, fulfilling his greatest goal, to tell a good story.',NULL,NULL),(1017,'Edmund Kwan',NULL,'',NULL,NULL),(1018,'Anton Toropov','USSR','','1984-01-01',NULL),(1019,'Lucinda Jenney','Long Island, New York, USA','Lucinda Jenney (born 23 April 1954) is an American actress.\n\nDescription above from the Wikipedia article Lucinda Jenney, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1954-04-23',NULL),(1020,'Michael Paciorek',NULL,'',NULL,NULL),(1021,'Rachid El Adouani',NULL,'',NULL,NULL),(1022,'Henry Pawlak',NULL,'',NULL,NULL),(1023,'Lamont Thompson',NULL,'Lamont Thompson is an actor.',NULL,NULL),(1024,'Katsumi Honda',NULL,'',NULL,NULL),(1025,'Tanya Champoux','Canada ','',NULL,NULL),(1026,'Iswadi Pratama',NULL,'',NULL,NULL),(1027,'Jake McAlister',NULL,'',NULL,NULL),(1028,'Nick Afanasiev',NULL,'','1989-07-29',NULL),(1029,'Edward Pawley','Kansas City, Missouri, USA ','','1901-03-16','1988-01-27'),(1030,'Pierre Edwards',NULL,'',NULL,NULL),(1031,'Kevin P. McCarthy',NULL,'',NULL,NULL),(1032,'Randy Orton','Knoxville, Tennessee, USA','Randal Keith Orton is an American professional wrestler and actor. Widely regarded as one of the greatest professional wrestlers of all time he is currently signed to WWE, where he performs on the Raw brand and is one half of the current Raw Tag Team Champions with Riddle in their second reign. Orton is a third generation professional wrestler; his grandfather Bob Orton, father Bob Orton Jr., and uncle Barry Orton were all wrestlers. Before being signed by the World Wrestling Federation (WWF, now WWE), he trained in and wrestled for the Mid-Missouri Wrestling Association and Southern Illinois Conference Wrestling. He was then signed by the WWF and was sent to Ohio Valley Wrestling (OVW), where he held the OVW Hardcore Championship twice. He became a member of the stable Evolution shortly after his WWE debut, which quickly led to an Intercontinental Championship reign, his first championship with the company. He also acquired the moniker \"The Legend Killer\" during a storyline where he began disrespecting and then physically attacking WWE Hall of Famers and wrestling veterans. At the age of 24, Orton became the youngest world champion in WWE history after he won the WWE World Heavyweight Championship. With this win, he departed from Evolution and a feud with his former stablemates began. In 2006, Orton joined forces with Edge in a tag team known as Rated-RKO. Together, they held the World Tag Team Championship. After Rated-RKO disbanded in mid-2007, Orton gained two WWE Championship reigns in one night, becoming the second youngest two-time WWE Champion at the age of 27. He formed the group The Legacy with Cody Rhodes and Ted DiBiase Jr. in 2008. They disbanded in 2010, and Orton returned to singles competition. From 2013 to 2015, he was aligned with The Authority, who named him the \"face of the WWE\". In 2016, he joined The Wyatt Family, winning the SmackDown Tag Team Championship with Bray Wyatt and Luke Harper before turning on them in 2017. He won his first United States Championship in 2018, becoming the 18th overall Grand Slam Champion after already having been the 17th Triple Crown Champion. Orton has held the WWE Championship 10 times and WWE\'s World Heavyweight Championship four times. He was the final holder of the World Heavyweight Championship, which he unified with the WWE Championship to become the WWE World Heavyweight Champion at TLC: Tables, Ladders & Chairs in 2013. Orton is recognized by WWE as having the third-most world championship victories in history at 14, behind John Cena and Ric Flair (both 16) and tied with Triple H (also at 14). All totaled, Orton has won 20 championships in WWE. He is also the winner of the 2013 Money in the Bank ladder match, as well as a two time Royal Rumble match winner (2009 and 2017) and has headlined multiple WWE pay-per-view events, including WrestleMania 25 and WrestleMania XXX. Following his match at the 2021 Survivor Series, he broke Kane\'s record for wrestling the most PPV matches in WWE history.','1980-04-01',NULL),(1033,'Goro Inagaki','Tokyo, Japan','Gorō Inagaki (born December 8, 1973) is a Japanese musician and actor from Itabashi, Tokyo, Japan. Inagaki is a member of the Japanese pop group SMAP. His career began while he was in junior high school, when his sister submitted his picture to a talent company; he was subsequently chosen to join SMAP, which has a considerable following in Japan. Inagaki\'s first major acting role was in the motion picture Saraba itoshino yakuza, released in 1990. His international film debut was in the romantic comedy Private Lessons II, playing the male lead role of a Japanese student who falls for his tutor. Private Lessons II also starred SMAP lead vocalist Masahiro Nakai.\n\nDescription above from the Wikipedia article Gorô Inagaki, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1973-12-08',NULL),(1034,'Joshua Lamboy',NULL,'',NULL,NULL),(1035,'Neide Tsukasaki',NULL,'',NULL,NULL),(1036,'Richard Dempsey','Welwyn Garden City, Hertfordshire, England, UK','','1974-05-16',NULL),(1037,'Rob Archer','Canada ','Rob Archer (born August 9, 1975) is a Canadian actor and stuntman known for his roles as Bruce in Lost Girl, Krampus in A Christmas Horror Story and Knox in Ant-Man and the Wasp.','1975-08-09',NULL),(1038,'Colby French',NULL,'Colby French is an American television actor, best known for playing the role of Hank on the NBC television drama Heroes. He is also known for playing Yankee on The Suite Life of Zack & Cody, CAPT Mike Murphy on 24, and he also played CAPT Evan Thorn on Last Resort. In 2016, he appeared in 3 episodes of American Horror Story: Roanoke. He played an undercover cop in “Better Call Saul’s” fourth-season episode, “Something Stupid”.',NULL,NULL),(1039,'Jane Doole',NULL,'',NULL,NULL),(1040,'Tarek Boudali','Paris, France','Tarek Boudali (born 5 November 1979) is a French actor and humorist of Moroccan origin.\n\nTarek Boudali, of Moroccan origin, graduated with a Higher Technician Certificate (BTS) Sales Force. In 2012, he joined the cast of the M6 series En famille, where he plays the role of Kader, a young father. He then had film success with Babysitting, released in 2014. He is part of La Bande à Fifi, a French comedy troupe bringing together Philippe Lacheau, Élodie Fontan, Tarek Boudali, Reem Kherici and Julien Arruti.\n\nIn 2018, he joined the Les Enfoirés.\n\nSource: Article \"Tarek Boudali\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1979-11-05',NULL),(1041,'Kirby Morrow','Jasper, Alberta, Canada','Kirby Robert Morrow (August 28, 1973 – November 18, 2020) was a Canadian actor, voice actor, writer and comedian. Morrow was born in Jasper, Alberta and studied theatre at Mount Royal University in Calgary, and worked in Vancouver, British Columbia. In animation, he was known as the voice of Miroku from InuYasha, Van Fanel from the Ocean dub of Escaflowne, Cyclops from X-Men Evolution, Jay from Class of the Titans, Teru Mikami from Death Note, Trowa Barton from Mobile Suit Gundam Wing, Ryo Takatsuki from Project ARMS, Goku from Ocean\'s dub of Dragon Ball Z (from Episode 160 onwards), Hot Shot from Transformers: Cybertron (replacing Brent Miller) and Cole from Lego Ninjago: Masters of Spinjitzu. On camera, he was known for the recurring role of Captain Dave Kleinman from Stargate Atlantis.\n\nDescription above from the Wikipedia article Kirby Morrow, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1973-08-28','2020-11-18'),(1042,'Leslee Emmett',NULL,'',NULL,NULL),(1043,'Hau Woon-Ling','Hong Kong, British Crown Colony','Woon Ling Hau was born on November 30, 1922 in Hong Kong, British Crown Colony. She was an actress, known for Push (2009), 2002 (2001) and Legendary Assassin (2008). She died on February 18, 2018 in Hong Kong.','1922-11-30','2018-02-18'),(1044,'Sara Tomko','California, USA','','1983-10-19',NULL),(1045,'Adam Savage','New York City, New York, USA','Adam Whitney Savage (born July 15, 1967)  is an American industrial design and special effects designer/fabricator, actor, educator, and co-host of the Discovery Channel television series MythBusters.\n\nDescription above from the Wikipedia article Adam Savage, licensed under CC-BY-SA,full list of contributors on Wikipedia.','1967-07-15',NULL),(1046,'Shirley Jean Rickert',' Seattle, Washington, USA','Shirley Jean Rickert (March 25, 1926 – February 6, 2009) was an American child actress who was briefly the \"blonde girl\" for the Our Gang series in 1931, during the Hal Roach talkie period.  At 18 months of age, Rickert won a local baby beauty contest, which emboldened her mother to move the family to Hollywood. She made her screen debut at the age of four in the short How\'s My Baby (1930), soon followed by her Our Gang debut, Helping Grandma in 1931. Rickert\'s most notable appearances were in the films Love Business and Bargain Day.\n\nAfter Rickert left the Our Gang series, she had a brief movie career, including starring roles as Tomboy Teri Taylor alongside Mickey Rooney in eight Mickey McGuire comedies, followed by a string of jobs including driving trucks for the U.S. Army Air Corps during World War II. She later worked in burlesque as an exotic dancer, billed as Gilda and Her Crowning Glory (after her long blonde hair), retiring from burlesque in 1959.  Description above from the Wikipedia article Shirley Jean Rickert, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1926-03-25','2009-02-06'),(1047,'David Frye',NULL,'',NULL,NULL),(1048,'Catherine S.',NULL,'',NULL,NULL),(1049,'Caroline Tohme',NULL,'',NULL,NULL),(1050,'Qu Jingjing','Shenyang, Liaoning Province, China','','1990-05-17',NULL),(1051,'Angelique De Luca',NULL,'',NULL,NULL),(1052,'Tshamano Sebe',NULL,'','1960-12-24',NULL),(1053,'D.J. Harder',NULL,'',NULL,NULL),(1054,'Daniil Steklov','Moscow, Russia','','1993-01-18',NULL),(1055,'Price Carson',NULL,'Price Carson is an American film and television actor.',NULL,NULL),(1056,'Bruno Davézé','Orléans - Loiret - France','Après avoir suivi une formation au Conservatoire d\'art dramatique d\'Orléans en 1991 avec Nicole Mérouze et Jean-Claude Cotillard, une formation sur paris à l\'école technique expérimentale du spectacle avec Hélene Hily, Bruno Davézé suit des études supérieures en faculté de théâtre à Paris III et mène en parallèle une carrière solo de mime. en 2000, il commence sa carrière théâtrale en interprétant en solo un personnage dans un spectacle Musical en hommage a Bourvil.\n\nAu théâtre, Bruno Davézé joue notamment dans \"Les naufragés\" de Michel Declercq, \"Osceola\" de Michel Denneliou, \"La nuit des exclus \"de Joel Chalude, \"La tour de babeth\" de Karim Houfaid, \"Suivez le guide\" de Michel Beatrix et part pour une tournée internationale en Roumanie, au Portugal... avec \"Le songe d\'une nuit d\'été\" de Richard Demarcy où il joue le rôle de Bottom.\n\nAu cinéma et à la télévision, Bruno Davézé joue sous la direction de Christian de Challonge dans le \"Malade Imaginaire\", dans \"Un flic\" de Fréderic Tellier, dans la série \"palizzi\" de Jean Dujardin avec Arsène Mosca, \"Mes amis, mes amours\" de Lorraine Levy. \n\nDe 2013 à 2014, Bruno Davézé joue le Proviseur Stanislavski dans La chronique du jeu vidéo d’Edward Ez et joue le rôle de Iegor dans le dernier film de René Féret Anton Tchekhov 1890.','1967-06-05',NULL),(1057,'Jenna Stern','Los Angeles, California, USA','Jenna Louise Stern (born September 23, 1967 in Los Angeles, California) is an American actress. Member of an artist family, Stern is the daughter of actor/producer Tom Stern and Academy award-nominated and Golden Globe-winning actress Samantha Eggar. Her brother, Nicolas Stern, is a producer for film and television. She married actor Brennan Brown in 1998, and they live in Brooklyn, New York. Stern graduated from the U.C. Berkeley with a B.A. and received her M.F.A. from NYU Graduate School. Credits include: Broadway: The Elephant Man Off-Broadway includes: Francine Volpe’s Late Fragment at Studio Dante, Amy Fox’s Summer Cyclone at EST, Erin Cressida Wilson’s Hurricane at CSC, Kate Robin\'s Intrigue With Faye at NY Stage and Film and David Auburn’s Skyscraper at Greenwich House Theater. Regional theatre includes: Hedda Gabler(Dallas Theater Center) Closer(Alley Theater) Othello (Portland Stage) and Love’s Labours Lost(NJShakespeare). Film: The Hungry Ghosts, 16 Blocks , Hitch, Random Hearts , The Eden Myth, Wirey Spindel, Picture Perfect and The Red Right Hand. Television: Canterbury’s Law, Gossip Girl, The Sopranos, Law and Order (s), Six Degrees, The Jury, Queens Supreme, HBO’s Baseball Wives, the ABC mini-series Widows, Spin City and The Larry Sanders Show.\n\nFrom Wikipedia, the free encyclopedia','1967-09-23',NULL),(1058,'Tom Rack',NULL,'',NULL,NULL),(1059,'Val Cole',NULL,'',NULL,NULL),(1060,'Matt Letscher','Grosse Pointe, Michigan, USA','','1970-06-26',NULL),(1061,'Gillian Barber','Coventry, West Midlands, England, UK','Gillian Barber is an English-born Canadian actress. She was born in Coventry, West Midlands, England, and raised in British Columbia, Canada. She studied at the Guildhall School of Music and Drama in London, and BFA program in the University of Victoria.','1958-02-22',NULL),(1062,'Vania Vilers','Neuchâtel, Switzerland','','1938-06-12','2009-02-22'),(1063,'Sam Schweikert','Dallas, Texas, USA','','1990-05-21',NULL),(1064,'Giovani Cimmino',NULL,'Giovani Cimmino is known for 300 (2006), As the World Turns (1956) and Ten Hundred Kings (2000).','1995-07-14',NULL),(1065,'Chisato Amate','Fukuoka, Japan','Chisato Amate is a Japanese actress. She played the lead actress role in 1-Ichi, a prequel to Ichi the Killer. In 2004, she played a supporting role in Izo. With Azuma Mami she is part of a CM duo called G☆cups, a reference to their large busts (Chisato\'s, at 86 cm, is large for a Japanese woman).','1980-12-16',NULL),(1066,'Whani Darmawan','Yogyakarta, Indonesia','Whani Hari Darmawan (born May 24, 1966) is an Indonesian actor.','1966-05-24',NULL),(1067,'Marie-Julie Rivest','Montreal, Quebec, Canada','','1977-10-10',NULL),(1068,'Liu Zhuoling',NULL,'',NULL,NULL),(1069,'Caroline Junko King',NULL,'A filmmaker and actress who grew up in the United States. Her work include the movies 3 Ninjas Kick Back, and Come See the Paradise, and the series Star Trek: The Next Generation, and Doraemon.','1979-07-13',NULL),(1070,'Arnold Vosloo','Pretoria, Gauteng, South Africa','From Wikipedia, the free encyclopedia\n\nArnold Vosloo (born June 16, 1962) is a South African actor, best-known for playing the role of the villain Imhotep in the 1999 film The Mummy, and its 2001 sequel, The Mummy Returns, also known for playing the role of the superhero Darkman in the sequel Darkman II: The Return of Durant (1994) and its 1996 sequel, Darkman III: Die Darkman Die. and more recently, a South African Mercenary named Colonel Coetzee (loosely based on Eeben Barlow) in the film Blood Diamond, a Middle Eastern terrorist named Habib Marwan in the television series 24, and Zartan in the film G.I. Joe: The Rise of Cobra.','1962-06-16',NULL),(1071,'Queen Latifah','Newark, New Jersey, USA ','Dana Elaine Owens (born March 18, 1970), known professionally as Queen Latifah, is an American rapper, actress, and singer. Born in Newark, New Jersey, she signed with Tommy Boy Records in 1989 and released her debut album All Hail the Queen on November 28, 1989, featuring the hit single \"Ladies First\". Nature of a Sista\' (1991) was her second and final album with Tommy Boy Records.\n\nLatifah starred as Khadijah James on the Fox sitcom Living Single from 1993 to 1998. Her third album, Black Reign (1993), became the first album by a solo female rapper to receive a RIAA certification, and spawned the single \"U.N.I.T.Y.\", which was influential in raising awareness of violence against women and the objectification of Black female sexuality. The record won a Grammy Award and peaked at No. 23 on the Billboard Hot 100. She then starred in the lead role of Set It Off (1996) and released her fourth album, Order in the Court, on June 16, 1998, with Motown Records. Latifah garnered acclaim with her role of Matron \"Mama\" Morton in the musical film Chicago (2002), receiving a nomination for the Academy Award for Best Supporting Actress.\n\nLatifah released her fifth album The Dana Owens Album in 2004. In 2007 and 2009, she released two more studio albums – Trav\'lin\' Light and Persona. She created the daytime talk show The Queen Latifah Show, which ran from 1999 to 2001, and again from 2013 to 2015, in syndication. She has appeared in a number of films, such as Bringing Down the House (2003), Taxi (2004), Barbershop 2: Back in Business (2005), Beauty Shop (2005), Last Holiday (2006), Hairspray (2007), Joyful Noise (2012), 22 Jump Street (2014) and Girls Trip (2017) and provided voice work in the Ice Age film series. Latifah received critical acclaim for her portrayal of blues singer Bessie Smith in the HBO film Bessie (2015), which she co-produced, winning the Primetime Emmy Award for Outstanding Television Movie. From 2016 to 2019, she starred as Carlotta Brown in the musical drama series Star. In 2020, she portrayed Hattie McDaniel in the miniseries Hollywood.\n\nQueen Latifah has been referred to as the \"Queen of Rap\" by several media articles, as well as \"rap\'s first feminist\". Latifah became the first hip hop artist to receive a star on the Hollywood Walk of Fame (2006). Latifah\'s work in music, film and television has earned her a Grammy Award, an Emmy Award, a Golden Globe Award, three Screen Actors Guild Awards, two NAACP Image Awards, and an Academy Award nomination.\n\nDescription above from the Wikipedia article Queen Latifah, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-03-18',NULL),(1072,'Rafael Santos Silva',NULL,'',NULL,NULL),(1073,'Jere Gillis',NULL,'',NULL,NULL),(1074,'Chase Conner',NULL,'',NULL,NULL),(1075,'Ben Peel',NULL,'',NULL,NULL),(1076,'Andrei Kovski',NULL,'',NULL,NULL),(1077,'Phil Morris','Iowa City, Iowa, USA','Phil Morris (born April 4, 1959) is an American actor. He played Jackie Chiles on Seinfeld, John Jones on The CW series Smallville and Silas Stone in Doom Patrol. He also voiced Doc Saturday on The Secret Saturdays and Dr. Joshua Strongbear Sweet in Atlantis: The Lost Empire and related media.','1959-04-04',NULL),(1078,'Giovanni Bonadonna',NULL,'',NULL,NULL),(1079,'Kim Chan','Guangdong, Republic of China','Kim Chan (December 28, 1917 – October 5, 2008) was a Chinese–American actor and producer. He was most notable for his roles as Lo Si, a.k.a. The Ancient, in Kung Fu: The Legend Continues and Mr. Kim in The Fifth Element.','1917-12-28','2008-10-05'),(1080,'Marina Inoue',' Tokyo, Japan','Marina Inoue is a Japanese voice actress and singer. She was signed onto Sony Music Entertainment Japan\'s Aniplex division until 2007. As for her voice acting career, she is employed by Aoni Production (previously with Sigma Seven).\n\nInoue made her debut as a voice actress and singer after she was chosen out of 2,000 people from the \"Gonna be a star\" auditions (hosted by Sony Music Entertainment Japan) for the title role in the OVA Le Portrait de Petit Cossette.','1985-01-20',NULL),(1081,'Drew Cross',NULL,'',NULL,NULL),(1082,'Skyler Joy',NULL,'',NULL,NULL),(1083,'Ryohei Abe','Aichi, Japan','','1980-03-26',NULL),(1084,'Timothy F. Griepp',NULL,'',NULL,NULL),(1085,'Denis Nikiforov',NULL,'',NULL,NULL),(1086,'Brandon Haas',NULL,'',NULL,NULL),(1087,'Ben Williams-Lee',NULL,'Ben Williams-Lee is an actor, known for \'71 (2014) and EastEnders (1985).',NULL,NULL),(1088,'Kinua McWatt',NULL,'',NULL,NULL),(1089,'Axel Keravec',NULL,'','2006-08-16',NULL),(1090,'Balaji Sarma',NULL,'',NULL,NULL),(1091,'Mark Swanson','Muskegon, Michigan, USA','','1980-05-10',NULL),(1092,'Yang Mal-bok','Seoul, South Korea','','1972-09-03',NULL),(1093,'Nour Bitar',NULL,'',NULL,NULL),(1094,'Damon Alexander',NULL,'',NULL,NULL),(1095,'Jane Velez-Mitchell','New York City, New York, USA','','1956-09-29',NULL),(1096,'Steve Hevessy',NULL,'',NULL,NULL),(1097,'Kim Hawthorne','Jersey City, New Jersey, USA','Kimberly Hawthorne is an American actress. She began her career appearing on Broadway and daytime soap operas, before landing supporting roles on the prime time dramas. From 2000 to 2005, Hawthorne was regular cast member in the CBC Television police drama, Da Vinci\'s Inquest. From 2016 to 2020, she starred as Kerissa Greenleaf in the Oprah Winfrey Network drama series, Greenleaf.','1968-04-19',NULL),(1098,'Victor Paguia',NULL,'',NULL,NULL),(1099,'Yukari Fukui','Hiratsuka, Kanagawa Prefecture, Japan','Yukari Fukui (福井 裕佳梨, Fukui Yukari) was born in Hiratsuka, Kanagawa Prefecture, Japan on 28 October 1982. She is a voice actress (seiyuu), singer and model known by the nickname Yukarin (ゆかりん) in Japan.  Her career includes movie and TV drama roles, radio DJ, and gravure model. Yukari is currently employed by Versatile Entertainment.\n\nYukari’s voice actor roles are known for her use of a soft lisping voice. Her debut as a voice actress was in Kare Kano, where she voiced Sena Rika.','1982-10-28',NULL),(1100,'Anna Taratorkina',NULL,'','1982-10-08',NULL),(1101,'Noel Madison','New York City, New York, USA','Noel Madison (born Noel Nathaniel Moscovitch; April 30, 1897 – January 6, 1975) was an American character actor in the 1930s and 1940s and appeared in 75 films, often as a gangster.\n\nBorn in New York City, Madison was the son of actor Maurice Moscovitch and his wife Rose.\n\nBesides his theatrical work in the United States, he acted on stage in England and Australia.\n\nDescription above from the Wikipedia article Noel Madison, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1897-04-29','1975-01-06'),(1102,'Alina Maznenkova',NULL,'',NULL,NULL),(1103,'Ron Wall',NULL,'',NULL,NULL),(1104,'Charle','Kovilpatti, Tamil Nadu, India','Charle sometimes credited as Charlie (born Manohar Velmurugan Thangasamy; born 6 March 1960) is an Indian actor who has acted in more than 550 Tamil films as a comedian and supporting actor.\n\nHe completed his undergraduate degree in chemistry from G. V. N. College in Kovilpatti, Tamil Nadu. Even during those days when he was at college, he was known for his histrionics, and had the uncanny ability to imitate Tamil actors like Sivaji Ganeshan, Muthuraman, and Nagesh. He was an avid entertainer, and a popular stage artist, while at this college.\n\nHe started his career as a Staff Artist – Actor in Song & Drama Division of Ministry of Information and Broadcasting and moved on to perform more than 1000 dramas in Six years. He was named as Charle and introduced in the film \"Poikal Kuthirai\" in the year 1982 by the eminent director Padma Sri Dr.K.Balachandar. He has proved as a versatile actor in comedy as well as character roles in Tamil, Telugu and Malayalam films; he has dubbed his own voice in his role in Malayalam film \"Hijack\". He has more than 550 films to his credit and has played a vital role in many films, including films produced by National Film Development Corporation of India. He is highly talented in miming, mono acting and anchoring in stage shows and he has performed in various countries.\n\nHe holds a Master of Arts degree from Madurai Kamaraj University and Master of Philosophy degree from Karaikudi Alagappa University. He submitted his dissertation for M.Phil in the title, \"Contributions of Comedians in the growth of Tamil cinema – 1937 to 1967\".','1960-03-06',NULL),(1105,'Posani Krishna Murali','Guntur, Andhra Pradesh, India','Posani Krishna Murali is an Indian screenwriter, actor, director and producer who primarily works in Telugu cinema. He worked as a writer for over 150 Telugu films and directed several commercially successful films.','1958-09-19',NULL),(1106,'Michael Dube','Red Lake, Ontario, Canada','','1978-03-04',NULL),(1107,'Jacob Blair','Red Deer, Alberta, Canada','Jacob William Blair (born January 26, 1984 in Red Deer, Alberta) is a Canadian actor and writer. He is best known for the leading role of William Pinkerton in the TV series The Pinkertons. His first role was in the sci-fi television series Battlestar Galactica: Razor and went on to appear in many other series as Bionic Woman, The L Word, Fringe, Aliens in America, Suits, Beauty and the Beast, Republic of Doyle,  Rookie Blue and Dark Rising: Warrior of Worlds. He also appeared in many movies such as Fear Island, Smokin’ Aces 2: Assassins’ Ball, Hot Tub Time Machine, The A-Team, Wrecked, The Grey, Underworld: Awakening,  Night Cries and Country Crush.','1984-01-26',NULL),(1108,'Zhang Zhijian',NULL,'','1955-10-05',NULL),(1109,'Syntrell Ryder',NULL,'',NULL,NULL),(1110,'David Sterne',NULL,'',NULL,NULL),(1111,'Pat Mahoney',NULL,'',NULL,NULL),(1112,'Emerson Wong','Toronto, Ontario, Canada','','1979-11-27',NULL),(1113,'Derek Solorsano',NULL,'',NULL,NULL),(1114,'Wang Luyao','中国,黑龙江,哈尔滨','','1970-01-11',NULL),(1115,'Justine Smith',NULL,'',NULL,NULL),(1116,'Bill Martin Williams',NULL,'',NULL,NULL),(1117,'Hu Ge','Shanghai, China','In 2004, Hu made his breakthrough role as Li Xiaoyao in the television series Chinese Paladin, an adaptation of the action RPG The Legend of Sword and Fairy. Hu also performed two songs for the series\' soundtrack and that marked the beginning of his music career.\n\nAfter Chinese Paladin, Hu embarked on a number of television series projects, most of which had a wuxia theme. Hu has acted in a number of films as well, including The Ghost Inside and The 601st Phone Call. In late 2008, he co-starred with Wu Chun and Charlene Choi in The Butterfly Lovers, a film based on the Chinese legend of the Butterfly Lovers. In the same year, he played the role of Guo Jing in The Legend of the Condor Heroes, an adaptation of Louis Cha\'s novel of the same title.\n\nHu performed many songs for the soundtracks of the television dramas he starred in. On 31 October 2006. Hu released his own EP, titled Treasure or Tell Her I Love Her, which featured three songs. On 15 May 2008, Hu released his first full-length music album, titled Start, which featured ten tracks.\n\nHu was involved in a car accident on 29 August 2006 while travelling from Hengdian to Shanghai on the highway. He survived with severe injuries while his assistant died. Hu had to undergo surgery and the entire healing process took approximately one year. The shooting of The Legend of the Condor Heroes, which he was working on then, was temporarily halted due to his injury, in addition to being unable to complete promoting his finished project, The Young Warriors, with his fellow cast members. Hu expresses how he felt about the incident through the performance of his single, To Love, and filmed a music video with his co-star from the two series and friend Cecilia Liu.','1982-09-20',NULL),(1118,'Chiwetel Ejiofor','Forest Gate, London, UK','Chiwetelu Umeadi \"Chiwetel\" Ejiofor (born on July 10, 1977) is an English actor. He attended London Academy of Music and Dramatic Art, but had to leave after a year after receiving the roll of Ens, in Steven Spielberg\'s historical drama, \"Amistad\". For his first leading film role in Dirty Pretty Things, he won a British Independent Film Award for best actor. He has portrayed Othello in numerous stage productions including Bloomsbury Theatre, Theatre Royal in Glasgow and Donmar Warehouse. He made his directorial debut in the short film Slapper, which he also wrote. He soon became well known after moving on to bigger roles in \"Inside Man\" (2005), \"American Gangster\" (2007), \"Children of Men\" and Steve McQueen\'s \"12 Years a Slave\" (2012).','1977-07-10',NULL),(1119,'Viv Leacock','Montréal, Québec, Canada','Viv Leacock is an actor and director.','1974-04-20',NULL),(1120,'Kellye Nakahara','Oahu, Hawaii, USA','Kellye Nakahara was born on January 16, 1948 in Oahu, Hawaii, USA as Kellye Nakahara Watson. She was an actress, known for Clue (1985), M*A*S*H (1972) and Doctor Dolittle (1998). She was married to David Wallett. She died on February 16, 2020 in Pasadena, California, USA.','1950-01-01','2020-02-16'),(1121,'Mark Simmons',NULL,'',NULL,NULL),(1122,'Sudheesh','Kerala - India','Sudheesh is a Malayalam actor from Calicut who mainly works in Malayalam cinema. Sudheesh\'s father Sudhakaran was an actor who has done notable roles in numerous films like Gulmohar and Khaki. The father-son duo has acted together in many films.\n\nSudheesh (born: Ajaya Kumar) as the only son of T. Sudhakaran Nair and Suryaprabha. He did his schooling from St.Josephs Calicut. Sudheesh is married to Dhanya on 30 March 2005. They have two sons Rudraksh and Madhav.[2][3] His father died on 4 January 2016 aged 73 after an accident.','1975-03-28',NULL),(1123,'Kalabhavan Shajon','Kottayam, Kerala, India','Kalabhavan Shajohn is an Indian film actor and comedian who mainly works in Malayalam cinema. He started his career as a mimicry artist in Kalabhavan, Kochi. He has acted in several Malayalam movies',NULL,NULL),(1124,'PaulaSu Grisham',NULL,'',NULL,NULL),(1125,'Jack Shalloo','Hornchurch, Essex, England, UK','','1986-12-10',NULL),(1126,'Joan Chen','Shanghai, China','Joan Chong Chen (born April 26, 1961) is a Chinese American actress, film director, screenwriter and film producer. She became famous in China for her performance in the 1979 film Little Flower and came to international attention for her performance in the 1987 Academy Award-winning film The Last Emperor. She is also known for her roles in Twin Peaks, Red Rose White Rose, Saving Face and The Home Song Stories, and for directing the feature film Xiu Xiu: The Sent Down Girl.','1961-04-26',NULL),(1127,'Darius McCrary','Walnut, California, USA','Darius Creston McCrary (born May 1, 1976) is an American actor, rapper, singer and producer. He is best known for his role as Edward \"Eddie\" Winslow, the oldest child of Carl and Harriette Winslow on the ABC/CBS sitcom Family Matters (1989–1998).\n\nFrom Wikipedia, the free encyclopedia.','1976-05-01',NULL),(1128,'Dick Ziker','Casper, Wyoming, USA','Dick Ziker (born 15 January 1940) is a stuntman, stunt actor, stunt coordinator, and director.','1940-01-15',NULL),(1129,'Mateen Devji',NULL,'',NULL,NULL),(1130,'Ikhsan Bastian',NULL,'',NULL,NULL),(1131,'Jan Hoag','Portland, Oregon, USA','','1948-09-19',NULL),(1132,'Chen Weidong','中国,上海','','1987-11-19',NULL),(1133,'Nicholas Reed',NULL,'',NULL,NULL),(1134,'Harry Verity',NULL,'',NULL,NULL),(1135,'Wu Ma','Tianjin, China','From Wikipedia, the free encyclopedia.\n\nWu Ma (Chinese: 午馬, 22 September 1942 – 4 February 2014) is a Chinese actor, director, producer and writer. Wu Ma made his screen debut in 1963, and with over 300 appearances to his name (plus over 40 directorial credits within a twenty-five year period), Wu Ma is one of the most familiar faces in the history of Hong Kong Cinema. He is best known as the Taoist ghosthunter in A Chinese Ghost Story.','1942-08-18','2014-02-04'),(1136,'Takumi Saitoh','Tokyo, Japan','Takumi Saitoh (斎 藤 工 Saitō Takumi, Tokyo, Japan, August 22, 1981) is a Japanese actor, singer, and model.\n\nSaitoh was born on August 22, 1981, in the city of Tokyo, Japan. He made his acting debut in 1992, playing a small role in the Japanese drama Ippai no kakesoba. In the following years, he worked as a model for companies like Calvin Klein and Issey Miyake. In 2001, he starred in the movie Toki no kaori: Remember me (a remake of the Korean film Ditto), while in 2006, he participated as Yūshi Oshitari in the musical adaptation of the manga The Prince of Tennis, a role that made him gain popularity as an actor.\n\nAlso, in 2006, he played Shūya Arisada in the drama Princess princess D, an adaptation of the homonymous manga by Mikiyo Tsuda. However, his most important role was undoubtedly that of Noeru Kisaragi in the direct-to-video movie BOYS LOVE. The film tells the story of a magazine editor who meets and interviews a young model (later he also discovers that he is a gigolo) and the immediate attraction that arises between them. After the success of the film, the following year a theatrical successor to it was released (titled Schoolboy Crush in the West), but with a different plot and without Saitoh\'s involvement.\n\nAnother of his most important works is Sukitomo, another homosexual-themed film, released in 2007, and Itsuka no kimi e, also released that same year. The expressiveness of Saitoh as an actor and his natural way of embarking homosexual characters has contributed to give a \"normalized\" image of homosexual love in Japan, to the point of making it accessible and understandable to the general public. However, he ran the risk of being caught in a series of characters of that nature, so he joined the cast of the lightweight 2007 drama Delicious Gakuin. He participated in the 2009 graduation special of the Gokusen drama series and in HANA-KIMI 2011, the second Japanese TV adaptation of the comics of the same title.','1981-08-22',NULL),(1137,'Adam H. Marchand',NULL,'',NULL,NULL),(1138,'Joe Don Baker','Groesbeck, Texas, USA','From Wikipedia, the free encyclopedia\n\nJoe Don Baker (born February 12, 1936) is an American film actor, perhaps best known for his roles as a Mafia hitman in Charley Varrick, real-life Tennessee sheriff Buford Pusser in Walking Tall, James Bond villain Brad Whitaker in The Living Daylights, and CIA agent Jack Wade in the James Bond films GoldenEye and Tomorrow Never Dies.\n\nDescription above from the Wikipedia article Joe Don baker, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1936-02-12',NULL),(1139,'Belinda McClory','Adelaide, South Australia, Australia','','1968-11-01',NULL),(1140,'Bradford Bancroft',NULL,'',NULL,NULL),(1141,'Jill Morrison','Langley, British Columbia, Canada','Jill Morrison was born in Langley, British Columbia, Canada. She is an actress, known for Mean Girls (2004), Motherland: Fort Salem (2020) and Project Blue Book (2019).',NULL,NULL),(1142,'Beau DeLatte',NULL,'',NULL,NULL),(1143,'Sean Close',NULL,'',NULL,NULL),(1144,'Kaizaad Kotwal',NULL,'',NULL,NULL),(1145,'Miki Yoshimura',NULL,'',NULL,NULL),(1146,'Siddique','Ernakulam, Kerala, India','Siddique is a Malayalam film actor, producer, and television compere. He started his film career doing comedy roles and later performed in a variety of roles.','1962-10-01',NULL),(1147,'Sienna Miller','New York City, New York, USA','Sienna Rosie Diana Miller (born December 28, 1981) is an American-born English actress. Born in New York City and raised in London, she began her career as a photography model, appearing in the pages of Italian Vogue and for the 2003 Pirelli calendar. Her acting breakthrough came in the 2004 films Layer Cake and Alfie. She subsequently portrayed socialite Edie Sedgwick in Factory Girl (2006) and author Caitlin Macnamara in The Edge of Love (2008), and was nominated for the 2008 BAFTA Rising Star Award. Her role as The Baroness in G.I. Joe: The Rise of Cobra (2009) was followed by a brief sabbatical from the screen amid increased tabloid scrutiny.\n\nMiller returned to prominence with her role as actress Tippi Hedren in the television film The Girl (2012), for which she was nominated for the BAFTA Television Award for Best Actress and the Golden Globe Award for Best Actress – Miniseries or Television Film. Further critical acclaim followed throughout the 2010s, with appearances in the films Foxcatcher (2014), American Sniper (2014), Mississippi Grind (2015), The Lost City of Z (2016), Live by Night (2016), and American Woman (2018), as well as the miniseries The Loudest Voice (2019).','1981-12-28',NULL),(1148,'Sam Hazeldine','Hammersmith, London, England, UK','','1972-03-29',NULL),(1149,'Vanessa Guide','Besançon, Doubs, France','','1983-03-21',NULL),(1150,'Durant Fowler',NULL,'',NULL,NULL),(1151,'Appukutty','Thoothukudi, Tamil Nadu, India','Sivabalan or known as Appukutty is an Indian actor, who mainly appears in Tamil films. He became recognized following his performance in Vennila Kabadi Kuzhu. His role as Azhagarsami in Azhagarsamiyin Kudhirai was praised by film critics and fetched him the National Film Award for Best Supporting Actor.','1984-08-22',NULL),(1152,'Kyle Morris','Boise, Idaho, USA','','1984-07-24',NULL),(1153,'Melina Kanakaredes','Akron, Ohio, USA','Melina Kanakaredes (born April 23, 1967) is an American actress. She is widely known for her roles on Providence, CSI: NY, and Guiding Light.','1967-04-23',NULL),(1154,'Ali Fikry',NULL,'',NULL,NULL),(1155,'Ramesh Thilak',NULL,'',NULL,NULL),(1156,'Shofia Shireen',NULL,'',NULL,NULL),(1157,'Steve Harris','Chicago, Illinois, USA','Steve J. Harris (born December 3, 1965) is an American actor who has appeared in a number of films including; Quarantine, Tyler Perry\'s Diary of a Mad Black Woman, Bringing Down The House, The Rock, The Mod Squad, and Minority Report. He is most famous for his role as Eugene Young on the legal drama The Practice. He has done voice work for the animated television show The Batman as Ethan Bennett. He has also appeared on Law & Order and earlier had a recurring role on Homicide: Life on the Street. He is the older brother of actor Wood Harris. He was born in Chicago, Illinois, the son of Mattie, a housewife, and John Harris, a bus driver. He attended St. Joseph High School in Westchester, Illinois, a private school known for developing professional basketball players. Harris earned a B.A. Theatre Arts from Northern Illinois University. Harris holds a Master\'s of Fine Arts degree in theater from the Professional Theater Training Program at the University of Delaware.\n\nIn 2006, he appeared in the now-cancelled TV series Heist. He also appeared in an episode of Grey\'s Anatomy.\n\nHe also appeared in several episodes of New York Undercover.\n\nFrom Wikipedia, the free encyclopedia','1965-12-03',NULL),(1158,'Stephen Fung','Hong Kong','Stephen Fung Tak-Lun (born August 9, 1974) is a Hong Kong based actor, singer, model, writer and film director.\n\nDescription above from the Wikipedia article  Stephen Fung, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1974-08-09',NULL),(1159,'Sabrina Grdevich','Brampton, Ontario, Canada','Sabrina Grdevich (born October 7th, 1970) is a Canadian actress.','1970-10-07',NULL),(1160,'Michael Peña','Chicago, Illinois, USA','Michael Anthony Peña (born January 13, 1976) is an American film and television actor, probably best known for his prominent roles in Crash, Observe and Report, and Oliver Stone\'s World Trade Center. He also appeared in the Nickelback music video for their song Savin\' Me. Peña portrays Luis in the Ant Man film series in the Marvel Cinematic Universe, appearing as the character in Ant-Man (2015) and Ant-Man and the Wasp (2018).\n\nDescription above from the Wikipedia article Michael Peña, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-01-13',NULL),(1161,'Philippe Reyno',NULL,'Philippe Reyno is known for 3 Days to Kill (2014), Alice & Charlie (2006) and The Art Dealer (2015).',NULL,NULL),(1162,'Hulk Hogan','Augusta, Georgia, USA','Terry Gene Bollea, known by his ring name Hulk Hogan, is an American professional wrestler, actor, television personality, and musician best known for his time working for WWE. Hogan enjoyed mainstream popularity in the 1980s and 90s as the all-American character Hulk Hogan in WWE, and as Hollywood Hogan, the villainous leader of the New World Order, in World Championship Wrestling (WCW). Hogan was inducted into the WWE Hall of Fame in 2005. He was signed to Total Nonstop Action Wrestling (TNA) from 2010 until 2013, where he was the on-screen General Manager. He is a 12-time world champion being a six-time WWE Champion, six-time WCW World Heavyweight Champion, and a former WWE World Tag Team Champion with Edge. His six combined reigns make him the second longest-reigning WWE Champion of all time (after Bruno Sammartino) and the longest-reigning of the 1980s, having held the title for 1,474 days from 1984-1988. His six combined reigns in WCW make him the longest-reigning WCW World Heavyweight Champion of all time as well, with a 469-day reign from 1994-1995. Hogan won the Royal Rumble in 1990 and 1991, making him the first man to win two consecutive Royal Rumbles.','1953-08-11',NULL),(1163,'Caroline Amiguet','Paris, France','Caroline Amiguet is a French actress, film producer, and model, best known for her roles in the films Love All You Have Left (2017), Angels Fallen (2020), and Everybody Dies by the End (2022), and for producing the short film Daisy Belle (2018). She has been nominated for best actress at the GI Film Festival San Diego in 2017 and at the Oceanside International Film Festival in 2022. She was crowned Miss Suisse romande in 1997.\n\nThis article uses material from the Wikipedia article \"Caroline Amiguet\", which is released under the Creative Commons Attribution-Share-Alike License 3.0.','1977-05-23',NULL),(1164,'Jessica Szohr','Milwaukee, Wisconsin, USA','Jessica Karen Szohr (born March 31, 1985) is an American actress. Szohr began her screen career starring on television shows such as CSI: Miami and What About Brian. She gained recognition in 2007 with her breakthrough role as Vanessa Abrams on The CW series Gossip Girl.\n\nDescription above from the Wikipedia article Jessica Szohr, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1985-03-31',NULL),(1165,'Lauren Fray',NULL,'',NULL,NULL),(1166,'Charles Baloyi',NULL,'',NULL,NULL),(1167,'Lesley Ann Warren','New York City, New York, USA','Lesley Ann Warren (born August 16, 1946), is a Golden Globe Award-winning, Oscar nominated American stage, film and television actress and singer.\n\nShe has appeared in more than sixty films, including The Happiest Millionaire, Victor Victoria, Clue, Burglar, Cop, Color of Night, and Secretary. She has also had roles in popular TV shows such as Mission: Impossible, Desperate Housewives, Crossing Jordan, Will & Grace, and In Plain Sight.','1946-08-16',NULL),(1168,'Hal Yamanouchi','Tokyo, Tokyo, Japan','Fluent in several languages and trained as a dancer, Yamanouchi moved to Europe in the early 1970\'s and embarked on an acting and performance career. At first in small roles in B films and as a stage actor, he eventually progressed into more and more international productions and even a few big budget Hollywood films such as PUSH, THE WAY BACK, and THE LIFE AQUATIC.','1946-03-27',NULL),(1169,'Jackie Chan','Victoria Peak, Hong Kong','Jackie Chan (Chinese: 成龍; born 7 April 1954), Chan Kong-sang, is a Hong Kong actor, action choreographer, filmmaker, comedian, producer, martial artist, screenwriter, entrepreneur, singer and stunt performer. In his movies, he is known for his acrobatic fighting style, comic timing, use of improvised weapons, and innovative stunts. Jackie Chan has been acting since the 1970s and has appeared in over 100 films.\n\nChan has received stars on the Hong Kong Avenue of Stars and the Hollywood Walk of Fame. As a cultural icon, Chan has been referenced in various pop songs, cartoons, and video games. Chan is also a Cantopop and Mandopop star, having released a number of albums and sung many of the theme songs for the films in which he has starred.\n\nChan was born on April 7, 1954, in Victoria Peak, in the former Crown colony of Hong Kong, as Chan Kong-sang (meaning \"born in Hong Kong\") to Charles and Lee-Lee Chan, refugees from the Chinese Civil War. He was nicknamed Paopao (Chinese: 炮炮, literally meaning \"Cannonball\") because he was such a big baby, weighing 12 pounds, or about 5.4 kgs. Since his parents worked for the French Consul to Hong Kong, Chan spent his formative years within the grounds of the consul\'s residence in the Victoria Peak district. Chan attended the Nah-Hwa Primary School on Hong Kong Island, where he failed his first year, after which his parents withdrew him from the school.\n\nIn 1960, his father immigrated to Canberra, Australia, to work as the head cook for the American embassy, and Chan was sent to the China Drama Academy, a Peking Opera School run by Master Yu Jim-yuen. Chan trained rigorously for the next decade, excelling in martial arts and acrobatics. He eventually became part of the Seven Little Fortunes, a performance group made up of the school\'s best students, gaining the stage name Yuen Lo in homage to his master. Chan became close friends with fellow group members Sammo Hung and Yuen Biao, the three of them later to be known as the Three Brothers or Three Dragons. At the age of 17, he worked as a stuntman in the Bruce Lee films Fist of Fury and Enter the Dragon under the stage name Chan Yuen Lung. He received his first starring role later that year, in Little Tiger of Canton, which had a limited release in Hong Kong in 1973.','1954-04-07',NULL),(1170,'Avery Konrad',NULL,'','1994-12-28',NULL),(1171,'Rico Ball',NULL,'',NULL,NULL),(1172,'Rokkaku Seiji','Hyogo, Japan','Seiji Rokkaku was born on June 24, 1962 in Himeji, Japan. He is an actor and producer, known for 13 Assassins (2010), Gintama Live Action the Movie (2017) and Gannibal (2022).','1962-06-24',NULL),(1173,'Lee Hyun-wook','South Korea','Lee Hyun Wook is a South Korean actor. Born on June 17, 1985, he made his acting debut in a minor role in the 2014 television drama series “3 Days.” He has since appeared in a number of films and television dramas, including “Mrs. Cop 2” (2016) and “Fake” (2017).','1985-06-17',NULL),(1174,'Herman Hack','Panola, Illinois, USA','','1899-06-15','1967-10-19'),(1175,'Tracy Sebastian',NULL,'',NULL,NULL),(1176,'Robert Pralgo','The Bronx, New York, USA','Robert Pralgo (born June 4, 1966) is an American actor.\n\nPralgo was born in the Bronx in New York City. He graduated with a \"BA Television and Film Production\" at the University of Georgia in 1989. After graduation, he worked as a bartender while attending acting classes at Atlanta and a few years later, he moved to Los Angeles where he continued with his studies in the field of acting.\n\nFrom Wikipedia, the free encyclopedia','1966-06-04',NULL),(1177,'Nievecita Dubuque',NULL,'',NULL,NULL),(1178,'Kim Little','Stillwater, Oklahoma, USA','',NULL,NULL),(1179,'Kabelo Murray',NULL,'',NULL,NULL),(1180,'Toby Nichols','Louisiana, USA','Toby got his start in film by starring in the short films made by his older brother, Seth. Playing the assassin, the victim, or the zombie got him ready to jump on his opportunity when it came around. He was discovered in an acting class and has since booked lead and supporting roles in feature films, prime time TV and prize winning short films.','2001-11-30',NULL),(1181,'Gabriel Thomson','Hammersmith, London, England, UK','','1986-10-27',NULL),(1182,'Sophia Alexis',NULL,'',NULL,NULL),(1183,'Ryan Wulff',NULL,'',NULL,NULL),(1184,'Karrueche Tran','Los Angeles, California, USA','Karrueche Tientrese Tran (born May 17, 1988) is an American actress and model. Tran currently co-stars as Vivian Johnson in the web series \"The Bay The Series\". She also appeared in the TV One movie - The Fright Night Files (2014), 3-Headed Shark Attack (2015) and A Weekend with the Family (2016)','1988-05-17',NULL),(1185,'David Kaye','Saskatoon, Saskatchewan, Canada','Vancouver-based artist David Andrew Kaye was born in Saskatoon, Saskatchewan, Canada before his family moved to Vancouver, British Columbia. David\'s film debut came in the Academy Award-winning film Legends of the Fall (1994) as Samuel Decker. David continued to work as a child actor, breaking into the voice over scene in 2001, voicing 100 episodes as the title character in Make Way for Noddy (2001) until he took a break to go to school at the University of British Columbia. While attending school, he took a film production class and realized a new passion. In 2008, he started Whiskaye Films with Jameson Parker. He graduated in 2011 with a Bachelor of Fine Arts degree in Acting. After graduating, David performed in a number of live shows, including three BC based runs of multiple award-winning hip-hop Shakespeare musical \"The Bombitty of Errors\". While live performances were beginning to roll in, David had been producing music videos with Whiskaye Films and teamed up with award-winning writer and director Tyler Funk. David worked with Tyler\'s company North of Now Films, producing branded digital content and broadcast commercials, garnering millions of online views and multiple awards. David is producing and voicing several characters in White Ninja (2015). He is an actor and producer also known for 3000 Miles to Graceland (2001).','1988-08-04',NULL),(1186,'Harold Huber','New York City, New York, USA','Harold Huber (born Harold Joseph Huberman) was an American stage, screen, and television actor.','1909-12-05','1959-09-29'),(1187,'Denzel Washington','Mount Vernon, New York, USA','Denzel Hayes Washington, Jr. (born December 28, 1954) is an American actor, screenwriter, director and film producer. He first rose to prominence when he joined the cast of the medical drama St. Elsewhere, playing Dr. Philip Chandler for six years. He has received much critical acclaim for his work in film since the 1990s, including for his portrayals of real-life figures, such as Steve Biko, Malcolm X, Rubin ‘Hurricane’ Carter, Melvin B. Tolson, Frank Lucas, and Herman Boone. Washington has received two Academy Awards, two Golden Globe awards, and a Tony Award. He is notable for winning the Best Supporting Actor Oscar for his part in Glory in 1989, and the Academy Award for Best Actor in 2001 for his role in the film Training Day.','1954-12-28',NULL),(1188,'Wrenn Schmidt','Lexington, South Carolina, USA','Melinda Wrenn Schmidt (born February 18, 1983) is an American actress. She is best known for her starring role as NASA engineer, flight director, and later director of NASA Margo Madison in the Apple TV+ original science-fiction space drama series For All Mankind. Her other television roles include Julia Sagorsky in the period drama series Boardwalk Empire (2012–2013), KGB handler Kate in the spy drama series The Americans (2014), Dr Iris Campbell on the thriller series Person of Interest (2014–2016), and Megan Holter in the horror series Outcast (2016–2018).[5] Her film roles include the horror film Preservation (2014), the biographical drama I Saw the Light (2015), the war film 13 Hours: The Secret Soldiers of Benghazi (2016), the romantic comedy, The Good Catholic (2017), and the science-fiction horror film Nope (2022).','1983-02-18',NULL),(1189,'Will Peltz','New York City, New York, USA','William Peltz is an American actor, who is best known for his roles in Unfriended, Men, Women & Children and Manifest.','1986-05-30',NULL),(1190,'Peter Ferdinando','London, United Kingdom','Peter Ferdinando is a British character actor, known for his varied performances.\n\nHe has collaborated extensively with director and cousin Gerard Johnson, playing the title role in the critically acclaimed Tony and the lead role in their more recent film together, the award-winning Hyena.\n\nHe played the King Pin Spencer in David Mackenzie\'s prison drama Starred Up.\n\nHe also regularly collaborates with British filmmaker Ben Wheatley, having played Jacob in A Field in England, The Half-Face Man in \"Deep Breath\", the first episode of series 8 of Doctor Who, and Paul in Wheatley\'s High-Rise.\n\nMore recent work includes Tommy\'s Honour with Peter Mullan, directed by Jason Connery, Ghost in the Shell, with Scarlett Johansson and Juliet Binoche, directed by Rupert Sanders, and Guy Ritchie\'s King Arthur: Legend of the Sword, with Jude Law. In 2017, he starred in Woody Harrelson\'s experimental, live film directorial debut Lost In London alongside Owen Wilson, Willie Nelson and Woody Harrelson.',NULL,NULL),(1191,'Paul Tryl',NULL,'',NULL,NULL),(1192,'Joseph Lyman',NULL,'',NULL,NULL),(1193,'Chuck Zito','The Bronx, New York City, New York, USA','Chuck Zito was born on March 1, 1953 in The Bronx, New York City, New York, USA. Chuck is an actor, known for Homefront (2013), Carlito\'s Way (1993) and The Rock (1996).','1953-03-01',NULL),(1194,'Charlie Murphy','Enniscorthy, Ireland','Charlotte Murphy (born 19 April 1988) is an Irish actress best known for her role as Ann Gallagher in the BBC series Happy Valley (2014–2023).\n\nShe won the Irish Times Irish Theatre Award for her performance of Eliza Doolittle in Pygmalion by George Bernard Shaw at the Abbey Theatre.\n\nShe was nominated for Best Actress in a Play at the 2019 WhatsOnStage Awards for her performance as Mairead in The Lieutenant of Inishmore by Martin McDonagh, directed by Michael Grandage.','1988-04-19',NULL),(1195,'Barry Sigismondi','Baltimore, Maryland, USA','','1946-08-04',NULL),(1196,'Lois Alexander',NULL,'','1910-11-04',NULL),(1197,'Bizeki Magwanda',NULL,'',NULL,NULL),(1198,'Marat Descartes','São Paulo, São Paulo, Brazil','','1975-05-17',NULL),(1199,'Brad Mills',NULL,'Brad first took to the stage with Charlotte Children\'s Theater. He immediately fell in love with performing and went on to study theater in New York, Shanghai, London and Atlanta. He has appeared on stage, television, and film. He spent most of 2014 working in India. He currently (2015) resides in Atlanta.',NULL,NULL),(1200,'Isabella Cascarano','Valencia, Venezuela','',NULL,NULL),(1201,'Patrick Huffn',NULL,'',NULL,NULL),(1202,'Chris Boyd',NULL,'',NULL,NULL),(1203,'Kriti Sanon','New Delhi, India','Kriti Sanon is an Indian model and film  actress. After a successful modeling career, she made her acting debut  with Sukumar\'s Telugu psychological thriller film 1: Nenokkadine, and subsequently made her Bollywood debut in Sabbir Khan\'s commercially successful action-romance film Heropanti. (Wikipedia)','1990-07-27',NULL),(1204,'Franco Mazzieri',NULL,'',NULL,NULL),(1205,'So Hee-jung','South Korea','Korean actress.','1973-05-28',NULL),(1206,'Jason Schombing','Philadelphia, Pennsylvania, USA','Jason Schombing (born March 23, 1963 in Philadelphia, Pennsylvania) is an American actor and voice actor who has been in television and film since the early nineties, making appearances in crime shows and an episode of The X-Files. Since then he has had a recurring role in Stargate and several roles on the big screen, as well as portraying Marty Malone in The Godfather: The Game.','1963-03-23',NULL),(1207,'Kei Tanaka','Tokyo, Japan','','1984-07-10',NULL),(1208,'Anna Faris','Baltimore, Maryland, USA','Anna Kay Faris (born November 29, 1976) is an American actress. She rose to prominence for her work in comedic roles, particularly the lead part of Cindy Campbell in the Scary Movie film series (2000–2006). She has appeared in a number of films, including The Hot Chick (2002), May (2002), Lost in Translation (2003), Brokeback Mountain (2005), Just Friends (2005), My Super Ex-Girlfriend (2006), Smiley Face (2007), The House Bunny (2008), What\'s Your Number? (2011), The Dictator (2012), and Overboard (2018).\n\nOn television, Faris had a recurring role as Erica in the final season of the NBC sitcom Friends (2004) and starred as Christy Plunkett in the CBS sitcom Mom (2013–2020). She has also had voice-over roles in the film series Cloudy with a Chance of Meatballs (2009–2013) and Alvin and the Chipmunks (2009–2015), as well as The Emoji Movie (2017).\n\nIn 2015, Faris launched Unqualified, an advice podcast, and in 2017, her memoir of the same name was published, which became a New York Times Best Seller.','1976-11-29',NULL),(1209,'David Coupe',NULL,'',NULL,NULL),(1210,'Sadrag Nakale',NULL,'',NULL,NULL),(1211,'Marckenson Charles',NULL,'',NULL,NULL),(1212,'Jhey Castles',NULL,'',NULL,NULL),(1213,'Glen Chin','Stockton, California, USA','From Wikipedia, the free encyclopedia\n\nGlen Chin (January 27, 1948 – August 16, 2018) was an American actor of Chinese descent who starred in film and television.\n\nChin grew up in Stockton, California, where he attended Amos Alonzo Stagg High School and was active in drama and choir. He studied music at the University of Pacific Conservatory of Music and played the double bass violin with the Stockton Symphony.\n\nChin appeared in 50 First Dates as the humorous Hawaiian café regular, The Underachievers (1987), and After One Cigarette as Shigeru. He appeared in Chinese cinema in such films as Hollywood Hong Kong. Chin\'s television credits include Boy Meets World (the Eskimo), Night Stand with Dick Dietrick (Coco), Mighty Max, and Seinfeld. He played a villain\'s role in the 1998 movie, Knock Off (film).\n\nIn the Seinfeld episode \"The Opera\", Chin plays Harry Fong, a character who buys a scalped ticket to an opera from George Costanza right before (or during) his girlfriend Susan ends up making the opera, so in the end, Jerry Seinfeld, Elaine Benes, Cosmo Kramer, Chin\'s character, and Susan all end up watching the opera.\n\nIn Michael Jackson\'s music video for \"Black or White\", Chin morphs into Tyra Banks.','1948-01-27','2018-08-16'),(1214,'Kensuke Goto',NULL,'',NULL,NULL),(1215,'Sheri Moon Zombie','San Jose, California, USA','Sheri Lyn Skurkis (born September 26, 1970) is an American actress and fashion designer. She legally changed her name to Sheri Moon and later Sheri Moon Zombie after she married her long-term boyfriend Rob Zombie. She has been described as a \"scream queen\".\n\nDescription above from the Wikipedia article Sheri Moon, licensed under CC-BY-SA, full list of contributors on Wikipedia .','1970-09-26',NULL),(1216,'Michael Gohlke',NULL,'',NULL,NULL),(1217,'Pason','Ringgold, Georgia, USA','She began acting in 1998, graduated from Chattanooga High School of Performing Arts and attended Columbia College-Chicago as a Theater/Dance major. She trained with Cirque Du Soleil, then became an international headliner as a dancer/aerialist. During a performance Big Sky Motion Pictures offered her a role in Spring Break \'83. She came off tour as a dancer/aerialist on Dec. 19th, 2010, and transitioned into acting.\n\nShe was nominated as Best Supporting Actress in a feature film (Bloody Wedding (2011)) at the Fantastic Horror Film Festival \'14. She has done motion capture and, performance capture intensive workshop with \'Tom Keegan\' and has made appearances in several films, on television, done commercials, voice-over work, performed in music videos, done ADR work, and has been in over 100 magazines. In addition, she has posed for three bronze sculptures by sculptor Andrew Cawrse. The San Francisco Museum of Modern Art had a five-foot photo of her on display, and the New York Times published an article about the photo, calling it the \"Essence of Power\".','1980-03-27',NULL),(1218,'Deco Morais',NULL,'',NULL,NULL),(1219,'Paul Stephen Edwards',NULL,'',NULL,NULL),(1220,'Uday Chandra',NULL,'',NULL,NULL),(1221,'Susse Budde',NULL,'',NULL,NULL),(1222,'James Lew','Escalon, California, USA','James Jene Fae Lew (born September 6, 1952) is an American actor and martial artist. Raised in South Central Los Angeles, James Lew\'s destiny was to answer a cattle call in Hollywood for the hugely popular Kung Fu (1972) television series. He went on to star in the now collectible Hong Kong film, Young Dragon (1976). He made the move to big budget studio films in 1984. John Carpenter handpicked him as the Martial Arts Choreographer for 20th Century Fox\'s now cult film, Big Trouble in Little China (1986).\n\nJackie Chan, Jet Li, Steven Seagal, Jean-Claude Van Damme, Mel Gibson, Brad Pitt, Tom Cruise, Dwayne Johnson, David Carradine, Chuck Norris, Dennis Quaid, Kurt Russell, Madonna, Charlie Sheen, Sarah Michelle Gellar, Kathleen Turner, Sylvester Stallone, Brandon Lee, Snoop Dogg and the list goes on and on.\n\nJames was voted \"Favorite Action Star\" by fans of Inside Martial Arts magazine. Internet fans voted him into the Hall of Fame in the Martial Arts History Museum. Inside Kung Fu Magazine inducted him as one of the \"Martial Arts Greats\" alongside legends as Bruce Lee, Chuck Norris, Steven Seagal, Jean-Claude Van Damme, and his longtime friend Jackie Chan.\n\nHit Parader Magazine dubbed him \"the king of big-screen martial arts villains.\" From the deadly killer in Red Sun Rising (1994) to the deadly fighter in the comedy spoof Hot Shots 2 (1993), Lew has proven his chops in both drama and comedy. As a stunt/fight coordinator his creative talents shone in the television series The Crow to recent work on the hit video game, The Matrix: Path of Neo (2005). He handpicked elite members for his company, \"Hong Kong Wire Action Team,\" to bring state of the art action to movies. His formula for longevity in the film industry is diversity, hard work and having a whole lot of fun.\n\nMost recently, James Lew wrote, directed and starred in a movie inspired by his personal experiences in the business titled 18 Fingers of Death! (2006). The story follows Buford Lee (James Lew), the most famous unknown \"B\"-minus, low-budget, martial-arts movie star and Ronald Mack (Maurice Patton), a young black kid from the hood. Together they laugh and bond together on their quest to finally make Buford\'s break out movie, 18 Fingers of Death! (2006).','1952-09-06',NULL),(1223,'Brahim Bouhlel',NULL,'',NULL,NULL),(1224,'Mario Opinato','Catania, Sicily, Italy','','1964-07-26',NULL),(1225,'Frankie Delgado',NULL,'',NULL,NULL),(1226,'Lexie Kendrick','Memphis, Tennessee, United States','','1979-08-22',NULL),(1227,'Agung Endhyatmoko',NULL,'',NULL,NULL),(1228,'Tyler Silva',NULL,'',NULL,NULL),(1229,'Joel Fry','London, England','Joel Fry (born May 20, 1984) is a British actor and musician, having had roles in White Van Man, Trollied, Plebs, Twenty Twelve, and W1A. In film, he appeared as Lu\'kibu in 10,000 BC, Rocky in the 2019 romantic comedy film Yesterday. In 2023, Fry starred in a main role as \'Hugh\', the solicitor to Burnley banker Dave Fishwick in the film Bank of Dave.','1984-05-20',NULL),(1230,'Wolfgang Preiss','Nuremberg, Germany','From Wikipedia, the free encyclopedia.\n\nWolfgang Preiss (27 February 1910 at Nuremberg - 27 November 2002 at Baden-Baden) was a German theatre, film and television actor.\n\nThe son of a teacher, in the early 1930s Preiss studied philosophy, German and drama. He also took private acting classes with Hans Schlenck, making his stage début in Munich in 1932. He went to appear in various theatre productions in Heidelberg, Königsberg, Bonn, Bremen, Stuttgart and Berlin.\n\nIn 1942 he made his film début - he was exempted from military service specifically - in the UFA production Die grosse Liebe with Zarah Leander. After the end of the Second World War Preiss returned to the theatre, and from 1949 worked extensively dubbing films into German.\n\nIn 1954 he returned to film acting, appearing in Alfred Weidenmann\'s Canaris. The following year Preiss played the lead role of Claus von Stauffenberg in Falk Harnack\'s film Der 20. Juli, which dramatised the 1944 plot to assassinate Hitler. This role brought Preiss to popular attention and also the 1956 Federal Film Award.\n\nFrom now on Preiss was largely typecast in the role of the upright and obligation-conscious German officer to the other A-list actor playing the Fanatic (I.E. Paul Scofeld in The Train) a part he played in many films, later reprising it in numerous international productions, predominantly in Italy and the USA, while occasionally playing a more typically cynical or brutal Nazi officer.\n\nPreiss appeared in such productions as The Longest Day (1962), Otto Preminger\'s The Cardinal (1963), and with Jean-Paul Belmondo in Is Paris Burning? (1966). He starred alongside Burt Lancaster in John Frankenheimer\'s The Train (1964), Frank Sinatra in Von Ryan\'s Express (1965), Robert Mitchum in Anzio (1968), with Richard Burton, in the title role of Erwin Rommel in Raid on Rommel (1971), and The Boys From Brazil (1978) with Gregory Peck. He also appeared in several Italian language films, credited as \"Luppo Prezzo\", and played Field Marshal Von Rundstedt in Richard Attenborough\'s all-star war epic A Bridge Too Far (1977).\n\nIn addition, for the cinema-going public of West Germany he became the epitome of the evil genius in his role as Doctor Mabuse, a role he first played in 1960 (following Rudolf Klein-Rogge) in Fritz Lang\'s The Thousand Eyes of Dr. Mabuse. He went on to play the role four more times.\n\nIn the 1980s Preiss turned to television, notably playing General Walther von Brauchitsch in the American TV mini-series Winds of War and War and Remembrance, based on the books of Herman Wouk.\n\nIn 1987 received a second Federal Film Award for his outstanding work in film.\n\nIn film dubbing Preiss provided the voice for such actors as Lex Barker, Christopher Lee, Anthony Quinn, Claude Rains, Richard Widmark, as well as that of Conrad Veidt as \"Major Strasser\" in the remastered version of Casablanca.\n\nDescription above from the Wikipedia article Wolfgang Preiss, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1910-02-27','2002-11-27'),(1231,'Yu Shaoqun','Wuhan, Hubei Province, China','','1981-10-11',NULL),(1232,'Omar Sharif','Alexandria, Egypt','Michel Dimitri Shalhoub, known as Omar Sharif (Arabic: عمر الشريف), also spelled Omar El-Sherif, born April 10, 1932 in Alexandria and died July 10, 2015 in Cairo, is an Egyptian actor. The son of a precious wood merchant, he grew up in a united Christian family with his parents and his sister. Enrolled at Victoria College, a prestigious British school in Alexandria, the teenager studied science, and foreign languages, and would later discover theater classes. A brilliant student, he continued his studies at Cairo University where he obtained his diploma in mathematics and physics.\n\nCaught up in his taste for acting, he was spotted at 21 by director Youssef Chahine who offered him a leading role in Struggle in the Valley (1954). The success was immediate, thanks to this role, the young leading man walked the red carpet of the Croisette at the Cannes Film Festival the same year. He became a star of Egyptian cinema then in full expansion, and collaborated again with Youssef Chahine (The Devil of the Desert, Black Waters). In 1962, he took on the role of Prince Sherif Ali in Lawrence of Arabia under the direction of David Lean. This film, the first outside Egypt for the actor, marks the beginning of a long friendship with Peter O\'Toole and a turning point in Omar Sharif\'s career. He won the Golden Globe for Best Supporting Actor and decided to leave his native country for Hollywood. In 1955, Omar Sharif married the Egyptian actress Faten Hamama, whom he met on the set of Struggle in the Valley, and for whom he converted to Islam. Their son Tarek was born in 1957. The couple separated when the actor decided to pursue his career in Hollywood. Their divorce was finalized a few years later in 1974.  The actor, a polyglot, then began an international career. David Lean offered him a new emblematic role with Doctor Zhivago (1965) in which he played opposite Geraldine Chaplin. His filmography includes more than a hundred films. The actor nevertheless had a more unhappy period on the big screen with some commercial failures (And Came the Day of Vengeance, The Rendezvous, The Horsemen). He returned to success in the 2000s with Monsieur Ibrahim and The Flowers of the Koran by François Dupeyron for which he was awarded the César for Best Actor in 2004. The same year, he starred in Hidalgo by Joe Johnston. Rarer on film sets, in 2009 he accepted the role of a painter suffering from Alzheimer\'s disease in I Forgot to Tell You alongside Emilie Dequenne. He appeared in his last film, Rock the Casbah by Laïla Marrakchi, in 2012.\n\nIn May 2015, his son, Tarek El-Sharif, announced in an interview that Omar Sharif had Alzheimer\'s disease. He died on July 10, 2015 following a heart attack. His funeral took place on July 12, 2015 in a mosque in Cairo and he was buried at the Sayyeda Nefisa cemetery in the south of the city.','1932-04-10','2015-07-10'),(1233,'Edwin Maxwell','Dublin, Ireland','Edwin Maxwell was born on February 9, 1886 in Dublin, Ireland. He was an actor, known for Scarface (1932), The Shop Around the Corner (1940) and His Girl Friday (1940). He was previously married to Betty Alden. He died on August 13, 1948 in Falmouth, Massachusetts, USA.','1886-02-09','1948-08-13'),(1234,'Mahesh Babu','Chennai, Tamil Nadu, India','Mahesh Babu (born Mahesh Ghattamaneni ) is an Indian actor, producer, media personality, and philanthropist known for his works in Telugu cinema.','1975-08-09',NULL),(1235,'Victor Wong','San Francisco, California, USA','From Wikipedia, the free encyclopedia\n\nVictor Wong (July 30, 1927 – September 12, 2001)  was a Chinese American character actor who appeared in supporting roles throughout the 1980s and 1990s.\n\nDescription above from the Wikipedia Victor Wong, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1927-07-30','2001-09-12'),(1236,'Emmet Kirwan',NULL,'',NULL,NULL),(1237,'Paolo Maria Scalondro','Rome, Lazio, Italy','','1952-10-06',NULL),(1238,'Douglas Dirkson','Lewistown, Montana, USA','','1943-05-17',NULL),(1239,'Casey King','Pittsburgh, Pennsylvania, USA','','1991-03-25',NULL),(1240,'Nicole Rudell',NULL,'',NULL,NULL),(1241,'Martha Merrill',NULL,'',NULL,NULL),(1242,'Matthew Connell',NULL,'',NULL,NULL),(1243,'Paul Herman','Brooklyn, New York,  USA','Paul Herman (March 29, 1946 - March 29, 2022) was an American actor. Among other roles, he was known for playing Randy in David O. Russell\'s dramedy Silver Linings Playbook (2012) and Whispers DiTullio in Martin Scorsese\'s crime epic The Irishman (2019).\n\nHis other appearances in movies include Once Upon a Time in America, At Close Range, We Own the Night, Heat, Crazy Heart, Quick Change, Sleepers, Cop Land, The Fan, Analyze That, The Day Trippers, and American Hustle. He had a recurring role on The Sopranos as \"Beansie\" Gaeta, as well as another HBO series, Entourage, as Vincent Chase\'s accountant, Marvin.\n\nHerman had also played minor background characters in two other Scorsese crime films. In Goodfellas, he was The Pittsburgh Connection, and in the montage sequence \'Back Home, Years Ago\' in Scorsese\'s Casino, he was a gambler who rushes to the phone booth to place the same bet that Sam Rothstein (Robert De Niro) did.\n\nIn 2009\'s Crazy Heart, Herman played the manager of Jeff Bridges\' character.\n\nHerman, along with his brother Charlie, ran the Columbus Cafe in the 1990s. Located across from Lincoln Center, it was frequented by actors, ballet dancers, gangsters, and FBI and DEA agents. Herman also had a small ownership stake in the cafe, along with Mikhail Baryshnikov as well as other actors.\n\nSource: Article \"Paul Herman\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1946-03-29','2022-03-29'),(1244,'Katie Wilson','Arizona, USA','Katie Wilson (she/her) is an actress, host, and Lvl 6 Sorcerer. Her credits range from mainstream Superstore (NBC), Into the Dark (HULU), 2012: Ice Age (SYFY), and hosting gigs (Roku, Syfy Wire, WB Games, Google, Geek & Sundry) to new media (Smosh Games, Screen Junkies, The Warp Zone, YT Red) and a variety of high-profile brand integrations (Nintendo, Disney, Hasbro, Doritos.)','1990-07-11',NULL),(1245,'Rain Li','Hongkong，China','','1983-11-11',NULL),(1246,'Mark Hengst','Madison, Wisconsin, USA','','1964-03-07',NULL),(1247,'Gregory Paul Smith','Menominee, Michigan, USA','','1981-03-06',NULL),(1248,'Lena Headey','Hamilton, Bermuda','Lena Kathren Headey (born 3 October 1973) is a British actress. She gained international recognition and acclaim for her portrayal of Cersei Lannister on the HBO epic fantasy drama series Game of Thrones (2011–2019), for which she received five Primetime Emmy Award nominations and a Golden Globe Award nomination.\n\nHeadey made her film debut in the mystery drama Waterland (1992). She continued to work steadily in British and American films and on television, before gaining further recognition with her lead performances in the films The Brothers Grimm (2005) and 300 (2007). Her other film credits include The Remains of the Day (1993), The Jungle Book (1994), Mrs Dalloway (1997), Ripley\'s Game (2002), Imagine Me & You (2005), Dredd (2012), The Purge (2013), 300: Rise of an Empire (2014), Pride and Prejudice and Zombies (2016), and Fighting with My Family (2019).\n\nOutside of film, Headey starred as Sarah Connor in the science fiction television series Terminator: The Sarah Connor Chronicles (2008–2009) and had a recurring role as Amelia Hughes in the animated web series Infinity Train (2019–2021). She provided voices for the role-playing video game Risen (2009) and the video game tie-in film Kingsglaive: Final Fantasy XV (2016), as well as the animated series Danger Mouse (2015–2017) and Trollhunters (2017–2018), and puppet-animated series The Dark Crystal: Age of Resistance (2019).','1973-10-03',NULL),(1249,'Irene Papas','Chiliomodi, Corinth, Greece','Irene Papas (Greek: Ειρήνη Παππά, born Eirini Lelekou (Greek: Ειρήνη Λελέκου) 3 September 1929 – 14 September 2022)was a Greek actress and singer who starred in over 70 films in a career spanning more than 50 years. She gained international recognition through such popular award-winning films as The Guns of Navarone (1961), Zorba the Greek (1964) and Z (1969). She was a powerful protagonist in films including The Trojan Women (1971) and Iphigenia (1977). She played the title roles in Antigone (1961) and Electra (1962). She had a fine singing voice, on display in the 1968 recording Songs of Theodorakis.\n\nPapas won Best Actress awards at the Berlin International Film Festival for Antigone and from the National Board of Review for The Trojan Women. Her career awards include the Golden Arrow Award in 1993 at Hamptons International Film Festival, and the Golden Lion Award in 2009 at the Venice Biennale.\n\nDescription above from the Wikipedia article Irene Papas, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1926-09-03','2022-09-14'),(1250,'Joel Swetow','New York City, New York, USA','Joel Swetow (Born December 30th, 1951) is an American character actor who has nearly 80 credits to his name in film, television and video games.  He is perhaps best known as Mr. Brown, the right hand man of Hugo Snyder, the main villain in the 1992 Martial Arts cult classic, the 3 ninjas. He has appeared on the hit tv series Charmed (1998) and played several roles in the Star Trek Franchise.','1951-12-30',NULL),(1251,'Chris Walley','Cork, Ireland','Chris Walley is an Irish actor best known for his role as Jock O\'Keeffe in the 2016 Irish comedy film The Young Offenders for which he received an IFTA Nomination for Best Actor in a Supporting Role - Film.\n\nIn 2018, he will reprise his role as Jock O\'Keeffe in a TV series of the same name created by the BBC.','1995-06-20',NULL),(1252,'Geneviève Guilbault',NULL,'',NULL,NULL),(1253,'Charles Sherlock','Chicago, Illinois, USA','','1900-07-09','1983-05-01'),(1254,'Rick Wiles',NULL,'',NULL,NULL),(1255,'Kurt Krause',NULL,'Kurt Krause is an actor.',NULL,NULL),(1256,'Mithu Chakrabarty','Hyderabad, Telengana, India','Mithu Chakrabarty is an Indian film and television actress. She appeared in Telugu, Tamil, Bengali, Hindi, Kannada, Malayalam and Marathi language films.',NULL,NULL),(1257,'Brittney Alger','Ohio, USA','','1988-10-25',NULL),(1258,'Ryan Cook',NULL,'',NULL,NULL),(1259,'Andrew Moxham','Toronto, Ontario, Canada','',NULL,NULL),(1260,'Brian Hall','Paterson, New Jersey, USA','','1959-06-27',NULL),(1261,'Andrew Ravani',NULL,'',NULL,NULL),(1262,'Thomas Haden Church','Yolo County, California, USA','Thomas Haden Church (born Thomas Richard McMillen; June 17, 1960) is an American actor. After co-starring in the 1990s sitcom Wings, Church became well known for his film roles, including his Academy Award-nominated performance in Sideways and his role as the Sandman in Spider-Man 3.','1960-06-17',NULL),(1263,'Emmett Vogan','Lima, Ohio, USA','From Wikipedia, the free encyclopedia\n\nCharles Emmett Vogan was an American actor with almost 500 film appearances from 1934–54, making him, along with Bess Flowers, one of the most prolific film actors of all time.','1893-09-27','1969-11-13'),(1264,'Sean James',NULL,'',NULL,NULL),(1265,'Jamie Parker','Middlesbrough, Cleveland, England, UK','','1979-08-14',NULL),(1266,'Victoria Cartagena','Philadelphia, Pennsylvania, USA','Victoria Cartagena is an American stage and screen actress. She graduated from the American Musical and Dramatic Academy, New York City.',NULL,NULL),(1267,'Addison Richards','Zanesville, Ohio, USA','From Wikipedia, the free encyclopedia\n\nAddison Whitaker Richards, Jr. (October 20, 1902 – March 22, 1964) was an American actor of film and television. He appeared in more than three hundred films and television series between 1933 and his death.','1902-10-20','1964-03-22'),(1268,'Phyllis Quek','Kuala Lumpur, Malaysia','Phyllis Quek is a Malaysia-born model-turned-actress and singer in Singapore. She was prominently a full-time Mediacorp artiste from 1995 to 2001 but continues to film on an ad-hoc basis and managed under Hype Records. She left Mediacorp after her contract expired and chose not to renew it.\n\nPhyllis Quek\'s entry to Singapore showbiz was through Star Search 1995, in which she garnered a third placing. Despite this, a stunning performance in her debut drama serial, Beyond Dawn (女子监狱), left an indelible impression in the hearts of viewers. She was subsequently awarded the Best Newcomer Award at MediaCorp\'s Star Awards ceremony in 1996.\n\nPhyllis struck gold when MediaCorp Raintree Pictures offered her a lead role opposite Hong Kong megastar Aaron Kwok and Daniel Wu in a Hong Kong-Singapore joint collaboration movie, 2000 A.D.. Through this action flick, she won attention in the Asian media and is noted to have a high potential in local book Singapore Cinema by Raphaël Millet. She subsequently followed this up with a supporting role as a policewoman in another Raintree Pictures film, The Tree (孩子树).\n\nHer recording of the theme song of her earlier drama, The Other Parent (妈妈先生) and Mind Games (危险人物) marked the start of a nascent career in singing. She then released her debut album, Phyllis, under Hype Records which contained primarily dance tunes and singles from the soundtrack of The Tree and Beyond The Axis Of Truth (法医X档案). To promote her album, Phyllis guest starred in a Channel 5\'s crime drama series Heartlanders 2 where she played a stalked actress. That particular episode featured her song, \'不知不觉\', thrice and was a radio hit along with her other singles, \'Freedom\'. However, the album did not mark the start of a longstanding music career for Phyllis and it was to remain her first and only album.\n\nAs soon as her contract expired in 2001, she made a critical decision to switch to another management company, Hype Records Artiste Networks after she enjoyed working with them whilst producing her debut album. In keeping with Hype Records\' plans for regionalisation, Phyllis made another conscious decision to star in productions from primarily the East Asian region (including Taiwan and China). She made her debut in Taiwan headlining the wacky lead role in a fluffy idol drama titled My Fair Lady (丑女大翻身), in which she donned fatsuits and prosthetics in order to play a fat and undesired girl.','1972-08-23',NULL),(1269,'Barry Barnes',NULL,'',NULL,NULL),(1270,'Elsa Pataky','Madrid, Spain','Elsa Lafuente Pataky (born 18 July 1976) is a Spanish actress.\n\nDescription above from the Wikipedia article Elsa Pataky, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-07-18',NULL),(1271,'Li Bingbing','Wuchang, Heilongjiang, China','Li Bingbing  (李冰冰) was born February 27, 1973 in Wuchang, Heilongjiang, China. She is an actress and producer, known for Transformers: Age of Extinction, Resident Evil: Retribution and Detective Dee: The Mystery of the Phantom Flame. Li\'s first big break came in 1999 when she played a kindhearted cop in the film \"Seventeen Years\" (过年回家). This film won her the Best Asian Actress award in the 2000 Singapore International Film Festival. In 2009, she was named a WWF Earth Hour Global Ambassador.','1973-02-27',NULL),(1272,'Tovino Thomas','Irinjalakuda, Kerala, India','Tovino Thomas is an Indian film actor active in Malayalam films. He made his acting debut in 2012 with the Malayalam film Prabhuvinte Makkal. Tovino is recognized for the wide range of characters he had portrayed in the Malayalam film industry which includes protagonists, strong crucial characters and negative roles.','1989-01-21',NULL),(1273,'Ryan Love',NULL,'',NULL,NULL),(1274,'Leslie Nielsen','Regina, Saskatchewan, Canada','Leslie William Nielsen, OC (February 11, 1926 – November 28, 2010) was a Canadian and naturalized American actor and comedian. Nielsen appeared in over one hundred films and 1,500 television programs over the span of his career, portraying over 220 characters. Born in Regina, Saskatchewan, Nielsen enlisted in the Royal Canadian Air Force and worked as a disc jockey before receiving a scholarship to Neighborhood Playhouse. Making his television debut in 1948, he quickly expanded to over 50 television appearances two years later. Nielsen made his film debut in 1956, and began collecting roles in dramas, westerns, and romance films. Nielsen\'s performances in the films Forbidden Planet (1956) and The Poseidon Adventure (1972) received positive reviews as a serious actor, though he is primarily known for his comedic roles.\n\nAlthough Nielsen\'s acting career crossed a variety of genres in both television and films, his deadpan delivery in Airplane! (1980) marked a turning point in his career, one that would make him, in the words of film critic Roger Ebert, \"the Olivier of spoofs.\" Nielsen enjoyed further success with The Naked Gun film series (1988 – 1994), based on a short-lived television series Police Squad! in which he starred earlier. His portrayal of serious characters seemingly oblivious to (and complicit in) their absurd surroundings gave him a reputation as a comedian. In the final years of his career, Nielsen appeared in multiple spoof and parody films, many of which were met poorly by critics, but performed well in box office and home media releases. Nielsen married four times and had two daughters from his second marriage. He was recognized with a variety of awards throughout his career, and was inducted into the Canada and Hollywood Walks of Fame.\n\nDescription above from the Wikipedia article Leslie Nielsen, licensed under CC-BY-SA, full list of contributors on Wikipedia','1926-02-11','2010-11-28'),(1275,'Shogo Nakajima',NULL,'',NULL,NULL),(1276,'Sabrina-Jasmine Guilbault',NULL,'',NULL,NULL),(1277,'Rony David Raj',NULL,'Rony David is an Indian film actor who appears in Malayalam Cinema, mainly in supporting roles. He made debut in the 2008 film Kurukshetra.',NULL,NULL),(1278,'Jonah Russell',NULL,'',NULL,NULL),(1279,'Stephen Daniel Wayne',NULL,'',NULL,NULL),(1280,'Christian Isaiah','Virginia Beach, Virginia, USA','','2007-12-15',NULL),(1281,'Neva Leoni','Rome, Italy','','1992-09-02',NULL),(1282,'DeRay Davis','Chicago, Illinois, USA','Antwan DeRay Davis is an American stand-up comedian and actor best known for his role as Ray-Ray the Hustle Guy in Barbershop and Barbershop 2: Back in Business, Davis has also appeared in other films, including Semi-Pro (2008) and 21 Jump Street. His television roles and appearances include programs  BET\'s ComicView, MTV\'s Nick Cannon\'s Wild \'N Out and \'Short Circuitz, and HBO\'s Entourage.\n\nHe began his career in comedy clubs and shortly after moving to Los Angeles, he won the Comedy Central Laugh Riots Competition and was a standout on the Cedric the Entertainer Tour.  He voices for several skits on rapper Kanye West\'s albums The College Dropout and Late Registration, and also appeared in West\'s music video for \"Through the Wire.\" Other music video appearances for Davis include Lil\' Flip\'s \"Game Over\", Chris Brown\'s \"Yo (Excuse Me Miss),\" and Three 6 Mafia\'s \"Doe Boy Fresh.\"\n\nDescription above from the Wikipedia article DeRay Davis  licensed under CC-BY-SA, full list of contributors on Wikipedia.','1982-02-26',NULL),(1283,'Shawn Michael Howard',NULL,'','1969-07-31',NULL),(1284,'Louis Herthum','Baton Rouge, Louisiana, USA','','1956-07-05',NULL),(1285,'Bill Sullivan',NULL,'',NULL,NULL),(1286,'Gordon Lai',NULL,'',NULL,NULL),(1287,'Ken Lo','Stung Treng, Cambodia','Kenneth Low Wai-kwong is a Hong Kong actor, martial artist, and stuntman. He was a member of the Jackie Chan Stunt Team.','1959-03-17',NULL),(1288,'Dimiter Doichinov',NULL,'Dimiter Doichinov is an actor and a stunt performer.',NULL,NULL),(1289,'Stanley Blystone','Eau Claire, Wisconsin, USA','From Wikipedia, the free encyclopedia\n\nStanley Blystone (August 1, 1894 – July 16, 1956) was an American film actor who made more than 500 film appearances between 1924 and 1956. Blystone is best known for his appearance in Charlie Chaplin\'s Modern Times, playing Paulette Goddard\'s father, and several short films starring The Three Stooges. Some of his more memorable roles were in the films Half Shot Shooters, False Alarms, Goofs and Saddles, Three Little Twirps and Slaphappy Sleuths. His final appearance with the trio was Of Cash and Hash in 1955. He also appeared in several Laurel and Hardy films.','1894-08-01','1956-07-16'),(1290,'Martin Murphy',NULL,'',NULL,NULL),(1291,'Wahid Bouzidi','Villepinte, Seine-Saint-Denis, France','Wahid Bouzidi (Arabic: وحيد بوزيدي), born July 9, 1978 in Villepinte (France) and died August 20, 2023 in Marrakech (Morocco), is a Franco-Algerian comedian and actor. From 2006 to 2008, he was a member of the Jamel Comedy Club before launching his own one-man show.\n\nThe youngest of ten children, Wahid Bouzidi grew up in Bobigny. He lost his mother then his father two months apart when he was only 15 years old. Subsequently, he lived in Noisy-le-Sec with his older brother Ahmed who became his legal guardian. The sudden loss of his parents plunges Wahid Bouzidi into a period of silence. It was within a Gagny theater troupe, named Les Guez Guez, that he found an outlet for his grief and revealed a talent for the performing arts.\n\nWahid Bouzidi was revealed in 2004, at the age of 26, by the director Guy Jacques who gave him a first role in the cinema in the feature film Ze Film. From there, Wahid took theater classes in Bondy in the Guezguez troupe for 2 years. In 2005, Kader Aoun, who was looking for young talents to join the Canal+ show Jamel Comedy Club (produced and presented by Jamel Debbouze), contacted Wahid Bouzidi who refused. Invited to attend the rehearsals of the first troupe of the Jamel Comedy Club, he wrote his first text: Le Gitan the same evening. The next day, he presented his text to Kader Aoun then twenty minutes later, he went on stage with the troupe. It was there that he discovered stand-up and presented his own shows including Wahid Se Lache and Graisse Anatomie.\n\nIn the cinema, he mainly plays in comedies such as Case Départ, Beur Sur La Ville, Mohamed Dubois, Alad\'2 and BDE. He appears in particular in two films directed by Philippe Lacheau. On television, in 2009, he was one of the protagonists of the comedy series Tongs et paréo on M6, alongside David Salles, Claudia Tagbo, Delphine McCarty and Gil Alma, among others. He appears in an episode of the hit series Captain Marleau in 2017. Between 2019 and 2022, he regularly participates in the show Friday, everything is permitted with Arthur on TF1.\n\nIn 2015, he played in the play La Grande Évasion, created and directed by Youssef Bouchikhi, alongside actors Paul Séré and Booder. He is credited on the poster under the sole first name of Wahid. In 2017 and 2018, he participated in Marrakech Du Rire hosted by Jamel Debbouze. For his latest show entitled \"Wahid… Il Se Relève”, performed from January to June 2023, Wahid Bouzidi draws inspiration from his health problems that occurred from 20214, evoking loneliness and mistreatment in the hospital. The show revolves around his experience in the hospital where he felt disappointed towards some of those around him. However, he highlights the unconditional support of his wife and his friend Booder. He talks about “white visiting rooms”, in reference to relatives who had promised to come see him, but who never did. The production, directed by Papy, begins with Bouzidi in a wheelchair, before he gradually gets up.\n\nOn August 16, 2023, Wahid Bouzidi suffered a new stroke while on vacation in Marrakech, which plunged him into a coma. He died on August 20, 20238.9 He was buried in Algeria near Tolga.','1978-07-09','2023-08-20'),(1292,'Kazutoshi Yokoyama',NULL,'Kazutoshi Yokoyama is known for Battle Royale (2000), Kamen Rider Fourze: Everyone, Space is Here! (2012) and Kamen Rider Fourze (2011).',NULL,NULL),(1293,'Tracey Mulqueen',NULL,'',NULL,NULL),(1294,'Stephanie Bunting',NULL,'',NULL,NULL),(1295,'Rob Roy Fitzgerald','Oxnard, California, USA','Rob Roy Fitzgerald was born in Oxnard, California. Singer/ song writer /writer/producer.','1955-02-04',NULL),(1296,'Lydia Styslinger','Birmingham, Alabama, USA','','2002-06-24',NULL),(1297,'Jeremy Thibodeau',NULL,'',NULL,NULL),(1298,'Jo Sang-geon','South Korea','','1946-01-09','2023-04-21'),(1299,'Francisco Peramos','Las Palmas de Gran Canaria, Canary Islands, Spain','',NULL,NULL),(1300,'Cheryl Singleton',NULL,'',NULL,NULL),(1301,'Gabriele Cristini','Rome, Lazio, Italy','','2010-04-18',NULL),(1302,'Yoram Blaschkauer',NULL,'',NULL,NULL),(1303,'Scott Caudill',NULL,'','1976-01-01',NULL),(1304,'Donald Watkins',NULL,'',NULL,NULL),(1305,'Jeremy Yong',NULL,'',NULL,NULL),(1306,'Sirinya Jantzen',NULL,'','1983-10-26',NULL),(1307,'Aarif Rahman','Hong Kong, China','Aarif Lee (born Aarif Rahman on 26 February 1987) is an actor and Cantopop singer from Hong Kong. After singing \"Only Friends\" at a gathering, he was signed by Alvin Wang and Leon Lai of East Asia Record Production and became one of the new artists in 2009. Lee also won \"Best New Performer\" at the 29th Hong Kong Film Awards in 2010, for his performance in Echoes of the Rainbow.\n\nDescription above from the Wikipedia article Aarif Lee, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1987-02-26',NULL),(1308,'Vladimir Menshov','Baku, USSR [now Azerbaijan]','','1939-09-17','2021-07-05'),(1309,'Grayson Hunt Urwin','New Plymouth, New Zealand','','1996-05-24',NULL),(1310,'Antony De Liseo','Wollongong, New South Wales, Australia','Antony De Liseo is an Australian actor.','1991-03-18',NULL),(1311,'Lee Chae-kyung','South Korea','After debuting in the musical Empress Myeongseong in 1999, Chae Kyung worked for eight years as an actor for the renowned Seoul Performing Arts Company until 2007. For over 20 years, she has appeared in over 100 musicals, plays, TV shows and films including Horror Stories (2012), She Was Pretty (2015), Guardian (2016), Hide-and-Seek (2016), 100 Days My Prince (2018), Hotel del Luna (2019), and #Alive (2020). Originally a physical education major in college, she applies the same discipline in preparation for her roles as an actor. With utmost dedication to her craft, her powerful performances can be seen both on the stage and silver screen. @chaekyung_lee_','1975-01-22',NULL),(1312,'David Chokachi','Plymouth, Massachusetts, USA','From Wikipedia, the free encyclopedia\n\nDavid Chokachi (born David Al-Chokhachy on January 16, 1968 in Plymouth, Massachusetts) is an American television actor. He\'s best known for his role in the TV series Witchblade, Baywatch, and Beyond The Break. His father is Iraqi and his mother is Finnish.\n\nDescription above from the Wikipedia article David Chokachi, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1968-01-16',NULL),(1313,'Naoto Takenaka','Kanazawa-ku, Yokohama, Kanagawa Prefecture, Japan','Naoto Takenaka is a Japanese actor, comedian, singer, and director from Yokohama, Kanagawa, affiliated with From First Production. He is married to former idol singer and actress Midori Kinouchi.\n\nDescription above from the Wikipedia article Naoto Takenaka, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1956-03-20',NULL),(1314,'Jeffrey Tott',NULL,'',NULL,NULL),(1315,'Eva Mendes','Miami, Florida, USA','Eva Mendes (born March 5, 1974, height 5\' 6\" (1,68 m)) is an American actress, model, singer, and homeware and fashion designer. She began acting in the late 1990s, and after a series of roles in B movies such as Children of the Corn V: Fields of Terror (1998) and Urban Legends: Final Cut (2000), she broke into the Hollywood mainstream with an appearance in Training Day (2001).\n\nShe has since starred in many films including All About The Benjamins (2002); 2 Fast 2 Furious, Once Upon a Time in Mexico, Out of Time and Stuck on You (2003); Hitch (2005); Ghost Rider and We Own the Night (both 2007); The Spirit (2008); The Bad Lieutenant: Port of Call New Orleans (2009); The Other Guys and Last Night (both 2010), Girl in Progress (2012).\n\nMendes has worked as a spokesmodel for Cocio chocolate milk, Magnum ice cream, Revlon make-up, Calvin Klein underwear and perfume, Cartier jewelry, Thierry Mugler perfume, Reebok trainers, Campari apéritif, Pantene shampoo, Morgan clothes and Peek & Cloppenburg clothes.\n\nMendes is the creator of a home decor line, Vida, sold exclusively at Macy\'s. She launched a bedding collection in 2008 and a dinnerware collection in 2010.\n\nMendes is a singer: she has recorded a version of The Windmills of Your Mind and has collaborated with Cee Lo Green on a song entitled Pimps Don\'t Cry.\n\nShe lives in the Los Feliz neighborhood of Los Angeles.','1974-03-05',NULL),(1316,'Charles Chudabala',NULL,'',NULL,NULL),(1317,'Santhakumari',NULL,'Santhakumari is an Indian actress in the Malayalam film and television industry.',NULL,NULL),(1318,'Una Kay',NULL,'','1933-12-05',NULL),(1319,'Gerard Jordan',NULL,'','1900-01-01',NULL),(1320,'Edward Butron',NULL,'',NULL,NULL),(1321,'Rocco Auteri',NULL,'',NULL,NULL),(1322,'George Segal','Great Neck, Long Island, New York, USA','George Segal (February 13, 1934 – March 23, 2021) was an American actor and musician.\n\nSegal became popular in the 1960s and 1970s for playing both dramatic and comedic roles. Some of his most acclaimed roles were in films such as Ship of Fools (1965), King Rat (1965), Who\'s Afraid of Virginia Woolf? (1966), The St. Valentine\'s Day Massacre (1967), Where\'s Poppa? (1970), The Hot Rock (1972), Blume in Love (1973), A Touch of Class (1973), California Split (1974), For the Boys (1991), and Flirting with Disaster (1996). He was nominated for the Academy Award for Best Supporting Actor for his performance in Who\'s Afraid of Virginia Woolf? and had won two Golden Globe Awards, including the Golden Globe Award for Best Actor in a Motion Picture Musical or Comedy for his performance in A Touch of Class.\n\nOn television, he was best known for his roles as Jack Gallo on Just Shoot Me! (1997–2003) and as Albert \"Pops\" Solomon on The Goldbergs (2013–present).\n\nSegal was also an accomplished banjo player. He had released three albums and had also performed the instrument in several of his acting roles and on late night television.','1934-02-13','2021-03-23'),(1323,'Saki Fujita','Tokyo, Japan','Saki Fujita (藤田 咲, Fujita Saki, born October 19, 1984) is a Japanese voice actress and narrator from Tokyo. She is represented by Arts Vision. Her real name and former stage name is Sakiko Fujita (藤田 咲子, Fujita Sakiko).\n\nShe sang the ending theme to the anime Tokimeki Memorial Only Love, \"Kiseki no Kakera\", (奇跡のかけら) along with Yuki Makishima and Yukako Yoshikawa as well as the opening songs for Working!! - Someone Else, Coolish Walk, Now!!!Gamble - with Kana Asumi and Eri Kitamura. She is best known for voicing Ymir from Attack on Titan, as well as for sampling her voice for Crypton Future Media\'s Vocaloid, Hatsune Miku.','1984-10-19',NULL),(1324,'Ken Mitsuishi','Yahata, Fukuoka, Japan','Ken Mitsuishi (光石 研 Mitsuishi Ken, born 26 September 1961) is a Japanese actor. He has appeared in films such as Chaos and Tokyo Playboy Club.','1961-09-26',NULL),(1325,'Betty Chong',NULL,'',NULL,NULL),(1326,'Natalie Daniels','Houston, Texas, USA','',NULL,NULL),(1327,'Samantha Ruth Prabhu','Chennai, Tamil Nadu, India','Samantha Ruth Prabhu is an Indian film actress and model, who mainly works for the South Indian film industry. Samantha was brought up in Chennai and pursued a career in modeling during her late teens. Despite signing up to Ravi Varman\'s Moscowin Kavery in 2007, her first release happened to be the critically acclaimed 2010 Telugu romance film, Ye Maaya Chesave directed by Gautham Menon. She has then appeared in critically acclaimed and commercially successful Telugu films like Brindavanam, Dookudu, Eega, Yeto Vellipoyindhi Manasu and Seethamma Vakitlo Sirimalle Chettu establishing herself as a leading contemporary actress in Telugu cinema.','1987-04-28',NULL),(1328,'Peter Gabb',NULL,'',NULL,NULL),(1329,'Stacie Greenwell',NULL,'',NULL,NULL),(1330,'Wayne Bibbs',NULL,'',NULL,NULL),(1331,'Petar Mitev',NULL,'',NULL,NULL),(1332,'Joseph Uzzell','New Orleans, Louisiana, USA','','1959-03-25',NULL),(1333,'Kaniehtiio Horn','Ottawa, Ontario, Canada','Kaniehtiio Horn is a Canadian actress native of the Mohawk reserve of Kahnawake.','1986-11-08',NULL),(1334,'Roberto Marchese',NULL,'',NULL,NULL),(1335,'Ty Olsson','Halifax, Nova Scotia, Canada','Ty Olsson is a Canadian voice, film and television actor, best known for voicing the dragon Ord on Dragon Tales, for portraying actual 9/11 victim Mark Bingham in the A&E television film Flight 93, and for playing vampire Benny Lafitte in Supernatural.','1974-01-28',NULL),(1336,'Tom Felton','Kensington, London, England, UK','Thomas Andrew Felton (born September 22, 1987) is an English actor who played Draco Malfoy in the film adaptations of the best-selling Harry Potter fantasy novels by J. K. Rowling.\n\nBorn in Surrey, Felton began appearing in commercials and made his screen debut in the role of Peagreen Clock in The Borrowers (1997). He portrayed Louis T. Leonowens in Anna and the King (1999) before being cast in Harry Potter and the Philosopher\'s Stone (2001). Felton appeared in seven sequels until the final film, Harry Potter and the Deathly Hallows – Part 2 (2011). Felton appeared in the sci-fi film Rise of the Planet of the Apes (2011). He was subsequently cast in indie films From the Rough (2011) and The Apparition (2012).\n\nFelton starred as Viscount Trencavel in the historical miniseries Labyrinth and as James Ashford in the period drama Belle (2013), which released to critical acclaim. In 2015, he reoccured as a murder suspect in TNT\'s Murder in the First. Felton appeared in Message from the King and A United Kingdom, which premiered at the 2016 Toronto International Film Festival. He portrayed Doctor Alchemy on The CW\'s The Flash, based on the comic books of the same name. Felton co-starred in drama film Feed (2017), action-thriller Stratton (2017), and biographical film Megan Leavey (2017). Felton was a series regular on the 2018 sci-fi series Origin and appeared as Laertes in Claire McCarthy\'s Ophelia (2018), both to critical praise. Felton portrayed the villain in family-horror A Babysitter\'s Guide to Monster Hunting (2020).','1987-09-22',NULL),(1337,'Lloyd Nolan','San Francisco, California, USA','From Wikipedia, the free encyclopedia.\n\nLloyd Benedict Nolan (August 11, 1902 – September 27, 1985) was an American film and television actor.  Among his many roles, Nolan is remembered for originating the role of private investigator Michael Shayne in a series of 1940s B movies.\n\nNolan was born in San Francisco, California, the son of Margaret and James Nolan, who was a shoe manufacturer of Irish descent. He attended Santa Clara Preparatory School and Stanford University, flunking out of Stanford as a freshman \"because I never got around to attending any other class but dramatics.\" His parents disapproved of his choice of a career in acting, preferring that he join his father\'s shoe business, \"one of the most solvent commercial firms in San Francisco.\"\n\nNolan served in the United States Merchant Marine before joining the Dennis Players theatrical troupe in Cape Cod. He began his career on stage and was subsequently lured to Hollywood, where he played mainly doctors, private detectives, and policemen in many film roles.\n\nNolan also contributed solid and key character parts in numerous other films. One, The House on 92nd Street, was a startling revelation to audiences in 1945. It was a conflation of several true incidents of attempted sabotage by the Nazi regime (incidents which the FBI was able to thwart during World War II), and many scenes were filmed on location in New York City, unusual at the time. Nolan portrayed FBI Agent Briggs, and actual FBI employees interacted with Nolan throughout the film; he reprised the role in a subsequent 1948 movie, The Street with No Name.\n\nNolan appeared three times on NBC\'s Laramie Western series, as sheriff Tully Hatch in the episode \"The Star Trail (1959), as outlaw Matt Dyer in the episode \"Deadly Is the Night\" (1961)[5] and then as former Union Army General George Barton in the episode \"War Hero\" (1962).[6] On December 8, 1960, Nolan was cast as Dr. Elisha Pittman, in \"Knife of Hate\" on Dick Powell\'s Zane Grey Theatre. In the story line, Dr. Pittman removed one of the legs of Jack Hoyt (Robert Harland) after Hoyt sustained a gunshot wound from which infection was developing. Hoyt wants to marry Susan Pittman (Susan Oliver), but her father is at first unyielding on the matter.\n\nNolan starred in The Outer Limits episode \"Soldier\" written by Harlan Ellison. He appeared in the NBC Western Bonanza as LaDuke, a New Orleans detective. In 1967, Strother Martin and he guest-starred in the episode \"A Mighty Hunter Before the Lord\" of NBC\'s The Road West series, starring Barry Sullivan. Also in 1967, Nolan was a guest star in the popular Western TV series The Virginian, in the episode \"The Masquerade\" and in the first episode of Mannix.\n\nA long-time cigar and pipe smoker, Nolan died of lung cancer on September 27, 1985, at his home in Brentwood, California; he was 83. He is interred at the Westwood Village Memorial Park Cemetery in Westwood, Los Angeles, California.  CLR\n\nDescription above from the Wikipedia article Lloyd Nolan, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1902-08-11','1985-09-27'),(1338,'Mercedes Young',NULL,'',NULL,NULL),(1339,'Spencer Kayden','Costa Mesa, California, USA','',NULL,NULL),(1340,'Beatrice Rosen','New York City, New York, USA','','1984-11-29',NULL),(1341,'René Auberjonois','New York City, New York, USA','René Murat Auberjonois (June 1, 1940 – December 8, 2019 , Height: 6\' 0\" [1.83 meters]) was an American actor and director who was known for his versatile and nuanced performances across stage, television, and film. He was particularly celebrated for his portrayal of Constable Odo on the science fiction television series Star Trek: Deep Space Nine (1993–1999), a role that earned him critical acclaim and a dedicated fan following.\n\nAuberjonois\'s stage career took off in the 1960s, and he quickly gained recognition for his captivating performances. In 1969, he originated the role of Sebastian Baye in the André Previn-Alan Jay Lerner musical Coco, opposite Katharine Hepburn. His performance earned him both a Tony Award and a Drama Desk Award, solidifying his position as a leading actor on Broadway.\n\nAuberjonois\'s success on stage paved the way for a prolific television and film career. He appeared in numerous television shows, including Maude, Benson, and Star Trek: Deep Space Nine. His portrayal of Constable Odo, a shapeshifting alien security officer on Deep Space Nine, earned him a Primetime Emmy Award nomination and became one of his most iconic roles.\n\nIn film, Auberjonois starred in a diverse range of projects, including Joe Versus the Volcano (1984), Silverado (1985), and The Abyss (1989). He also lent his voice to animated projects, including the Disney film Lilo & Stitch (2002) and the series Justice League Unlimited (2004–2006).\n\nHis work on Star Trek: Deep Space Nine remains particularly cherished, as he breathed life into the complex and enigmatic character of Constable Odo. Auberjonois\'s legacy extends beyond his acting accomplishments, as he was also a respected director and a passionate advocate for the arts. His contributions to the entertainment industry will continue to be appreciated for generations to come.','1940-06-01','2019-12-08'),(1342,'John Ashby',NULL,'John Ashby is a retired stuntman and occasional actor.',NULL,NULL),(1343,'Simona Jovic',NULL,'',NULL,NULL),(1344,'Sheila Ellis','Wisconsin, USA','Sheila Ellis was raised in Wisconsin. Her first print job was in May 2002 where she was featured as a model in the Milwaukee City LifeStyle Magazine. In 2003 she moved to CA and that is when she immersed herself in the entertainment industry. One pivotal moment in her career was when she garnered the principal role in the crime re-enactment television show Extreme Forensics. Since that time, Sheila has been featured and garnered credits that range from commercials, television, film, industrials and voiceover in the San Francisco and Los Angeles markets.\n\nIn 2013, she was the executive producer of The Tailypo. In 2015, she garnered the role of Commander Lisa Hunt in a short called Who is Daniel Warren? The film explores the problem of police brutality and Commander Hunt is trying to restore order in her agency and well as trying to restore police/community relations.\n\nSheila would encourage anyone that has a goal in mind to dream, pursue and attain!',NULL,NULL),(1345,'Pat Morita','Isleton, California, USA','Noriyuki \'Pat\' Morita (June 28, 1932 - November 24, 2005) was an American actor of Japanese descent who was well-known for playing the role of Matsuo \"Arnold\" Takahashi on Happy Days and as Mr. Miyagi in the The Karate Kid movie series, in which he was nominated for the Academy Award for Best Supporting Actor in 1984.','1932-06-28','2005-11-24'),(1346,'Kim Cattrall','Mossley Hill, Liverpool, England, UK','Kim Victoria Cattrall (born August 21, 1956) is a British-Canadian actress, renowned for her diverse acting career in film, stage, and television. She started her career early, signing a film deal with Otto Preminger before graduating high school in 1972. While famous as Samantha Jones in \"Sex and the City,\" she boasts classical training from LAMDA and the American Academy of Dramatic Arts. Her stage credits include Broadway, alongside Sir Ian McKellen, and in David Mamet\'s praised play \'The Cryptogram.\' On TV, she starred in adaptations like \'The Heidi Chronicles\' and Oliver Stone’s \'Wild Palms,\' alongside numerous blockbuster films. Awards include a Golden Globe, Screen Actors Guild Awards, Emmy and Screen Actors Guild nominations for her iconic role in \'Sex and the City.\' Cattrall is also a successful author, having written bestsellers like \'Sexual Intelligence\' and \'Satisfaction: The Art of the Female Orgasm.\'','1956-08-21',NULL),(1347,'Mark Gregory','Rome, Lazio, Italy','Mark Gregory was born Marco De Gregorio in Rome. After appearing in a number of Italian exploitation films, such as the Thunder trilogy and Castellari\'s Bronx films, he disappeared from the big screen. In 2013 he committed suicide.','1964-05-02','2013-01-31'),(1348,'Todd Bass',NULL,'',NULL,NULL),(1349,'Frank Marlowe','Taunton, Massachusetts, USA','','1904-01-20','1964-03-30'),(1350,'Anya','Taiwan','Anya Wu was born on February 17th, in 1976 in Taiwan. She moved to the United States, together with her family, by the age of 6. She was raised in New York City and was discovered by a record company to become a singer back in Taiwan. While she was in Taiwan and preparing for her album release, Anya, became the first girl DJ in Taiwan clubs. She caught alot of media attention, even media from Hong Kong. With so much public attention, her interview in a magazine caught the eye of Director Jingle Ma, who then convinced Golden Harvest, a film production, distribution and exhibition company to relocate her to Hong Kong and sign her. Unfortunately, by the time they found her, he had already started \"Moi Moi Cha\", the movie in which he had wanted her for. So her debut film became Born To Be King, the final installment of the Young & Dangerous series,as Jordan Chan\'s wife, Nanako. Relocating to Hong Kong, Anya\'s profile has increased swiftly with Golden Harvest\'s support. She has since had larger roles in several of the studio\'s post-millenium efforts. She appeared as one of Ekin Cheng\'s many girls in For Bad Boys Only and in 2001 took more action-oriented roles in two hot action films. Sharp Guns and 2002, where her Fire Ghost menaced Stephen Fung and Nicholas Tse. She went on to become one of the top upcoming actresses in both Hong Kong and Taiwan and with her undoubtable gorgeous looks has also graced numerous magazine covers, print ads, and TV shows in both regions. In 2002, Anya began work on the \"remake/sequel\" to Naked Killer, titled Naked Weapon as Kat, the best friend to Charlene, Maggie Q\'s character. She also recently worked in HK on a stage play Glengarry Glenross in which she took on the challenging role of Blake that has been always played by a man. Tickets were sold out and another day had to be added. Afterwards, she starred in Tsui Hark\'s thriller Vampire Hunters as Sasa. After the liquidation of Golden Harvest\'s talent agency, Anya decided to go back to her native Taiwan and experiment on some TV series there. There she did starred in a TV series called Pink Godfather, as well as Taiwan\'s version of \"Sex And The City\" where she played \"Samantha\". After being there for a year, she realized that her focus was still more in films, and headed to join the fierce competitive, but growing industry in China. Being fluent in Chinese as well as English, her current works are on co-productions with China and foreign production companies.','1976-02-17',NULL),(1351,'Peter Mensah','Chiraa, Ghana','Peter Osei Mensah (born on 27 August 1959, ht. 6\'3\"), is a Ghanaian-English actor, best known for his roles in Tears of the Sun, 300, Sleepy Hollow, and on the Starz original series, Spartacus: Blood and Sand, Spartacus: Gods of the Arena, and Spartacus: Vengeance.\n\nMensah comes from an academic family. He was born in Ghana, to parents of the Ashanti People but he moved to Hertfordshire, England with his father, an engineer, and his mother, a writer and two younger sisters at a young age. Mensah moved to Canada 11 years ago. He emigrated from Britain to see the world and it was a toss-up whether his destination would be Canada or Australia. The paperwork for Canada came through first.\n\nMensah\'s film credits include Avatar, 300, Hidalgo, Tears of the Sun, Jason X, Harvard Man, Bless the Child and The Incredible Hulk. He also stars in the short film The Seed, produced and directed by Linkin Park\'s DJ Joe Hahn. He has made television appearances in Star Trek: Enterprise, Tracker, Witchblade, Blue Murder, Relic Hunter, Earth: Final Conflict, Highlander: The Raven, and La Femme Nikita. He was a member of the repertory cast of the A&E Network series A Nero Wolfe Mystery.','1959-08-27',NULL),(1352,'Michael Schermi',NULL,'','1984-11-17',NULL),(1353,'Philippe Lacheau','Fontenay-sous-Bois, Val-de-Marne, France','Philippe Lacheau (born 25 June 1980) is a French actor, director and writer.\n\nFrom 2002 to 2010, Philippe Lacheau worked on French television for several TV Show like the \"Casting Live\" (2002), \"Total Fun\" (2003) and \"Pour le meilleur et pour le fun\" (2004). He also work with Karl Zéro on \"C’est quoi ce jeu ?\" (2004), Michel Denisot on Le Grand Journal (2005–07). In 2009, he is a part of the French Silent Library (TV series) produces by Christophe Dechavanne and he joined the team of Laurent Ruquier for a couple of his TV Show.\n\nSource: Article \"Philippe Lacheau\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1980-06-25',NULL),(1354,'Son Kyoung-won','South Korea','Son Kyoung-won is a South Korean actor.','1972-05-22',NULL),(1355,'Morocco Omari','Chicago, Illinois, USA','Morocco Omari is an actor and director.','1975-05-07',NULL),(1356,'BJ Harrison','Los Angeles, California, U.S','',NULL,NULL),(1357,'Everton Lawrence',NULL,'',NULL,NULL),(1358,'Carole Estes',NULL,'',NULL,NULL),(1359,'John L. Armijo',NULL,'',NULL,NULL),(1360,'Jaci LeJeune',NULL,'',NULL,NULL),(1361,'Troy Brown',NULL,'Stunt Coordinator on various movies and TV shows.\n\nHe has been married to Dawn Brown since September 12, 1997. They have two children',NULL,NULL),(1362,'Stéphanie Aubry',NULL,'',NULL,NULL),(1363,'Phil Altman',NULL,'',NULL,NULL),(1364,'Derrick Scott',NULL,'',NULL,NULL),(1365,'Jonathan Makabi',NULL,'',NULL,NULL),(1366,'Anaïs Parello','Metz, France','Anaïs Parello is a French-Spanish-American actor. She grew up between Spain and the South of France, where she co-created a theater company in which she stayed for about a decade. After an intensive foundation degree in literature, she moved to Paris and got a Spanish degree at the Sorbonne. In the meantime, she trained at Le Cours Florent, and majored in musicals.','1991-04-27',NULL),(1367,'Michael Bellisario','Los Angeles County, California, United States','From Wikipedia, the free encyclopedia.\n\nMichael Angelo Bellisario (born April 7, 1980) is an American actor and the son of scriptwriter and producer Donald P. Bellisario.\n\nBellisario has mostly had parts in series produced by his father, he played Midshipman Michael \"Mikey\" Roberts in JAG and also appeared during the first part of NCIS season 3 as Charles \"Chip\" Sterling. He has also appeared in four episodes of Quantum Leap.\n\nMichael is the half-brother of actress Troian Bellisario.\n\nDescription above from the Wikipedia article Michael Bellisario, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1980-04-07',NULL),(1368,'Ian Hoch','New Orleans, Louisiana, USA','','1983-12-17',NULL),(1369,'Samantha Dalsoglio','São Paulo, São Paulo, Brazil','','1973-03-10',NULL),(1370,'Jena Sims','Winder, Georgia, USA','','1988-12-30',NULL),(1371,'Marco Bonini','Rome, Lazio, Italy','Marco Bonini, is an Italian actor, producer and screenwriter.\n\nIn 2009 he joined the cast of the second season of the series 7 vite where he played Valerio Tempesta. In 2011 he joined the cast of the I liceali miniseries where he gave life to Anton Giulio Poppi, a professor of art history. In 2013 he appeared as a guest in the first season of the series Crossing Lines where he played Lorenzo Vincente, an Italian detective and former partner of Sergeant Eva Vittoria (Gabriella Pession).\n\nMarco is married to actress Sinne Mutsaers, the couple has two children, Orlando Bonini and Maya Bonini.\n\nFrom Wikipedia, the free encyclopedia','1972-08-20',NULL),(1372,'Andrey Yakimov','Tambov, USSR (Russia)','','1984-06-25',NULL),(1373,'Sean Cory','Hartford, Connecticut','','1969-10-06',NULL),(1374,'Hechter Ubarry','Arecibo, Puerto Rico','',NULL,NULL),(1375,'Travis Davis','Oklahoma City, Oklahoma, USA','Travis Davis is an American actor born in Oklahoma City, Oklahoma on October 23rd, 1968. His first work in a horror film was playing the role of Officer Lund in the 2009 remake of Friday the 13th.','1968-10-23','2009-10-12'),(1376,'Michele Boyd','Alachua, Gainesville, Florida, USA','Michele Boyd (born October 29, 1980) is an American actress.','1980-10-29',NULL),(1377,'Bianca Kajlich','Seattle, Washington, USA','Bianca Maria Kajlich (KY-lik; born March 26, 1977) is an American actress, best known for her role as Jennifer on CBS\'s sitcom Rules of Engagement (2007–2013).\n\nShe began her career with the Olympic Ballet Theater as a ballet dancer in Edmonds, Washington. After seven years, she decided to try acting. By that time, she had already performed lead roles in The River, Swan Lake, and The Nutcracker.\n\nHer first acting part was in an advertisement for Kragen Auto Parts. She has since appeared in the films Bring It On, 10 Things I Hate About You, Halloween: Resurrection, and 30 Minutes Or Less. She also had recurring roles in the television series Boston Public as Lisa Grier and in Dawson\'s Creek as Natasha Kelly, as well as roles in UPN\'s Rock Me Baby and the Fox drama Vanished.\n\nShe was ranked No. 74 on the Maxim \"Hot 100 Women of 2004\" and No. 63 on the Maxim \"Hot 100 Women of 2007\".\n\nIn March 2013, she was cast as a main character in the NBC sitcom Undateable (2014-2016). In October 2017, she appeared as Paula, a prostitute befriended with sartorial advice by Larry David in HBO\'s Curb Your Enthusiasm.\n\nShe starred as Christina Henry on the Amazon Prime series Bosch.','1977-03-26',NULL),(1378,'Gino Dentie','Pittsburgh, Pennsylvania, USA','',NULL,NULL),(1379,'Amy Smart','Topanga Canyon, California, USA','Amy Lysle Smart is an American actress and former fashion model. Smart began her career modeling in Italy and subsequently enrolled in acting school. Her first role in film was in director Martin Kunert\'s film Campfire Tales. Wikipedia','1976-03-26',NULL),(1380,'Geoff Reeves',NULL,'',NULL,NULL),(1381,'Jesse Moore',NULL,'Born and raised in New York, award-winning actor, singer, composer and musician Jesse Moore has performed on concert and theatrical stages throughout the world. He began his career at the tender age of 12, winning the talent contest at the Apollo Theater. Viewers will recognize his face from numerous portrayals of characters from doctors to lawyers to a homeless vet to a South African teacher in a myriad of TV, theater and film productions. He studied acting at the prestigious American Conservatory Theater (ACT) in San Francisco, the Los Angeles Civic Lite Opera Musical Theater Workshop, and with Stella Adler.  - IMDb Mini Biography',NULL,NULL),(1382,'Frendy Kusuma',NULL,'',NULL,NULL),(1383,'Éric Naggar','Neuilly-sur-Seine, Hauts-de-Seine, France','Éric Naggar was born on December 3, 1957 in Neuilly-sur-Seine, Hauts-de-Seine, France. He is an actor and writer, known for 3 Days to Kill (2014), Tell No One (2006) and Micmacs (2009).','1957-12-03',NULL),(1384,'Shinnosuke Abe','Osaka, Japan','','1982-02-19',NULL),(1385,'Mariano Mendoza','Los Angeles, California, USA','Mariano Mendoza, a former MMA World Champion Fighter, is an American film and television actor and stunt performer.','1968-09-17',NULL),(1386,'Steve Terada',NULL,'',NULL,NULL),(1387,'Nicholas Minchillo',NULL,'',NULL,NULL),(1388,'Winston Chao','Taiwan','Winston Chao Wen-hsuan (born 9 June 1960) is a Taiwanese actor. He came to international attention for his performance in the 1993 film The Wedding Banquet. He is also known for his roles in Red Rose White Rose and Eat Drink Man Woman, and for his five portrayals of Sun Yat-sen, notably in the films The Soong Sisters (1997), Road to Dawn (2007) and 1911 (2011). His notable television roles include the adaptation of Cao Yu\'s play Thunderstorm (1997), a double role in the historical drama Palace of Desire, the biographical mini-series The Legend of Eileen Chang (2004), the historical drama Da Tang Fu Rong Yuan (2007), the adaptation of Ba Jin\'s novel Cold Nights (Han ye, 2009), and the portrayal of Confucius (2011).\n\nDescription above from the Wikipedia article Winston Chao, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1960-06-09',NULL),(1389,'Zlatko Burić','Osijek, Croatia','Zlatko Burić (born 13 May 1953) is a Croatian-Danish actor. He was born in Osijek where he was educated at the Dramski Studio in 1972. In the 1970s and early 1980s, Burić belonged to the experimental theater group Kugla Glumište (formed in 1975) together with Željko Zorica-Šiš and Damir Bartol-Indos.\n\nHe moved to Denmark in 1981 where he married Sonja Hindkjær, with whom he has three children. After their divorce, he married Dragana Milutinović, on 7 October 1998. He has appeared in several successful Danish films from the 1990s and 2000s, frequently appearing in films directed by Nicolas Winding Refn, including Bleeder and as Milo in The Pusher Trilogy. For his role in Pusher, he won the Bodil Award for best supporting actor in 1997.[1][2]\n\nIn 2009, Burić had a large supporting role in the apocalyptic film 2012, as Yuri Karpov, a Russian billionaire. In 2012, he reprised his role as Milo in the British remake of Pusher.','1953-05-13',NULL),(1390,'Bob Gunton','Santa Monica, California, USA','Robert Patrick \"Bob\" Gunton, Jr. (born November 15, 1945) is an American actor. He is known for playing strict, authoritarian characters, with his best known roles as Warden Samuel Norton in the 1994 prison film The Shawshank Redemption, Chief George Earle in 1993\'s Demolition Man, and President Juan Peron in the original Broadway cast of Evita.\n\nDescription above from the Wikipedia article Bob Gunton , licensed under CC-BY-SA, full list of contributors on Wikipedia.','1945-11-15',NULL),(1391,'Robert \'Bobby Z\' Zajonc','Washington, USA','','1947-02-07',NULL),(1392,'Renata Jábali',NULL,'',NULL,NULL),(1393,'DonnaMarie Recco',NULL,'',NULL,NULL),(1394,'Bokeem Woodbine','Harlem, New York City, New York, USA','Bokeem Woodbine (born April 13, 1973) is an American film and television actor.','1973-04-13',NULL),(1395,'Yoo Yeon','South Korea','Korean actress.',NULL,NULL),(1396,'Scotch Hopkins',NULL,'',NULL,NULL),(1397,'Mitch Pileggi','Portland, Oregon, USA','Mitchell Craig \"Mitch\" Pileggi (born April 5, 1952) is an American actor. Pileggi is known for playing FBI assistant director Walter Skinner on the long-running popular series The X-Files. He also had a recurring role on Stargate Atlantis as Col. Steven Caldwell. He appeared in the 2008 film, Flash of Genius.','1952-04-05',NULL),(1398,'Marc Lawrence','New York City, New York, USA','Marc Lawrence was an American character actor who specialized in underworld types.  In 1930, Lawrence befriended another young actor, John Garfield. The two appeared in a number of plays before Lawrence was given a film contract with Columbia Pictures. Lawrence appeared in films beginning in 1931. Garfield followed, starting his film career in 1938. Lawrence\'s pock-marked complexion, brooding appearance and New York street-guy accent made him a natural for heavies, and he played scores of gangsters and mob bosses over the next six decades. Later, Lawrence found himself under scrutiny for his political leanings. When called before the House Un-American Activities Committee, he admitted he had once been a member of the Communist Party. He named Sterling Hayden, Lionel Stander, Anne Revere, Larry Parks, Karen Morley and Jeff Corey as Communists. He was blacklisted and departed for Europe, where he continued to make films. Following the demise of the blacklist, he returned to America and resumed his position as a familiar and talented purveyor of gangland types. He played gangsters in two James Bond movies: 1971\'s Diamonds Are Forever opposite Sean Connery, and 1974\'s The Man with the Golden Gun opposite Roger Moore. He also portrayed a henchman opposite Laurence Olivier in Marathon Man (1976) and a stereotypical Miami mob boss alongside Jerry Reed and Dom DeLuise in the comedy Hot Stuff (1979).\n\nDescription above from the Wikipedia article Marc Lawrence, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1910-02-17','2005-11-27'),(1399,'Vic Morrow','The Bronx, New York City, New York, USA','From Wikipedia, the free encyclopedia\n\nVictor \"Vic\" Morrow (February 14, 1929 – July 23, 1982) was an American actor, whose credits include a starring role in the 1960s TV series Combat!, prominent roles in a handful of other television and cinema dramas, and numerous guest roles on television. He and two children died when a stunt helicopter crashed on them during the filming of Twilight Zone: The Movie.\n\nDescription above from the Wikipedia article Vic Morrow, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1929-02-14','1982-07-23'),(1400,'Bruce Cutler','New York City, New York, USA','From Wikipedia, the free encyclopedia.\n\nBruce Cutler (born April 29, 1948) is an Americancriminal defenselawyer known for defending organized-crime defendants, and for media appearances as an actor, a legal commentator, and a reality-show attorney.','1948-04-29',NULL),(1401,'Michael F. Keenan',NULL,'',NULL,NULL),(1402,'Sreejith Ravi',NULL,'',NULL,NULL),(1403,'Vladimir Blagoy',NULL,'',NULL,NULL),(1404,'Johnny Depp','Owensboro, Kentucky, USA ','John Christopher Depp II (born June 9, 1963) is an American actor, producer and musician. He is the recipient of various accolades, including a Golden Globe Award and a Screen Actors Guild Award, in addition to nominations for three Academy Awards and two British Academy Film Awards.\n\nDepp made his debut in the horror film A Nightmare on Elm Street (1984), before rising to prominence as a teen idol on the television series 21 Jump Street (1987–1990). In the 1990s, Depp acted mostly in independent films, often playing eccentric characters. These included What\'s Eating Gilbert Grape (1993), Benny and Joon (1993), Dead Man (1995), Donnie Brasco (1997) and Fear and Loathing in Las Vegas (1998). Depp also began collaborating with director Tim Burton, starring in Edward Scissorhands (1990), Ed Wood (1994) and Sleepy Hollow (1999).\n\nIn the 2000s, Depp became one of the most commercially successful film stars by playing Captain Jack Sparrow in the swashbuckler film series Pirates of the Caribbean (2003–present). He received critical praise for Finding Neverland (2004), and continued his commercially successful collaboration with Tim Burton with the films Charlie and the Chocolate Factory (2005), Corpse Bride (2005), Sweeney Todd: The Demon Barber of Fleet Street (2007), and Alice in Wonderland (2010). In 2012, Depp was one of the world\'s biggest film stars, and was listed by the Guinness World Records as the world\'s highest-paid actor, with earnings of US$75 million. During the 2010s, Depp began producing films through his company, Infinitum Nihil, and formed the rock supergroup Hollywood Vampires with Alice Cooper and Joe Perry.','1963-06-09',NULL),(1405,'David Ury',NULL,'David Brian Ury (born September 30, 1973) is an American actor, stand-up comedian, YouTuber, and Japanese translation specialist.\n\nUry was born and raised in Sonoma, California. He graduated from Sonoma Valley High School, where he acted in theatre productions. He earned a bachelor\'s degree in linguistics at Evergreen State College in Olympia, Washington and studied abroad in Japan, where he became fluent in Japanese. Ury is a descendant of German Jewish impressionist painter Lesser Ury.\n\nSince studying abroad in Tokyo, Ury and has worked as a translator in film, television, and manga and currently (As of May 2011) translates and writes English adaptations for manga. Ury moved to Los Angeles in August 2001 where he began performing stand-up comedy. Cartoonist Keith Knight, a neighbor of his, described Ury\'s acting career as \"Spooge man\" and \"a cavalcade of reprobates, sleazeballs, derelicts, & weirdos.\"\n\nUry has made several film and television appearances, including an episode of Tim Kring\'s Crossing Jordan and in Shoot \'Em Up. He also appeared in Heroes, Malcolm in the Middle, Life, Without a Trace, Breaking Bad, Better Call Saul, Zeke and Luther, and The Librarians. In March 2015, Ury was cast for Rob Zombie\'s slasher film 31 as Schizo-Head. A character actor, Ury has died on screen in almost every role he has portrayed.\n\nUry also has several YouTube channels/accounts/personalities and alter-egos, which include Karaoke Steve and Ken Tanaka, the fictional adopted twin brother of David Ury. Tanaka is described as an Ashkenazi Jewish man adopted as an infant by Japanese parents Hideo and Mari Tanaka, and raised in Shimane Prefecture of Japan; he returns to Los Angeles to find his birth parents Jonathan and Linda Smith.','1973-01-01',NULL),(1406,'Shaun Benson','Guelph, Ontario, Canada','Shaun Benson was born on January 16, 1976 in Guelph, Ontario, Canada. He is an actor and director, known for The Boys (2019), ARQ (2016) and General Hospital (1963).','1976-01-16',NULL),(1407,'George Wilson',NULL,'',NULL,NULL),(1408,'Danny Trejo','Los Angeles, California, USA','Dan Trejo (born May 16, 1944) is an American actor who has appeared in numerous Hollywood films, often as hypermasculine characters, villains and anti-heroes. Some of his notable films include Heat, Con Air, Machete, and Desperado, the latter two with frequent collaborator Robert Rodriguez.','1944-05-16',NULL),(1409,'David Giuntoli','Milwaukee, Wisconsin, USA','David C. Giuntoli (born June 18, 1980) is an American actor. He\'s best known for his roles as Det. Nick Burkhardt on NBC\'s supernatural drama Grimm (2011–2017), and Eddie Saville on ABC\'s drama A Million Little Things (2018–2023). He has appeared in films such as 13 Hours: The Secret Soldiers of Benghazi (2016) and Buddymoon (2016).\n\nHe first gained attention as a participant on MTV\'s Road Rules: South Pacific, and later on Real World/Road Rules Challenge: The Gauntlet. In 2007, he moved to Los Angeles, CA to pursue an acting career. He has appeared on several TV series including Nip/Tuck, Veronica Mars, Grey\'s Anatomy, Ghost Whisperer, Privileged, Without a Trace, and Cold Case, among others. He also hosted AT&T U-Verse \"Buzz\". His music career has not been as successful, but he has performed with German DJ Flula Borg, his occasional co-host on \"Buzz,\" at The Viper Room in Los Angeles.\n\nHe married his Grimm co-star, actress Elizabeth Tulloch in June 2017. They have a daughter, Vivian, who was born in February 2019.\n\nFrom Wikipedia, the free encyclopedia.','1980-06-18',NULL),(1410,'Dakota Johnson','Austin, Texas, USA','Dakota Mayi Johnson (born October 4, 1989) is an American actress. The daughter of actors Don Johnson and Melanie Griffith, she made her film debut at age ten with a minor role in the dark comedy film Crazy in Alabama (1999) with her mother. After graduating high school, she began auditioning for roles in Los Angeles and was cast in a minor part in The Social Network (2010). Johnson had her breakthrough playing Anastasia Steele in the erotic romantic drama film series Fifty Shades (2015–2018), and received a BAFTA Rising Star Award nomination in 2016.\n\nJohnson appeared in films such as the crime drama Black Mass (2015), Luca Guadagnino\'s drama A Bigger Splash (2015), the romantic comedy How to Be Single (2016), the supernatural horror film Suspiria (2018), the thriller Bad Times at the El Royale (2018), the coming-of-age film The Peanut Butter Falcon (2019), Maggie Gyllenhaal\'s psychological drama The Lost Daughter (2021), and Cooper Raiff\'s Cha Cha Real Smooth (2022).\n\nShe has received various awards and nominations, including a People\'s Choice Award, and nominations for a BAFTA Award and two MTV Movie & TV Awards. She was also featured in Forbes 30 Under 30 list in 2016.','1989-10-04',NULL),(1411,'Dan Martin','USA','','1951-12-22',NULL),(1412,'Rick Xu','Liaoning, China','',NULL,NULL),(1413,'Anouar H. Smaine','Alger, Algérie','','1976-01-01',NULL),(1414,'Rossy Masses',NULL,'',NULL,NULL),(1415,'Joseph D Fisher',NULL,'',NULL,NULL),(1416,'Lucas Fleischer',NULL,'',NULL,NULL),(1417,'J. Winston Carroll',NULL,'',NULL,NULL),(1418,'Haik Garibyan',NULL,'',NULL,NULL),(1419,'Michael Vecqueray',NULL,'',NULL,NULL),(1420,'Dan Shadwell',NULL,'',NULL,NULL),(1421,'Pesi Daruwalla',NULL,'Pesi Daruwalla is an actor.',NULL,NULL),(1422,'Aju Varghese','Tiruvalla, Kerala, India','Aju Varghese is an Indian film actor. He made his debut in 2010 in the Malayalam film, Malarvadi Arts Club under Vineeth Sreenivasan,  which was a super hit and has been active in the Malayalam film industry, since. He joined hands with Vineeth Sreenivasan, Thattathin Marayathu (2012) and Oru Vadakkan Selfie  (2015) created a bigger mark at the box office and his performance was  praised by the audience and critics alike, as it turned out to be a blockbuster. His other films include Kili Poyi, Zachariyayude Garbhinikal, Ohm Shanthi Oshaana, Punyalan Agarbattis, Vellimoonga , \'Ormayundo Ee Mukham , Kunjiramayanam, Su Su Sudhi Vatmeekam, Two Countries and Adi Kapyare Koottamani\" . He has acted in some advertisements.\n\nAju Varghese was born to Varghese and Celiene in Thiruvalla a Town in Pathanamthitta Dist, Kerala.He has a younger sister Anju. Aju married Augustina on 24 February 2014.They have 2 children a girl and a boy born on 28 October 2014.\n\nAju did schooling in Rajagiri High School Kalamasserry in Ernakulam.Later he did his schooling from Bhavans Adarsha Vidhyalaya, Ernakulam. He did his Bachelor\'s in Electronics and Communication Engineering from Hindustan group, Chennai in 2006. He was working with HSBC in Human Resources, Chennai. It was during that time he was called by Vineeth Sreenivasan[5] his college friend, to play one of the lead role in his directorial debut Malarvadi Arts Club and later in Thattathin Marayathu. In mean time he was part of \"Sevenes\" (2011) by veteran director Joshiy and \"Mayamohini\".','1985-01-11',NULL),(1423,'Ben Youcef',NULL,'',NULL,NULL),(1424,'Minehiro Kinomoto','Shiga Prefecture, Japan','','1989-11-22',NULL),(1425,'Barton MacLane','Columbia, South Carolina, USA','Barton MacLane graduated from Wesleyan University, where he displayed a notable aptitude for sports, in particular football and basketball. Not surprisingly, his physical prowess led to an early role in The Quarterback (1926) with Richard Dix. MacLane once commented that, as an actor, he needed to have the physical strength to tear the bad guys \"from limb to limb\", if necessary. Ironically, it was usually Barton himself who was destined to be at the end of a hiding (when not getting shot, instead), typically as snarling henchmen, outlaws and other assorted dubious or abrasive types throughout most of his 40-year acting career. In fact, Barton became so typecast that his name was for a time used proverbially, to generally describe a shouting, hard-nosed ruffian.\n\nAfter training at the American Academy of Dramatic Arts, MacLane joined a stock company in Brooklyn. In 1927 he had his first part on Broadway, a brief moment as an assistant district attorney, in the melodrama \"The Trial of Mary Dugan\". He then played a small featured role as a police officer in \"Subway Express\" (1929-30), a drama enacted in the interior of a subway car. In mid-1932 MacLane tried his hand at writing his own starring vehicle for the stage, entitled \"Rendezvous\". While the play closed after just 21 performances, it led to a contract with Warner Brothers.\n\nBarton had already appeared in bit roles for Paramount at their Astoria Studios, including The Marx Brothers\' debut film The Cocoanuts (1929). He portrayed mobster Brad Collins in \'G\' Men (1935) (with James Cagney), which set the tone for most of his future assignments. Brawny, with squinty eyes and a rasping voice, MacLane was the ideal surly tough guy, particularly suitable for westerns and the type of films noir Warner Brothers excelled at. He was often cast as cops, be they bent or honest. Some of his most representative performances include gangster Al Kruger in Bullets or Ballots (1936), which won him some of the best critical notices of his career; outlaw Jack Slade in Western Union (1941); crooked construction boss Pat McCormick, who gets beaten up by Humphrey Bogart and Tim Holt over past-due wages in The Treasure of the Sierra Madre (1948); hard-nosed cops Detective Dundy in The Maltese Falcon (1941) and Lt. Reece in Kiss Tomorrow Goodbye (1950). MacLane, on loan to Universal, also had a starring role in Prison Break (1938) as an innocent tuna fisherman who is framed for murder. He was prominent as a tough but sympathetic cop, foil to sleuthing girl reporter Glenda Farrell in the \"Torchy Blaine\" series of the mid- to late 1930s. In the 1960s Barton began to cultivate a good-guy image as Marshal Frank Caine in the NBC western series Outlaws (1960) as well as showing up in a small recurring role as Air Force Gen. Martin Peterson in I Dream of Jeannie (1965).\n\nBarton was married to the actress Charlotte Wynters, who appeared with him in six of his films. When not on the set, the couple spent time on their 2000-acre cattle ranch in Madera County, California.\n\nFor his work in television, Barton has a star on the Hollywood Walk of Fame.','1902-12-25','1969-01-01'),(1426,'James Bradford','Wimbledon, Surrey, England, UK','','1938-01-01',NULL),(1427,'Ashley Campbell',NULL,'',NULL,NULL),(1428,'Michael Ealy','Washington, District of Columbia, USA','Michael Brown (born August 3, 1973), professionally known as Michael Ealy, was born on August 3, 1973 in Silver Spring, Maryland. He attended SpringbrookHigh School and the University of Maryland, College Park. Ealy started his acting career in the late-1990s, appearing in a number of off-Broadway stage productions. Among his first film roles were Bad Company and Kissing Jessica Stein. His breakout role came in 2002\'s Barbershop, in which he plays reformed street thug Ricky Nash, a role that he reprised in the 2004 sequel, Barbershop 2: Back in Business. In 2003, he played the role of Slap Jack in the second installment of the Fast and the Furious film series, 2 Fast 2 Furious. Later in 2004, Ealy appeared in Never Die Alone with DMX. In 2005, Ealy co-starred in the telefilm version of Their Eyes Were Watching God, produced by Oprah Winfrey and Quincy Jones, and starring Academy Award-winning actress HalleBerry. The same year, he starred in the independent film Jellysmoke, directed by Mark Banning. He starred in the Showtime television series Sleeper Cell and Sleeper Cell: American Terror. On December 14, 2006, Ealy was nominated for a Golden Globe Award for his role in Sleeper Cell: American Terror in the category Best Performance by an Actor in a Mini-Series or Motion Picture Made for Television. In December 2008 he was featured in the movie Seven Pounds alongside Will Smith as Ben Thomas. He also starred as CIA Field Officer Marshall Vogel in the ABC television series FlashForward. In 2010 Ealy starred in the action-thriller Takers and in the drama For Colored Girls. Also in 2010, Ealy signed on to play an attorney, Derrick Bond in the TV series, The Good Wife.','1973-08-03',NULL),(1429,'Toshiyo Matsunaga',NULL,'',NULL,NULL),(1430,'Alan Gibbs','Hollywood, Florida, USA','','1940-11-24','1988-03-18'),(1431,'Courtney Jarrell',NULL,'',NULL,NULL),(1432,'Rob Welsh',NULL,'',NULL,NULL),(1433,'Megumi Kagurazaka','Okayama Prefecture, Japan','Megumi Kagurazaka is a Japanese actress and glamour model. She is married to director Sion Sono and has starred in some of his films.','1981-09-28',NULL),(1434,'Carl Watts',NULL,'',NULL,NULL),(1435,'Sam Tedesco',NULL,'',NULL,NULL),(1436,'Torey Adkins','Troy, Michigan, USA','Born and raised in Troy, MI, Torey Adkins started his acting career in Chicago where he lived for 19 years. Besides acting, he is a professional comedian.',NULL,NULL),(1437,'Antone Pagán',NULL,'',NULL,NULL),(1438,'Julian Brewster','Carson City, Nevada, USA','','1989-01-15',NULL),(1439,'Adam Arkin','Brooklyn, New York City, New York, USA','Adam Arkin (born August 19, 1956) is an American actor and director. His father is Oscar Award-winning actor Alan Arkin and his brother is actor Matthew Arkin. He is known for playing the role of Aaron Shutt on Chicago Hope. He has been nominated for numerous awards, including a Tony (Best Actor, 1991, I Hate Hamlet) as well as three primetime Emmys, four SAG Awards (Ensemble, Chicago Hope), and a DGA Award (My Louisiana Sky). Beginning in 1990, he had a recurring guest role on Northern Exposure playing the angry, paranoid Adam, for which he received an Emmy nomination. In 2002, Arkin won a Daytime Emmy for Outstanding Directing in a Children\'s Special for My Louisiana Sky.  Between 2007 and 2009, he co-starred in the drama series Life. In 2009, he portrayed villain Ethan Zobelle, a white separatist gang leader, in Sons of Anarchy, and Principal Ed Gibb in 8 Simple Rules (2003–2005).','1956-08-19',NULL),(1440,'Veronika Kurshinskaya',NULL,'',NULL,NULL),(1441,'Aziz Ansari',' Columbia, South Carolina, USA','Aziz Ansari (born February 23, 1983) is an American actor, writer, and stand-up comedian. He formerly starred as Tom Haverford on the NBC show Parks and Recreation, and has since gone on to co-create, co-produce, and star in two seasons of the critically acclaimed comedy/drama Netflix series, Master of None.','1983-02-23',NULL),(1442,'Wil Omar Sanchez',NULL,'',NULL,NULL),(1443,'Deborah Foreman','Montebello, California, USA','Deborah Lynn Foreman (born October 12, 1962) is an American actress. She is perhaps best known for her starring role in the 1983 movie Valley Girl, as Julie Richman acting opposite Nicolas Cage as Randy.\n\nDescription above from the Wikipedia Deborah Foreman, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1962-10-12',NULL),(1444,'Mo Gallini','Miami, Florida, USA','Mo Gallini is an American actor.','1966-02-15',NULL),(1445,'Adriane Lenox','Memphis, Tennessee, USA','Adriane Lenox is an American actress, best known for her performances in Broadway theatre. Her performance in the play Doubt: A Parable garnered her the Tony Award for Best Featured Actress in a Play in 2005. She received another Tony Award nomination for After Midnight in 2014.\n\nFrom Wikipedia, the free encyclopedia','1956-09-11',NULL),(1446,'Gemma Atkinson','Bury, Greater Manchester, England','Originally from Bury, Greater Manchester, Atkinson took her GCSEs at Castlebrook High School before becoming a commercial and photographic model. Atkinson has dated Cristiano Ronaldo and was engaged to Marcus Bent but they have since split up.\n\nGemma has been in a relationship with martial arts instructor Liam Richards since 2009, they got engaged in August 2012.\n\nGemma found fame playing Lisa Hunter int the Channel 4 soap opera Hollyoaks. Gemma then moved on to spin off series with co-star Marcus Patric in Hollyoaks: Let Loose and Hollyoaks: In The City. Gemma has starred in many TV shows, film and even video games.','1984-11-15',NULL),(1447,'Eric Etebari','Los Angeles, California, USA','Eric Etebari is an Iranian-American actor, model and musician.','1969-12-05',NULL),(1448,'Preston Porter',NULL,'',NULL,NULL),(1449,'Naveen Polishetty','Hyderabad, India','Naveen polishetty is the Youtube star turned a mainstream actor with the movie Agent Sai Srinivas Atreya.','1989-12-26',NULL),(1450,'Gary Sofia',NULL,'',NULL,NULL),(1451,'David Thomas Newman','Bedford, Texas, USA','David Thomas Newman is an actor based in Los Angeles, CA. He is best known for his roles in \"Wild West Chronicles,\" \"Voodoo Macbeth,\" and \"Terror Toons 4.\"','1987-04-03',NULL),(1452,'James Austin Kerr','Oklahoma City, Oklahoma, USA','James Austin Kerr is an actor and writer, known for Culpability (2015), NCIS: Naval Criminal Investigative Service (2003) and Queen of the South (2016).','1992-06-19',NULL),(1453,'David Lambert',NULL,'',NULL,NULL),(1454,'Vinessa Shaw','Los Angeles, California, USA','Vinessa Elizabeth Shaw (born July 19, 1976) is an American actress and model. Shaw has starred in numerous motion pictures since the early 1990s, and is probably most well-known for her performances in Disney\'s 1993 Halloween film Hocus Pocus, Ladybugs, the 2006 remake of Wes Craven\'s horror picture The Hills Have Eyes, as well as the 2008 romance film Two Lovers, in which she starred alongside Joaquin Phoenix and Gwyneth Paltrow.\n\nDescription above from the Wikipedia article Vinessa Shaw, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-07-19',NULL),(1455,'Wang Yabin',NULL,'',NULL,NULL),(1456,'Nicolas Pignon',NULL,'',NULL,NULL),(1457,'John Douglas Thompson',NULL,'',NULL,NULL),(1458,'Sakiko Tamagawa','Tokyo, Japan','Sakiko Tamagawa (玉川 砂記子, formerly 玉川 紗己子, Tamagawa Sakiko, born January 20, 1962) is a Japanese actress, voice actress and singer from Tokyo. She is affiliated with Sigma Seven. She voices Rei Kuki in Genji Tsuushin Agedama, Natsumi Tsujimoto in You\'re Under Arrest, Kazama\'s mother in Crayon Shin-chan, and Toyama-san in Atashin\'chi. Other roles of note include Pirotess in Record of Lodoss War, Cocoa in NG Knight Ramune & 40, Tachikoma in Ghost in the Shell: Stand Alone Complex, Rouge in Starship Girl Yamamoto Yohko, Juiz in Eden of the East, and Jasmine in Cross Ange.','1962-01-20',NULL),(1459,'Sonny Marinelli','Brooklyn, New York,  USA','','1967-05-02',NULL),(1460,'Draysan Debugice',NULL,'',NULL,NULL),(1461,'J. Evan Bonifant','Virginia Beach, Virginia, USA','From Wikipedia, the free encyclopedia\n\nJ. Evan Bonifant (born August 19, 1985) is an American actor.\n\nDescription above from the Wikipedia J. Evan Bonifant, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1985-08-19',NULL),(1462,'Natasha Bassett',' Sydney, New South Wales, Australia','Natasha Bassett (born ca. 1992) is an Australian actress.','1992-10-16',NULL),(1463,'Race Nelson',NULL,'',NULL,NULL),(1464,'Wendy Barry',NULL,'',NULL,NULL),(1465,'Collin Brock',NULL,'',NULL,NULL),(1466,'Matt Lagan',NULL,'',NULL,NULL),(1467,'Alfredo Septién','Jersey City, New Jersey, USA','','1966-11-15',NULL),(1468,'Thad Luckinbill','Enid, Oklahoma, USA','Thaddeus Rowe \"Thad\" Luckinbill (born April 24, 1975) is an American actor best known for playing J.T. Hellstrom on the CBS soap opera The Young and the Restless for eleven years (from August 1999 to November 2010). Luckinbill\'s wife and co-star, Amelia Heinle, announced on September 24, 2010 that Luckinbill would not be renewing his contract because he wanted to pursue other acting roles.','1975-04-24',NULL),(1469,'Manal El-Feitury','England, UK','',NULL,NULL),(1470,'Farouk A. Afify',NULL,'',NULL,NULL),(1471,'Carlos de Niggro','São Paulo, São Paulo, Brazil','','1977-06-27',NULL),(1472,'Alizee Delaruelle',NULL,'',NULL,NULL),(1473,'Luceli Soncini',NULL,'',NULL,NULL),(1474,'Sayaji Shinde','Chembur, Maharashtra, India','Sayaji Shinde is an Indian film actor, who has acted in Telugu, Marathi, Hindi, Tamil, Kannada, and Malayalam films.','1952-02-01',NULL),(1475,'Huang Wenyong','Kuala Lumpur, Malaysia','Huang Wenyong was a Malaysia-born Singaporean actor and former teacher of Chinese descent. Local media and fellow colleagues referred to him as \"Ah Ge\" (senior actor) due to his status. Huang died at the Singapore General Hospital at around 5 pm (GMT+8) on 20 April 2013, at the age of 60 due to lymphoma.\n\nHuang was a teacher in Kuala Lumpur before leaving for Singapore. Huang moved to Singapore in the 1970s, with only fifty dollars in hand. He joined the Singapore Broadcasting Corporation in 1977. He is perhaps best known for his appearances in The Awakening, in which he played love interest to Xiang Yun\'s character, and The Seletar Robbery during the 1980s. Huang is also known for starring alongside Chew Chor Meng in the long-running popular series Don\'t Worry, Be Happy (1996–2002) and its spin-off Lobang King as the stingy uncle Leon Ong Kim Lye to Chew\'s character Ah Bee. Huang was nominated for and named one of the Top 10 Most Popular Male Artistes every single year in the annual Star Awards since its introduction in 1994, until his death in 2013. In total, Huang starred in more than a hundred Chinese-language television programmes. In addition to acting, Huang sang pieces for a few television sitcoms and also released two albums. He was an ambassador for anti-ageing product company Zell-V. He was an actor for MediaCorp from the late 1970s until his death. Appearing in more than 100 television programmes, he was among the first few batches of locally trained actors to enter the local entertainment industry was and considered to be one of the \"pioneers in local Chinese drama\".','1952-07-25','2013-04-20'),(1476,'Giovanni Capitello','Brooklyn, New York,  USA','Giovanni Capitello is an actor, writer, director and producer.','1979-08-27',NULL),(1477,'Tanya M. Williams',NULL,'',NULL,NULL),(1478,'Duke Jackson',NULL,'',NULL,NULL),(1479,'Joo Bo-bi','Yeonggwaang, South Jeolla, South Korea','','1989-10-12',NULL),(1480,'Erica Taylor','Loma Linda, California, USA','',NULL,NULL),(1481,'Rodrigo Santoro','Petrópolis, Rio de Janeiro, Brazil','Rodrigo Junqueira dos Reis Santoro is a Brazilian actor. He has appeared in many successful movies, including Brainstorm (2001), Carandiru (2003), 300 (2007), Che (2008), I Love You Phillip Morris (2009) and Rio (2011). He was also a series regular on the Television series Lost portraying the character Paulo.','1975-08-22',NULL),(1482,'Syunichiro Yunoki',NULL,'',NULL,NULL),(1483,'Dave Bautista','Washington, D.C., USA','David Michael Bautista Jr. (born January 18, 1969) is an American actor of Filipino-Greek descent and retired professional wrestler. He had several stints in WWE between 2002 and 2019. In his acting career, he is most widely known for his portrayal of Drax the Destroyer in the Marvel Cinematic Universe since Guardians of the Galaxy (2014), up until leaving the franchise after Guardians of the Galaxy Vol. 3 (2023), and for his portrayal of Glossu Rabban Harkonnen in Denis Villeneuve\'s Dune (2021) and its sequel, Dune: Part Two (2024).','1969-01-18',NULL),(1484,'Fru Roszil',NULL,'',NULL,NULL),(1485,'Noriaki Sugiyama','Tokyo Prefecture, Japan','Noriaki Sugiyama (born March 9, 1976 in Tokyo, Japan) is a voice and television actor affiliated with Stay-Luck and formerly Production Baobab and Axl One. Many of the characters he plays not only have the same voice but have a very similar personality, such as his characters in the Bleach and Naruto series.\n\nSugiyama is affectionately known as Non-tan by his fans, a nickname given to him by voice actress Junko Takeuchi on the radio show O-! Naruto Nippon!.','1974-03-09',NULL),(1486,'Doug Abrahams',NULL,'Doug Abrahams is known for his work on Fido (2006), Elysium (2013) and Man of Steel (2013).',NULL,NULL),(1487,'Antonella Lualdi','Beirut, French Mandate for Syria and the Lebanon [','Antonella Lualdi (Greek: Αντονέλλα Λουάλντι, born Antonietta de Pascale; 6 July 1931) is an Italian actress and singer. She appeared in many Italian and French films in the 1950s and 1960s, notably in Claude Autant-Lara\'s film The Red and the Black in 1954, opposite Gérard Philipe.\n\nShe began her career in 1949, after having won a contest for new talents of the cinema magazine Hollywood, in which she was presented as \"Signorina X\" (\"Miss X\"), inviting the readers to choose her stage name.\n\nAfter having starred with him in several films, she married Italian actor Franco Interlenghi in 1955; the couple had two daughters, Stella and Antonellina, an actress in her own right.\n\nIn 1974 she debuted in France as a singer with some success and critical appreciation, then she also debuted on stage with the comedy Le Moulin de la Galette, with which she toured across several European countries.\n\nDescription above from the Wikipedia article Antonella Lualdi, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1931-07-06','2023-08-10'),(1488,'Leviticus Jones',NULL,'',NULL,NULL),(1489,'Gauthami Nair','Kollam, Kerala, India','','1991-11-13',NULL),(1490,'Jimi Mistry','Scarborough, Yorkshire, England, UK','Jimi Mistry (born 1 January 1973) is a retired British actor. He is known for appearing in numerous films such as East Is East (1999), The Guru (2002), Ella Enchanted (2004), The Truth About Love (2005), Blood Diamond (2006), Partition (2007), RocknRolla (2008), Exam (2009), It\'s a Wonderful Afterlife (2010), and West is West (2010). He is also known for his roles, as Dr. Fred Fonseca in BBC1 soap opera EastEnders, Latif in Cinemax series Strike Back, Kal Nazir in long-running ITV soap opera Coronation Street, and as Tom Bedford in Kay Mellor drama The Syndicate.','1973-01-01',NULL),(1491,'Tania Trudel',NULL,'',NULL,NULL),(1492,'Joseph Alfieri',NULL,'Joseph Alfieri is an American actor.',NULL,NULL),(1493,'Hunter Johnson','Wauwatosa, Wisconsin, USA','','1986-09-18',NULL),(1494,'Jaason Simmons','Hobart, Tasmania, Australia','','1970-07-12',NULL),(1495,'Taylor Cole','Texas, USA','Taylor Cole (born April 29, 1984) is an American actress and fashion model.','1984-04-29',NULL),(1496,'Joshua Bowman','Berkshire, England, UK','Joshua Tobias Bowman (born 4 March 1988) is an English actor best known for his role as Daniel Grayson in ABC\'s Revenge.','1988-03-04',NULL),(1497,'Jamie Neumann','Louisiana, USA','','1981-10-02',NULL),(1498,'Thogun Teixeira','Rio de Janeiro, Rio de Janeiro, Brazil','',NULL,NULL),(1499,'John O\'Donnell',NULL,'',NULL,NULL),(1500,'Barbara Scolaro','Bronx, New York, USA','','1966-01-12',NULL),(1501,'Dominic West','Sheffield, Yorkshire, England, UK','Dominic Gerard Francis Eagleton West is an English actor, director, and musician. He is best known for playing Jimmy McNulty in HBO\'s The Wire (2002–2008), Noah Solloway in Showtime\'s The Affair (2014–2019), the latter of which earned him a Golden Globe Award for Best Actor – Television Series Drama nomination, Ebenezer Scrooge\'s nephew Fred in A Christmas Carol (1999, with Patrick Stewart as Scrooge), and Charles, Prince of Wales, in the Netflix drama The Crown (2022–present).\n\nWest was born in Sheffield, England, in 1969. He is the sixth of seven children born to Irish parents. He studied English literature at Trinity College Dublin and drama at the Guildhall School of Music and Drama.\n\nWest began his acting career in theater, appearing in productions of \"Hamlet\" and \"Oedipus Rex.\" He made his film debut in 1995 with a small role in the film \"The Boxer.\"\n\nWest\'s breakthrough role came in 2002, when he was cast as Jimmy McNulty in the HBO series The Wire. The Wire is considered one of the greatest television shows of all time, and West\'s performance as McNulty was critically acclaimed.\n\nWest has since starred in a number of other successful films and television shows, including \"300,\" \"The Hour,\" \"The Affair,\" and \"The Crown.\" He is a versatile actor who is equally comfortable in both dramatic and comedic roles.\n\nWest is also a talented musician. He plays the guitar and piano, and he has released two albums of his own music.','1969-10-15',NULL),(1502,'James Flavin','Portland, Maine, USA','American character actor whose career lasted nearly half a century. James Wilson Flavin Jr. was the son of a hotel waiter of Canadian-English extraction and a mother, Katherine, whose father was an Irish immigrant. (Thus Flavin, well-known in Hollywood as an \"Irish\" type, was only one-quarter Irish.) Flavin was born and raised in Portland, Maine (a fact that may have enrichened his later working relationship with director John Ford, also a Portland native). He attended the United States Military Academy at West Point, but (contrary to some sources) did not graduate. Instead he dropped out and returned to Portland where he drove a taxi. Then as now, summer stock companies flocked to Maine each year, and in 1929 he was asked to fill in for an actor. He did well with the part and the company manager offered him $150 per week to go with the troupe back to New York. Flavin accepted and by the spring of 1930 was living in a rooming house at 108 W. 87th Street in Manhattan. Flavin didn\'t manage to crack Broadway at this time (his Broadway debut would not occur for another thirty-nine years, in the 1971 revival of \"The Front Page,\" in which Flavin played Murphy and briefly took over the lead role of Walter Burns from star Robert Ryan). He worked his way across the country in stock productions and tours, arriving in Los Angeles around 1932. He quickly made the transition to movies, landing the lead in his very first film, a Universal serial, The Airmail Mystery (1932). He also landed his leading lady, marrying the serial\'s female star Lucile Browne that same year. However, the serial marked virtually the last time that Flavin would play the lead in a film. Thereafter, he was restricted almost exclusively to supporting characters, many of them without so much as a name. He specialized in uniformed cops and hard-bitten detectives, but played chauffeurs, cabbies, and even a 16th-century palace guard with aplomb. Flavin appeared in nearly four hundred films between 1932 and 1971, and in almost a hundred television episodes before his final appearance, as President Dwight D. Eisenhower in Francis Gary Powers: The True Story of the U-2 Spy Incident (1976). Flavin died of a heart ailment at Cedars-Sinai Medical Center in Los Angeles on April 23, 1976. His widow Lucile died seventeen days later. They were survived by their son, William James Flavin, subsequently a professor at the United States Army War College. James and Lucile Brown Flavin were buried at Holy Cross Cemetery in Culver City, California.','1906-05-14','1976-04-23'),(1503,'Claire Duburcq',NULL,'',NULL,NULL),(1504,'Gong Zhixue',NULL,'','1974-11-10',NULL),(1505,'Aaron Monaghan','Co. Cavan, Ireland','Aaron Monaghan was born in 1980 in Co. Cavan, Ireland. He is an actor and director, known for The Banshees of Inisherin (2022), Assassin\'s Creed (2016) and \'71 (2014).','1980-06-01',NULL),(1506,'Sidney Flack',NULL,'',NULL,NULL),(1507,'Jay Beyers',NULL,'',NULL,NULL),(1508,'Sophia Blum',NULL,'',NULL,NULL),(1509,'Xu Qing','中国,北京','Xu Qing (born 22 January 1969) is a Chinese actress. She was accepted into the acting class of Beijing Film Academy in 1988. She made her debut in the 1990 film Life on a String, directed by Chen Kaige. She graduated from Beijing Film Academy in 1992, and in that year, she was nominated for the Hundred Flowers Award for Best Actress. On 30 November 2009, Xu became a contracted artiste under the talent agency Huayi Brothers. She portrayed Soong Ching-ling in the 2009 Chinese historical film The Founding of a Republic. Xu played the wife of Bruce Willis\'s character in the 2012 film Looper.\n\nDescription above from the Wikipedia article Qing Xu, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1969-01-22',NULL),(1510,'Geoff Stults','Detroit, Michigan, USA ','Geoffrey Manton Stults (born December 15, 1977) is an American actor. His first regular roles on television included 7th Heaven, October Road, and Happy Town. He went on to star as Major Walter Sherman on The Finder, Sgt. Pete Hill on Enlisted, and Marco Strzalkowski on Guilty Party. He also played the recurring role of Mitch on the hit Netflix series Grace and Frankie.\n\nHis film roles include Wedding Crashers, The Break-Up, She\'s Out of My League, Only the Brave, and 12 Strong.\n\nHe acted in the long running show, \"7th Heaven\" (1996), in which he played Ben, the brother of Kevin Kinkirk who is portrayed by George Stults, his real life brother.\n\nHe Attended Whittier College from 1994-1998, where he performed in some theatrical productions and played division III football. Played professional Football in Europe as a wide receiver.','1977-12-15',NULL),(1511,'Daniel Roebuck','Bethlehem, Pennsylvania, USA','From Wikipedia, the free encyclopedia\n\nDaniel Randall James Roebuck (born March 4, 1963) is an American actor and writer. His best known roles include Deputy Marshal Robert Biggs in The Fugitive and its spinoff film U.S. Marshals, Jay Leno in The Late Shift, and Dr. Leslie Arzt in Lost, as well as numerous Rob Zombie and Don Coscarelli films. He is also known for his role as Cliff Lewis, Ben Matlock\'s private investigator, on Matlock from 1992 until 1995.\n\nDescription above from the Wikipedia article Daniel Roebuck, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1963-03-04',NULL),(1512,'Carlos Javier Castillo',NULL,'Carlos Javier Castillo is known for American Crime Story (2016), The Bold and the Beautiful (1987) and 9-1-1 (2018).',NULL,NULL),(1513,'Lauren Sparrow',NULL,'',NULL,NULL),(1514,'Nick Swardson','Minneapolis, Minnesota, USA','Nicholas \"Nick\" Swardson (born October 9, 1976) is an American actor, stand-up comedian, and writer. He is best known for his recurring role as Terry Bernardino in the Comedy Central series Reno 911!, for his work in Happy Madison movies, and for his new Comedy Central television series Nick Swardson\'s Pretend Time.\n\nDescription above from the Wikipedia article Nick Swardson, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-10-09',NULL),(1515,'Channing Tatum','Cullman, Alabama, USA','Channing Matthew Tatum (born April 26, 1980) is an American actor. Tatum made his film debut in the drama Coach Carter (2005), and had his breakthrough role in the 2006 dance film Step Up. He gained wider attention for his leading roles in the sports comedy She\'s the Man (2006), the comedy-drama Magic Mike (2012) and its sequels Magic Mike XXL (2015) and Magic Mike\'s Last Dance (2023), the latter two of which he also produced, and in the action-comedy 21 Jump Street (2012) and its sequel 22 Jump Street (2014).\n\nTatum has also appeared as Duke in the action film G.I. Joe: The Rise of Cobra (2009) and its sequel G.I. Joe: Retaliation (2013). His other films include White House Down (2013), Foxcatcher (2014), The Hateful Eight (2015), Hail, Caesar! (2016), Logan Lucky (2017), and The Lost City (2022). Tatum has also starred in, produced and co-directed the road film Dog (2022). Time magazine named him one of the 100 most influential people in the world in 2022.','1980-04-26',NULL),(1516,'Andrew Arrabito',NULL,'',NULL,NULL),(1517,'Bobby Field',NULL,'',NULL,NULL),(1518,'Scott McCord','Sarnia, Ontario, Canada','','1971-04-19',NULL),(1519,'David Arquette','Winchester, Virginia, USA','David Arquette (born September 8, 1971) is an American actor, former professional wrestler, director, producer, and fashion designer. In acting, he is best known for his role as Dewey Riley in the slasher film franchise Scream, for which he won a Teen Choice Award and two Blockbuster Entertainment Awards. As a professional wrestler, he is best remembered for his 2000 stint in World Championship Wrestling (WCW), where he won the WCW World Heavyweight Championship and headlined the Slamboree pay-per-view event; he has received praise in recent times for his work on the independent circuit.\n\nA member of the Arquette acting family, he first became known during the mid-1990s after starring in several Hollywood films aside from the Scream franchise, such as Wild Bill, Never Been Kissed, Buffy the Vampire Slayer, See Spot Run and Eight Legged Freaks. He has since had several television roles, such as Jason Ventress on ABC\'s In Case of Emergency. Arquette has also voiced Skully on the Disney Channel animated series Jake and the Never Land Pirates, and executive produced the game show Celebrity Name Game, for which he received a Daytime Emmy Award nomination.\n\nDescription above from the Wikipedia article David Arquette, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1971-09-08',NULL),(1520,'Olivia Jordan','Tulsa, Oklahoma, U.S.','','1998-09-28',NULL),(1521,'Eric Supply',NULL,'',NULL,NULL),(1522,'Paul Popplewell','England, UK','Paul Popplewell is a British actor. He became a professional actor at 16, leaving college after gaining the lead role of Simon in the BBC television drama Criminal.','1977-01-01',NULL),(1523,'Malay Choeung Kim',NULL,'',NULL,NULL),(1524,'Shawn Klush',NULL,'',NULL,NULL),(1525,'Jeff Fahey','Olean, New York, USA','From Wikipedia, the free encyclopedia.  \n\nJeffrey David \"Jeff\" Fahey (born November 29, 1952) is an American film and television actor. He has portrayed Captain Frank Lapidus on the ABC series Lost and the title role of Deputy Marshal Winston MacBride on The Marshal.','1952-11-29',NULL),(1526,'Sanae Hitomi','Hiratsuka, Kanagawa Prefecture, Japan','Hitomi Sanae is a Japanese double and actress. She has worked in several Tokusatsu series as a double: She was the first woman who managed to work 3 years in a row after Yuuki Ono. She can also be seen in Juuken Sentai Gekiranger, playing Lily, one of the three thief sisters in episode 36.','1982-06-23',NULL),(1527,'Shinnosuke Tachibana','Gifu, Japan','Shinnosuke Tachibana (立花 慎之介, Tachibana Shinnosuke, April 26, 1978) is a Japanese voice actor, singer, narrator and mystery writer from Gifu. He is married to voice actress Ao Takahashi and is the CEO of Black Ship.\n\nAfter gratudating from Aoni Juku Tokyo School 18th term he joined Production Baobab. In 2003, he made his voice actor debut as Kyo in the TV anime E\'s Otherwise. He belonged to Production Baobab until May 2011. In June of the same year he joined Axl One. On January 5, 2017, he reported his marriage to Ao Takahashi on his blog. On March 31, 2018, he left Axl One to establish, together with Jun Fukuyama, their own agency: Black Ship.','1978-04-26',NULL),(1528,'Rolando Alvarez Giacoman',NULL,'Rolando Alvarez Giacoman is an actor.',NULL,NULL),(1529,'Gérard Miller','Neuilly-sur-Seine, Hauts-de-Seine, France','','1948-07-03',NULL),(1530,'Christian Monaldi','Roma','',NULL,NULL),(1531,'Michelle Sander','Peekskill, New York, USA','','1994-06-04','2022-06-19'),(1532,'Austin Robert Russell',NULL,'',NULL,NULL),(1533,'Floyd Resnick',NULL,'',NULL,NULL),(1534,'Daniel Attwell',NULL,'',NULL,NULL),(1535,'Gaël Kamilindi',NULL,'',NULL,NULL),(1536,'Barry Bostwick','San Mateo, California, USA','Barry Knapp Bostwick (born February 24, 1945) is an American actor and singer. He is known for playing Brad Majors in the 1975 cult classic The Rocky Horror Picture Show, replacing Peter Scolari as Mr. Tyler in the sitcom What I Like About You, and playing Mayor Randall Winston in the sitcom Spin City. He has also had considerable fame in musical theater.','1945-02-24',NULL),(1537,'Ayanna S. Flemings',NULL,'',NULL,NULL),(1538,'John Impolito',NULL,'',NULL,NULL),(1539,'Wong Dik-Gei',NULL,'',NULL,NULL),(1540,'Yiheng Chen','中国,北京','','1954-04-03',NULL),(1541,'Sullivan Stapleton','Melbourne, Victoria, Australia','Sullivan Stapleton (born 14 June 1977)] is an Australian actor who is best known for his roles in the SKY (BSkyB)/Cinemax/HBO television series Strike Back and the 2010 Sundance Film Festival selection Animal Kingdom.\n\nStapleton played the lead role, Greek leader Themistocles, in the film 300: Rise of an Empire (2014). He was honored on 24 October 2013 with a Breakthrough Award at an exclusive Australians in Film Benefit Dinner held in Los Angeles.','1977-06-14',NULL),(1542,'G. Anthony Joseph',NULL,'',NULL,NULL),(1543,'Kevin Fry-Bowers',NULL,'',NULL,NULL),(1544,'Perry Irvins',NULL,'',NULL,NULL),(1545,'Alan McRae',NULL,'',NULL,NULL),(1546,'David Costabile','Washington, D.C., USA','David Costabile (born January 9, 1967) is an American actor. He is best known for his television work, having appeared in supporting roles in several television series such as Billions, Breaking Bad, Damages, Flight of the Conchords, Suits, The Wire, and The Dirt. He has also acted on film and in Broadway theatre','1967-01-09',NULL),(1547,'Danny McBride','Statesboro, Georgia, USA','Daniel Richard McBride (born December 29, 1976) is an American actor, comedian, screenwriter and producer. He starred in the HBO television series Eastbound & Down, Vice Principals, and The Righteous Gemstones, also co-creating the former two with frequent collaborator Jody Hill while creating the latter himself. He has appeared in films such as The Foot Fist Way (2006), Hot Rod (2007), Pineapple Express (2008), Tropic Thunder (2008), Up in the Air (2009), Your Highness (2011), This Is the End (2013), and Alien: Covenant (2017). He has done voice acting for Despicable Me (2010), Kung Fu Panda 2 (2011), Hell and Back (2015), The Angry Birds Movie, Sausage Party (both 2016), The Angry Birds Movie 2 (2019), and The Mitchells vs. the Machines (2021).\n\nDescription above from the Wikipedia article Danny McBride licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-12-29',NULL),(1548,'Chris Patrick-Simpson','Edmonton, Alberta, Canada','Chris was born in Canada but grew up Belfast. He began acting under the guidance of an inspirational drama teacher at secondary school who put him on the path to becoming a professional actor.  On leaving school he successfully auditioned for the Gaiety School of Acting in Dublin, graduating in 2000. Since then he has continued to fulfill his ambition of collaborating with the best directors in film, television and theatre in projects such as the award-winning The Magdalene Sisters, (Momentum) The Boxer, (Universal) Fifty Dead Men Walking, (Brightlight Pictures) Good Vibrations, (Revolver Films) 71 (Warp Films), Shooting for Socrates (New Black Films), Mrs Brown\'s Boys D\'Movie (Universal Pictures) and most recently High Rise Directed by Ben Wheatley','1979-01-18',NULL),(1549,'Jack Maloney',NULL,'',NULL,NULL),(1550,'Paul Anka','Ottawa, Ontario, Canada','Paul Albert Anka (born July 30, 1941) is a Canadian-American singer, songwriter and actor. He is best known for his signature hit songs including \"Diana\", \"Lonely Boy\", \"Put Your Head on My Shoulder\", and \"(You\'re) Having My Baby\". Anka also wrote the theme for The Tonight Show Starring Johnny Carson; one of Tom Jones\' biggest hits, \"She\'s a Lady\"; and the English lyrics to Claude François and Jacques Revaux\'s music for Frank Sinatra\'s signature song \"My Way\", which has been recorded by many, including Elvis Presley. He co-wrote three songs with Michael Jackson: \"This Is It\" (originally titled \"I Never Heard\") \"Love Never Felt So Good\", and \"Don\'t Matter to Me\", which became posthumous hits for Jackson in 2009, 2014, and 2018, respectively.\n\nAnka was born in Ottawa, Ontario, to Camelia (née Tannis) and Andrew Emile \"Andy\" Anka Sr., who owned a restaurant called the Locanda. His parents were both of Lebanese descent. His father came to Canada from Bab Tuma, Damascus, Syria, and his mother was an immigrant from Lebanon. His mother died when he was 18.\n\nAnka sang with the St. Elias Antiochian Orthodox Cathedral choir under the direction of Frederick Karam, with whom he studied music theory. He studied piano with Winnifred Rees. He attended Fisher Park High School, where he was part of a vocal trio called the Bobby Soxers.\n\nPaul Anka recorded his first single, \"I Confess\", when he was 14. In 1956, with $100 given to him by his uncle, he went to New York City where he auditioned for Don Costa at ABC Records, singing what was widely believed to be a lovestruck verse he had written to a former babysitter. In an interview with NPR\'s Terry Gross in 2005, he stated that it was to a girl at his church whom he hardly knew. The resulting song \"Diana\" brought Anka stardom as it went to No. 1 on the Canadian and US music charts. \"Diana\" is one of the best selling singles ever by a Canadian recording artist. He followed up with four songs that made it into the Top 20 in 1958, including \"It\'s Time to Cry\", which hit No. 4 and \"(All of a Sudden) My Heart Sings\", which reached No. 15, making him (at 17) one of the biggest teen idols of the time. He toured Britain, then Australia with Buddy Holly. Anka also wrote \"It Doesn\'t Matter Anymore\" – a song written for Holly, which Holly recorded just before he died in 1959. Anka stated shortly afterward: \"It Doesn\'t Matter Anymore\" has a tragic irony about it now, but at least it will help look after Buddy Holly\'s family. I\'m giving my composer\'s royalty to his widow – it\'s the least I can do.\" ...\n\nSource: Article \"Paul Anka\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1941-07-30',NULL),(1551,'Olga Kurylenko','Berdiansk, Ukrainian SSR, USSR [now Zaporizhzhia O','Olga Kurylenko was born on November 14, 1979, in Berdyansk, Ukraine, Soviet Union. Her mother, Marina Alyabysheva, divorced her father, Konstantin Kurylenko, soon after her birth. After the divorce, her mother struggled to survive as an art teacher. Young Olga Kurylenko was brought up by her mother and her grandmother, Raisa. During her youth, Olga had a humbling experience of living in poverty; she had no choice but to wear rags and had to darn the holes on her sweater. During the years in Ukraine she studied art, languages, did 7 years of musical school studying piano and went to a ballet studio until 13.\n\nAt age 13, Olga and her mother made a trip to Moscow. There she was scouted by an agent who approached her at a subway station and offered a job as a model. Initially, Olga\'s mother was suspicious, but eventually Olga made a good career choice and took training as a model in Moscow. By age 16, she was ready for the next step. She moved to Paris, learned French in six months, and was signed by the Madison agency. At age 18, Olga appeared on the cover of Glamour, then she graced magazine covers of Elle, Madame Figaro, Marie Claire, and Vogue, and also became the face of Lejaby lingerie, Bebe clothing, Clarins and Helena Rubinstein cosmetic companies.\n\nIn 1999, Olga married her friend, French photographer Cedric Van Mol and divorced him three and a half years later. One day Olga presented herself to an acting agency. Eventually, she swapped the catwalk for celluloid, and her acting career took off. In 2005 she made her film debut as Iris, a sensual beauty in L\'annulaire (2005) by director Diane Bertrand.\n\nShe appeared opposite Elijah Wood in Paris, je t\'aime (2006) and as Sofia in Le serpent (2006), then co-starred as Russian beauty Nika Boronina opposite Timothy Olyphant in Hitman (2007/I). She also appears as Mina Harud in the indy surveillance-thriller \"Tyranny\" (2008) and is billed as Camille, the Bond girl in Quantum of Solace (2008), a sequel to Casino Royale (2006).','1979-11-14',NULL),(1552,'Burt Reynolds','Lansing, Michigan, USA','Burton Leon Reynolds Jr. (February 11, 1936 – September 6, 2018) was an American actor, director, and producer, considered a sex symbol and icon of American popular culture.\n\nReynolds first rose to prominence when he starred in several different television series such as Gunsmoke (1962–1965), Hawk (1966), and Dan August (1970–1971). Although Reynolds had leading roles in such films as Navajo Joe (1966), his breakthrough role was as Lewis Medlock in Deliverance (1972). Reynolds played the leading role – often a lovable rogue – in a number of subsequent box office hits, such as The Longest Yard (1974), Smokey and the Bandit (1977), Semi-Tough (1977), The End (1978), Hooper (1978), Starting Over (1979), Smokey and the Bandit II (1980), The Cannonball Run (1981), Sharky\'s Machine (1981), The Best Little Whorehouse in Texas (1982), and Cannonball Run II (1984), several of which he directed himself. He was nominated twice for the Golden Globe Award for Best Actor – Motion Picture Musical or Comedy.\n\nReynolds was voted the world\'s number one box office star for five consecutive years (from 1978 to 1982) in the annual Top Ten Money Making Stars Poll, a record he shares with Bing Crosby. After a number of box office failures, Reynolds returned to television, starring in the sitcom Evening Shade (1990–1994), which won him a Golden Globe Award and Primetime Emmy Award for Outstanding Lead Actor in a Comedy Series. His performance as high-minded pornographer Jack Horner in Paul Thomas Anderson’s Boogie Nights (1997) brought him renewed critical attention, earning him another Golden Globe (for Best Supporting Actor – Motion Picture), with nominations for an Academy Award for Best Supporting Actor and a BAFTA Award for Best Supporting Actor.\n\nDescription above from the Wikipedia article Burt Reynolds, licensed under CC-BY-SA, full list of contributors on Wikipedia','1936-02-11','2018-09-06'),(1553,'Eddie J. Fernandez','Chicago, Illinois, USA','Eddie J. Fernandez is American award-winning stunt performer, martial artist, actor and stunt coordinator of over 300 films and television shows.',NULL,NULL),(1554,'Terence Tsui Chi-Hung',NULL,'',NULL,NULL),(1555,'David Stephen Mitchell',NULL,'',NULL,NULL),(1556,'Wole Daramola',NULL,'',NULL,NULL),(1557,'Damien Masson',NULL,'',NULL,NULL),(1558,'Kellen McAlone',NULL,'',NULL,NULL),(1559,'Aleksandr Vorobyov','Gomel, Byelorussian SSR, USSR [now Belarus]','','1962-02-14','2021-01-15'),(1560,'Asif Ali','Kochi, Kerala, India','Asif Ali  is an Indian film actor and producer best known for his work in Malayalam cinema.\n\nAsif Ali made his acting debut with the Malayalam film Ritu (2009) directed by Shyamaprasad. Later, he went on to act in successful films including Apoorvaragam (2010), Traffic (2011), Salt N\' Pepper (2011), Ordinary (2012), Ozhimuri (2012), Honey Bee (2013), Sapthamashree Thaskaraha (2014),Nirnayakam (2015),  Anuraga Karikkin Vellam (2016), and Sunday Holiday (2017). He made his debut as a producer with the film Kohinoor under his production company Adam\'s World of Imaagination, which also starred himself.','1986-02-04',NULL),(1561,'Pat Kiernan','Calgary, Alberta, Canada','Patrick Kiernan (born November 20, 1968) is a Canadian-American television host, appearing as the morning news anchor of NY1 since 1997. He is widely known in New York City for his \"In the Papers\" feature, in which he summarizes the colorful content in New York City\'s daily newspapers, replete with his deadpan humor. Kiernan has also hosted game shows and appeared in films and on television either as himself or as a reporter.','1968-11-20',NULL),(1562,'Ernie Robinson','Kansas, USA','',NULL,NULL),(1563,'James Diego Martins Santana',NULL,'',NULL,NULL),(1564,'Sidney Clute','Brooklyn, New York,  USA','','1916-04-21','1985-10-02'),(1565,'Rodrigo Cáceres',NULL,'',NULL,NULL),(1566,'Linda Evans','Hartford, Connecticut, USA','Linda Evans  (born on November 18, 1942) is an American actress known primarily for her roles on television. She rose to fame playing Victoria Barkley\'s (played by Barbara Stanwyck) daughter, Audra Barkley, in the 1960s Western TV series, The Big Valley (1965–1969). Her most prominent role was that of long-suffering heroine Krystle Carrington, the wife of Blake Carrington (played by John Forsythe), in the 1980s ABC prime time television soap opera Dynasty, a role she played from 1981 to 1989.\n\nDescription above from the Wikipedia article Linda Evans, licensed under CC-BY-SA, full list of contributors on Wikipedia','1942-11-18',NULL),(1567,'Taddeo Kufus',NULL,'','1999-01-01',NULL),(1568,'Teah','Tokyo, Japan','','1978-04-14',NULL),(1569,'Stephen Davis',NULL,'',NULL,NULL),(1570,'Edwin Richardson',NULL,'',NULL,NULL),(1571,'Owen de Wet',NULL,'',NULL,NULL),(1572,'Killian Scott','Sandymount, County Dublin, Ireland','Killian Scott is an Irish actor known for Love/Hate (2010), \'71 (2014), Calvary (2014) and Damnation (2017).','1985-07-06',NULL),(1573,'Eric Schwartau',NULL,'',NULL,NULL),(1574,'Georgina Hegedos',NULL,'',NULL,NULL),(1575,'Benjamin James',NULL,'',NULL,NULL),(1576,'Tao Zeru','Nanjing, Jiangsu, China','','1953-12-07',NULL),(1577,'Angelo Tiffe',NULL,'',NULL,NULL),(1578,'Alessandra Tani',NULL,'',NULL,NULL),(1579,'Chen Shucheng','Shantou, China','Chen Shu Cheng is a veteran artiste whose career spans over 40 years in the entertainment business. Undisputedly the person all younger artistes look up to, Shu Cheng is a role model for anyone who wishes to carve out and sustain a profession in this business.\n\nHe is well liked by sponsors due to his eloquence and quick wit. These attributes gave him the chance to host Econ Nite and Weekend Delight year after year. With his vast amount of life experience behind him, Shu Cheng is able to handle live and major shows without any hiccups.\n\nHe is also a consummate actor whose professional ethics is an exemplifying example to all other artistes. He has acted in blockbuster productions that garnered amazing ratings from viewers. Give him any role and Shu Cheng is able to break it down analytically without much effort. Without a doubt, he is definitely a valuable asset to Mediacorp.\n\nShu Cheng was reaffirmed of his hard work and acting skills, when he won the Best Supporting Award for The Oath 行医, at Star Awards 2012. He was also awarded the Best Evergreen Artiste Award in Star Award 2016. Shu Cheng won his second Best Everygreen Artiste Award in Star Award 2018, his second Best Supporting Actor Award for A Million Dollar Dream and his first Top 10 Most Popular Male Artistes Award in Star Awards 2019.','1949-10-21',NULL),(1580,'Vladimir Mashkov','Тула, СССР','From Wikipedia, the free encyclopedia.\n\nVladimir Lvovich Mashkov (b. November 27, 1963 in Novokuznetsk, Soviet Union now Russia) is a Russian actor best known to Western audiences for his work in the 2001 film Behind Enemy Lines. Mashkov has also worked as a movie director, producer and writer for the 2004 Russian film \"Papa\"\n\nDescription above from the Wikipedia article Vladimir Mashkov, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1963-11-27',NULL),(1581,'Kendal Rae',NULL,'',NULL,NULL),(1582,'Taro Masuoka','Hyōgo Prefecture, Japan','','1971-10-22',NULL),(1583,'Giovanni Cianfriglia','Anzio, Lazio, Italy','Giovanni Cianfriglia (born 5 April 1935) is an Italian film actor. He has appeared in more than 100 films since 1958.\n\nBorn in Anzio, Cianfriglia debuted as the body double of Steve Reeves in Hercules, then he started appearing, often uncredited, as a stuntman in dozens of genre films. Since the second half of the sixties he starred in several adventure films and Spaghetti Westerns in leading roles using the stage name Ken Wood.\n\nSource: Article \"Giovanni Cianfriglia\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1935-04-05',NULL),(1584,'Gabriel Jarret','Los Angeles, California, USA','Gabriel Jarret (born Gabriel Kronsberg; January 1, 1970) is an American actor. He is best known for his role as the young genius Mitch Taylor in the 1985 comedy film Real Genius in which he co-starred with Val Kilmer.\n\nJarret\'s first film was Going Ape! in 1981. Arguably his most notable appearance was as Mitch Taylor alongside Val Kilmer\'s Chris Knight in the movie Real Genius. Other film roles include The Karate Kid Part III, Apollo 13, and Last Days. Jarret also made television guest appearances in such shows as 21 Jump Street, L.A. Law, Party of Five, and The West Wing.\n\nDescription above from the Wikipedia article Gabriel Jarret, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-01-01',NULL),(1585,'Ennio Girolami','Rome, Lazio, Italy','','1935-01-14','2013-02-16'),(1586,'Mohamed Badrsalem',NULL,'',NULL,NULL),(1587,'Greg Kramer','Hertfordshire, England','','1961-01-01','2013-04-08'),(1588,'Will Leong',NULL,'Will Leong is an actor and a stunt performer.',NULL,NULL),(1589,'Craig Price',NULL,'',NULL,NULL),(1590,'Fernando Lamas','Buenos Aires, Argentina','From Wikipedia, the free encyclopedia.\n\nFernando Álvaro Lamas (January 9, 1915 – October 8, 1982) was an Argentine-born actor and director, and the father of actor Lorenzo Lamas.\n\nDescription above from the Wikipedia article Fernando Lamas, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1915-01-09','1982-10-08'),(1591,'Damien Puckler','Frankfurt am Main, Hesse, Germany','Damien Puckler is an actor who is known for 30,000 Leagues Under the Sea, Death Factory, The Colony, and Man vs Wild. He loves the Marx Brothers and is a spider fanatic, hence the tarantula tattoo on his chest.','1972-04-10',NULL),(1592,'Brantley Bush',NULL,'',NULL,NULL),(1593,'Enzo G. Castellari','Roma, Lazio, Italia','From Wikipedia, the free encyclopedia\n\nEnzo G. Castellari (born July 29, 1938) is an Italian film director. He became famous during the 1960s by directing several spaghetti westerns with such titles as Go Kill and Come Back (Vado... l\'ammazzo e torno, 1967) , One Dollar Too Many (1968), Seven Winchesters for a Massacre (Sette winchester per un massacro, 1967) and Go Kill Everybody and Come Back Alone (Ammazzali tutti e torna solo, 1968). His films exhibited a flair for violent action and gunfights, often using slow-motion to spectacular effect. His film Keoma (1976) is considered the last great film of the genre.\n\nDescription above from the Wikipedia article Enzo G. Castellari, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1938-07-29',NULL),(1594,'Jonah Hill','Los Angeles, California, USA','Jonah Hill Feldstein (born December 20, 1983) is an American actor, comedian, screenwriter, producer and director. He is known for his comedic roles in films including Superbad (2007), Knocked Up (2007), 21 Jump Street (2012), This Is the End (2013), and 22 Jump Street (2014). For his performances in Moneyball (2011) and The Wolf of Wall Street (2013), he was nominated for the Academy Award for Best Supporting Actor.\n\nHill ranked 28th on Forbes magazine\'s list of highest-paid actors from June 2014 to June 2015, at $16 million. In 2020, he was found to have sworn on film more than any other actor. As a screenwriter, he contributed to the stories of 21 Jump Street, 22 Jump Street, Sausage Party and Why Him? In 2018, he starred in the Netflix dark comedy miniseries Maniac and made his directorial debut with the film Mid90s. He also wrote the screenplay for Mid90s.\n\nHill has provided voices for the animated films Horton Hears a Who! (2008), Megamind (2010), How to Train Your Dragon (2010–2019), The Lego Movie (2014), and The Lego Movie 2: The Second Part (2019).','1983-12-20',NULL),(1595,'Simon Dutton','Buckinghamshire, England, UK','Simon Dutton (born 1 January 1958) is an English actor, best known for playing the title role of Simon Templar (alias the Saint) in a series of internationally produced television films in 1989. In 2007, he joined the cast of British sitcom Not Going Out as recurring character Guy, but was written out at the end of series two.','1958-01-01',NULL),(1596,'Denise Gough','Ennis - County Clare - Ireland','Denise Gough is an Irish actress. She was born in Ennis, County Clare and is the elder sister of the actress Kelly Gough. She graduated from the Academy of Live and Recorded Arts in 2003. She is notable for her work in theatre and television, including the play The Painter and Messiah V: The Rapture.','1980-02-28',NULL),(1597,'Sandy Alexander',NULL,'',NULL,NULL),(1598,'N\'Bushe Wright','New York City, New York, U.S.','From Wikipedia, the free encyclopedia.  \n\nN\'Bushe Wright (pronounced nuh-BOO-shay, born September 20, 1970 in New York City, New York, U.S.) is an American film and television actress, known mainly for her part in Blade. A native of New York City, she is the daughter of jazzman Stanely Wright aka Suleiman-Marim Wright. Her mother is a psychologist with the New York City Board of Education.\n\nDescription above from the Wikipedia article N\'Bushe Wright, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-09-20',NULL),(1599,'Alvin Knight Sr.',NULL,'',NULL,NULL),(1600,'Peter Egan','Hampstead, London, England, UK','Peter Joseph Egan (born 28 September 1946) is a British actor known for his TV roles, including Hogarth in Big Breadwinner Hog, the future King George IV of the United Kingdom in Prince Regent (1979); smooth neighbour Paul Ryman in the sitcom Ever Decreasing Circles (1984–89); and Hugh \"Shrimpie\" MacClare, Marquess of Flintshire, in Downton Abbey (2012–15). He is married to retired actress Myra Frances.\n\nEgan was born in Hampstead, London, the son of Doris (née Pick) and Michael Thomas Egan, who is of Irish descent.[1][2] He was educated at St. George\'s Roman Catholic Comprehensive School, Maida Vale. He also attended the London Oratory School and the Royal Academy of Dramatic Art.\n\n(Wikipedia)','1946-09-28',NULL),(1601,'Christopher Heskey',NULL,'',NULL,NULL),(1602,'Erik Betts','Boston, Massachusetts, USA','','1967-11-22',NULL),(1603,'Caco Ciocler','São Paulo, São Paulo, Brazil','','1971-09-27',NULL),(1604,'Hunter Burke',NULL,'',NULL,NULL),(1605,'Paul Nuckles','Johnson City, Tennessee, USA','','1939-08-25','2015-04-10'),(1606,'Shōhei Imamura','Tokyo, Tokyo Prefecture, Japan','Shōhei Imamura (Tokyo, 15 September 1926 – 30 May 2006) was a Japanese film director. Imamura was the first Japanese director to win two Palme d\'Or awards, but was never Oscar nominated for any category.\n\nHis eldest son Daisuke Tengan is also a script writer and film director, and worked on the screenplays to Imamura\'s films The Eel (1997), Dr. Akagi (1998), Warm Water Under a Red Bridge (2001) and 11\'9\"01 September 11 (2002).','1926-09-15','2006-05-30'),(1607,'Scott Dillin','Bayonne, New Jersey, USA','Scott Dillin was born on May 31, 1960. He was an actor, known for 15 Minutes (2001), A Perfect Murder (1998) and Salt (2010). He died on October 8, 2021 in Bayonne, New Jersey, USA.','1960-05-31','2021-10-08'),(1608,'Rachel O\'Meara',NULL,'',NULL,NULL),(1609,'Allen Pomeroy','Hartford, Connecticut, USA','','1900-10-23','1976-09-04'),(1610,'Joshua Nelms',NULL,'',NULL,NULL),(1611,'Tamás Lengyel','Budapest, Hungary','','1977-09-07',NULL),(1612,'Tony Luke Jr.','Philadelphia, Pennsylvania, USA','Anthony Lucidonio Jr. (born March 12, 1962) better known as Tony Luke, Jr. is an American actor, screenwriter, songwriter, restaurateur, sports reporter, and entrepreneur.\n\nDescription above from the Wikipedia article Anthony Lucidonio Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia','1962-03-12',NULL),(1613,'John Cena','West Newbury, Massachusetts, USA','John Felix Anthony Cena is an American professional wrestler, actor, and former rapper currently signed to WWE. Widely regarded as one of the greatest professional wrestlers of all time, he is tied with Ric Flair for the most world championship reigns in professional wrestling history.\n\nBorn and raised in West Newbury, Massachusetts, Cena moved to California in 1998 to pursue a career as a bodybuilder. He transitioned to professional wrestling in 1999 when he debuted for Ultimate Pro Wrestling (UPW). He signed with the World Wrestling Federation (WWF, now WWE) in 2001, where he was initially assigned to Ohio Valley Wrestling (OVW). He gained fame in the WWE after adopting the persona of a trash-talking rapper. He won his first singles title, the United States Championship, in 2004. The next year, he won the WWE Championship for the first time, and his character subsequently transitioned into a clean-cut \"Superman-like\" hero. He then led the company as its franchise player, and public face for the next decade.\n\nA joint-record 16-time world champion, Cena has won the WWE Championship thirteen times, a record for the title. He is also a five-time United States Champion, a four-time world tag team champion, a two-time Royal Rumble match winner, a one-time Money in the Bank match winner, and has headlined several major WWE pay-per-view events, including their flagship event, WrestleMania, five times. His professional wrestling career has been met with mixed critical and audience reception, with praise for his character work and promotional skills, but criticism for his supposed over-representation and on-screen placement relative to other wrestlers.\n\nCena first starred in The Marine (2006), and gained praise for his performances in Trainwreck (2015), Ferdinand (2017), Blockers, and Bumblebee (both 2018). He starred in F9 and portrayed Peacemaker in The Suicide Squad (both 2021) and in the eponymous television series. His debut studio album, You Can\'t See Me (2005), was certified platinum. Outside his work in entertainment, Cena is known for his involvement in numerous charitable causes, namely with the Make-A-Wish Foundation, where he has granted the most wishes, at over 650.','1977-04-23',NULL),(1614,'Sonny Rocker',NULL,'',NULL,NULL),(1615,'Igal Naor','Giv\'atayim, Israel','Igal Naor was born on June 25, 1958 in Givatayim, Israel. He is an actor, known for Munich Games (2022), Homeland (2011) and Riviera (2017).','1958-06-25',NULL),(1616,'David Alan Grier','Detroit, Michigan, USA','David Alan Grier is an American comedian and film and television actor, best known for his work on the sketch comedy television show \"In Living Color\".','1956-06-30',NULL),(1617,'Yakima Canutt','Colfax, Washington, U.S.A.','From Wikipedia, the free encyclopedia\n\nYakima Canutt (November 29, 1895 – May 24, 1986), also known as Yak Canutt, was an American rodeo rider, actor, stuntman and action director.\n\nDescription above from the Wikipedia article Yakima Canutt, licensed under CC-BY-SA, full list of contributors on Wikipedia.\n\n','1895-11-29','1986-05-24'),(1618,'Liam McGuckian',NULL,'',NULL,NULL),(1619,'Jason Diablo',NULL,'Jason Diablo is an actor who plays Detective on Fringe.',NULL,NULL),(1620,'Antonio Fargas','New York City, New York, USA','Antonio Juan Fargas (born August 14, 1946) is an American actor famous for his roles in 1970s blaxploitation movies, as well as his portrayal of Huggy Bear in the 1970s TV series Starsky and Hutch.\n\nDescription above from the Wikipedia article Antonio Fargas, licensed under CC-BY-SA, full list of contributors on Wikipedia','1946-08-14',NULL),(1621,'Johnny Simmons','Montgomery, Alabama, USA','Johnny Simmons (born November 28, 1986) is an American actor. He is known for his roles as Dylan Baxter in Evan Almighty (2007), Chip Dove in Jennifer\'s Body (2009), \"Young Neil\" Nordegraf in Scott Pilgrim vs. the World (2010), Brad Hayes in The Perks of Being a Wallflower (2012), serial killer Adam \"Balloon Man\" Kemper in Elementary (2012), Peter Newmans in The Late Bloomer (2016), and Shane in Girlboss (2017).','1986-11-28',NULL),(1622,'Mark Damon','Chicago, Illinois, USA','Mark Damon (born Alan Harris on April 22, 1933, in Chicago, Illinois) was an American film actor and producer. He started his career in his native country, appearing in such films as Young and Dangerous (1957) and Roger Corman\'s House of Usher. In an attempt to boost his career, he relocated to Italy, where he starred in several spaghetti westerns and B-movies, playing either the hero or the antagonist. He eventually gave up acting in the mid-1970s to become a film producer.\n\nDescription above from the Wikipedia article Mark Damon, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1933-04-22','2024-05-12'),(1623,'Jay Williams','Winnipeg, Manitoba, Canada','','1969-09-22',NULL),(1624,'Robert Musgrave',NULL,'Robert Musgrave is known for Idiocracy (2006), Bottle Rocket (1996) and Drillbit Taylor (2008).',NULL,NULL),(1625,'Bill Thurman','Texas, USA','Character actor Bill Thurman was born on November 4, 1920 in Texas. A large, rugged, stocky man with a hard, lined, puffy face, a deep, twangy, amicable voice, a strong, bulky build and a charmingly low-key and down-to-earth unaffected natural screen presence, Thurman often portrayed police officers and assorted scruffy redneck types in a huge number of entertainingly cheap\'n\'cheesy Southern-fried fright flicks and delightfully down\'n\'dirty drive-in fare made throughout the 60s and 70s. Bill frequently acted in features for legendary Grade Z low-budget independent filmmaker Larry Buchanan; said movies include \"The Eye Creatures,\" \"High Yellow,\" \"Zontar the Thing from Venus,\" \"Mars Needs Women,\" \"Curse of the Swamp Creature,\" \"In the Year 2889,\" the especially atrocious \"It\'s Alive!,\" and \"A Bullet for Pretty Boy.\" Moreover, Thurman had bit parts in two Steven Spielberg films: he\'s a hillbilly hunter in \"The Sugerland Express\" and an air traffic controller in \"Close Encounters of the Third Kind.\" Bill\'s other memorable roles include the abusive Coach Popper in Peter Bogdanovich\'s magnificent \"The Last Picture Show,\" a doomed hitchhiker in \"Keep My Grave Open,\" a corrupt sheriff in the Claudia Jennings exploitation classic \"\'Gatorbait,\" a mean small town deputy in \"Ride in A Pink Car,\" a more amiable sheriff in the fantastic Bigfoot winner \"Creature from Black Lake,\" Cheryl \"Rainbeaux\" Smith\'s father in \"Slumber Party \'57,\" a priest in \"The Evictors,\" and the boozy, dissolute Reverend Bill McWiley in the enjoyably crummy \"Mountaintop Motel Massacre.\" Bill Thurman died in Dallas, Texas on April 13, 1995. - IMDb Mini Biography By: woodyanders','1920-11-04','1995-04-13'),(1626,'Kenny Sheard',NULL,'',NULL,NULL),(1627,'Robert Paradis',NULL,'',NULL,NULL),(1628,'Gilberto Canto',NULL,'',NULL,NULL),(1629,'Nana Funabiki',NULL,'',NULL,NULL),(1630,'Colin Lawrence','London, UK','Colin Lawrence (born September 7, 1970) was born in London but raised in Vancouver, Canada. Since 1991 he has participated in many TV series, either as guest star or in reoccurring roles. In 2004\'s TV series Battlestar Galactica he gained recognition as Hamish \"Skulls\" McCall. In the TV series Blade (2006) he was the protagonist\'s father. In the TV series Endgame (2011) he appeared as detective Jason Evans. Besides his career as a TV actor he also appeared in many feature films including Afghan Knights and Watchmen. Description above from the Wikipedia article Colin Lawrence, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-09-07',NULL),(1631,'Steffi Thake','Malta','Steffi was born in Malta. Having been involved in the performing arts since she was 3 years old she began acting professionally at the age of 19 when she joined the Malta Amateur Dramatic Club (MADC) and took part in a number of theatre productions. During the 2013 MADC One Act Play Festival, she was awarded the Best Actress award for her performance in Murder Play. Some other notable works include: Shakespeare\'s Much Ado About Nothing and A Midsummer Night\'s Dream, I\'ll Be Back Before Midnight, The Vagina Monologues, Image of an Unknown Young Woman and A Handbag. She has recently featured in a few of short and feature films; the latest being Do Re Mi Fa directed by Chris Zarb, and 13 Hours: The Secret Soldiers of Benghazi directed by Michael Bay.','1990-11-29',NULL),(1632,'Brad Renfro','Knoxville, Tennessee, USA','Brad Barron Renfro  (July 25, 1982 – January 15, 2008) was an American actor. was an American actor born on July 25, 1982 in Knoxville, Tennessee, to Angela Denise McCrory and Mark Renfro, a factory worker. He was discovered at age 10 by director Joel Schumacher and made his film debut cast in the lead role of the motion picture The Client (1994), which starred Susan Sarandon and Tommy Lee Jones. Although this would be his zenith, he went on to appear in other films, including The Cure (1995), Tom and Huck (1995), Sleepers (1996), and Apt Pupil (1998). He went on to star in a total of 21 feature films, several short films, and two television episodes during his career. Renfro won The Hollywood Reporter\'s Young Star Award in 1995 and was nominated as one of People magazine\'s \"Top 30 Under 30,\" though addiction problems in his teens and early 20s led to several police arrests and much of his later career was marred by a pattern of substance abuse which hampered his career. He died from a heroin overdose on January 15, 2008, at the young age of 25.','1982-07-25','2008-01-15'),(1633,'Ed Lauter','Long Beach, Long Island, New York, USA','An American actor. He has appeared in numerous movies and was a stand up comic before getting into acting. Lauter was born in Long Beach, Long Island, New York. His films include The Last American Hero (1973), Executive Action (1973), The Midnight Man (1974), The Longest Yard (1974), Breakheart Pass (1975), King Kong (1976), Magic (1978), Death Hunt (1981), Cujo (1983), Real Genius (1985), Girls Just Want To Have Fun (1985), Death Wish 3 (1985), Youngblood (1986), Raw Deal (1986), Revenge of the Nerds II: Nerds in Paradise (1987), The Rocketeer (1991), School Ties (1992), True Romance (1993), Under Wraps (1997) Not Another Teen Movie (2001), Purple Heart (2005), Camille (2007) and A Modern Twain Story: The Prince and the Pauper(2007). He starred with Bruce Dern, Barbara Harris, Karen Black and William Devane in the final film of director Alfred Hitchcock, Family Plot. Hitchcock was impressed by Lauter and asked him to play a major role in the romantic espionage thriller he planned as his next film; the director\'s failing health and eventual death in 1980 meant that The Short Night never went into production. Lauter\'s TV guest appearances include performances on Psych, The X-Files, Kojak, The A-Team, Booker, Charmed, Highlander: The Series, Star Trek: The Next Generation (as Lt. Cmdr. Albert in the season 5 episode \"The First Duty\"),The Equalizer and ER (with a recurring role as Fire Captain Dannaker).\n\nDescription above from the Wikipedia article Ed Lauter, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1938-10-30','2013-10-16'),(1634,'Robert De Niro','Greenwich Village, New York City, New York, USA','Robert Anthony De Niro (born August 17, 1943) is an American actor. Known for his collaborations with Martin Scorsese, he is considered to be one of the best actors of his generation. De Niro is the recipient of various accolades, including two Academy Awards, a Golden Globe Award, the Cecil B. DeMille Award, and a Screen Actors Guild Life Achievement Award. In 2009, De Niro received the Kennedy Center Honor, and earned a Presidential Medal of Freedom from U.S. President Barack Obama in 2016.\n\nDe Niro studied acting at HB Studio, Stella Adler Conservatory, and Lee Strasberg\'s Actors Studio. His first collaboration with Scorsese was with the 1973 film Mean Streets. De Niro earned two Academy Awards, one for Best Supporting Actor for his role as Vito Corleone in Francis Ford Coppola\'s The Godfather Part II (1974) and the other for Best Actor portraying Jake LaMotta in Scorsese\'s drama Raging Bull (1980). His other Oscar-nominated roles were for Taxi Driver (1976), The Deer Hunter (1978), Awakenings (1990), Cape Fear (1991), and Silver Linings Playbook (2012).\n\nOther notable roles include in 1900 (1976), The King of Comedy (1982), Once Upon a Time in America (1984), Brazil (1985), The Mission (1986), Goodfellas (1990), This Boy\'s Life (1993), Mary Shelley’s Frankenstein (1994), Heat (1995), Casino (1995), Jackie Brown (1997), The Good Shepherd (2006), Joker (2019), and The Irishman (2019). He made his directorial film debut with A Bronx Tale (1993). His comedic roles include Midnight Run (1988), Wag the Dog (1997), Analyze This (1999), the Meet the Parents films (2000-2010), and The Intern (2015).\n\nAlso known for his television roles, De Niro portrayed Bernie Madoff in the HBO film The Wizard of Lies (2017), earning a Primetime Emmy Award for Outstanding Lead Actor in a Limited Series or Movie nomination. He received further Emmy Award nominations for producing the Netflix limited series When They See Us (2019), and for portraying Robert Mueller on Saturday Night Live.[1]\n\nDe Niro and producer Jane Rosenthal founded the film and television production company TriBeCa Productions in 1989, which has produced several films alongside his own. Also with Rosenthal, he founded the Tribeca Film Festival in 2002. Six of De Niro\'s films have been inducted into the United States National Film Registry by the Library of Congress as \"culturally, historically, or aesthetically significant\".','1943-08-17',NULL),(1635,'Nileen Sandra',NULL,'',NULL,NULL),(1636,'Narain','Kolkata, India','Sunil Kumar, known by his stage name Narain, is an Indian film actor, who has starred in Malayalam and Tamil films. He made his debut in Adoor Gopalakrishnan\'s Nizhalkuthu, followed by performances in Malayalam films 4 the People, Achuvinte Amma, and Classmates.','1979-10-07',NULL),(1637,'Paz Vega','Seville, Andalusia, Spain','Paz Campos Trigo (born January 2, 1976), better known as Paz Vega, is a Spanish actress. She became popular for her performance in the comedy television series, 7 Vidas. Her notable film credits include Sex and Lucia (2001), Spanglish (2004), and Rambo: Last Blood (2019)','1976-01-02',NULL),(1638,'Huang Zhizhong','Tianjin, China','Huang Zhizhong is Chinese actor born in 5 March 1969 in Tianjin. Huang was a basketball player at a young age. After he retired from basketball team, he worked in Tianjin Textile manufacturing factory as a Machinist fitter. Later， he enter Tianjin Trade union Academy for a short training. In 1991, Huang attended the Central Academy of Drama, where he graduated in 1995. He has since gone on to star in numerous TV dramas and films, he is famous known by most audience since historical TV series The Road We Have Taken 2009','1969-03-05',NULL),(1639,'Breckyn Hager',NULL,'',NULL,NULL),(1640,'Yoo Ah-in','Daegu, South Korea','Yoo Ah-in is a South Korean Actor and Creative Director and Curator of Studio Concrete. Yoo Ah-in was selected by Riccardo Tisci to be the Burberry\'s only male global ambassador in 2019.','1986-10-06',NULL),(1641,'Chadwick Boseman','Anderson, South Carolina, USA','Chadwick Boseman was an American actor, playwright, and screenwriter hailing from Anderson, South Carolina. He graduated from Howard University and went on to study at the British American Dramatic Academy in Oxford.  Boseman\'s play \"Deep Azure\" was nominated for a 2006 Joseph Jefferson Award for New Work.  His breakout role was playing the lead Jackie Robinson in 2013\'s 42.\n\nBoseman was best remembered for portraying T’Challa/Black Panther in the Marvel Cinematic Universe. He has portrayed the character in Captain America: Civil War (2016), Black Panther (2018), Avengers: Infinity War (2018), and Avengers: Endgame (2019).','1976-11-29','2020-08-28'),(1642,'Tony Giorgio',NULL,'',NULL,NULL),(1643,'Soledad Miranda','Sevilla, Spain','Soledad Rendón Bueno (9 July 1943 – 18 August 1970), better known by her stage names Soledad Miranda or Susann Korda (or sometimes Susan Korday), was an actress who was born in Seville, Spain to Portuguese parents of Roma ancestry. She frequently starred in the films of Jess Franco, such as Count Dracula and Vampyros Lesbos. She died in a car accident on a Lisbon highway.\n\nDescription above from the Wikipedia article Soledad Miranda, licensed under CC-BY-SA, full list of contributors on Wikipedia','1943-07-09','1970-08-18'),(1644,'Arnoldo Foà','Ferrara, Italy','','1916-01-24','2014-11-01'),(1645,'Donald O\'Brien','Pau, France','Donal \"Donald\" O\'Brien (September 15, 1930) is a French-born Irish film and television actor. In his near 40-year career, O\'Brien appeared in dozens of stage performances and in more than 60 film and television productions.  O\'Brien was born in Pau, Pyrénées-Atlantiques, raised in both Northern France and Dublin, Ireland with his family, and made his feature film debut in 1953 with Anatole Litvak\'s war drama Act of Love. He studied acting in Dublin and initially joined the Gate Theatre at age 19 before making the transition to film several years later. O\'Brien\'s performance in The Train (1964), in which he played an SSFeldwebel, led to his first breakout role in Grand Prix (1966) starring alongside James Garner and Eva Marie Saint.','1930-09-15','2003-11-29'),(1646,'Anna Medley',NULL,'',NULL,NULL),(1647,'Alessandro Roja','Rome, Italy','','1978-06-04',NULL),(1648,'Morgan Thompson',' Australia','','1990-01-01',NULL),(1649,'Siyabulela Ramba',NULL,'',NULL,NULL),(1650,'Sarrett Williams',NULL,'',NULL,NULL),(1651,'Jacob Neayem',NULL,'',NULL,NULL),(1652,'Cheryl Lee Thorup',NULL,'',NULL,NULL),(1653,'Carl Ciarfalio','Alhambra, California, USA','Actor and Stuntman Carl Ciarfalio has played dozens of anonymous henchman roles in action movies such as Death Wish 4: The Crackdown, License to Kill, and Rapid Fire. He achieved cinematic notoriety by being the infamous victim of when Joe Pesci decided to put a rival gangster\'s head in a vice in Casino.','1953-11-12',NULL),(1654,'Bonnie Mak',NULL,'',NULL,NULL),(1655,'Sebastian St. Germain',NULL,'',NULL,NULL),(1656,'Aisha Eifert',NULL,'',NULL,NULL),(1657,'Tori Matsuzaka','Chigasaki, Kanagawa, Japan','Tori Matsuzaka is a Japanese film and television actor and model. He was born on October 17, 1988 in Kanagawa, Japan. He is known for \"The Blood of Wolves\" (2018), \"Call Boy\" (2018) and \"We Can\'t Change the World. But, We Wanna Build a School in Cambodia.\" (2011).','1988-10-17',NULL),(1658,'Richard Collier',NULL,'',NULL,NULL),(1659,'Christian Ackerman',NULL,'',NULL,NULL),(1660,'Joshua Lee',NULL,'',NULL,NULL),(1661,'Mathew Botuchis','Cincinnati, Ohio, USA','','1983-09-28',NULL),(1662,'Katrina Despain',NULL,'',NULL,NULL),(1663,'Zhihui Chen','Chengde, Heibei Province, China','','1970-12-13',NULL),(1664,'Jacob Audirsch',NULL,'',NULL,NULL),(1665,'Craig Roberts','Newport, Wales','Craig Haydn Roberts  is a Welsh actor, writer and director. He is best known for playing the lead role of Oliver Tate in \"Submarine\", a coming-of-age comedy-drama, set in Swansea.\n\nRoberts was born in Newport, Wales, the son of Alison and Haydn Roberts, but was raised in Bargoed, Caerphilly.','1991-01-21',NULL),(1666,'Peter Dobson','Red Bank, New Jersey, USA','Peter Dobson (born July 19, 1964) is an American actor. His film roles include appearances in Sing (1989), Last Exit to Brooklyn (1989), The Marrying Man (1991), The Frighteners (1996), and Drowning Mona (2000), in addition to a cameo as Elvis Presley in Forrest Gump (1994). On television, he starred as the title character in the CBS comedy Johnny Bago (1993) and the lead of the USA Network comedy-drama Cover Me (2000–2001).','1964-07-19',NULL),(1667,'Yu-Hang To','Hong Kong, China','Dennis To Yu-hang (born 1 January 1981) is a Hong Kong martial artist and actor. He started his career as a wushu practitioner and won several awards at various competitions, including a silver medal at the 2002 Asian Games and a gold medal at the 2005 East Asian Games t to became an actor in 2007 and started off by playing minor roles in Ip Man(2008), Bodyguards and Assassins (2009) and Ip Man 2 (2010). He is best known for his role as the Wing Chun grandmaster Ip Man in the 2010 film The Legend Is Born - Ip Man. (Wikipedia)','1981-01-01',NULL),(1668,'Maurizio Streccioni',NULL,'',NULL,NULL),(1669,'Lauren Chavez-Myers',NULL,'',NULL,NULL),(1670,'Cooper Justin Grisham',NULL,'',NULL,NULL),(1671,'Charlie Kerr','Vancouver, British Columbia, Canada','Charlie Kerr is a Canadian actor, musician and playwright.',NULL,NULL),(1672,'Michael Wincott','Toronto, Ontario, Canada','Michael Anthony Claudio Wincott (born January 21, 1958) is a Canadian actor. His deep, raspy voice has often led to his being cast in villainous roles.','1958-01-21',NULL),(1673,'Phil Cheadle',NULL,'',NULL,NULL),(1674,'John Cenatiempo','New York City, New York, USA','John Cenatiempo, born March 5, 1963 (age 59) in New York City, New York, USA, is an actor and stunt co-ordinator. He has a recurring co-starring role in the first season as Vincent Lamb. He is known for his work as the stunt co-ordinator of the series Law & Order: Criminal Intent and as a stunt performer in the films The Good Shepherd (2006), American Gangster (2007), and The Bourne Ultimatum (2007).','1963-03-05',NULL),(1675,'Davide Zanfrisco',NULL,'',NULL,NULL),(1676,'Alexandra Kamp','Baden-Baden, Germany','Alexandra Kamp-Groeneveld (born 29 December 1966) is a German model and actress.\n\nShe was born in Karlsruhe to Peter Kamp and his wife and grew up in Baden-Baden. She visited drama schools in New York, Los Angeles and Paris before she started her career as an actress in 1994. She has had many star and supporting roles in German movies and TV series and some in Hollywood B-movies. In 1998, she acted together with Claudia Cardinale in Riches, belles, etc., in 2001 with Leslie Nielsen in 2001: A Space Travesty and in 2003 she played the star role in Sumuru together with Michael Shanks in an English-South African co-production. In 2007 she appeared as a covergirl on the German issue of the Playboy. Alexandra is the spokeswoman for the children\'s hospital \"Kinderhospiz St. Nikolaus\" in the Bavarian Alps, which gives a care home to terminally ill children and their parents. She frequently gives charity readings.','1966-12-29',NULL),(1677,'Sarah Ellen Stephens',NULL,'',NULL,NULL),(1678,'Harold J. Stone','New York City, New York, USA','From Wikipedia, the free encyclopedia.  Harold J. Stone (March 3, 1913 – November 18, 2005) was an American film and television character actor.\n\nBorn Harold Hochstein to a Jewish acting family, he began his career on Broadway in 1939 and appeared in five plays in the next six years, including One Touch of Venus and Stalag 17, following which he made his motion picture debut in the Alan Ladd film noir classic The Blue Dahlia (1946). He went on to work in small but memorable roles in such films as The Harder They Fall with Humphrey Bogart (1956), Alfred Hitchcock\'s The Wrong Man (1956), Somebody Up There Likes Me (1956), Spartacus (1960) and Girl Happy (1965). Although he would go on to perform secondary roles in a number of films, he became a recognizable face to television viewers for his more than 150 guest appearances on numerous shows dating from the 1950s to the early 1980s including but not limited to The Restless Gun, United States Marshal, The Barbara Stanwyck Show, I Spy, The Virginian, Griff, The Untouchables, The Twilight Zone, Hogan\'s Heroes and Get Smart. In the 1961-1962 season, he appeared three times in Stephen McNally\'s ABC crime drama Target: The Corruptors!. In 1963, he appeared with Marsha Hunt in the ABC medical drama Breaking Point in an episode which was nominated for an Emmy Award for writing. In Sept. 1964,Stone appeared in popular TV series, Bonanza (in an episode entitled -\'The Hostage\').Stone himself was nominated for an Emmy for Outstanding Single Performance by an Actor in a Leading Role for his role in The Nurses.\n\nIn the 1960s and 1970s, while continuing to work in television, most notably as a regular on 1973\'s short-lived Bridget Loves Bernie, Stone returned to the stage, directing several off-Broadway and Broadway productions, including Ernest in Love and Charley\'s Aunt.\n\n \n\nDescription above from the Wikipedia article Harold J. Stone, licensed under CC-BY-SA, full list of contributors on Wikipedia.   ','1913-03-03','2005-11-18'),(1679,'Lynette Ruiz',NULL,'',NULL,NULL),(1680,'Lala Kent','Salt Lake City, Utah, USA','Lala Kent (September 2, 1990) rose to fame on Bravo’s Vanderpump Rules and has since become a wildly popular media personality. She is the founder of Give Them Lala Beauty and has appeared in films such as The Row, Vault, Axis Sally, and Hard Kill. In 2022, Kent released her first book titled Give Them Lala.','1990-09-02',NULL),(1681,'John DiResta',NULL,'',NULL,NULL),(1682,'Emanuel Brooks',NULL,'',NULL,NULL),(1683,'Mike Epps','Indianapolis, Indiana, USA','From Wikipedia, the free encyclopedia.\n\nMichael Elliot \"Mike\" Epps (born November 18, 1970) is an American stand-up comedian, actor, film producer, writer, singer, musician, and rapper, best known for playing Day-Day Jones in Next Friday and the sequel-to-the-sequel, Friday After Next, and also starring alongside Ice Cube in All About The Benjamins. He is known as the new voice of Boog in Open Season 2 and Open Season 3.\n\nAs of 2010, Epps was the executive producer on a documentary about the life story of a former member of Tupac Shakur\'s Outlawz, Napoleon: Life Of An Outlaw.\n\nDescription above from the Wikipedia article Mike Epps, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-11-18',NULL),(1684,'Hu Ming','Yan\'an, Shaanxi Province, China','','1970-12-18',NULL),(1685,'Boubacar Babiane',NULL,'',NULL,NULL),(1686,'Ori Pfeffer','Gerusalemme, Israele','','1975-07-28',NULL),(1687,'Elisa Bachir Bey',NULL,'','1990-03-17',NULL),(1688,'Liam McMahon',NULL,'',NULL,NULL),(1689,'Aldine Müller','São José dos Ausentes, Rio Grande do Sul, Brazil','Aldine Müller (born Aldina Rodrigues Raspini, 8 October 1953, São José dos Ausentes, Brazil) is a Brazilian actress. She was a key figure in the sexploitation film genre known as Pornochanchada in Brazil in the 1970s.  Müller was born in 1953 to a Portuguese mother and an Italian father. She was married and has an adult son, Cézar Raspini da Fonseca.','1953-10-08',NULL),(1690,'Amanda Peet','New York City, New York, USA','Amanda Peet (born January 11, 1972) is an American actress, writer and producer. She began her career with small parts on television, and made her feature film debut in Animal Room (1995). Her portrayal of Jill St. Claire in The Whole Nine Yards (2000) brought her wider recognition, and she has since appeared in a variety of films, such as Saving Silverman (2001), High Crimes; Changing Lanes; Igby Goes Down (all 2002), Something\'s Gotta Give (2003), Identity (2003), Melinda and Melinda (2004), A Lot Like Love (2005), Syriana (2005), Battle for Terra (2007), Martian Child (2008), The X-Files: I Want to Believe (2008), Please Give (2010), Gulliver\'s Travels (2010), The Way, Way Back (2013), Identity Thief (2013), and Trust Me (2013).\n\nOn television, Peet starred as Jacqueline Barrett on The WB\'s Jack & Jill (1999–2001), as Tina Morris on HBO\'s Togetherness (2015–2016), as Jules on IFC\'s Brockmire (2016–2020), and as Betty Broderick on the second season of Dirty John in 2020. She wrote and co-executive produced the Netflix series The Chair that was released in 2021.\n\nDescription above from the Wikipedia article Amanda Peet, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1972-01-11',NULL),(1691,'Max Elliott Slade','Pasadena, California, USA','Max Elliott Slade (born July 4, 1980) is an American actor who starred in 3 Ninjas, 3 Ninjas Kick Back, and 3 Ninjas Knuckle Up. He was featured as Jay Lovell in Apollo 13, young Mark Goddard in The Sweeper, and young Gil Buckman in Parenthood. Slade was born in Pasadena, California. He chose his own middle name, Elliott, at the age of 3 after watching the movie E.T. His parents\' names are John and Betty, and has an older brother named Demian. All of them are, or at one time were, actors. He attended Pasadena High School, where he co-founded a rock and roll club called Three Broken Chords and The Lying Truth. Slade earned a brown belt in Gosoku-ryu karate at age 11. Slade previously worked as a bartender. He plays guitar and sings in a band called Haden. He holds a bachelor\'s degree in Anthropology from the University of Southern California.\n\nDescription above from the Wikipedia Max Elliott Slade, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1980-07-04',NULL),(1692,'Kevin Allen','Gosport, Hampshire, England, UK','Kevin Allen is an English-born Welsh screenwriter, film director, film producer and actor. In 1997 he directed and wrote the cult Welsh black comedy feature \"Twin Town\". He also directed the films \"The Big Tease\" and \"Agent Cody Banks 2: Destination London\" and hit TV series \"Benidorm\".  He is the younger brother of comedian and actor Keith Allen and uncle of singer Lily Allen .\n\nAllen first came to national prominence in 1990 when he documented an England fan\'s eye view of the 1990 FIFA World Cup Finals in Italy with his camcorder for the BBC series \"Video Diaries\" in an episode entitled \"On The March With Bobby\'s Army\". Kevin\'s first acting roles came by way of \"The Comic Strip\" and progressed to the BBC sitcom \"The Thin Blue Line\" and many other theatre and TV roles. He also wrote and directed several documentaries for the BBC in the 1990s.','1959-09-15',NULL),(1693,'Tom Stevens','Vancouver, British Columbia, Canada','Thomas James \"Tom\" Stevens (born June 24, 1987) is a Canadian actor, producer, and musician. He is best known for his role as Jason Higgins on Fox TV\'s Wayward Pines. Stevens regularly performs in theatre in Vancouver and received critical acclaim for his role as \"Jerry\" in The Zoo Story during Vancouver\'s 2014 Fringe Festival season. In 2016, he won a Leo Award for Best Actor in a Guest Starring Role for Wayward Pines.','1987-06-24',NULL),(1694,'Jesus Jr.',NULL,'',NULL,NULL),(1695,'Aleksandr Lukanichev','USSR','','1971-11-23',NULL),(1696,'Jolene Andersen',NULL,'',NULL,NULL),(1697,'Peter Stormare','Arbrå, Gävleborgs län, Sweden','A Swedish film, stage, voice and television actor as well as a theatrical director, playwright and musician. He is perhaps best known for his roles as John Abruzzi in Prison Break and as Gaear Grimsrud, one of the two kidnappers in Fargo.\n\nPeter Stormare began his acting career at the Royal National Theatre of Sweden, performing for eleven years. In 1990 he became the Associate Artistic Director at the Tokyo Globe Theatre and directed productions of many Shakespeare plays, including \"Hamlet\". In 1993 he moved to New York, where he appeared in English productions. He continues to work in both the United States and his his homeland of Sweden. He resides in Los Angeles, California, USA, with his wife.','1953-08-27',NULL),(1698,'Christopher M. Jimenez',NULL,'',NULL,NULL),(1699,'Chelsey Earlywine',NULL,'',NULL,NULL),(1700,'Chanelle Lamothe',NULL,'',NULL,NULL),(1701,'Ryan Nolan',NULL,'',NULL,NULL),(1702,'Dwayne Cameron','Auckland, New Zealand','Dwayne Cameron was born October 28 1981 in Auckland New Zealand. Age ten his father was killed when he was hit by a train. Landed his first role opposite William Shatner. Starred in Disturbing the Peace (2020) with Guy Pearce, with Nicolas Cage in 211 (2018) and in Roger Donaldson\'s McLaren (2017). Played love interest to Amber Heard and Selma Blair and also starred alongside John Savage. His career took off when he was cast for the lead role of Bray in the cult TV series The Tribe (1999). By the age of 18 he had completed 156 episodes of The Tribe and had been on a number of publicity tours to Europe and the USA, appearing in all major youth media to promote the show and spin-off album. He represented The Tribe in Los Angeles when it was a nominee at the 2000 GAIT Awards for international television drama. Dwayne has written, directed, produced, edited and starred in a number of his own short films made by his production company Dancing Mind Films.','1981-10-28',NULL),(1703,'Stephen Harwick',NULL,'',NULL,NULL),(1704,'Rye Rye','Baltimore, Maryland, USA','Ryeisha Berrain (born November 25, 1990), known by her stage name Rye Rye, is an American rapper, singer, dancer and actress. Signed to N.E.E.T. Recordings, she released her first mixtape RYEot PowRR in 2011 and her anticipated debut album Go! Pop! Bang! on May 15, 2012. In early 2009, MSNBC listed Rye Rye as one of the \"5Top: Top of the pops! Up-and coming young singers.\" In 2011, Rye Rye was named one of Billboard\'s \"21 Under 21\". Rye Rye made her acting debut in the 2012 film 21 Jump Street.','1990-11-25',NULL),(1705,'Bian Yang',NULL,'',NULL,NULL),(1706,'Ferdinand Schumann-Heink','Hamburg, Germany','','1893-08-09','1958-09-15'),(1707,'Brian Manning',NULL,'',NULL,NULL),(1708,'Tig Fong',NULL,'',NULL,NULL),(1709,'David Denman','Newport Beach, California, USA','From Wikipedia, the free encyclopedia.\n\nDavid Denman (born July 25, 1973) is an American film and television actor. As of 2011, Denman stars in the Fox comedy series Traffic Light.\n\nDescription above from the Wikipedia article David Denman, licensed under CC-BY-SA, full list of contributors on Wikipedia','1973-07-25',NULL),(1710,'Tyler Forrest','Hammond, Louisiana, USA','','1989-05-02',NULL),(1711,'Lydia Hull','American Samoa','Lydia Hull is an American actress and producer.','1986-05-12',NULL),(1712,'Alexander Siddig','Omdurman, Sudan','Siddig El Tahir El Fadil El Siddig Abderrahman Mohammed Ahmed Abdel Karim El Mahdi (born November 21, 1965) is a Sudanese-born English actor, also known as Siddig El Fadil and his stage name Alexander Siddig.\n\nHe is known for playing Dr. Julian Bashir in the television series Star Trek: Deep Space Nine, and for his performances as Prince Nasir Al-Subaai in Syriana (2005) and as Imad ad-Din al-Isfahani in Kingdom of Heaven (2005). He has also guest starred on 24 as Hamri Al-Assad. Siddig co-starred in the award-winning film Cairo Time (2009) as Tareq Khalifa.','1965-11-21',NULL),(1713,'Jason A. Iannacone',NULL,'',NULL,NULL),(1714,'Eiki Kitamura',NULL,'',NULL,NULL),(1715,'Amanda Cerny','Pittsburgh, Pennsylvania, USA','Amanda Cerny was born in Pittsburgh, Pennsylvania, and attended Florida State University. She was Playboy\'s playmate of the month in October 2011 and started her modeling career soon afterwards. A social media star, Cerny has four million followers on Vine, where she posts comedic videos. Her first film credit was The Bet (2016). She lives in Los Angeles, California.','1991-06-26',NULL),(1716,'Loucas Minchillo',NULL,'',NULL,NULL),(1717,'Nilton Nicola',NULL,'',NULL,NULL),(1718,'Qi Dao','Fuyang,Anhui,China','','1975-01-26',NULL),(1719,'John Capodice','Chicago, Illinois, USA','John Capodice (born December 25, 1941) is an American character actor.\n\nCapodice was born in Chicago, Illinois. He began his film and television career in the late 1970s. His first role was in the ABC-TV soap opera Ryan\'s Hope, where he appeared in six episodes as Lloyd Lord. He had guest roles on numerous other TV series, including Spenser: For Hire, Kate & Allie, Seinfeld, Murder She Wrote, Murphy Brown, Knots Landing, Hunter, and Law & Order. He appeared on the series Moonlighting in 1989 and performed as a guest star in an episode of NBC-TV\'s Will & Grace (episode 1.21), in the role of the repairman who suffers a heart attack.\n\nHis most recent TV appearances were on The West Wing, Six Feet Under and CSI: Crime Scene Investigation.\n\nIn a memorable 1980s television ad for Polly-O String Cheese, Capodice portrayed Fred, a dumbfounded pizzeria owner, who is asked by three teens to make a pizza with extra cheese, but to hold the tomato sauce, and the crust. Essentially a pizza, with \"nuttin.\" He also appeared as a trucker who gives medical advice in a popular ad for Dimetapp Cold Medicine.\n\nCapodice has also worked in the theatre, appearing mainly in Off-Broadway productions. He appeared as a prison guard in the play Getting Out at the Marymount Manhattan Theatre in October/November 1978 and at the Lucille Lortel Theatre from May 1979 to December 1980. The play won two Outer Critics Circle Awards in 1979. Capodice appeared in the Broadway production of Requiem For a Heavyweight, opposite John Lithgow, George Segal, and John C. McGinley.\n\nCapodice appeared as Doyle in the 1982 film Q and in the 1989 film Family Business as Tommy. Other film appearances are in the 1991 Oliver Stone film The Doors and the 1989 comedy See No Evil, Hear No Evil, where he appears as a police detective. He had roles in Ace Ventura: Pet Detective, Naked Gun 33+1⁄3: The Final Insult (1994), Speed (1994), Independence Day (1996), and Enemy of the State (1998). He provides the voice of Sidney Pen in the 2010 video game Mafia II.','1941-12-25',NULL),(1720,'Louise Tu\'u',NULL,'',NULL,NULL),(1721,'Sapir Azulay','Israel','Sapir Azulay is an accomplished film and television actress, singer, dancer, writer and producer who is quickly establishing herself as a force to be reckoned with in Hollywood. A former Captain in the Israeli Defense Force, she served as Tank Commander, is trained in martial arts, Krav-Maga, and is proficient in operating heavy machine guns and tanks. She also has 11 years of dance training and is fluent in both Hebrew and English.\n\nSapir made her TV debut recurring in the ABC Comedy show, \"Selfie\" in the role of Thistle. Her other television credits include guest starring roles on \"Teachers\", \"Adam Astra Casting\" as well as recurring appearances on ABC\'s \"Castle\". Sapir can be seen playing a Russian brothel queen in the sex trafficking world, in the film \"Trafficked\" starring Ashley Judd and Anne Archer.\n\nSapir Azulay has recently signed on to the new Nicolas Cage bank heist drama \"#211\" where she will be playing the role of Officer Jacobs, Nicholas\' tough, badass partner! Filming starts May 2017. She has also landed a lead supporting role on the new Netflix film \"The Angel,\" where she can be seen playing Souad, a chic Kuwaiti woman.\n\nSapir has also produced over a dozen short films. Her most recently produced film, \"Manolita\", made it to Cannes Film Festival in 2016.',NULL,NULL),(1722,'Ophélie Winter','Boulogne-Billancourt, Hauts-de-Seine, France','Ophélie Kleerekoper-Winter (born 20 February 1974) is a French pop and R&B singer and actress. She is the daughter of Dutch singer David Alexandre Winter and French fashion model Catherine Fefeu. She rose to prominence in much of Europe after signing with EastWest Records in 1995 and released her hit song \"Dieu m\'a donné la foi\" which reached number one on the French singles chart as well as other hits: \"le feu qui m\'attise\", \"Shame on U\", \"Elle Pleure\"\" and \"Sache\"\".\n\nWinter was born in Boulogne-Billancourt, Hauts-de-Seine. Her father David Alexandre Winter was a Dutch pop singer who had some success during the 1970s, while her mother Catherine Fefeu was a French fashion model, who is now her agent. Her brother Michael is a singer and TV presenter.\n\nHer parents divorced when she was just two years old and she moved to Paris with her mother and brother, while her father left for the United States. In 1984, at the age of 10, she recorded her first song in France, La Chanson des Klaxons and three years later another song, Poil de Carotte, in French. At the age of 17, she was discovered by a modeling agent on the Champs-Élysées in Paris and after three years of modeling, she decided to become a singer and an actress.\n\nOphélie Winter has released four studio albums starting in 1996, with her debut album, No Soucy!, which her brother collaborated on, Privacy, Explicit Lyrics and Résurrection. The singer Prince wrote her a song. It was announced at one point that Prince intended The Most Beautiful Girl In The World, to be recorded in multiple languages by local artists, but it is unknown how many of these recordings took place; one recording that was made was Le Garçon Le Plus Beau Dans L’Univers by French model and actress Ophélie Winter (intended for a single, Le Garçon Le Plus Beau Dans L’Univers), but this remains unreleased. Ophélie Winter was a featured model in a photoshoot with Prince/0)+> in 1995, holding his gold symbol guitar.\n\nIn 2014, she participated in the fifth season of Danse avec les stars, the French version of Dancing with the Stars. She was partnered with professional dancer Christophe Licata. On October 10, 2014, they were eliminated finishing 10th out of 11 contestants.\n\nShe currently resides in Paris making various TV appearances. Her look-alike puppet is in the French show \"Les Guignols de l\'info\" (1988).\n\nSource: Article \"Ophélie Winter\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1974-02-20',NULL),(1723,'Lionel Stander','The Bronx, New York City, New York, USA','Lionel Stander was an American stage, screen, radio, and television actor.','1908-01-11','1994-11-30'),(1724,'Kevin Hummel',NULL,'','1982-08-12',NULL),(1725,'Geo Corvera',NULL,'',NULL,NULL),(1726,'Sean Whalen','Washington, District of Columbia, USA','From Wikipedia, the free encyclopedia\n\nSean M. Whalen (born May 19, 1964) is an American film, television, and stage actor. Whalen was born in Washington D.C. in 1964, the youngest of four children, he was raised in Silver Spring/Olney, Maryland. He attended Sherwood High School and graduated from UCLA. He worked as a waiter while studying and performing at The Groundlings Theater. He appeared in commercials and in 1991, his first film, The People Under the Stairs. Whalen may be best known for the first \"Got Milk?\" commercial, in which his character tries in vain, after taking a large bite of a peanut butter sandwich, to answer a radio host\'s question about the famous Burr-Hamilton duel. Whalen also starred in a DiGiorno pizza commercial, in which his character and a friend enjoy a Chicago-style pizza in Tucson, Arizona, as well as the short-lived 2001 television program, Special Unit 2.\n\nWhalen has appeared in several television shows, including The Suite Life of Zack and Cody as a radio station host, Hannah Montana as a worker at a Make A Moose store in a Moose Costume, Scrubs as an X-ray technician. He appeared in the film, The Last Day of Summer and as a ghost on a Wizards of Waverly Place episode called \"Halloween\". Whalen also played Neil, also known as \"Frogurt\", one of the plane crash survivors, in a mobisode and three episodes of Lost.','1964-05-19',NULL),(1727,'Thomas Henning',NULL,'',NULL,NULL),(1728,'Louis Lombardi','The Bronx, New York City, New York, USA','Louis Lombardi (born January 17, 1968) is an American actor known for his roles in The Sopranos, Fantasy Island, and 24.','1968-01-17',NULL),(1729,'Ray DeBenedictis',NULL,'',NULL,NULL),(1730,'Elaine Kagan','St. Louis, Missouri, USA','Elaine Kagan was born in St. Louis, Missouri, USA. She is known for Coming to America (1988), Quarantine (2008) and Goodfellas (1990).',NULL,NULL),(1731,'András Korcsmáros','Budapest, Hungary','','1985-08-10',NULL),(1732,'John Krasinski','Boston, Massachusetts, USA','John Burke Krasinski (born October 20, 1979) is an American actor, film director and writer. He is widely known for playing Jim Halpert on the NBC sitcom The Office from 2005 to 2013. He has also appeared in several films including License to Wed (2007), Leatherheads (2008), Away We Go (2009), It\'s Complicated (2009), Something Borrowed (2011), Aloha (2015), 13 Hours: The Secret Soldiers of Benghazi (2016), Detroit (2017), and A Quiet Place (2018), which he also directed and co-wrote. Also in 2018, Krasinski returned to television portraying the titular character in the Amazon series Jack Ryan.','1979-10-20',NULL),(1733,'Joe Rosario',NULL,'',NULL,NULL),(1734,'Dominic Fumusa','Madison, Wisconsin, USA','Dominic Fumusa is an American stage and screen actor, best known for his role in the comedy drama series \"Nurse Jackie\" on Showtime.','1969-09-13',NULL),(1735,'Brianna Ferris',NULL,'',NULL,NULL),(1736,'Reza Rahadian','Bogor','Reza Rahadian is an Indonesian actor who rose to prominence following his role in Woman with a Turban. Born in Bogor, he took up acting while in senior high school and made his feature film debut in 2004. Since receiving his first Citra Award in 2009, he has acted in over a dozen films, ranging from comedies and romances to dramas and biopics.','1987-03-05',NULL),(1737,'Josef Davies',NULL,'Josef Davies is a British actor.',NULL,NULL),(1738,'Gina Gershon','San Fernando Valley, California, USA','Gina L. Gershon (born June 10, 1962) is an American film, television and stage actress, singer and author. She is known for her roles in the films Cocktail (1988), Showgirls (1995), Bound (1996), Face/Off (1997), The Insider (1999), Demonlover (2002), P.S. I Love You (2007), Five Minarets in New York (2010), Killer Joe (2011) and House of Versace (2013). She has also had supporting roles in FX\'s Rescue Me and HBO\'s How to Make It in America.','1962-06-10',NULL),(1739,'Dean Norris','South Bend, Indiana, USA','Dean Joseph Norris (born April 8, 1963 height 5\' 7\" (1,70 m)) is an American actor, best known for portraying DEA agent Hank Schrader on the AMC series Breaking Bad (2008–2013) and town selectman James \"Big Jim\" Rennie on the CBS series Under the Dome (2013–present). He has also appeared in films such as Lethal Weapon 2 (1989), Total Recall (1990), Terminator 2: Judgment Day (1991), Starship Troopers (1997), Little Miss Sunshine (2006), and Evan Almighty (2007).\n\nNorris was born in South Bend, Indiana, to Jack, a furniture store owner, and Rosie Norris. He has four sisters. Norris graduated from Clay High School in 1981, where he says he got straight A\'s. He is a 1985 graduate of Harvard College, where he majored in social studies. He also attended the Royal Academy of Dramatic Art.','1963-04-08',NULL),(1740,'Ambyr Childers','Murrieta, California, USA','From Wikipedia, the free encyclopedia\n\nChilders was born in Cottonwood, Arizona and raised in Murrieta, California. Childers attended Vista Murrieta High School. After appearing in the 2003 film Dickie Roberts: Former Child Star, Childers became established for her role on the daytime soap opera All My Children as Colby Chandler, whom she portrayed from 2006 to 2008. She also played Elizabeth \"E\" Dodd in The Master. Childers is married to movie producer Randall Emmett and their daughter, London, was born on February 2, 2010.','1988-07-18',NULL),(1741,'Omero Capanna','Rome, Lazio, Italy','','1942-04-04','2003-10-11'),(1742,'John Bostic',NULL,'',NULL,NULL),(1743,'Bruce Mitchell','Freeport, Illinois, USA','Bruce Mitchell was born on November 16, 1880 in Freeport, Illinois, USA as James Bruce Mitchell. He was an actor, known for Whistling Bullets (1937), I Cover Chinatown (1936) and Pride of the West (1938). He died on September 26, 1952 in Hollywood, California, USA.','1880-11-15','1952-09-26'),(1744,'Kenichi Ogata','Tagawa, Fukuoka, Japan','Kenichi Ogata (緒方 賢一) is a Japanese voice actor.','1942-03-29',NULL),(1745,'Terence Keely',NULL,'',NULL,NULL),(1746,'Alex Fong Lik-Sun','Hong Kong, China','Alex Fong (方力申, Fong Lik-Sun; born 26 February 1980) is a Hong Kong actor, singer, and swimmer. He was nicknamed \"LittleFlying Fish\" for his swimming achievements. As of 2016, Fong still holds several Hong Kong swimming records (and some youth-grade records). He first represented Hong Kong at the age of 11. Fong has also represented Hong Kong at the Sydney Olympics in 2000. He holds a degree in Business Administration from the University of Hong Kong. Fong caught the attention of record executives with his popularity amongst teenage girls and became a singer in 2001.','1980-02-26',NULL),(1747,'Shirley Raun',NULL,'',NULL,NULL),(1748,'Kamal Chopra',NULL,'',NULL,NULL),(1749,'Christopher Matthew Cook','USA','Christopher Matthew Cook is known for Dog Eat Dog (2016), 2 Guns (2013) and The Walking Dead (2010).',NULL,NULL),(1750,'Marc Ewins','Boise, Idaho, USA','','1985-08-11',NULL),(1751,'Brian Read',NULL,'',NULL,NULL),(1752,'Gustavo Cardozo',NULL,'',NULL,NULL),(1753,'Mica Javier',NULL,'',NULL,NULL),(1754,'James Cullen Bressack','Los Angeles, California, USA','','1992-02-29',NULL),(1755,'Vincent Regan','Swansea, Wales','Vincent Regan (born May 16, 1965) is a British film and television actor.Regan has over 15 stage roles to his credit, most recently as Achilles in Troilus and Cressida at the Edinburgh International Festival. In association with The Royal Shakespeare Company, the festival presented director Peter Stein\'s strongly cast and visually striking production. He is famous for Ancient Greece-based films 300, in which he played the Captain, Troy, where he played Eudorus, Achilles\' second in command, and Clash of the Titans, in which he played King Cepheus. Regan is also a screenwriter and director, developing projects for his own film company. His script, Come Like Shadows, is an accessible but classic interpretation of Macbeth headlining Sean Bean and Tilda Swinton, will be directed by John Maybury. He also appeared briefly as a sexually confused character in British 