ed the thrash metal band Body Count, which he introduced in his 1991 album O.G.: Original Gangster. Body Count released its self-titled debut album in 1992. Ice-T encountered controversy over his track \"Cop Killer\", which was perceived to glamorize killing police officers. Ice-T asked to be released from his contract with Warner Bros. Records, and his next solo album, Home Invasion was released later in the Fall of 1993 through Priority Records. Body Count\'s next album was released in 1994, and Ice-T released two more albums in the late 1990s.  Since 2000, he has portrayed NYPD Detective Odafin Tutuola on the NBC police drama Law & Order: Special Victims Unit.','1958-02-16',NULL),(1768,'Tsuyoshi Ihara','Fukuoka, Japan','Tsuyoshi Ihara (Ihara Tsuyoshi, birth name: Ihara Tsuyoshi) is a Japanese actor of Korean descent, born on November 6, 1963 in Kitakyūshū, and who grew up in Ikuno-ku, Osaka. He is a graduate of Imamiya Senior High School, situated in Naniwa-ku, Osaka. Ihara is represented by the K Dash agency.','1963-11-06',NULL),(1769,'Thom Allison','Winnipeg, Canada','Thom Allison (born November 11th, 1971) is a Canadian actor.','1971-11-11',NULL),(1770,'Leon Laderach',NULL,'',NULL,NULL),(1771,'José Garcia','Paris, France','José Doval Garcia (born 17 March 1966), sometimes credited as José Luis Garcia, is a Spanish-French film and television actor. He was born as José Doval in Paris, France. At age 20, he follows two years of training in free class comedian Cours Florent in Paris with Francis Huster as a teacher. He completed his training through the Annie Fratellini Circus School (where he met his future wife Isabelle Doval) and following the course of the Actors Studio taught in France. He also holds an accounting BEP. Since 1989, Garcia has made acting appearances in over forty-five films. Additionally, he has made appearances, some in acting roles but mostly as himself, in over twenty television productions.','1966-03-17',NULL),(1772,'Anson Boon','Cambridge