,'Yasunori Masutani (増谷 康紀, Masutani Yasunori, born July 5, 1961) is a Japanese voice actor and narrator born in Sapporo, Hokkaido. He is affiliated with Aoni Production.','1961-07-05',NULL),(1800,'Djair Guilherme',NULL,'',NULL,NULL),(1801,'Gus Rhodes',NULL,'',NULL,NULL),(1802,'Zhu Jiazhen',NULL,'',NULL,NULL),(1803,'Aidan Gillen','Dublin, Ireland','Aidan Murphy (born 24 April 1968), better known as Aidan Gillen, is an Irish actor. He is the recipient of three Irish Film & Television Awards and has been nominated for a British Academy Television Award, a British Independent Film Award, and a Tony Award.\n\nOn television, he played Stuart Alan Jones in the Channel 4 series Queer as Folk (1999–2000), Tommy Carcetti in the HBO series The Wire (2004–2008), John Boy in the RTÉ series Love/Hate (2010–2011), Petyr \"Littlefinger\" Baelish in the HBO series Game of Thrones (2011–2017), and Dr. J. Allen Hynek in The History Channel\'s Project Blue Book (2019–2020). Gillen also featured as Aberama Gold in the BBC TV drama series “Peaky Blinders” 2017-2019. In 2021, he appeared in the crime dramas Mayor of Kingstown and Kin.\n\nHis film roles include Miles Jackson in 12 Rounds (2009), CIA operative Bill Wilson in The Dark Knight Rises (2012), Janson in Maze Runner: The Scorch Trials (2015) and Maze Runner: The Death Cure (2018), Robert in The Lovers (2017), Queen\'s manager John Reid in Bohemian Rhapsody (2018), and Jack Blackwell in Those Who Wish Me Dead (2021). He also provided the voice and motion capture for Paul Serene in the 2016 video game Quantum Break.','1968-04-24',NULL),(1804,'Frederick Malahieude',NULL,'Frederick Malahieude is known for 3 Days to Kill (2014), The Fall of Men (2015) and One Man and His Cow (2016).',NULL,NULL),(1805,'Anna Burgess',NULL,'',NULL,NULL),(1806,'Mo\'Nique','Woodlawn, Maryland, USA','From Wikipedia, the free encyclopedia.\n\nMonica Imes (born December 11, 1967) known professionally as Mo\'Nique, is an American comedienne and actress. Mo\'Nique rose to fame in the UPN series The Parkers while making a name as a stand-up comedian hosting a variety of venues, including Showtime at the Apollo. Mo\'Nique transitioned to film with roles in such films as Phat Girlz, and Welcome Home Roscoe Jenkins.\n\nIn 2009, she received critical praise for her villainous role in the film Precious: Based on the Novel \"Push\" by Sapphire. For this performance, she has won numerous awards including an Academy Award for Best Supporting Actress, a Screen Actors Guild Award, a Golden Globe Award, and a BAFTA Award. She is the sixteenth African American actress to receive a nomination for the Academy Award for Best Supporting Actress, and the fourth to win. Overall, Mo\'Nique is the twelfth individual African-American to win an Oscar for acting; and the seventh winner during the decade of the 2000s. She hosts The Mo\'Nique Show, a late-night talk show that premiered in 2009 on BET.\n\nDescription above from the Wikipedia article Mo\'Nique, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1967-12-11',NULL),(1807,'Jeko Bogoslovov',NULL,'',NULL,NULL),(1808,'Roman Madyanov','Dedovsk, Moskovskaya oblast, RSFSR, USSR','Roman Sergeevich Madyanov (Russian: Рома́н Серге́евич Мадя́нов; born July 22, 1962) is a Soviet and Russian actor.[1][2] Madyanov\'s career in cinema began as a child actor when he starred as Huckleberry Finn in Hopelessly Lost (1973). He is best known in the West for portraying the corrupt mayor Vadim in the 2014 film Leviathan.','1962-07-22',NULL),(1809,'Jacob Lofland','Briggsville, Arkansas, USA','Jacob Seth Lofland (born July 30, 1996) is an American actor best known for his role as Neckbone in the film Mud and for his role as Aris in Maze Runner: The Scorch Trials.','1996-07-30',NULL),(1810,'Marie Guillard','Neuilly-sur-Seine, Hauts-de-Seine, France','Marie Guillard (born June 20, 1972) is a French actress. She was born in the Paris suburb of Neuilly-sur-Seine.\n\nShe has been married twice: she is married to Samy Naceri and was previously married to Nicola Sirkis: they were married in July 1995 and divorced in November 1998.\n\nDescription above from the Wikipedia article Marie Guillard, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1972-06-20',NULL),(1811,'Marie-Anne Chazel','Gap, Hautes-Alpes, France','Marie-Anne France Jacqueline Chazel (born 19 September 1951) is a French actress, screenwriter and director, who has been active in both film and television since 1974.\n\nChazel was born to actress Louba Guertchikoff (birth name Louba Louise Pinon; 1919–1999) in Gap, Hautes-Alpes, France.\n\nFrom 1967, Chazel studied at Pasteur College, alongside Michel Blanc, Gerard Jugnot, Thierry Lhermitte and Christian Clavier. After the achievement of her baccalaureate and two years of studies of political sciences, she and her college comrades formed a theatrical troop in 1974 named Le Splendid, joined by Josiane Balasko.\n\nChazel achieved popularity as Gigi in Les Bronzés (1978) directed by Patrice Leconte. She is best known for her role as Ginette in Les Visiteurs (1993).\n\nFrom 1976 to 2001, Chazel was married to actor Christian Clavier. They have one child, a daughter Margot Clavier (b. 1983).\n\nSource: Article \"Marie-Anne Chazel\" from Wikipedia in english, licensed under CC-BY-SA 3.0.','1951-09-19',NULL),(1812,'Ali Olomi',NULL,'',NULL,NULL),(1813,'Kameron Louangxay',NULL,'',NULL,NULL),(1814,'Amber Heard','Austin, Texas, USA','Amber Laura Heard (born April 22, 1986) is an American film and television actress. After a series of small roles in film and television, Heard had her first starring role in the horror film All the Boys Love Mandy Lane (2006). She first gained mainstream recognition for supporting roles in the action film Never Back Down (2008) and the comedy Pineapple Express (2008). In the following years, she appeared in films such as The Joneses (2009), The Ward (2010), The Rum Diary (2011), Drive Angry (2011), Machete Kills (2013) and Magic Mike XXL (2015).\n\nIn 2017, Heard joined the DC Extended Universe to play Atlantean queen Mera in superhero films Justice League (2017), Aquaman (2018), and Zack Snyder\'s Justice League (2021). In addition to acting, Heard has been a global spokesperson for the cosmetics giant L\'Oréal Paris since 2018. She also engages in human rights activism.','1986-04-22',NULL),(1815,'Lindsay Felton',' Seattle, Washington, USA','','1984-12-04',NULL),(1816,'Charlie Alvarado',NULL,'',NULL,NULL),(1817,'Ning Jing','Guiyang, Guizhou, China','Ning Jing was born on April 27, 1972 in Guiyang, Guizhou, China. She is an actress, known for Red Firecracker, Green Firecracker (1994), Red River Valley (1997) and Heart of China (1999).','1972-04-27',NULL),(1818,'Scott Thomas Reynolds','San Diego, California, USA','Scott Thomas Reynolds was born in San Diego, CA and raised in Scottsdale, Arizona. Reynolds spent his early years studying acting both privately and in school courses. Reynolds attended the University of Arizona where he received his BFA in Acting. While cultivating his acting career, Reynolds spends his extra time working in film production.',NULL,NULL),(1819,'Eric Rosenberg',NULL,'',NULL,NULL),(1820,'Philip Kramer',NULL,'',NULL,NULL),(1821,'Scott Alan Warner',NULL,'',NULL,NULL),(1822,'Rachel Hayward',' Toronto, Ontario, Canada ','Rachel Hayward (born August 7, 1968) is a Canadian actress, known for her work as a series regular in Chris Carter\'s Harsh Realm (1999) for FOX and her leading role in the 2015 made for TV movie, Stolen Daughter (2015).\n\nShe landed her first acting role in the feature Breaking All the Rules (1985) at the age of 17. Her feature film and TV movie credits include Stranger in the Mirror, Under the Gun, Breaking All the Rules, Deadfire, She Woke Up Pregnant, Convergence, Knight Moves and the romantic comedy Apartment Hunting. In television she has starred as Florence in Chris Carter\'s series Harsh Realm and had a recurring role in Jake 2.