ce Were Warriors (1994), Three Kings (1999), Training Day (2001), Whale Rider (2002), Collateral Damage (2002), Sunshine, Live Free or Die Hard (both 2007), The Dark Horse (2014), for which he won the Asia Pacific Screen Award for Best Performance by an Actor, Doctor Sleep (2019), Avatar, and Avatar: The Way of Water (2022). His  television roles include NBC\'s Trauma, and ABC\'s Body of Proof and Missing. From 2015 to 2017, he portrayed Travis Manawa on the AMC horror drama series Fear the Walking Dead.\n\nHe is the co-owner of the independent New Zealand production company Whenua Films.','1968-07-27',NULL),(1854,'Kelsey Grammer','St. Thomas, U.S. Virgin Islands','Allen Kelsey Grammer (born February 21, 1955) is an American actor. He gained fame for his role as psychiatrist Dr. Frasier Crane on the NBC sitcom Cheers (1984–1993) and its spin-off Frasier (1993–2004; 2023–present). At more than 20 years on-air, this is one of the longest-running roles played by a single live-action actor in television history. He has received numerous accolades including a total of six Emmy Awards, three Golden Globe Awards, a Screen Actors Guild Award and a Tony Award.\n\nDescription above from the Wikipedia article Kelsey Grammer, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1955-02-21',NULL),(1855,'Navid Negahban','Mashhad, Iran','Navid Negahban was born and raised in Mashhad, Iran. His passion for acting led him to Germany, where he spent eight years honing his theatrical skills prior to arriving in the US. Navid has been building a strong resume ever since, playing a broad range of intriguing characters for film, theatre, and television.\n\nNavid has a powerful leading role in the stunning dramatic feature The Stoning of Soraya M., and significant supporting roles in Brothers with Tobey Maguire, directed by Jim Sheridan, Powder Blue with Jessica Biel and Forest Whitaker, and Charlie Wilson\'s War opposite Tom Hanks, directed by Mike Nichols. On TV, Navid had a recurring role on the eighth and final season of 24, and guest appearances include Lost, CSI: Miami, Law & Order, Covert Affairs, and NCIS: Los Angeles. Navid recently (2011) appeared as Dr. Robert Stadler in Atlas Shrugged Part 1. He also shot The Power of Few in New Orleans with Christopher Walken and Christian Slater. Navid is currently (2011/2012) playing the chilling Abu Nazir on Showtime\'s Homeland, with Damian Lewis and Claire Danes. Credit:  J. Bass ','1968-06-02',NULL),(1856,'Nabhaan Rizwan','Regno Unito','Nabhaan Rizwan is a British actor known for his work in film and television. He gained prominence for his role as Raza Shar in the British drama series \"Informer\" (2018). Rizwan\'s compelling performance in the series garnered attention and critical acclaim. Additionally, he has appeared in various other projects, including \"Station Eleven,\" showcasing his talent and versatility as an actor. Rizwan continues to make strides in the entertainment industry, establishing himself as a promising talent to watch.','1996-11-30',NULL),(1857,'Lindsey Marie Wilson',NULL,'Lindsey Marie Wilson is an actress.',NULL,NULL),(1858,'Zhao Wei','Wuhu，Anhui PProvince，China','Zhao Wei (Chinese: 赵薇, born March 12, 1976) is a mainland Chinese film actress and pop singer. Audiences sometimes refer to her by her English name, Vicki Zhao (sometimes spelt Vicky Zhao).  She has been awarded the Hundred Flowers Award, Shanghai Film Critics Award, Huabiao Award, Golden Eagle TV Award as well as Shanghai Film Festival Golden Globet, two times Changchun Film Festival Golden Deer and four nominations of Hong Kong Film Award, two nominations of Golden Horse Award.','1976-03-12',NULL),(1859,'Andrey Fomin','Samara, Russia','','1984-09-18',NULL),(1860,'Paul Anderson','London, England, UK','Paul Anderson is an English actor who started his acting career in the late 2000s. He was previously a ticket scalper who decided to attend Webber Douglas drama school, subsequently landing roles in theatre and in films such as The Firm, Sherlock Holmes: A Game of Shadows and Passion. Anderson is known for his breakout role as Arthur Shelby in British television series Peaky Blinders.','1978-02-12',NULL),(1861,'Carlos Landucci',NULL,'',NULL,NULL),(1862,'Anton Yelchin','Leningrad, USSR (St. Petersburg, Russia)','Anton Viktorovich Yelchin (March 11, 1989 – June 19, 2016) was an American film and television actor, known for portraying Pavel Chekov in the Star Trek reboot series, and for several other prominent roles.\n\nBorn to a Russian Jewish family in Leningrad, Yelchin relocated to the United States as an infant. He began performing in the late 1990s, appearing in several television roles and the Hollywood films Along Came a Spider and Hearts in Atlantis (both 2001). His role as Jacob Clarke in the Steven Spielberg miniseries Taken was significant in furthering his career as a child actor. He later appeared on the television series Huff and appeared in the films Terminator Salvation (2009), Charlie Bartlett (2007), Fright Night (2011), Like Crazy (2011), The Smurfs (2011), The Pirates! Band of Misfits (2012) and Only Lovers Left Alive (2013). He appears in Star Trek (2009) and Star Trek Into Darkness (2013), and will appear posthumously in Star Trek Beyond (2016).\n\nDescription above from the Wikipedia article Anton Yelchin, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1989-03-11','2016-06-19'),(1863,'Ben O\'Toole','Brisbane, Queensland, Australia','Ben O\'Toole is known for his work on Hacksaw Ridge (2016), Detroit (2017) and The Water Diviner (2014).','1991-07-10',NULL),(1864,'Laura Basuki','West Berlin, Germany','Laura Basuki is an Indonesian actress.','1988-01-09',NULL),(1865,'Duobujie','Shigatse，Xizang，China','','1958-05-01',NULL),(1866,'Jack Taylor','Oregon City, Oregon, USA','From Wikipedia, the free encyclopedia\n\nJack Taylor (born George Brown Randall; 21 October 1936) is an American actor.','1936-10-21',NULL),(1867,'Craig Shugart',NULL,'',NULL,NULL),(1868,'Will Forte','Alameda County, California, USA','Orville Willis Forte IV, better known as Will Forte (born June 17, 1970), is an American actor, comedian and writer best known as a cast member on Saturday Night Live from 2002–2010 and for starring in the SNL spin-off film MacGruber.','1970-06-17',NULL),(1869,'Cherry Jones','Paris, Tennessee, USA','Cherry Jones (born November 21, 1956) is an American actress. Having started her career in theatre as a founding member of the American Repertory Theatre in 1980, she then transitioned into film and television. Celebrated for her dynamic roles on stage and screen, she has received various accolades, including three Primetime Emmy Awards and two Tony Awards, as well as nominations for an Olivier Award and a Screen Actors Guild Award.\n\nJones made her Broadway debut in the 1987 play Stepping Out. She went on to receive two Tony Awards for Best Actress in a Play for The Heiress in 1995 and Doubt in 2005. Her other Tony-nominated roles were in Our Country\'s Good in 1991, A Moon for the Misbegotten in 2000, and The Glass Menagerie in 2014. Her most recent Broadway performance was in The Lifespan of a Fact in 2018.\n\nShe is also known for her work on television with breakthrough roles as Barbara Layton in The West Wing and President Allison Taylor in 24 the latter of which won her the Primetime Emmy Award for Outstanding Supporting Actress in a Drama Series in 2009. She received a Screen Actors Guild Award nomination for Transparent in 2015 and earned two Primetime Emmy Awards Outstanding Guest Actress in a Drama Series for her roles in the Hulu drama series The Handmaid\'s Tale in 2019 and the HBO drama series Succession in 2020.\n\nHer film appearances include The Horse Whisperer (1998), Erin Brockovich (2000), Signs (2002), The Village (2004), Amelia (2009), The Beaver (2011), A Rainy Day in New York (2019), and The Eyes of Tammy Faye (2021).','1956-11-21',NULL),(1870,'Lim Yu-Beng',NULL,'Yu-Beng is a familiar face on stage and screen. He won Best Actor in 2005 for The Lover, and The Dumb Waiter, Best Supporting Actor in 2004 for Bent, and was in the Best Acting Ensemble in 2002 for Animal Farm, all for the Life! Theatre Awards.\n\nHe has played leads in the acclaimed local films Singapore Dreaming, and Solos, as well as the soon to be released Universe; and internationally in Kung Fu Killers, and The Great Wall; and supporting roles in numerous international films, including Anna and the King, and HBO Asia’s Grace. For Singapore television he has played leads in Firasat, Do Not Disturb, 9 Lives, The Second Singapore Short Story Project, and The New Home; and all four seasons of the hit series Triple 9.\n\nTheatregoers know him from shows like Another Country, Animal Farm, Members Only, Doubt, The Lover and The Dumb Waiter, Bent, Lear, The First Emperor\'s Last Days, The Blue Room, The Yang Family and As If He Hears.\n\nIn the last few years he wrote and directed It’s My Life, an original teen musical, as well as 2 Houses, and Pearl of the Eastern & Oriental, both sell-out successes specially commissioned by the Georgetown Festival in Penang. In 2018, he performed an evening of his original songs as part of the Writers’ Festival. Yu-Beng’s latest television projects include 20 Days (2018), Warrior (2018), Lion Mums S3 (2019), After Love (2019), Raksasa (2019) and In The Wind (2019).\n\nHe continues to explore new ground, and works extensively as an actor, director, writer, acting coach, lighting designer, fight choreographer and whatever it takes to get the show up.\n\nYu-Beng is represented by FLY Entertainment.','1965-11-20',NULL),(1871,'Minami Tsukui','Saitama, Japan','','1987-12-18',NULL),(1872,'Stefania Girolami Goodwin','Rome, Lazio, Italy','Stefania Girolami Goodwin was born in 1963 in Rome, Lazio, Italy. She started as an actress at a young age, usually cast in films directed by her father, Enzo G. Castellari. She is now a director and producer.',N