New York, USA','Charles O\'Connell (born April 21, 1975) is an American actor and reality television personality. He is known for his appearance on The Bachelor, as well as appearing in several projects involving his older brother Jerry O\'Connell, including a starring role as Colin Mallory in Season 4 of the science fiction television series Sliders.\n\nO\'Connell was born in New York City, New York, the son of Linda (née Witkowski), an art teacher, and Michael O\'Connell, an advertising agency art director. His maternal grandfather, Charles S. Witkowski, was the mayor of Jersey City, New Jersey. O\'Connell is of half Irish, one quarter Italian, and one quarter Polish ancestry. O\'Connell appeared in small roles in such films as Dude, Where\'s My Car? and The New Guy, the latter of which also paired him with his brother Jerry. He obtained greater notoriety when he appeared with his brother in Sliders and then on the seventh season of the reality television series The Bachelor between March 2005 and May 2005. In two episodes of Crossing Jordan, entitled \"Sunset Division\" (season 2) and \"Skin and Bone\" (season 4), he played the onscreen brother of his brother\'s character, Detective Woody Hoyt.\n\nFrom Wikipedia, the free encyclopedia.','1975-04-21',NULL),(1895,'Jay Gillespie','Dallas, Texas, USA','','1979-11-30',NULL),(1896,'Mark Margolis','Philadelphia, Pennsylvania, USA','Mark Margolis (November 26, 1939 – August 3, 2023) was an American actor, who had been making films since 1976.\n\nMargolis went to Temple University briefly before moving to New York City, where he studied drama with Stella Adler and at the Actors Studio. He was perhaps most famous for his supporting roles in Scarface and the films of Darren Aronofsky: π, Requiem for a Dream, The Fountain, The Wrestler, and Black Swan. Aronofsky wrote the role of Father Avila in The Fountain specifically for Margolis.\n\nHe had recurring roles on numerous TV shows, including The Equalizer, HBO\'s Oz, Law And Order, Crossing Jordan and most recently Showtime\'s Californication and Breaking Bad. He also appeared in a first season episode of Quantum Leap.\n\nIn 1991, he also played Helmut Dieter in soap opera Santa Barbara.','1939-11-26','2023-08-03'),(1897,'Gilberto Galimberti','Rom, Latium, Italien','','1933-02-25','2017-06-16'),(1898,'Robert Himber',NULL,'',NULL,NULL),(1899,'Joe Mantegna','Chicago, Illinois, USA','From Wikipedia, the free encyclopedia\n\nJoseph Anthony “Joe” Mantegna, Jr. (born November 13, 1947) is an American actor, producer, writer and director. He is best known for his roles in box-office hits such as Three Amigos (1986), The Godfather Part III (1990), Forget Paris (1995) and Up Close &amp; Personal (1996). He currently stars in the CBS television series Criminal Minds as FBI Special Agent David Rossi.\n\nMantegna has gained Emmy Award nominations for his roles in three different miniseries, The Last Don (1997), The Rat Pack (1999) and The Starter Wife (2007). Mantegna served as executive producer for various movies and television movies, such as Corduroy (1984), Hoods (1998), and Lakeboat (2000), which he also directed.\n\nOn television, Mantegna starred in the short lived series First Monday (2002) and Joan of Arcadia (2003–2005). Since the 1991 episode \"Bart the Murderer\", Mantegna has had a recurring role on the animated comedy series The Simpsons as mob boss Fat Tony, reprising the role in The Simpsons Movie (2007). He also played Robert B. Parker\'s fictional detective Spenser in three made-for-TV movies between 1999 and 2001.\n\nDescription above from the Wikipedia article Joe Mantegna, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1947-11-13',NULL),(1900,'Fedi Bashur',NULL,'',NULL,NULL),(1901,'Albert Duic',NULL,'',NULL,NULL),(1902,'Rajiim A. Gross','Bronx, New York, USA','Rajiim was born in Bronx, NY in the year 1971 to Rodney and Barbara Gross. Rajiim is the oldest of 3 children. Rajiim was a U.S. Air Force \"Brat\" for many years and lived in the United States and Abroad. While in high school and college Rajiim studied Communication Arts and Drama. Rajiim wanted to become an actor from an early age but became a Radio DJ first. Rajiim married in 1992 and had 2 children. He got divorced in 2000 and later remarried in 2003 to Kelly Smith. Kelly encouraged Rajiim to pursue his passion in acting and he has. Together Rajiim and Kelly have a blended family with 4 children (Cathy, Garrett, Rajiim II and Jordan) and several grandchildren. Rajiim has done voiceover commercial work for radio stations and personal clients. Now Rajiim is looking forward to the big screen. Rajiim\'s first role was as an uncredited Federal Agent in the 2017 film Reprisal. \"Only way now is up\" - Rajiim Gross','1971-01-24',NULL),(1903,'Peter Arnett','Riverton, New Zealand','','1934-11-13',NULL),(1904,'Jaycee Chan','Los Angeles, California, USA','Jaycee Chan (Chinese: 房祖名, born 3 December 1982) is an American-born Hong Kong actor. He is the son of martial artist and actor Jackie Chan.','1982-12-03',NULL),(1905,'Laura Giosh',NULL,'',NULL,NULL),(1906,'Mohan Raman',NULL,'Mohan Venkata Pattabhi Raman is an Indian  film and television actor and management trainer. He is acclaimed for  playing supportive or negative roles in Tamil television serials  prominent ones being Marmadesam and Chidambara Rahasiyam directed by Tamil director Naga. He is the eldest son of lawyer and politician V. P. Raman and elder brother of P. S. Raman, Former Advocate-General of Tamil Nadu. His daughter Vidyullekha Raman made her debut in Neethane En Ponvasantham He is also the uncle of Gautam.S.Raman.','1956-04-03',NULL),(1907,'Jeon Woon-jong','South Korea','Korean actor.','1983-12-07',NULL),(1908,'Eric Ali',NULL,'',NULL,NULL),(1909,'Morgan Lily','Santa Monica, California, USA','Morgan Lily (born April 11, 2000) is an American child actress and fashion child model. She started modeling internationally at four years old and appeared in more than 21 television commercials, and many photo shoots before her role in Henry Poole Is Here as Millie Stupek. Lily had supporting roles in He\'s Just Not That Into You, as Matthew Gray Gubler\'s daughter in Pornstar, and as Lilly Curtis in the apocalyptic film 2012. She acted as Young Julianna Baker in the film Flipped based on the novel with the same name by Wendelin van Draanen and Missy in the Hallmark Channel\'s upcoming TV film, Love\'s Resounding Courage. Morgan is currently filming the role of young Mystique in X-Men: First Class.\n\nFrom Wikipedia, the free encyclopedia','2000-04-11',NULL),(1910,'George Trochta',NULL,'',NULL,NULL),(1911,'David Barrera','San Juan, Texas, USA','',NULL,NULL),(1912,'Charles Glover','New Mexico, USA','','1962-07-20',NULL),(1913,'Eric Braeden','Bredenbek, Germany','Eric Braeden (born Hans-Jörg Gudegast; April 3, 1941) is a German-born film and television actor. The internationally-acclaimed, Emmy Award-winning and People’s Choice Award-winning film and television actor ERIC BRAEDEN is a television icon and arguably the most popular character in daytime history.  For over 37 plus years, he has portrayed “Victor Newman” on the #1 rated daytime drama series The Young and the Restless, which has over 120,000,000 daily viewers around the world.  The show is syndicated in over 30 foreign countries including Australia, Belgium, Canada, France, Greece, India, Israel, Italy, the Middle East, New Zealand, Romania, Slovenia, South Africa, Switzerland and Turkey.\n\nBraeden recently wrote his critically acclaimed autobiography I’ll Be Damned: How My Young and Restless Life Led Me to America’s #1 Daytime Drama from HarperCollins, which appeared on the Publishers Weekly and Canadian bestseller list.  Additionally, according to A.C. Nielsen, Braeden has one of the highest TVQ’s on television, and is one of the most recognized actors in the world.  On July 20 2007, he was the recipient of a star on The Hollywood Walk Of Fame and become the first German born actor since Marlene Dietrich to receive such an honor.','1941-04-03',NULL),(1914,'Paul Walker','Glendale, California, USA','Paul William Walker IV (September 12, 1973 – November 30, 2013) was an American actor. He became well known in 1999 after his role in the hit film Varsity Blues. However, he was perhaps best known for starring as Brian O\'Conner in The Fast and the Furious film series. His other films include Eight Below, Into the Blue, She\'s All That and Takers.','1973-09-12','2013-11-30'),(1915,'Haley Farris',NULL,'',NULL,NULL),(1916,'Josie Fink',NULL,'',NULL,NULL),(1917,'Sammo Hung','Hong Kong, British Crown Colony','Sammo Hung (Chinese: 洪金寶, born Hung Kam Po, 7 January 1952) is a Hong Kong actor, martial artist, producer and director, known for his work in many kung fu films and Hong Kong action cinema. He has been a fight choreographer for, amongst others, Jackie Chan, King Hu, and John Woo. Hung is one of the pivotal figures who spearheaded the Hong Kong New Wave movement of the 1980s, helped reinvent the martial arts genre and started the vampire-like Jiang Shi genre. He is widely credited with assisting many of his compatriots, giving them their starts in the Hong Kong film industry, by casting them in the films he produced, or giving them roles in the production crew. In East Asia, it is common for people to address their elders or influential people with familial nouns as a sign of familiarity and respect. Jackie Chan, for example, is often addressed as \"Dai Goh\", meaning Big Brother. Hung was also known as \"Dai Goh\", until the filming of Project A, which featured both actors. As Hung was the eldest of the kung fu \"brothers\", and the first to make a mark on the industry, he was given the nickname \"Dai Goh Dai\", meaning, Big, Big Brother or Biggest Big Brother.\n\nWas a member of the\"Seven Little Fortunes\"  in Yu Jim-Yuen\'s China Drama Academy\'s Peking Opera School.','1952-01-07',NULL),(1918,'Jake Johnson','Evanston, Illinois, USA','Jake Johnson (born May 28, 1978) is an American actor and comedian. He is best known for his role as Nick Miller on the Fox television sitcom New Girl (2011-2018).','1978-05-28',NULL),(1919,'Keath Kibbey',NULL,'',NULL,NULL),(1920,'Choomporn Theppitak','Chumphon Province, Thailand','Choomporn Theppitak was a Thai actor and director.','1939-07-05','2017-07-09'),(1921,'Rosalind Rubin',NULL,'','1984-04-17',NULL),(1922,'David Murgia','Verviers, Belgique','','1988-03-16',NULL),(1923,'Brian J. Smith','Dallas, Texas, USA','Brian J. Smith (born October 12, 1981) is an American actor who is known for his role as Trey in the 2006 independent film Hate Crime and as series regular Lt. Matthew Scott in the military science fiction television series, Stargate Universe.\n\nSmith is a native of Allen, Texas. After studying at the Quad C Theatre program at the Collin County Community College in Plano, Texas, Smith graduated from the Juilliard School Drama Division\'s four-year acting program in New York City. In 2005, he portrayed Trey, a gay man facing intolerance from the son of a fundamentalist preacher, in Hate Crime, an independent film featured at multiple gay and lesbian film festivals around the United States. Smith also portrayed roles in two more independent films, Red Hook and The War Boys. In 2008, he appeared on Broadway in the play Come Back, Little Sheba as the character Turk. Smith was cast as Lieutenant Matthew Scott, a lead role in the 2009 Stargate television series, Stargate Universe, until its cancellation in 2010.\n\nDescription above from the Wikipedia article Brian J. Smith, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1981-10-12',NULL),(1924,'Serena Starks',NULL,'',NULL,NULL),(1925,'Edward Finlay','Miami, Florida, USA','Edward Finlay (also known as Eddie or Eduardo Finlay) was born and raised, first generation, in Miami, FL, from native Cuban parents, who fled Cuba as political refugees in the late 1950s. He is one of four siblings; two brothers and a sister. His ancestry consist of Spanish and Scottish origin. Eddie grew up watching a lot of movies with his family. Movies that inspired his imagination and fantasy of becoming an actor/ artist included collections from the Star Wars series, the Indiana Jones series, and the Superman series, with Christopher Reeve. He loved the stories and imagination that these types of movies brought out in him. Eddie attended Cristopher Columbus High School in South Florida where he loved playing sports, but never got involved in theatre until he received an opportunity to audition for the lead role in the play Splender in the Grass, to play Bud Stamper, for the sister school, theater program, at Our Lady of Lourdes Academy. He won the role, and fell in love with the journey, and the process, of performing and storytelling. From that point on, he made the decision to get involved in the acting business.',NULL,NULL),(1926,'Michael Badawi',NULL,'',NULL,NULL),(1927,'Barry Primus','New York City, New York, USA','Barry Primus (born February 16, 1938) is an American actor, director, and writer.\n\nDescription above from the Wikipedia article Barry Primus, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1938-02-16',NULL),(1928,'Denis Berkfeldt',NULL,'',NULL,NULL),(1929,'Nathieu Grandjean',NULL,'',NULL,NULL),(1930,'John Lynch','Corrinshego, Northern Ireland, UK','From Wikipedia, the free encyclopedia\n\nJohn Lynch (born 26 December 1961) is an actor and novelist from Northern Ireland. He won the AFI (AACTA) Award for Best Actor for the 1995 film Angel Baby. His other film appearances include Cal (1984), The Secret Garden (1993), In the Name of the Father (1993), Sliding Doors (1998), The Fall (2013–2016), Medici (2019), The Head (2020), and The Banishing (2021).\n\nLynch has also written two novels, Torn Water (2005) and Falling Out of Heaven (2010).','1961-12-26',NULL),(1931,'Jayakumar Parameswaran Pillai',NULL,'',NULL,NULL),(1932,'Vanessa Am