tor and musician.\n\nDescription above from the Wikipedia article Tygh Runyan, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-06-13',NULL),(1966,'Devon Aoki','New York City, New York, USA','Devon Edwenna Aoki (born August 10, 1982) is an American actress and model.\n\nHer acting career includes films like 2 Fast 2 Furious, D.E.B.S., Sin City, Dead or Alive, War and Mutant Chronicles. She did not have her driver\'s license prior to filming 2 Fast 2 Furious and had to learn to drive during filming. She was cast as Tatsu Yamashiro in Arrow season 3, but was replaced by Rila Fukushima due to a scheduling conflict.\n\nDescription above from the Wikipedia article Devon Aoki, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1982-08-10',NULL),(1967,'Tracey A. Leigh',NULL,'Tracey A. (Aileen) Leigh is an American film, television, stage and voice actress, and dancer.',NULL,NULL),(1968,'Jess Mal Gibbons','Canada ','Jess Gibbons is a Canadian actor, write, voice actor, and sales and marketing professional.',NULL,NULL),(1969,'Jimmy Campbell',NULL,'',NULL,NULL),(1970,'Chasty Ballesteros',' Vancouver, British Columbia, Canada','Chasty Ballesteros is a Canadian actress who has had roles in Smallville, Supernatural, Psych,Sanctuary, and How I Met Your Mother.','1981-01-03',NULL),(1971,'Everett McGill','Miami Beach, Florida, USA','Everett McGill is an American actor who was born in Miami Beach, Florida, on October 21, 1945. He is best known for his roles in the films Quest for Fire (1981), Dune (1984), Silver Bullet (1985), Heartbreak Ridge (1986), Licence to Kill (1989), The People Under the Stairs (1991), and Under Siege 2: Dark Territory (1995). He also had a recurring role as \"Big\" Ed Hurley on the television series Twin Peaks (1990–1991).\n\nMcGill began his acting career on Broadway, appearing in the award-winning plays Equus, A Texas Trilogy, and Whose Life Is It, Anyway? He made his film debut in 1975 with a small role in the film The Day of the Locust. He went on to have a number of supporting roles in films throughout the 1970s and early 1980s.\n\nIn 1981, McGill starred in the film Quest for Fire, which was a critical and commercial success. He followed this up with a starring role in the film Dune, which was also a success. McGill continued to have a successful career in the 1980s, appearing in a number of films, including Silver Bullet, Heartbreak Ridge, Licence to Kill, and The People Under the Stairs.\n\nIn the 1990s, McGill\'s career slowed down, but he still appeared in a number of films, including Under Siege 2: Dark Territory, The Quick and the Dead, and The Faculty. He also had a recurring role on the television series Twin Peaks.\n\nMcGill retired from acting in 1999, but he returned for the revival of Twin Peaks in 2017. He has since retired from acting again.','1945-10-21',NULL),(1972,'Hans Matheson','Stornoway, UK','','1975-08-07',NULL),(1973,'Domenico Cianfriglia','Anzio, Lazio, Italy','Domenico Cianfriglia is an Italian stuntman / actor who is the brother of Giovanni Cianfriglia.','1938-05-19','2020-10-26'),(1974,'Tom Ventura',NULL,'',NULL,NULL),(1975,'Mary Jasionowski',NULL,'',NULL,NULL),(1976,'Siriana Hernandez',NULL,'',NULL,NULL),(1977,'Jin So-yeon','South Korea','Korean actress.','1991-06-02',NULL),(1978,'Matsumoto Hakuō II','Tokyo, Japan','Matsumoto Hakuō II was born on August 19, 1942 in Tokyo, Japan. He is an actor, known for 13 Assassins (2010), Dai Chûshingura (1957) and Tokugawa bugei-chô: Yagyû san-dai no ken (1993).','1942-08-19',NULL),(1979,'Peter Gadiot','West Sussex, England, UK','Alan Peter Gadiot was born and raised in England and he\'s of Dutch and Mexican descent.\n\nHe trained at the Drama Centre in London, before making his television debut in 2010 in the family comedy drama \'My Spy Family\'. He made his American TV debut as the genie Cyrus in \'Once Upon a Time in Wonderland\' in 2013 and in the same year appeared in the UK sitcom \'Fresh Meat\', actually playing a Mexican, a holiday romance who comes to England to marry his girlfriend despite not being able to speak any English. In addition to acting on stage and screen he wrote and directed a short film \'12-17\' and is an active campaigner against human trafficking, actually rowing the Atlantic Ocean in support of his cause.\n\nHe have tripe citizenship with United Kingdom, Mexico and Netherlands.',NULL,NULL),(1980,'Ricardo Oshiro',NULL,'',NULL,NULL),(1981,'Dwayne Alistair Thomas',NULL,'',NULL,NULL),(1982,'Tyler Christopher','Joliet, Illinois, USA','','1972-11-11','2023-10-31'),(1983,'Mindy Marin',NULL,'',NULL,NULL),(1984,'Zolile Nokwe',NULL,'',NULL,NULL),(1985,'Gerran Howell',NULL,'','1991-02-25',NULL),(1986,'Toby Holguin','Gardena, California, USA','','1969-12-20',NULL),(1987,'Jillian Bell','Las Vegas, Nevada, USA','Jillian Bell (born April 25, 1984) is an American comedian, actress, and screenwriter. Jillian was raised in Las Vegas, Nevada and began studying improv at the age of eight. She graduated from Bishop Gorman High School in 2002, then moved to Los Angeles, where she became a member of the Groundlings. She auditioned for Saturday Night Live, and though she did not join the cast, she became a writer for the show in 2009 for the 35th season.','1984-04-25',NULL),(1988,'Paul Logan','New Jersey, USA','Paul Logan (born 15 October 1973) is an accomplished martial artist, stuntman, and actor best known for his roles in low budget action films. But he is well known for his role as Glen Reiber in Days of Our Lives from 2001 to 2002.','1973-10-15',NULL),(1989,'Frank C. Turner','Wainwright, Alberta, Canada','Frank C. Turner is an actor and iconographer born in Wainwright, Alberta and now living in Port Coquitlam, British Columbia. He received his theatrical training at the University of Alberta, graduating in 1975 with a BFA. For the first few years after graduation he acted in theatres across western Canada and Ontario. In 1983 he moved to Vancouver, BC and has worked mainly in film since then. His favourite credits include, Air Bud (1997), Air Bud: Golden Receiver (1998), Air Bud 3 (2000), Air Bud: Seventh Inning Fetch (2002), The New Addams Family: Addams Family Feud (1999), Lonesome Dove: The Outlaw Years (1995), Cats & Dogs (2001), Snow Dogs (2002) and The Duke (1999). Frank has previously performed the GKC - GBS debate in Calgary, St. Paul, Minnesota, and on Apostle of Common Sense with EWTN. In 1991 he began studying iconography under Vladislav Andreyev. He has completed about 50 icons in the Byzantine tradition for individuals and churches in the Vancouver area. A frequent attendee of the Mount Angel Iconography Institute where he studied with Charles Rohrbacher, Mary Katsilometes, and Cathy Sievers; more recently he studied with Father Gianluca Busi from Bologna, spending six weeks there in 2007. He gives private instruction in iconography. Along with Chris Kielsinki and Michal Janek, Frank was a founding member of Epiphany Sacred Arts Guild, and has served as its president for four years. He also served on the curriculum advisory board of Living Waters College, soon to be opened in Derwent, Alberta.','1951-06-02',NULL),(1990,'Riadh Belaïche','Sidi Bel Abbes, Algeria','','1998-07-03',NULL),(1991,'Darren Anthony Thomas',NULL,'',NULL,NULL),(1992,'Holly Johnson',NULL,'',NULL,NULL),(1993,'Gary McLarty','North Hollywood, California, USA','Gary McLarty (January 16, 1941 – October 11, 2014) was an American stunt performer and stunt coordinator for film and television. His abilities earned him the nickname \"Whiz Kid\" in Hollywood. McLarty performed stunts in over 150 films between 1966 and 2004, among them The Wild Bunch, Little Big Man, The Longest Yard, Blade Runner, The Terminator, Jurassic Park, Heat, and Collateral.\n\nHe was in the helicopter, as a stunt coordinator, when actor Vic Morrow and two children died in an accident on a \"Twilight Zone\" movie set. In the subsequent trial, McLarty testified that, prior to the accident, he had warned director John Landis that the stunt was too dangerous. In 1991 McLarty shot and killed his roommate. McLarty was cleared of all charges when the Deputy District Attorney determined that it was a clear case of justifiable homicide. On the Friday before as part of a bizarre series of events another man had been fatally shot by Sheriff\'s deputies at McLarty\'s Lake View Terrace ranch.  McLarty\'s house also caught on fire and burned down during the same incident. McLarty semi-retired from stunt work in 2004. The following year, he testified at the murder trial of actor Robert Blake, testifying that Blake offered him $10,000 to murder Blake\'s wife, Bonnie Lee Bakley; McLarty declined. Bakley was fatally shot in Blake\'s car outside a restaurant in May 2001. Blake was thought by most to be the actual murderer, but was acquitted in a 2005 criminal trial.\n\nMcLarty died on October 11, 2014 when a pickup truck driven by fellow stuntman Bob Orrison making a U-turn was broadsided by a Jeep Cherokee in Rancho Cordova, California, USA. Both stuntmen were killed instantly. The two persons in the Jeep Cherokee were hospitalized with non-life threatening injuries.','1941-01-16','2014-10-11'),(1994,'Christian Pedersen',NULL,'',NULL,NULL),(1995,'Artemio Antonini','Rome, Lazio, Italy','','1924-06-26','2001-12-05'),(1996,'Kenneth Hogue',NULL,'',NULL,NULL),(1997,'Hajime Inoue','Shinjuku, Tokyo, Japan','Hajime Inoue (井上 肇, Inōe Hajime, March 29, 1961) is a Japanese actor born in Shinjuku, Tokyo. He belongs to Y.K OFFICE.','1961-03-29',NULL),(1998,'Christine Claibourne',NULL,'',NULL,NULL),(1999,'Karel Roden','České Budějovice, Czechoslovakia','Karel Roden (born 18 May 1962) is a Czech actor, popularly known for his roles in Hellboy and The Bourne Supremacy, and his voice work in Grand Theft Auto IV.','1962-05-18',NULL),(2000,'Jordan James Smith',NULL,'',NULL,NULL),(2001,'Peter Linka','	Melbourne, Australia','','1962-02-07',NULL),(2002,'Janardhanan','Vaikom, Kerala, India','Janardhanan is a Malayalam film actor. In 1969, he acted in Veettu Mrugam directed by P. Venu. He is known for his style of handling humor and his iconic voice. He started his career playing brusque villains in the 1970s but later went on to establish himself as a highly sought-after comedian. The turning point of his career was his role in the 1988 film Oru CBI Diary Kurippu, which brought out his comic skills. However, he was typecast as a comedian only after the 1993 film Meleparambil Aanveedu. Apart from stereotyped Hindu/Muslim/Christian characters, he has the distinction of portraying a Sikh and a Jewish character.','1946-07-24',NULL),(2003,'Jim Dirker',NULL,'',NULL,NULL),(2004,'Jack O\'Connell','Derby, England, UK','Jack O\'Connell (born 1 August 1990) is an English actor who first found fame as James Cook in Skins (2009–2010, 2013). He is also known for Pukey Nicholls in This Is England (2006), roles in the slasher film Eden Lake (2009) and the television dramas Dive (2010), United (2011) and playing the lead, Roy Goode, in the Netflix wild west miniseries Godless (2017).\n\nO\'Connell gave critically acclaimed performances in the independent films Starred Up (2013) and \'71 (2014). He subsequently starred as war hero Louis Zamperini in the war film Unbroken (2014), for which he received the BAFTA Rising Star Award. He has since starred in the thriller Money Monster (2016), the biographical drama Trial by Fire (2018) and the BBC miniseries The North Water (2021).','1990-08-01',NULL),(2005,'Lillie Fink',NULL,'',NULL,NULL),(2006,'Juan Diego Botto','Buenos Aires, Argentina','From Wikipedia, the free encyclopedia\n\nJuan Diego Botto-Rota (born August 29, 1975, in Buenos Aires, Argentina) is an Argentine-Spanish actor.\n\nBotto\'s father disappeared during the Argentine Dirty War when Juan Diego was only two years old. With his mother and older sister María, also an actress, he moved to Madrid, Spain, where he currently resides.\n\nBotto started acting at the age of 5 in the film Juego de poder (Power Game). His role in the 1999 film Sobreviviré (I will survive), about a woman who falls in love with a man who, unknown to her, is homosexual, got him more national and international recognition.\n\nBotto has appeared on stage in Spain in several critically acclaimed plays. He also directed a play called Privilegio de ser perro (Privilege of Being a Dog), about the tough life immigrants are subjected to while trying to sneak into and live in a new country.\n\nCurrently Botto lives in Madrid with his partner, the Spanish journalist and writer Olga Rodríguez. He is also active in politics, protesting the 2003 war in Iraq several times with fellow Spaniards and taking part in a support group for fellow children of the disappeared.  Description above from the Wikipedia article Juan Diego Botto, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1975-08-29',NULL),(2007,'Dhenyze Iwone',NULL,'',NULL,NULL),(2008,'Gilbert Rosales','El Paso, Texas, USA','Gilbert Rosales was born on November 11, 1969 in El Paso, Texas, USA. He is an actor, known for Iron Man (2008), Starship Troopers (1997) and Falling Down (1993).','1969-11-11',NULL),(2009,'Parm Soor','India','Born in India and raised in London, Parm moved to Canada where he studied Theatre at the University of Winnipeg.  After completing his actor apprenticeship in Canada, Parm worked on the stage and as a stand up comedian across North America for ten years before being offered his first feature film role in 2002.\n\nHe then landed a recurring role as Detective Nadeem Parmir in two outstanding CBC crime dramas, DaVINCI\'S INQUEST and DaVINCI\'S CITY HALL.\n\nHis extensive film and television credits include the Emmy Award nominated miniseries TRAFFIC, the Genie Award nominated film PARTITION, the Gemini Award winning miniseries HUMAN CARGO, the Writers Guild nominated feature film AFGHAN LUKE, and big budget Hollywood blockbusters including WATCHMEN and 2012.\n\nParm travelled to Valencia,Spain to shoot the DISNEY feature film TOMORROWLAND starring George Clooney.\n\nHis next film appearance will be in the highly anticipated third and final installment of The Maze Runner Trilogy. MAZE RUNNER: THE DEATH CURE.',NULL,NULL),(2010,'Chris Hemsworth','Melbourne, Victoria, Australia','Chris Hemsworth (born 11 August 1983) is an Australian actor.\n\nHe is best known for his roles as Kim Hyde in the Australian TV series Home and Away (2004) and as Thor in the Marvel Cinematic Universe films Thor (2011), The Avengers (2012), Thor: The Dark World (2013), Avengers: Age of Ultron (2015), Thor: Ragnarok (2017), Avengers: Infinity War (2018), Avengers: Endgame (2019), and Thor: Love and Thunder (2022). He has also appeared in the science fiction action film Star Trek (2009), the thriller adventure A Perfect Getaway (2009), the horror comedy The Cabin in the Woods (2012), the dark fantasy action film Snow White and the Huntsman (2012), the war film Red Dawn (2012) and the biographical sports drama film Rush (2013).','1983-08-11',NULL),(2011,'Gavin Warren','Houston, Texas, USA','Gavin Warren was born in Houston, Texas in 2008, the youngest son of a family of five. As a child he played the piano and did gymnastics before, inspired by Adam Sandler, he decided he wanted to become an actor. In 2015, Warren won an acting and modeling competition, after which he was accepted into a local artist agency. This was followed by his first roles in the short film Two Wongs Make a White and in the film drama Back Roads, before Warren was seen in Damien Chazelle\'s film biography Awakening to the Moon alongside Ryan Gosling in 2018.\n\nIn order to focus on his acting career, Warren switched from public school to home schooling. In subsequent years, he made guest appearances in the television series Daybreak and NCIS: New Orleans, while he took on supporting roles in the films Mack (2019), A Hard Problem (2021) and 12 Mighty Orphans (2021). In 2023 he appeared in the eighth season of the horror series Fear the Walking Dead before playing a leading role in the horror film Night Swim the following year.\n\nHis other announced film projects include the thrillers The Descendant and Geechee, the drama film Unbreakable Boy and the crime film The Man in the White Van.\n\nWarren lives in Katy, Texas.\n\nIMDb mini bio by; yusufpiskin','2008-04-17',NULL),(2012,'Eli Snyder','Pasadena, California','Eli Snyder began his film career as a child actor in films such as 300 and Watchmen. He went on to study directing at UCLA\'s prestigious theatre, film, & television program. His undergraduate thesis film, Interlude, received awards at film festivals across the country.',NULL,NULL),(2013,'Julie Hagerty','Cincinnati, Ohio, USA','Julie Hagerty (born June 15, 1955) is an American actress and former model.\n\nDescription above from the Wikipedia article Julie Hagerty, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1955-06-15',NULL),(2014,'Baha Jackson',NULL,'','1978-06-12',NULL),(2015,'James Paul Roeske II','Milwaukee, Wisconsin, USA','','1989-07-17',NULL),(2016,'Martin McCann','Belfast, Northern Ireland, UK','Martin McCann grew up with a brother and sister in the Divis Flats area of Falls Road in Belfast.\n\nIn  2006 Lord Richard Attenborough cast McCann in his film after seeing him  play Alex in a stage production of A Clockwork Orange. Attenborough  called Spielberg and recommended McCann. He was invited to LA to  audition for \'The Pacific\' HBO miniseries, Attenborough sent along  scenes from his film for Spielberg to view. McCann was cast in The  Pacific as R.V. Burgin.\n\nIn early 2010 he filmed in Belfast for  the new music-comedy Killing Bono, a film about the life of one of  Bono\'s classmates who tries to make it in the music business, only to  have his failures and frustrations magnified by the continued rise U2.  McCann plays the role of Bono. He has performed on stage in Ireland and  on tour.\n\nIn 2011 Martin won the Irish Film and Television Award  for best male performance in a feature film, the nominees in the  category were fellow northern Irish man Liam Neeson, Cillian Murphy and  Colm Meaney.\n\nMartin has become Patron of the charity YouthAction Northern Ireland.','1983-07-20',NULL),(2017,'Vladislav Demin',NULL,'',NULL,NULL),(2018,'Tony Bolano',NULL,'',NULL,NULL),(2019,'Tom Papa','Passaic, New Jersey, USA','Thomas Papa Jr. (born November 10, 1968) is an American comedian, actor, and radio host.','1968-11-10',NULL),(2020,'Ray Lui','Chợ Lớn, Saigon, Republic of Vietnam','Ray Lui was born on December 22nd, 1956 in Vietnam. He is an Actor and Assistant Director.','1956-12-22',NULL),(2021,'Chad Riley','Winnipeg, Manitoba, Canada','','1979-12-26',NULL),(2022,'Raphaël Carlier','Bois-Colombes, Hauts-de-Seine, Île-de-France, Fran','Son of French TV columnist Guy Carlier, Raphaël gained popularity as a French YouTuber with the duo Mcfly & Carlito formed with David Coscas.','1986-08-30',NULL),(2023,'Janit Baldwin','Kansas City - Missouri - USA','','1953-07-24',NULL),(2024,'Stan Stone',NULL,'',NULL,NULL),(2025,'Dot-Marie Jones','Turlock, California, USA','Dorothy-Marie Jones (born January 4, 1964) is an American actress and retired athlete who has had multiple roles in television. She attended California State University, Fresno, where she set records for shot put. Jones is also a 15-time world arm wrestling champion. She was a recurring guest star starting in the second season of the musical television series Glee as Coach Beiste, and appeared through the show\'s sixth and final season, when she was promoted to starring status. She was nominated for the Primetime Emmy Award for Outstanding Guest Actress in a Comedy Series in 2011, 2012, and 2013 for her portrayal of Coach Beiste. She is also known for her roles as Coach Kelly in Lizzie McGuire and Butch Brenda in Material Girls.','1964-01-04',NULL),(2026,'Ashraf Barhom','Tarshiha, Palestine','','1979-01-08'