tage and screen actor, director, and producer who appeared in over 150 films between 1961 and 1996. His parents were exiled to Mexico,  where Aldo began a football career in Puebla F.C., known as Madrileño Sánchez. When he returned to Spain he played for Alcoyano and Rayo Vallecano, and finally started to work as an actor.','1931-02-23','2010-07-10'),(2081,'Eva Green','Paris, France','Eva Gaëlle Green, born July 6th 1980, is a French actress and model. She started her career in theatre before making her film debut in 2003 in Bernardo Bertolucci\'s controversial The Dreamers. She achieved international recognition when she appeared in Ridley Scott\'s Kingdom of Heaven, and portrayed Vesper Lynd in the James Bond film Casino Royale. In 2006, Green was awarded the BAFTA Rising Star Award.','1980-07-06',NULL),(2082,'Joe Chrest','St. Albans, West Virginia, USA','Joseph Chrest is an American academic and actor. He has had roles in numerous films and television shows including 21 Jump Street, 22 Jump Street, Oldboy, Lee Daniels\' The Butler, The Perfect Date, and as Ted Wheeler in Stranger Things.','1963-05-26',NULL),(2083,'Simon Leung',NULL,'',NULL,NULL),(2084,'Darrell Lee Hall',NULL,'',NULL,NULL),(2085,'Anthony Molinari','Worcester, Massachusetts, United States','From Wikipedia, the free encyclopedia\n\nAnthony Molinari (born May 9, 1974) is an American actor, stunt performer and stunt coordinator. He played Neary in The Fighter. Three-time Screen Actors Guild Award nominee.\n\nDescription above from the Wikipedia article Anthony Molinari, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1974-05-09',NULL),(2086,'Philip Kieffer','Philadelphia, Pennsylvania, USA','','1886-07-31','1962-07-13'),(2087,'Paul Tinto',NULL,'',NULL,NULL),(2088,'Antonio Fisher',NULL,'',NULL,NULL),(2089,'Steven Michael Quezada',NULL,'Steven Michael Quezada; born February 15, 1963 is an American actor and politician. He played Drug Enforcement Administration agent Steven Gomez in the AMC series Breaking Bad from 2008 to 2013.','1963-02-15',NULL),(2090,'Roy Huang',NULL,'',NULL,NULL),(2091,'Obi Abili','Nigeria','',NULL,NULL),(2092,'Emily Piggford','Victoria, British Columbia, Canada','',NULL,NULL),(2093,'Bryan Foster',NULL,'',NULL,NULL),(2094,'Sampley Barinaga',NULL,'Sampley Barinaga is an actor and a huge lover of film. He has worked with Oscar , Emmy , BAFTA, and Golden Globe winners throughout his career (Allison Janney, Martin Sheen, Robert Duvall, and Bryan Cranston), and trains in his craft every single day. His passion for acting and film burn brighter each and every day, hoping to shine on others who ...',NULL,NULL),(2095,'Pran Sikand','Delhi, India','From Wikipedia, the free encyclopedia\n\nPran (born Pran Krishan Sikand on 12 February 1920) is a multiple Filmfare and BFJA award-winning Indian actor, who is one of the most popular villains of Hindi cinema.He has appeared in over 350 films. Pran played the leading man in films like Pilpili Saheb, Halaku (1956), Dharma(1973), Jangal Mein Mangal (1972), Gaddar and Ek Kunwari Ek Kunwara (1973). His pivotal roles in the films such as Jis Desh Mein Ganga Behti Hai (1960), Half Ticket (1962), Manoj Kumar’s Upkaar (1967) and Purab Aur Paschim, Aurat(1967), Ansoo Ban Gaye Phool, Kab? Kyoon? Aur Kahan?, Johny Mera Naam(1970), Victoria No. 203, Zanjeer (1973), Chori Mera Kaam(1975) , Amar Akbar Anthony (1977), Chor Ke Ghar Chor(1978), Don (1978), Maan Gaye Ustaad(1981) and Duniya(1984) are considered to be among his best performances. In 2010, he has been named on the list of CNN\'s \"Top 25 Asian actors of all time\". He won the Filmfare Best Supporting Actor Award in 1967, 1969, and 1972 and was awarded the Filmfare Lifetime Achievement Award in 1997. In 2001, he was honoured with the Padma Bhushan by the Government of India, for his contribution to Indian cinema. Contrary to the villainous characters he played in his early films, he is very social, a member of various organizations, and even has his very own football team, \'Bombay Dynamos Football Club\'.\n\nDescription above from the Wikipedia article Pran, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1920-02-12','2013-07-12'),(2096,'Wyatt Russell','Los Angeles, California, USA','Wyatt Hawn Russell (born July 10, 1986) is an American actor and former ice hockey player. He is best known for his roles as Corporal Lewis Ford in Julius Avery\'s 2018 horror film, Overlord, and as Dud in AMC\'s Lodge 49. He plays John Walker in the Disney+ series The Falcon and the Winter Soldier, which is set in the Marvel Cinematic Universe. He is also the son of actors Goldie Hawn and Kurt Russell.','1986-07-10',NULL),(2097,'Geoff Gustafson','Vancouver, British Columbia, Canada','','1974-02-20',NULL),(2098,'Pavel Vladimirov',NULL,'',NULL,NULL),(2099,'Joseph Fischer',NULL,'',NULL,NULL),(2100,'Campbell Lane','Canada ','','1935-01-01','2014-01-30'),(2101,'Aimee J. Nelson',NULL,'',NULL,NULL),(2102,'Merlin Olsen',NULL,'','1940-09-15','2010-03-10'),(2103,'E-40','Vallejo, California, USA','From Wikipedia, the free encyclopedia.\n\nEarl Stevens (born November 15, 1967), better known by his stage name E-40, is an American rapper from Vallejo, California. He is also part of the rap group The Click and the founder of Sick Wid It Records. His solo debut album, Federal, was released in November 1992, after The Click\'s debut album \"Down and Dirty\" came out in May 1992. E-40\'s 1995 solo album In a Major Way opened him up to a wider audience. He has released over ten albums, including those with his group The Click; he has also appeared on numerous movie soundtracks and has guest appearances on a host of other rap albums. Starting in 1998, he worked with rappers outside the Bay Area and rose to even higher mainstream popularity in 2006 with his single \"Tell Me When to Go\" which was produced by Lil Jon.\n\nDescription above from the Wikipedia article E-40, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1967-11-15',NULL),(2104,'Tom Wilson','Helena, Montana, USA','','1880-08-26','1965-02-19'),(2105,'Thomas Ian Nicholas','Las Vegas, Nevada, USA','Thomas Ian Nicholas (born July 10, 1980) is an American film actor, singer, musician, producer, director, and writer. Nicholas is best known for playing Henry Rowengartner in Rookie of the Year and Kevin Myers in American Pie, American Pie 2, and American Wedding.\n\nFrom Wikipedia, the free encyclopedia','1980-07-10',NULL),(2106,'Buck Young','Winchester, Virginia, USA','Buck Young (August 6, 1921 - February 4, 2000) was an American actor.','1921-08-06','2000-02-04'),(2107,'Michael Arthur',NULL,'',NULL,NULL),(2108,'Janene Carleton','Kelowna, British Columbia, Canada','Janene is the youngest of 3 children, born and raised in Kelowna, Canada. Growing up she was always a well-rounded athlete having participated in a wide range of sports & dance. But her main focus was competitive horseback riding where she competed at a national level in show jumping and three day eventing. Janene shifted her focus from the competitive horse circuit to attend college in Victoria BC, where she studied Biology and English. She also became a personal trainer, fitness model and began to dabble in mixed martial arts. However, it was through Janene\'s experience with training animals and horses that helped her transition into her career as a stunt woman by 2005.\n\nIt didn\'t take long for the rest of her experience as a well-rounded athlete to launch her into her full-fledged career as a well-rounded stunt woman. She has since doubled many of Hollywood\'s biggest action stars including Angelina Jolie, Jessica Biel, Paula Patton and Carla Gugino.\n\nA highlight in Janene\'s stunt career was being recognized by her stunt peers in 2011, winning a World Taurus Stunt Award for \'Best Overall Stunt Performed by a Woman\' for her action doubling Angelina Jolie in \'Salt\'.','1978-04-14',NULL),(2109,'Ben Coyle-Larner',NULL,'',NULL,NULL),(2110,'Ellie Kemper','Kansas City, Missouri, USA','Elizabeth Claire \"Ellie\" Kemper (born May 2, 1980) is an American actress, comedian, and writer. She is best known for her roles as Erin Hannon in the NBC series The Office and Kimmy Schmidt in the NBC comedy Unbreakable Kimmy Schmidt. She is also known for her supporting roles in the films Bridesmaids and 21 Jump Street.','1980-05-02',NULL),(2111,'Tyler Neitzel','San Diego, California, USA','Tyler Neitzel was born on September 19, 1991 in San Diego, California, USA. He is an actor, known for 300 (2006), Reconciliation (2009) and City Bus (2015).','1991-09-19',NULL),(2112,'Vincent Kiala',NULL,'',NULL,NULL),(2113,'Francesco Bruni',NULL,'',NULL,NULL),(2114,'Marco Khan','Tehran, Iran','',NULL,NULL),(2115,'Zsófi Trecskó','Kecskemét, Hungary','','1987-08-11',NULL),(2116,'Nate Boyer',NULL,'',NULL,NULL),(2117,'Harikrishnan',NULL,'',NULL,NULL),(2118,'Sean Owen Roberts',NULL,'',NULL,NULL),(2119,'Weiwei Wang',NULL,'',NULL,NULL),(2120,'Zinaid Memišević',NULL,'','1950-04-26',NULL),(2121,'Jesse Eisenberg','New York City, New York, USA','Jesse Adam Eisenberg (born October 5, 1983) is an American actor, writer and filmmaker. He has received various accolades, including nominations for an Academy Award, two BAFTA Awards, a Golden Globe Award and two Screen Actors Guild Awards.\n\nHe made his television debut with the short-lived comedy-drama series Get Real (1999–2000). Following his first leading role in the comedy-drama film Roger Dodger (2002), he appeared in the films The Village (2004), The Squid and the Whale (2005), and The Education of Charlie Banks (2007). He is also known for playing Facebook founder Mark Zuckerberg in David Fincher\'s film The Social Network (2010), which earned him nominations for the BAFTA, Golden Globe, and Academy Award for Best Actor.\n\nIn 2009, Eisenberg had his breakthrough with starring roles in the comedy-drama film Adventureland, and the horror comedy Zombieland. He has since starred in the heist films Now You See Me (2013), its 2016 sequel and the dramas The Double (2013), The End of the Tour (2015), The Art of Self-Defense (2019). In 2016, he portrayed Lex Luthor in the superhero film Batman v Superman: Dawn of Justice and he reprised the role in Justice League (2017). In 2022, he starred in the FX / Hulu miniseries adaptation of Fleishman Is in Trouble. He released his film directorial debut with the A24 film When You Finish Saving the World (2023).\n\nEisenberg has contributed pieces to The New Yorker and McSweeney\'s websites. He has written and starred in three plays for the New York stage: Asuncion, The Revisionist, and The Spoils. He released his first book, Bream Gives Me Hiccups: and Other Stories in 2015.','1983-10-05',NULL),(2122,'Roseanne Barr','Salt Lake City, Utah, USA','Roseanne Cherie Barr (born November 3, 1952) is an American actress, comedian, writer, television producer and director.\n\nBarr began her career in stand-up comedy at clubs in Colorado in the 1980s. Her big break came in 1987 when she was cast in her own sitcom, Roseanne. The show was a hit and lasted nine seasons, from 1988 to 1997. Barr won both an Emmy Award and a Golden Globe Award for Best Actress for her work on the show. In addition, she has won six People\'s Choice Awards, three American Comedy Awards, a Kids Choice Award, a GLAAD Media Award, and the TV Land Innovator Award.\n\nBarr starred in the film She-Devil (1989) and had a voice role in Look Who\'s Talking Too (1991). In 2004, she voiced one of the main characters in the animated film Home on the Range. After her sitcom ended, Barr launched her own talk show, The Roseanne Show, which aired from 1998 to 2000. She later returned to stand-up in the mid-2000s. She had guest spots on shows, 3rd Rock from the Sun, The Nanny, and My Name Is Earl. Barr released her autobiography in 1989, a second book in 1994, and a third book in 2011. She will star in her own reality TV show on Lifetime, revolving around her family and life on her farm. She hosts a radio show on KCAA on Sundays.\n\nIn 1990, controversy arose when she sang the \"The Star-Spangled Banner\" during a nationally aired baseball game, by singing the song off-key, then spitting and grabbing her crotch. The next year she appeared in People magazine announcing that she was an \"incest survivor\", something her parents and sister publicly denied. Twenty years later Barr and her sister appeared on The Oprah Winfrey Show to explain how they felt at the time. She was married to Bill Pentland for 15 years and had three children before divorcing and marrying comedian Tom Arnold four days later. Their marriage lasted for four years, before going through a highly publicized divorce. Barr married her bodyguard in 1995 and had one child before divorcing in 2002. She began dating Johnny Argent in 2003, and now lives in Hawaii.\n\nDescription above from the Wikipedia article Roseanne Barr, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1952-11-03',NULL),(2123,'Danny Lima',NULL,'',NULL,NULL),(2124,'Londale Theus',NULL,'',NULL,NULL),(2125,'Anthony Ramsey',NULL,'',NULL,NULL),(2126,'Peter McRobbie','Hawick, Borders, Scotland, UK','Peter McRobbie is a Scottish-born American character actor, best known for his roles as Pop Pop Jamison in the 2015 horror film The Visit and Father Paul Lantom in Daredevil, as well as a recurring role in the TNT series The Alienist.','1943-01-31',NULL),(2127,'Raj Lal','British Columbia, Canada','','1985-04-29',NULL),(2128,'Tommy Lee','Athens, Greece','Thomas Lee Bass (born October 3, 1962) is an American musician and founding member of Mötley Crüe. As well as being the band\'s long-term drummer, Lee founded rap-metal band Methods of Mayhem, and has pursued solo musical projects.\n\nLee was born Thomas Lee Bass on October 3, 1962, in Athens, Greece, to father David Lee Thomas Bass, an American U.S. Army sergeant, and mother Vassilikki \"Voula\" Papadimitriou (Greek: Βασιλική Παπαδημητρίου), a Miss Greece contestant for the 1960 Miss World event. His family moved to California a year after he was born. He received his first drum when he was four years old, and his first drum kit when he was a teenager. Lee dropped out of high school to pursue a career in music, starting with the band Suite 19. He has a younger sister, Athena Lee (née Bass), who was also the drummer in his solo band KrunK and was married to James Kottak, the drummer for the rock band Scorpions.\n\nAs a teenager, Lee listened to Led Zeppelin, Van Halen, Cheap Trick, Kiss, AC/DC and Sweet. His main drumming influences were John Bonham, Tommy Aldridge, Alex Van Halen and Terry Bozzio.','1962-10-03',NULL),(2129,'Toru Nakamura','Inagi, Tokyo, Japan','Toru Nakamura (仲村 トオル Nakamura Tōru, born September 5, 1965) is a Japanese actor. His real name is Tōru Nakamura (中村 亨 Nakamura Tōru).\n\nNakamura co-starred in Bok Geo-il\'s 2009 Lost Memories along with Jang Dong-gun and in Lou Ye\'s Purple Butterfly with Zhang Ziyi and Liu Ye.\n\nHe co-starred in Junji Sakamoto\'s 2010 film Strangers in the City with Manami Konishi.','1965-09-05',NULL),(2130,'Sergei Guryev','USSR','','1974-10-23',NULL),(2131,'Nick Donadio',NULL,'',NULL,NULL),(2132,'Derek Hoffman',NULL,'',NULL,NULL),(2133,'James Cagney','New York City, New York, USA','From Wikipedia, the free encyclopedia.\n\nJames Francis Cagney, Jr. (July 17, 1899 – March 30, 1986) was an American film actor. Although he won acclaim and major awards for a wide variety of roles, he is best remembered for playing \"tough guys\". In 1999, the American Film Institute ranked him eighth among the Greatest Male Stars of All Time.\n\nIn his first performing role, Cagney danced dressed as a woman in the chorus line of the 1919 revue Every Sailor. He spent several years in vaudeville as a hoofer and comedian until his first major acting role in 1925. He secured several other roles, receiving good reviews before landing the lead in the 1929 play Penny Arcade. After rave reviews for his acting, Warners signed him for an initial $500 a week, three-week contract to reprise his role; this was quickly extended to a seven year contract. Cagney\'s seventh film, The Public Enemy, became one of the most influential gangster movies of the period. Notable for its famous grapefruit scene, the film thrust Cagney into the spotlight, making him one of Warners\' and Hollywood\'s biggest stars.\n\nIn 1938, he received his first Academy Award Best Actor nomination for Angels with Dirty Faces, before winning in 1942 for his portrayal of George M. Cohan in Yankee Doodle Dandy. He was nominated a third time in 1955 for Love Me or Leave Me. Cagney retired for 20 years in 1961, spending time on his farm before returning for a part in Ragtime mainly to aid his recovery from a stroke.\n\nCagney walked out on Warners several times over his career, each time coming back on improved personal and artistic terms. In 1935, he sued Warners for breach of contract and won; this marked one of the first times an actor had beaten a studio over a contract issue. He worked for an independent film company for a year while the suit was settled, and also established his own production company, Cagney Productions, in 1942 before returning to Warners again four years later. Jack Warner called him \"The Professional Againster\", in reference to Cagney’s refusal to be pushed around. Cagney also made numerous morale-boosting troop tours before and during World War II, and was President of the Screen Actors Guild for two years.\n\nDescription above from the Wikipedia article James Cagney, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1899-07-17','1986-03-30'),(2134,'Teruyuki Tanzawa','Saitama, Japan','','1985-02-23',NULL),(2135,'Peter Hooten','Clermont, Florida, USA','','1950-11-29',NULL),(2136,'Igor Taradaykin',NULL,'',NULL,NULL),(2137,'Oscar Gale',NULL,'',NULL,NULL),(2138,'Alanna Tremblay',NULL,'',NULL,NULL),(2139,'Heather Dawn',NULL,'',NULL,NULL),(2140,'Suriya','Chennai, Tamil Nadu, India','Saravanan Sivakumar known by his stage name Suriya, is an Indian film actor, producer and television presenter, best known for his work in Tamil cinema.\n\nAfter making his debut in Nerukku Ner (1997), Suriya landed his breakthrough role in Nandha (2001) and then had his first major commercial success with the thriller Kaakha Kaakha (2003). As of 2010, he has won three Tamil Nadu State Film Awards and three Filmfare Awards South. In 2013, Suriya founded the production house 2D Entertainment.\n\nHe is the eldest son of Tamil film actor Sivakumar and his younger brother Karthi is also an actor. Suriya married co-star Jyothika in 2006, after being engaged for several years. In 2008, he began Agaram Foundation, which funds for various philanthropic activities.','1975-07-23',NULL),(2141,'Mark Docherty',NULL,'',NULL,NULL),(2142,'Vincent Kok','Hong Kong','Vincent Kok Tak-Chiu  (Chinese:谷德昭 , born 15 August 1965) is a Hong Kong actor, scriptwriter and film director. Kok is best known for his frequent collaborations with Stephen Chow, acting and co-writing with him the films Forbidden City Cop, From Beijing with Love and The God of Cookery in addition to producing and co-writing Chow\'s 2007 film CJ7. He also made a cameo appearance in Chow\'s Shaolin Soccer as a hapless soccer player. Kok also wrote, directed and starred alongside Jackie Chan in Gorgeous, a rare romantic comedy by the martial arts actor.\n\nDescription above from the Wikipedia article Vincent Kok, licensed under CC-BY-SA, full list of contributors on Wikipedia','1965-08-15',NULL),(2143,'Sam Johnston','Bellefontaine - Ohio - USA','Sam Johnston is an American professional wrestler signed to WWE, where he works under the ring name Solomon Crowe. Previously known as Sami Callihan, he worked for several independent promotions throughout the United States. He found most success in Combat Zone Wrestling (CZW), but also wrestled for Dragon Gate USA, Evolve, Ring of Honor, Pro Wrestling Guerrilla, Full Impact Pro, and All American Wrestling.','1987-09-01',NULL),(2144,'Brett Lapeyrouse','Houma, Louisiana, USA','','1993-09-20',NULL),(2145,'David W. Harper','Abilene, Texas, USA','','1961-10-04',NULL),(2146,'Manuel Cauchi',NULL,'',NULL,NULL),(2147,'Shin Goo','Seoul, South Korea','Shin Goo (신구), born Shin Soon-gi (신순기), is a South Korean actor.','1936-08-13',NULL),(2148,'Alex Napiwocki',NULL,'',NULL,NULL),(2149,'Mark Kiely','Providence, Rhode Island, USA','Mark Kiely is an American actor, probably best known for his recurring guest appearance as Gil Meyers in Beverly Hills, 90210. He also appeared in Charlie\'s Angels and The Judge. He currently lives in Rhode Island and is a beloved swim coach to many. He also graduated from Assumption College in Worcester, Mass.','1963-01-16',NULL),(2150,'Jonathan Good','Cincinnati, Ohio, USA','Jonathan Good is an American professional wrestler currently signed to All Elite Wrestling (AEW) and New Japan Pro Wrestling (NJPW), where he appears under the name Jon Moxley. He was previously known for his work in World Wrestling Entertainment (WWE) under his former ring name Dean Ambrose, where he was one-third of the stable The Shield before signing with AEW and NJPW.','1985-12-07',NULL),(2151,'Doris Morgado',NULL,'','1981-07-17',NULL),(2152,'Boban Samuel',NULL,'',NULL,NULL),(2153,'Philippe Passon',NULL,'',NULL,NULL),(2154,'Dax Flame','United States','Madison Patrello (born November 5, 1991), better known online as Daxflame, is an American YouTube Vlogger and actor, who joined YouTube in 2007. some of his known movie credits are Project X (2012), 21 Jump Street (2012), and 22 Jump Street (2014).','1991-11-05',NULL),(2155,'Andreanne Ross',NULL,'',NULL,NULL),(2156,'Zhang Yujiao',NULL,'',NULL,NULL),(2157,'Andrea Frankle',NULL,'Andrea Frankle is an American TV, film and stage actress best known for her work as Susanna Macon on critically-acclaimed Underground, Ellie Stanton of The Purge and Jan in HBO\'s True Detective, Season 1.','1975-07-17',NULL),(2158,'Bart Baggett',NULL,'Bart A. Baggett is an American author and speaker. Baggett is a ten-time author who has appeared on over 1500 radio and TV shows including CNN, Today Show, Good Morning America and appeared in over 16 feature films.\n\nFrom Wikipedia, the free encyclopedia',NULL,NULL),(2159,'Michael Segovia',NULL,'',NULL,NULL),(2160,'Michael Wozniak',NULL,'',NULL,NULL),(2161,'Ritchie Coster','London, England, UK','Ritchie Coster (born 1 July 1967) is an English actor. He is best known for playing the roles of Dietrich Banning in The Tuxedo (2002), the Chechen in The Dark Knight (2008), Elias Kassar in Blackhat (2015), Mayor Austin Chessani on the second season of the HBO anthology television series True Detective and Francisco Scaramucci / Mr. Blue on the SyFy television series Happy!.','1967-07-01',NULL),(2162,'Raghubir Yadav','Jabalpur, Madhya Pradesh, India','Raghubir Yadav or Raghuvir Yadav is an Indian film, stage and television actor, music composer, singer and set designer. He made his film debut with Massey Sahib (1985), in which he played the title role. He has garnered two International Awards as Best Actor for Massey Sahib, FIPRESCI Critic\'s Award, Venice Film Festival, 1986 and the IFFI Best Actor Award (Male): Silver Peacock Award at the 11th International Film Festival of India, 1987. The film also starred the noted writer and social activist Arundhati Roy. Raghuvir Yadav is an alumnus of the 1977 batch at the National School of Drama, New Delhi','1957-06-25',NULL),(2163,'Jacob Renton',NULL,'',NULL,NULL),(2164,'Massimiliano Rossi','Napoli','','1970-01-01',NULL),(2165,'George Daly','Detroit, Michigan, USA','','1888-12-13','1937-02-24'),(2166,'Charles Ferrara',NULL,'',NULL,NULL),(2167,'Cliff DeYoung','Los Angeles, California, USA','Clifford Tobin DeYoung (born February 12, 1945) is an American actor and musician.\n\nPrior to his acting career, he was the lead singer of the 1960s rock group Clear Light, which played with The Doors, Jimi Hendrix, and Janis Joplin. After the band broke up, he starred in the Broadway production of Hair and the Tony Award-winning Sticks and Bones. After four years in New York, he moved back to California to star in the television film Sunshine, about a young mother dying of cancer, and featuring the songs of John Denver. There was also a short-lived television series based on the film. The song \"My Sweet Lady\" from the film reached #17 on the Billboard Hot 100 Pop Chart in 1974. A sequel, Sunshine Christmas, was produced in 1977.\n\nSince then, DeYoung has made more than 80 films and television series, including The 3,000 Mile Chase (1977), Centennial (1978), the 1981 \"sequel\" to The Rocky Horror Picture Show, Shock Treatment, where he played two characters and sang a duet with himself, and Flight of the Navigator (1986). In the 1989 Civil War film Glory, he played the controversial Union Colonel James Montgomery. Other projects include the films Suicide Kings (1997) and Last Flight Out (2004).\n\nHe has guest-starred on Star Trek: Deep Space Nine (in the episode \"Vortex\") and as Amber Ashby\'s kidnapper, John Bonacheck, on The Young and the Restless in 2007.\n\nFrom Wikipedia, the free encyclopedia','1945-02-12',NULL),(2168,'Ashley Bissing',NULL,'',NULL,NULL),(2169,'Mike Camello',NULL,'',NULL,NULL),(2170,'Allen Holubar','San Francisco, California, USA','','1888-08-03','1923-11-20'),(2171,'Adrian Scarborough','Melton Mowbray, Leicestershire, England, UK','','1968-05-10',NULL),(2172,'Mikijiro Hira','Hiroshima, Hiroshima Prefecture, Japan','From Wikipedia, the free encyclopedia\n\nMikijirō Hira (平 幹二朗 Hira Mikijirō) was a Japanese actor. Starting as a stage actor in the 1950s, he also worked in film and television and was active until the time of his death. From the 1970s he starred in several of Yukio Ninagawa\'s productions, including an acclaimed role as Macbeth. Described as \"Japan\'s best Shakespearean actor\", Hira received several awards throughout his career, including an excellence award at the 2011 National Arts Festival hosted by the Japanese government\'s Agency for Cultural Affairs.','1933-11-21','2016-10-22'),(2173,'David Fleischer',NULL,'',NULL,NULL),(2174,'George Young Jr.',NULL,'',NULL,NULL),(2175,'Ivan Kaloshev',NULL,'',NULL,NULL),(2176,'Ikki Sawamura','Kagoshima, Kagoshima Prefecture, Japan','Ikki Sawamura (沢村 一樹 Sawamura Ikki, born July 10, 1967) is a Japanese model, film and television actor, and television presenter signed to Ken-On.','1967-07-10',NULL),(2177,'Mark Cheek',NULL,'',NULL,NULL),(2178,'Kim Collins',NULL,'',NULL,NULL),(2179,'Daryl Dismond',NULL,'',NULL,NULL),(2180,'Joshua David Brown',NULL,'',NULL,NULL),(2181,'Nicolas Marié','Versailles, Yvelines, France','','1954-02-22',NULL),(2182,'Jessica Lea Risco',NULL,'',NULL,NULL),(2183,'Michael Beasley','Omaha, Nebraska, USA','Michael Beasley is an American actor.',NULL,NULL),(2184,'Corey Michael Eubanks',NULL,'While training for a Golden Gloves boxing tournament in Southern California, Corey was discovered in his gym and cast to play the role of a young boxer in the feature film The Sting II (1983) for Universal Pictures. Intrigued by the entertainment industry, Corey spent the next four years perfecting his craft as a professional stuntman on the television show The Dukes of Hazzard (1979). Soon Corey\'s talents as a stuntman were in demand, and he began working on several other action shows such as The A-Team (1983), Hunter (1967), and The Fall Guy (1981). Throughout his twenty-year career, Corey has kept extremely busy working as one of Hollywood\'s top professional stuntmen.',NULL,NULL),(2185,'Chad Power','Ventura, California, USA','','1984-01-30',NULL),(2186,'Charles Papasoff','Montreal, Quebec, Canada','','1956-01-01',NULL),(2187,'Riley G. Matthews, Jr.','Eureka Springs, Arkansas, USA','','1960-08-07',NULL),(2188,'Allison Lee Ritter',NULL,'',NULL,NULL),(2189,'Adam Baldwin','Chicago, Illinois, USA','Appearing in dozens of films since 1980, Baldwin rose to prominence as the troubled outcast Ricky Linderman in My Bodyguard (1980) and moved on to bigger roles in D.C. Cab (1983), Full Metal Jacket (1987), Independence Day (1996), The Patriot (2000) and Serenity (2005)—in which he reprises his role as the mercenary Jayne Cobb from the television series Firefly. His other work includes Radio Flyer (1992), From the Earth to the Moon (1998), The X-Files (Knowle Rohrer), Smoke Jumpers (1996), The Cape, Men in Black: The Series, Stargate SG-1, Angel, The Inside, NCIS and the 2005 remake of The Poseidon Adventure. He also starred in the ABC series Day Break as Chad Shelten in 2006. Baldwin parodied the Ricky Linderman character in the 2008 film Drillbit Taylor. Baldwin won a SyFy Genre Award in 2006 for Best Supporting Actor/Television for his role as Jayne Cobb in the television series Firefly. Baldwin was cast as Clark Kent/Superman in the first DC animated universe movie, Superman: Doomsday, based on DC Comics\' The Death of Superman and is currently co-starring in the NBC television show Chuck as NSA Agent John Casey. The show premiered September 24, 2007. Baldwin has a role as a voice actor in the Xbox 360 games Halo 3 and Halo 3: ODST, the latter putting him in the role of Cpl. Taylor \"Dutch\" Miles. Baldwin also appears as a voice actor in Half Life 2: Episode 2 for various resistance soldiers and citizens. Adam also appeared in Mass Effect 2, playing the role of Quarian marine Kal\'Reegar. Baldwin was born in Chicago, Illinois and studied at New Trier Township High School East in Winnetka, Illinois. He has three children with his wife, Ami. He has been a registered voter with the Democratic Party since 1980, but admits reexamining his views after being given a copy of David Horowitz\'s book Radical Son. Politically, he considers himself a \"small government conservative libertarian\", and has contributed blogs to the Huffington Post and Big Hollywood. As a hobby, he also collects and posts links to varying viewpoints on his Twitter feed','1962-02-27',NULL),(2190,'Wings Hauser','Hollywood, California, USA','From Wikipedia, the free encyclopedia\n\nWings Hauser (born December 12, 1947) is an American actor, director, film writer.\n\nDescription above from the Wikipedia article Wings Hauser, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1947-12-12',NULL),(2191,'Maya Markova',NULL,'',NULL,NULL),(2192,'Caitlin Carmichael','Tifton, Georgia, USA','Caitlin Carmichael (born July 2, 2004) is an American actress','2004-07-02',NULL),(2193,'Peter McNeil O\'Connor',NULL,'',NULL,NULL),(2194,'Blu Mankuma','Seattle, Washington, USA','Blu Mankuma (born July 5, 1948) is an American actor. He has appeared in numerous Canadian and American productions filmed in Canada.\n\nMankuma was born in Seattle, Washington. Among Mankuma\'s film credits are Tin Man, The Russia House, Another Stakeout, Harmony Gate, Bird on a Wire, Harmony Cats, Cadence, Look Who\'s Talking, Connor\'s War, Shoot to Kill, Blacktop, Eureka, 2012 and G-Saviour The Movie, the first attempt so far at a live action G-n-am Movie. Television credits include continuing roles on M.A.N.T.I.S., Forever Knight, Madison, Love on the Run (1994), Street Justice, Mom P.I., 21 Jump Street, Huckleberry Finn and His Friends, RoboCop and his role as host of the seven-part series Diversity. Individual television episodic credits include the series The X-Files, The Outer Limits, Supernatural, Kung Fu, North of 60, The Round Table, Hat Squad, Scene of The Crime, Booker, Wiseguy, MacGyver, Walt Disney\'s Davy Crockett, Blue\'s Folly, Stargate SG-1 and Jack.\n\nMankuma is widely-known as the voice of Tigatron, Tigerhawk and one of the Vok in Beast Wars. Other notable roles include Gigabyte in ReBoot, Heavy Duty in G.I. Joe: Spy Troops and G.I. Joe: Valor vs. Venom, and Anubis in the 1997 cartoon Mummies Alive!.\n\nHe also done voices on other animated films and television shows including Spider-Man Unlimited, Extreme Dinosaurs, Fat Dog Mendoza, RoboCop: Alpha Commando, NASCAR Racers, Scruff, G.I. Joe Extreme, Captain N: The Game Master, Trollz, The Animated Adventures of Tom Sawyer, Space Strikers, Double Dragon, He-Man and the Masters of the Universe, Madeline, Inspector Gadget\'s Last Case, Ultimate Book of Spells, Shadow Raiders, X-Men Evolution, Being Ian, Sabrina, the Animated Series, Sonic Underground, The Littlest Angel, Barbie: Mermaidia, Firehouse Tales, The Wacky World of Tex Avery, Littlest Pet Shop, Card Captors, CatDog, Sherlock Holmes in the 22nd Century, Gadget Boy, Yvon of the Yukon, Billy the Cat, Super Duper Sumos and A Hollywood Hound\'s Christmas.\n\nMankuma became an internet celebrity in 2010 for his seminal work in \"Sex Ed Video: Puberty,\" a YouTube sensation from San Francisco to Columbus, Ohio.\n\nMankuma is an avid musician, singer, songwriter and stage actor. He and his family currently reside in Vancouver.\n\nFrom Wikipedia, the free encyclopedia','1948-07-05',NULL),(2195,'Claudia Jennings','Evanston, Illinois, USA','Claudia Jennings, born Mary Eileen Chesterton (20 December 1949 - 3 October 1979), was an American model, stage and screen actress. She was Playboy magazine\'s Playmate of the Month for November 1969 and also Playmate of the Year for 1970. Jennings subsequently pursued a career in acting, and was known as the \"Queen of B movies\". She died in an automobile accident at the age of 29.','1949-12-20','1979-10-03'),(2196,'John Scott Clough','Nederlander, Colorado, USA','','1960-07-04',NULL),(2197,'Ezio Greggio','Cossato, Biella, italy','Ezio Greggio (Cossato, 7 aprile 1954) è un attore, regista e conduttore televisivo italiano. È anche iscritto all\'ordine dei giornalisti','1954-04-07',NULL),(2198,'Márcio Sossay',NULL,'',NULL,NULL),(2199,'Jonny Lavelle',NULL,'',NULL,NULL),(2200,'Isabella Rocchietta',NULL,'',NULL,NULL),(2201,'Claudio Masciulli','Villamagna, Italy','','1954-10-06',NULL),(2202,'Tanvi Ram','Kannur, Kerala, India','',NULL,NULL),(2203,'Stephan James','Toronto, Ontario, Canada','Stephan James (born December 16, 1993) is a Canadian actor. After starring in a string of television series as a teenager, he rose to prominence upon winning a Canadian Screen Award for Best Actor for his role as track and field sprinter Jesse Owens in the 2016 film Race.\n\nIn 2018, he starred in Barry Jenkins\' acclaimed drama film If Beale Street Could Talk, based on the James Baldwin novel of the same name. Also that year, he portrayed Walter Cruz in the Amazon series Homecoming, for which he received a Golden Globe Award nomination.\n\nDescription above from the Wikipedia article Stephan James (actor), licensed under CC BY-SA, full list of contributors on Wikipedia.','1993-12-16',NULL),(2204,'Luke Healy',NULL,'',NULL,NULL),(2205,'Richard Madden','Elderslie, Renfrewshire, Scotland, UK','Richard Madden (born June 18, 1986) is a Scottish actor. He was cast in his first role at age 11 and made his screen acting debut in 2000. He later began performing on stage whilst a student at the Royal Conservatoire of Scotland. In 2007, he toured with Shakespeare\'s Globe company as Romeo in Romeo and Juliet, a role he reprised in the West End in 2016. Madden rose to fame with his portrayal of Robb Stark in the fantasy drama series Game of Thrones from 2011 to 2013.\n\nMadden subsequently played Prince Kit in the romantic fantasy film Cinderella (2015) and Italian banker Cosimo de\' Medici in the first season of the historical fiction series Medici (2016). In 2018, he gained acclaim for his performance as a police officer in the thriller series Bodyguard, for which he won a Golden Globe Award. The following year, Madden was named one of the 100 most influential people in the world by Time, and he had supporting roles as music manager John Reid in the biopic Rocketman and a soldier in the war film 1917. He has since starred as Ikaris in the Marvel Cinematic Universe superhero film Eternals (2021) and as a spy in the action thriller series Citadel (2023).','1986-06-18',NULL),(2206,'Chim Wah-Leung',NULL,'',NULL,NULL),(2207,'Junior Oliphant',NULL,'',NULL,NULL),(2208,'Tam Wai-Ho',NULL,'',NULL,NULL),(2209,'Jang Dong-gun','Yongsan, Seoul, South Korea','Jang Dong-gun (born March 7, 1972) is a South Korean actor and musician.\n\nDescription above from the Wikipedia article Jang Dong-gun, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1972-03-07',NULL),(2210,'Peter Karas','Houston, Texas, USA','',NULL,NULL),(2211,'Huo Qing','Beijing, China','','1962-11-14',NULL),(2212,'Clyde Ventura',NULL,'',NULL,NULL),(2213,'Ryan Gardner Smith',NULL,'',NULL,NULL),(2214,'Anil Kapoor','Mumbai, Maharashtra, India','Living in a Chawl in Tilak Nagar, Punjabi-speaking Anil was born in 1959 to Surinder and Nirmal aka Suchitra Kapoor. He has an elder brother, Boney, a sister, Reena, and a younger brother, Sanjay. His dad used to be Shammi Kapoor\'s Secretary.\n\nA loner, without many friends, he studied in the nearby O.L.P.S. (Our Lady of Perpetual Succor) School, and was an ardent fan of Bollywood flicks that were telecast during the Ganesh Maha Utsav every year. He was a fan of Raj Kapoor, and it was this that influenced his acting, and people saw him as a mimic of the legendary showman. He landed a role as a child artiste with Shashi Kapoor in the lead, but the movie (Tu Payal Main Geet) was never released.\n\nAfter school, he went to study in St. Xaviers College. He commuted by bus and train from Chembur to Bombay V.T., and the walked the rest of the way. It was here that he met Mazhar Khan. A distracted Anil was kicked out of College in the second year due to his lack of presence. His attempts to join the Pune Film Institute were in vain, as he failed in the written examination. He then decided to join Roshan Taneja\'s Acting school.\n\nHe first appeared on the silver screen in Hamhare Tumhare in a character role. His first lead role was in \'Woh 7 Din\' and from thence on there has been no looking back. He has acted in close to a 100 movies, and has 5 in production. He has produced two movies (Gandhi My Father & Badhaai Ho Badhaai), as well as been a Casting Director/Outdoor In charge for \'Hum Paanch\'.\n\nKapoor\'s first role in an international film was in Danny Boyle\'s 2008 Academy Award-winning film Slumdog Millionaire, for which he shared the Screen Actors Guild Award for Outstanding Performance by a Cast in a Motion Picture. His performance in the eighth season of the action series 24 generated rave reviews from the American press Globally, Anil Kapoor is one of the most recognized Indian actors.\n\nAnil met wealthy and chic model, Sindhi-speaking Sunita Bhambhani, and married her in 1984. Since then they have given birth to 3 children, kapoor has two daughters and a son Harshwardhan Kapoor.Kapoor\'s elder daughter is actress Sonam Kapoor. Rhea Kapoor attended school in New York and is now a producer in Mumbai.','1956-12-24',NULL),(2215,'Edward Keane','New York City, New York, USA','From Wikipedia, the free encyclopedia\n\nEdward Keane (May 28, 1884 – October 12, 1959) was an American film actor. He appeared in more than 300 films between 1921 and 1955.','1884-05-28','1959-10-12'),(2216,'Armie Hammer','Los Angeles, California, USA','Armand Douglas \"Armie\" Hammer (born August 28, 1986) is an American actor. After appearing on television and playing the title role in 2008\'s Billy: The Early Years, he became known for his portrayal of the Winklevoss twins in the 2010 film The Social Network. His notorious film roles include Clyde Tolson in J. Edgar, Prince Albert Alcott in Tarsem Singh\'s Snow White, and The Lone Ranger.','1986-08-28',NULL),(2217,'Gail Greaves',NULL,'',NULL,NULL),(2218,'Rand Kingsley',NULL,'',NULL,NULL),(2219,'Dean Kreyling',NULL,'',NULL,NULL),(2220,'Carroll \'Pinky\' Duwart III',NULL,'',NULL,NULL),(2221,'Carlos Javier Rivera',NULL,'',NULL,NULL),(2222,'Ronn Surels',NULL,'Ronn Daniel Surels is a stuntman and actor.',NULL,NULL),(2223,'Ekaterina Malikova','Zhukovsky, USSR (Russia)','','1982-03-05',NULL),(2224,'Nano Asmorodano',NULL,'',NULL,NULL),(2225,'Corey McKinley',NULL,'',NULL,NULL),(2226,'Ben Steel',NULL,'',NULL,NULL),(2227,'Lindsey Broad','Ohio, USA','Lindsey Broad is an American television, stage, and film actress. She is best known for her role as flirtatious temp Cathy Simms on the NBC series The Office. Her film credits include 21 Jump Street, Don Jon, and Get Him to the Greek. She also starred on the Fox sitcom, \'Til Death, and appeared opposite Stephen Merchant on the HBO series Hello Ladies. Her theatre credits include the world premiere of Sukie and Sue: Their Story, by Michael John LaChiusa, at the Blank Theatre.\n\nShe starred as Karen Rosenberg on the IFC series Benders, which was cancelled in 2015.','1984-12-08',NULL),(2228,'Danielle Hubbard',NULL,'',NULL,NULL),(2229,'Masachika Ichimura','Kawagoe, Saitama Prefecture, Japan','Masachika Ichimura (市村 正親 Ichimura Masachika, born January 28, 1949) is a Japanese actor and voice actor. He was born in Kawagoe, Saitama and studies at Theater Art College in Tokyo after graduating high school. He is best known to anime fans as the voice of Mewtwo. He is married to singer Ryoko Shinohara.','1949-01-28',NULL),(2230,'Valene Kane','Newry, Northern Ireland','Valene Kane is a British-Irish actress born and raised in Newry, N.Ireland where she trained as a dancer.\n\nAt the age of 15, Valene joined the prestigious National Youth Theatre. Two years later, she moved to London to train at the Royal Central School of Speech and Drama.\n\nShe is best known for roles as Rose Stagg in The Fall opposite Jamie Dornan and Lyra Erso in Rogue One: A Star Wars Movie.','1987-01-30',NULL),(2231,'Erin Marie Hogan','St. Louis, Missouri, USA','Born in St. Louis, Missouri, Erin first displayed interest in the entertainment industry when she built a stage out of cardboard bricks in her preschool classroom and directed her classmates to stand on the make-shift stage and perform.  Throughout her school years, she performed in numerous school and community plays and eventually, in films.  She also sang with local bands Failside and Tight Pants Syndrome.  Erin recently appeared in the films Paranormal Entity and 6 Guns.  The streaming series, Kingdom Come premieres in June, 2010.','1985-09-22',NULL),(2232,'Danielle Graham',NULL,'',NULL,NULL),(2233,'Hans Nielsen','Hamburg, Germany','','1911-11-30','1965-08-17'),(2234,'Eddie Parker','Waukegan, Illinois, USA','From Wikipedia, the free encyclopedia\n\nEddie Parker (December 12, 1900 – January 20, 1960) was an American stuntman and actor who appeared in many classic films, mostly westerns and horror films. Some of his more famous films and serials include the 1943 \"Batman\" (as Lewis Wilson\'s stunt double), The Crimson Ghost, Abbott and Costello Meet the Mummy (as the Mummy), and Rear Window for Alfred Hitchcock as well as many classic Universal horror films. He appeared three times in the early television series, Tales of the Texas Rangers, and also performed stunts for that program.\n\nParker died of a heart attack in 1960.','1900-12-12','1960-01-20'),(2235,'Ben Hart',NULL,'',NULL,NULL),(2236,'Alex Zahara','Grande Prairie, Alberta, Canada','Alex Zahara is a Canadian actor and a voice actor. Alex was born in Northern Alberta, and, according to his mother, has always enjoyed performing for others. He grew up loving the classics in acting,Humphrey Bogart, James Cagney, etc. Got involved with theatre while still in school, performing in a stage version of MASH. Took some time off to travel Europe and while lying on a beach in Greece, decided to go to Film School. Later, taught a class on \"Acting for Teens\" at the Vancouver Film School. Acquired his BFA from U of A and UBC.',NULL,NULL),(2237,'Sab Shimono','Sacramento, California, USA','From Wikipedia, the free encyclopedia.  \n\nSab Shimono (born July 31, 1937) is an American actor who has appeared in dozens of movies and television shows in character roles.\n\nDescription above from the Wikipedia article Sab Shimono, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1937-07-31',NULL),(2238,'Alexandre Haussmann',NULL,'',NULL,NULL),(2239,'Mauro Aversano','Rome, Lazio, Italy','','1974-02-23',NULL),(2240,'Filomena Luiza',NULL,'',NULL,NULL),(2241,'Aaron Kwok','Hong Kong, British Crown Colony [now China]','Aaron Kwok Fu-shing (born 26 October 1965) is a Hong Kong singer, dancer and actor. He has been active since the 1980s to the present. The media refer to him, Jacky Cheung, Andy Lau and Leon Lai as the Cantopop Four Heavenly Kings .Kwok\'s onstage dancing and displays is influenced by Michael Jackson.While most of his songs are in the dance-pop genre, he has experimented numerous times with rock and roll, ballad, rock, R&B, soul, electronica and traditional Chinese music.\n\nDescription above from the Wikipedia article Aaron Kwok, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1965-10-26',NULL),(2242,'Dean Marshall',NULL,'',NULL,NULL),(2243,'Frank Shannon','Ireland','Frank Shannon was an Irish-born stage and screen performer. He had his film debut in The Prisoner of Zenda (1913). He is most fondly remembered as the brilliant Dr. Zarkov in the three Flash Gordon serials.','1874-07-27','1959-02-01'),(2244,'Richard Donner','Bronx, New York, USA','Richard Donner (born Richard Donald Schwartzberg; April 24, 1930 – July 5, 2021) was an American film director, producer, and occasional comic book writer. The production company The Donners\' Company was owned by Donner and his wife, producer Lauren Shuler Donner. After directing the horror film \"The Omen\" (1976), Donner became famous for the creation of the first modern superhero film, \"Superman\" (1978), starring Christopher Reeve. The influence of this film eventually helped establish the superhero concept as a respected film genre. Donner went on to direct such enduringly popular titles as \"The Goonies\" (1985), \"Scrooged\" (1988) and the \"Lethal Weapon\" series (1987-98).','1930-04-24','2021-07-05'),(2245,'Angela Seto',NULL,'',NULL,NULL),(2246,'John Mee',NULL,'',NULL,NULL),(2247,'Michaël Abiteboul','Tours, Indre-et-Loire, France','',NULL,NULL),(2248,'Darryl Cox','Wiesbaden, Hesse, West Germany','','1955-04-08',NULL),(2249,'Björn Freiberg','Isny im Allgäu, Germany','','1970-03-28',NULL),(2250,'Aaron Cohen','Montreal, Quebec, Canada','Aaron Cohen (born 28 February 1976) is an Israeli-American writer, director, actor, author and former Duvdevan Special Forces soldier specializing in counter-terrorism. He wrote the memoir Brotherhood of Warriors.','1976-02-28',NULL),(2251,'Brian G. Andersson','The Bronx, New York City, New York, USA','','1957-02-24',NULL),(2252,'Bernie Henry',NULL,'',NULL,NULL),(2253,'Renaldo Brady',NULL,'',NULL,NULL),(2254,'Joe Anders',NULL,'',NULL,NULL),(2255,'Kalaiyarasan',NULL,'Kalaiyarasan is an Indian actor, who works in the Tamil film industry. He has collaborated with directors Myshkin and Ranjith, and made a breakthrough with his performance in Madras (2014). Kalaiyarasan, a graduate in Computer Applications from SRM University, initially began work as an actor with Parthy Bhaskar\'s Arjunan Kadhali in 2008, but the film remains unreleased.He then worked with director Myshkin on two ventures, Nandalala (2010) and Mugamoodi (2012), and credits the film maker as his mentor. He also played small roles in Ranjith\'s directorial debut Attakathi (2012), playing the suitor to the heroine, as well as in Vikram Sugumaran\'s Madha Yaanai Koottam (2013).','1986-02-20',NULL),(2256,'Gary Peterman',NULL,'',NULL,NULL),(2257,'Anthony Spampanato',NULL,'',NULL,NULL),(2258,'Jay Wilsey',NULL,'','1896-02-06','1961-10-25'),(2259,'Anne Heche','Aurora, Ohio, USA','Anne Celeste Heche (May 25, 1969 – August 11, 2022) was an American actress. She first came to recognition portraying twins Vicky Hudson and Marley Love on the soap opera Another World (1987–1991), winning her a Daytime Emmy Award and two Soap Opera Digest Awards. She achieved greater prominence in the late 1990s with roles in the crime drama film Donnie Brasco (1997), the disaster film Volcano (1997), the slasher film I Know What You Did Last Summer (1997), the political satire film Wag the Dog (1997), the action comedy film Six Days, Seven Nights (1998), and the drama-thriller film Return to Paradise (1998).\n\nFollowing her portrayal of Marion Crane in Gus Van Sant\'s horror remake film Psycho (1998), which earned her a Saturn Award nomination, Heche went on to have roles in many well-received independent films, such as the drama film Birth (2004), the sex comedy film Spread (2009), Cedar Rapids (2011), the drama film Rampart (2011), and the black comedy film Catfight (2016). She received acclaim for her role in the television film Gracie\'s Choice, which earned her a Primetime Emmy Award nomination, and for her work on Broadway, particularly in a restaging of the play Twentieth Century, for which she received a Tony Award nomination.\n\nIn addition to her film roles, Heche starred in the comedy drama television series Men in Trees (2006–2008), Hung (2009–2011), Save Me (2013), Aftermath (2016), and the military drama television series The Brave (2017). She voiced Suyin Beifong in the animated television series The Legend of Korra (2014), and appeared as a contestant in the 29th season of Dancing with the Stars (2020).\n\nDescription above from the Wikipedia article Anne Heche, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1969-05-25','2022-08-11'),(2260,'Michael Forest','Harvey, North Dakota, USA','Michael Forest is an American stage, film, television and voice over actor. He holds a BA in English and Drama from San Jose State University, California, USA.','1929-04-17',NULL),(2261,'Spike Leighton',NULL,'Spike Leighton is an actor, known for 1917 (2019) and Sex Education (2019).',NULL,NULL),(2262,'Kate Tsui','Hong Kong, China','Kate Tsui Tsz-shan is a Hong Kong actress most well-known for her career with broadcaster TVB. She is the 2004 Miss Hong Kong pageant winner. In June 2019, she graduated from the University of Hong Kong with a Master\'s degree in Psychology.','1979-06-19',NULL),(2263,'Tim Barlow','Blackpool, England, UK','Born Michael John Leigh Barlow in Blackpool, Tim Barlow became profoundly deaf whilst in the army but left to pursue a career in acting despite this disability. In 2008 was fitted with a cochlear implant which enabled him to hear for the first time in over 50 years.','1936-01-18','2023-01-20'),(2264,'William H. Burns','New York City, New York, USA','','1960-11-25',NULL),(2265,'Kim Gyu-ri','Anyang, Gyeonggi, South Korea','Kim Gyu-ri (Hangul: 김규리; born 16 August 1979), previously known as Kim Min-sun (Hangul: 김민선) is a South Korean actress best known for the film Portrait of a Beauty.','1979-08-16',NULL),(2266,'Jeremeo Le Cordeur',NULL,'',NULL,NULL),(2267,'Brendan Sexton III','Staten Island, New York, USA','Brendan Eugene Sexton III (born February 21, 1980) is an American actor.','1980-02-21',NULL),(2268,'Mark Nager',NULL,'',NULL,NULL),(2269,'Patrick Sabongui','Montreal, Quebec, Canada','','1975-01-09',NULL),(2270,'Addison Metcalf',NULL,'',NULL,NULL),(2271,'Robson Nunes','São Bernardo do Campo, São Paulo, Brazil','Robson Nunes nasceu em 6 de agosto de 1982, em São Bernardo do Campo, São Paulo, Brasil. Ele é um ator, conhecido por 2 Coelhos (2012), Carandiru (2003) e Domésticas (2001).','1982-08-06',NULL),(2272,'Sam Gilman','Lynn, Massachusetts, USA','','1915-02-05','1985-12-03'),(2273,'Michael Tower',NULL,'',NULL,NULL),(2274,'Bruno Romagnoli',NULL,'',NULL,NULL),(2275,'Agam Darshi','Birmingham, West Midlands, England, United Kingdom','From Wikipedia, the free encyclopedia.\n\nAgam Darshi is an English-born actress, now based in Vancouver, British Columbia, Canada.\n\nDescription above from the Wikipedia article Agam Darshi, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1982-06-20',NULL),(2276,'Yan Ma','Chengde, Heibei, China','',NULL,NULL),(2277,'Wang Yuanda',NULL,'',NULL,NULL),(2278,'George Poulos','Chicago, Illinois, USA','','1939-03-09',NULL),(2279,'Jett Turner',NULL,'',NULL,NULL),(2280,'Florence Dudley','Maysville, Missouri, USA','Florence Dudley (born Florence Angeline Leddy; January 28, 1902 -  May 23, 1953) was an American actress.','1902-01-28','1953-05-23'),(2281,'Nandan Unni',NULL,'',NULL,NULL),(2282,'Kazuhiro Mashiko',NULL,'',NULL,NULL),(2283,'Jena Malone','Sparks, Nevada, USA','Jena Malone (born November 21, 1984) is an American actress, musician, and photographer. She made her film debut in Bastard Out of Carolina (1996) and has appeared in films including Ellen Foster (1997), Contact (1997), Stepmom (1998), For Love of the Game (1999), Donnie Darko (2001), Life as a House (2001), Saved! (2004), Pride & Prejudice (2005), Into the Wild (2007), The Ruins (2008), Sucker Punch (2011), The Hunger Games film series (2013–15), The Neon Demon (2016), Nocturnal Animals (2016), and Antebellum (2020).\n\nMalone is also an indie pop musician who has released music both under her own name (as \"Jena Malone and Her Bloodstains\") and as one-half of the duo The Shoe.','1984-11-21',NULL),(2284,'Emily Roeske','Milwaukee, Wisconsin, USA','Emily Marie Roeske (born July 15, 1991) is best known for her role as Sophie Cromwell in the first three Disney Channel Original Movies, Halloweentown, Halloweentown II: Kalabar\'s Revenge, and a small role in Halloweentown High. Also, she was karate girl in 3 Ninjas: High Noon at Mega Mountain and Alicia in Fell\'s Redeemer. She appeared on ER in the September 30, 1999 episode \"Leave it to Weaver.\"\n\nShe did not reprise her role in the October 2006 Disney Channel movie, Return to Halloweentown, but her character was mentioned briefly.\n\nDescription above from the Wikipedia article Emily Roeske, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1991-07-15',NULL),(2285,'Maital Sabban',NULL,'',NULL,NULL),(2286,'Dragana Atlija',NULL,'Dragana Atlija is known for The November Man (2014), Everly (2014) and Ironclad: Battle for Blood (2014).',NULL,NULL),(2287,'Edgar Leza',NULL,'Edgar Leza is known for Zoo (2015), We Have a Ghost and Money Plane (2020).',NULL,NULL),(2288,'Kelly Carlson','Minneapolis, Minnesota, USA','From Wikipedia, the free encyclopedia.\n\nKelly Lee Carlson (born February 17, 1976) is an American actress and model. She is best known for her role as Kimber Henry on Nip/Tuck. In 2001 she was listed on Tear Sheet Magazine\'s 50 Most Beautiful list.','1976-02-17',NULL),(2289,'Tom Cowling',NULL,'',NULL,NULL),(2290,'Amélie Sorel',NULL,'','1983-03-15',NULL),(2291,'Qi Yuwu','Guangzhou, Guangdong, China','Arguably one of the most successful local TV actors to have crossed over to movies, Qi Yuwu launched his acting career when he won the China round of All Asian Star Search 1999, a regional talent search contest. The Physical Education graduate from Guangzhou Sports University then signed on with MediaCorp and based himself in Singapore.\n\nA natural actor, Yuwu was cast alongside regional artistes in his first TV series, Master Swordsman Lu Xiao Feng, followed immediately by another TV co-production Dare To Strike with veteran Hong Kong artistes. Through the years, Yuwu has acted in numerous drama serials, and became one of Singapore’s favourite leading man with his acting skills and idol good looks.\n\nHe has been consistently nominated for Best Actor in MediaCorp’s annual Star Awards, as well as a winner for the Top 10 Most Popular Male Artistes. He was named Screen Heartthrob of the 2000s at the Star Awards 25th Drama Anniversary Show in 2007, and was Highly Commended for Best Drama Performance by An Actor at Asian Television Awards 2009 for his role in The Little Nyonya, the highest rated local drama in recent years. In 2011, he was awarded Best Actor at the Star Awards for his outstanding performance in The Family Court.\n\nYuwu’s illustrious movie career started in 2007. Home Song Stories, starring renowned international actress Joan Chen, received a total of 7 Golden Horse nominations, including Best Film and Best Original Screenplay, as well as 14 nominations at the Australian Film Institute (AFI) Awards in 2007, including Best Lead Actor for Yuwu. 881, directed by local award-winning director, Royston Tan, is one of the most successful local films in terms of box office and critical acclaim.\n\nIn 2008, Yuwu acted with Donnie Yen & Zhou Xun in Painted Skin, a regional movie that scored exceptional box office in China and was also Hong Kong\'s official entry into the 2009 Oscars.\n\nIn 2016, he successfully ascended to All Time Favourite status and also awarded Best Actor at the Star Awards for his outstanding performance in The Dream Makers 2.\n\nHis Most recent production is A Quest To Heal which is premiering in July 2020.','1976-11-28',NULL),(2292,'Eduardo Parisi',NULL,'',NULL,NULL),(2293,'Park Shin-hye','Gwangju, South Korea','Park Shin-hye (Hangul: 박신혜; born February 18, 1990) is a South Korean actress, singer and dancer. She is best known for her leading roles in the television dramas You\'re Beautiful (2009), Heartstrings (2011), Flower Boys Next Door (2013), The Heirs (2013) and Pinocchio (2014).','1990-02-18',NULL),(2294,'Jacqueline Woods',NULL,'',NULL,NULL),(2295,'Beshoy Mehany',NULL,'',NULL,NULL),(2296,'Daniel Wu','Berkeley, California, USA','Daniel Wu is a Chinese-American actor, director, and producer. Since his film debut in 1998, he has been featured in over 60 films. He was awarded Best Supporting Actor for his role in \"New Police Story\", and was awarded Best New Director for his mockumentary, \"The Heavenly Kings\". Currently, he is most well-known for his role as Sunny in the AMC action series \"Into the Badlands\".','1974-09-30',NULL),(2297,'D.J. Mills',NULL,'',NULL,NULL),(2298,'Rob Wiethoff',NULL,'',NULL,NULL),(2299,'Jesse Yarborough','Tampa, Florida