 the 1970s and early 1980s, he worked with his elder brother, Yuen Woo-ping, and other members of the Yuen family on several films, some of them kung fu comedies such as Shaolin Drunkard (1982) and The Miracle Fighters (1983). Son of Simon Yuen Siu-Tin.','1957-01-01',NULL),(2315,'Pip Carter',NULL,'',NULL,NULL),(2316,'Stephen Cirieco',NULL,'',NULL,NULL),(2317,'Brian Hooks','Bakersfield, California, USA','','1973-07-27',NULL),(2318,'Lance LeGault','Chicago, Illinois, USA','Lance LeGault (May 2, 1935 – September 10, 2012) was an American actor.','1935-05-02','2012-09-10'),(2319,'Alan Cohen',NULL,'',NULL,NULL),(2320,'Arata Furuta','Kobe, Hyogo Prefecture, Japan','Arata Furuta (古田 新太 Furuta Arata, born as Takafumi Furuta on December 3, 1965 in Kobe) is a Japanese theatre and movie actor.\n\nFurata has a broad range that goes from playing serious salary men, to bushi in period drama roles, and even women.','1965-12-03',NULL),(2321,'Bert Kittel',NULL,'',NULL,NULL),(2322,'Tony Askin',NULL,'',NULL,NULL),(2323,'Mark Strong','London, England, UK','Mark Strong (born Marco Giuseppe Salussolia; 5 August 1963) is a British actor. He is best known for his film roles such as Prince Septimus in Stardust (2007), Archibald in RocknRolla (2008), Lord Henry Blackwood in Sherlock Holmes (2009), Frank D\'Amico in Kick-Ass (2010), Jim Prideaux in Tinker Tailor Soldier Spy (2011), Sinestro in Green Lantern (2011), George in Zero Dark Thirty (2012), Major General Stewart Menzies in The Imitation Game (2014), Merlin in Kingsman: The Secret Service (2014) and Kingsman: The Golden Circle (2017), Dr. Thaddeus Sivana in Shazam! (2019), and John in Cruella (2021).\n\nDescription above from the Wikipedia article Mark Strong, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1963-08-05',NULL),(2324,'Artie Ortego','San Jose, California, USA','','1890-02-09','1960-07-24'),(2325,'Lisa Arturo','Los Angeles, California, USA','','1963-05-21',NULL),(2326,'Igor Morozov',NULL,'',NULL,NULL),(2327,'Danny De La Paz','Whittier, California, USA','','1957-04-03',NULL),(2328,'Gerard Plunkett','Dublin, Ireland','','1955-08-14',NULL),(2329,'Valentine Monnier','Paris, France','Valentine Monnier (born 22 October 1956, in Paris) is a French actress, model, and photographer. She appeared on the September 1977 cover of Cosmopolitan magazine, and on the cover art of the album Chic, also in 1977. In a November 2019 interview, she accused film director Roman Polanski of violently raping her in Switzerland in 1975 when she was 18.\n\nSource: Article \"Valentine Monnier\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1956-10-22',NULL),(2330,'Vera Farmiga','Clifton, New Jersey, USA','Vera Ann Farmiga (born August 6, 1973) is an American actress and director. Farmiga made her film debut in the 1998 drama thriller Return to Paradise. This was followed by supporting roles in the 2000 romantic film Autumn in New York and the 2001 television series UC: Undercover. She was also cast in the 2001 thriller 15 Minutes. Her other film appearances and roles include the 2003 comedy Dummy, the 2004 drama Down to the Bone, the 2006 crime thriller The Departed, the 2007 horror Joshua, and the 2008 drama The Boy in the Striped Pyjamas. Farmiga gained critical acclaim following her work in the 2009 comedy-drama Up in the Air, for which she was nominated for an Academy Award, a BAFTA Award, a Golden Globe Award, and a Screen Guild Actors Award. She also starred as Kate Coleman in Orphan in 2009. Her latest appearance was in the critically acclaimed 2011 thriller/action movie Source Code, as Capt. Colleen Goodwin.','1973-08-06',NULL),(2331,'Reid Asato',NULL,'',NULL,NULL),(2332,'Mary Gillis',NULL,'',NULL,NULL),(2333,'Kate Sargeant','San Jose, California, USA','','1980-11-22',NULL),(2334,'Nichapa Prakornkitwattana',NULL,'',NULL,NULL),(2335,'Kevin Brief','Brooklyn, New York, USA','Kevin is an accomplished actor, known for his work on stage, television, and film. He was born in Brooklyn, New York and spent his early years there before his family relocated to Long Beach, California.\n\nIt was during high school football that he discovered his love for acting. When summer school was required for football, he also took a drama class, which ultimately led him to pursue a career in theater.\n\nAfter earning his Bachelor of Arts in Theater from California State University, Long Beach, Kevin went on to earn a Masters of Fine Arts in Acting from the prestigious Asolo/FSU Conservatory in Sarasota, Florida. After completing his training, he moved to Kansas City, where he began his professional acting career. While working in the Midwest, Kevin established himself as a full-time working actor, with roles on stage, in films, commercials, and voice-overs.\n\nEventually, Hollywood called, and Kevin moved back to Southern California. Since then, he has continued his work in theater, as well as appearing on television and in feature films. Television-wise, Kevin has had roles in everything from \'Baywatch to Big Bang Theory\', \'Fresh Prince of Belair to Friends\', \'Golden Girls to Grey\'s Anatomy\'... well, you get the idea. A lot of shows! Kevin has also lent his voice and face to several hundred TV and radio commercials.',NULL,NULL),(2336,'Patrick Garrow','Canada ','Patrick Garrow is a Canadian actor.',NULL,NULL),(2337,'Kyle Riefsnyder','Canada ','',NULL,NULL),(2338,'Jim Brown','St. Simons Island, Georgia, USA','Jim Brown was an American former professional football player who also made his mark as an actor. He is best known for his exceptional and record-setting nine-year career as a running back for the NFL Cleveland Browns from 1957 to 1965. In 2002, he was named by Sporting News as the greatest professional football player ever. He is considered to be one of the greatest professional athletes the U.S. has ever produced.\n\nDescription above from the Wikipedia article Jim Brown, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1936-02-17','2023-05-18'),(2339,'Brad Hansen',NULL,'',NULL,NULL),(2340,'Sarah Lieving','Canton, Illinois, USA','Since beginning her acting career in 2002, Sarah has appeared in many creature, fantasy and science fiction-based outings. In addition to her video and film work, Sarah has found roles on television series such as Criminal Minds (2005) and The Witches of Oz (2011).',NULL,NULL),(2341,'Luis Javier',NULL,'',NULL,NULL),(2342,'Troy Robinson',NULL,'Doubles: Vin Diesel, Randy Couture.\n\nAwards & Achievements\n\n2011 Winner Taurus Stunt Award \"Best High Work\"\n\n2012 Winner Taurus Stunt Award \"Best Fight\"\n\n2012 Winner Taurus Stunt Award \"Best Hight Work\"\n\n2012 Winner Taurus Stunt Award \"Best Stunt Coordinator\"\n\n2014 Winner Taurus Stunt Award \"Best Stunt Coordinator\"',NULL,NULL),(2343,'Seth Adkins','Albuquerque, New Mexico, U.S.','From Wikipedia, the free encyclopedia.\n\nSeth Elijah Adkins (born October 30, 1989) is an American actor. He made his debut in the mid-1990s as a child artiste in the TV shows Small Talk and Sabrina, the Teenage Witch in 1996 and the films ...First Do No Harm and Titanic in 1997. He later made a successful transition to an adult performer. One of his most recent roles was in Matt Reeves\' Let Me In (2010).\n\nDescription above from the Wikipedia article Seth Adkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1989-10-30',NULL),(2344,'Pascal Bongard',NULL,'',NULL,NULL),(2345,'Geoff Ward',NULL,'',NULL,NULL),(2346,'Ben Sebastian',NULL,'',NULL,NULL),(2347,'Sébastien Lalanne',NULL,'',NULL,NULL),(2348,'Isaach De Bankolé','Abidjan, Côte d\'Ivoire','Isaach or Isaac de Bankolé (born 12 August 1957; Abidjan, Côte d\'Ivoire) is an Ivorian actor.\n\nDe Bankolé was born in Abidjan, Ivory Coast, to Yoruba parents from Benin. His grandparents are from Nigeria.[6] He moved to Paris in 1975 for his last year of lycée and pursued a master\'s degree in physics and mathematics. He then attended an aviation school and earned a private pilot licence, before a chance encounter with French director Gérard Vergez led him to enroll in the Cours Simon, a Parisian drama school.','1957-08-12',NULL),(2349,'Michael Sopkiw','Connecticut, USA','','1954-01-12',NULL),(2350,'Walter Carvalho Jr',NULL,'',NULL,NULL),(2351,'Dash Mihok','New York City, New York, USA','Dashiell Raymond Mihok (born May 24, 1974) is an American actor and director best known for playing Brendan \"Bunchy\" Donovan in the Showtime drama Ray Donovan.','1974-05-24',NULL),(2352,'Piper Perabo','Dallas, Texas, USA','Piper Lisa Perabo (born October 31, 1976) is a Golden Globe Award nominated American stage, film and television actress. Since her breakthrough role in Coyote Ugly (2000), she has appeared in films such as Lost and Delirious (2001), Cheaper by the Dozen (2003), Cheaper by the Dozen 2 (2005), The Prestige (2006), Beverly Hills Chihuahua (2008), and Looper (2012). Since 2010, she has played Annie Walker on the USA Network series Covert Affairs, for which she has been nominated for a Golden Globe Award for Best Actress.\n\nEarly life\n\nPerabo was born in Dallas, Texas, the daughter of Mary Charlotte (née Ulland), a physical therapist, and George William Perabo, a professor of poetry at Ocean County College. She is of English, German, Irish, and Norwegian descent; while her surname is sometimes described as Portuguese, it originates in Germany, where her paternal grandfather\'s family came from. She grew up in Toms River, New Jersey.\n\nPerabo\'s parents named her after actress Piper Laurie. She has two younger brothers: Noah (born 1979) and Adam (born 1981). She graduated from Toms River High School North in 1994, and earned a bachelor\'s degree in theater from Honors Tutorial College at Ohio University in 1998. She also studied Latin, physics, and poetry in her final year.\n\nPerabo was first noticed a year before she graduated from university. She was in New York City, visiting her then-boyfriend, and accompanied him to an audition. Casting director Denise Fitzgerald spotted her and asked her to read for a part. She was not cast, but when Fitzgerald found out that she didn\'t have any representation, she made phone calls on Perabo\'s behalf and found her an agent.\n\nPersonal life Perabo has been close friends with actress Lena Headey since they starred together in the 2005 films The Cave and Imagine Me & You. She speaks fluent French, and is an advocate of LGBT rights. As of 2013, she is engaged to Stephen Kay.She is the part-owner of the prohibition-themed bar Employees Only in West Village, Manhattan, which opened in 2005, and the restaurant Jack\'s Wife Freda in SoHo, Lower Manhattan, which opened in 2012.\n\nDescription above from the Wikipedia article Piper Perabo, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-10-31',NULL),(2353,'Eddie Dunn','Brooklyn [now in New York City], New York, USA','From Wikipedia, the free encyclopedia\n\nEdward Frank Dunn (March 31, 1896 – May 5, 1951) was an American actor best known for his roles in comedy films, supporting many comedians such as Charley Chase (with whom he co-directed several short films), Charlie Chaplin, W.C. Fields, and Laurel and Hardy. Dunn also appeared as Detective Grimes in several of The Falcon series of films in the 1940s which starred George Sanders and later on Sanders\' brother Tom Conway, and in many small and uncredited parts in many feature films until his death in 1951 aged 55.','1896-03-29','1951-05-05'),(2354,'Jim Chong',NULL,'',NULL,NULL),(2355,'Serge Feuillard',NULL,'',NULL,NULL),(2356,'Dmitry Endaltsev',NULL,'','1989-02-20',NULL),(2357,'John McConnell','Baton Rouge, Louisiana','From Wikipedia, the free encyclopedia\n\nJohn McConnell (born November 13, 1958), aka John \"Spud\" McConnell, is an American actor and radio personality based in New Orleans, Louisiana. McConnell is a character actor who has appeared in more than 40 films, ranging from obscure independent films (mostly filmed locally in New Orleans, or elsewhere set in the Gulf Coast region) to major cinematic release movies (such as the Coen Brothers production O Brother, Where Art Thou?). McConnell has also appeared in numerous plays, including an off-Broadway run in the one-man show The Kingfish, wherein he portrays colorful Louisiana Governor Huey P. Long. He is perhaps best-known for having portrayed Ignatius J. Reilly from the Pulitzer Prize winning novel A Confederacy of Dunces, and in that role was the model for a life-sized bronze statue of the fictitious character on historic Canal Street in downtown New Orleans. On television, McConnell made appearances over three seasons of Roseanne, with good friend and colleague John Goodman. Most recently, McConnell is featured in a recurring role on the FX series The Riches, starring Eddie Izzard and Minnie Driver. McConnell is a conservative afternoon radio personality, hosting a daily call-in talk show, \"The Spud Show\", on WWL 870 AM and 105.3 FM.\n\nDescription above from the Wikipedia article John McConnell (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.','1958-11-13',NULL),(2358,'Daying Ye','Changchun, Jilin Province, China','','1958-01-01',NULL),(2359,'Indrans','Thiruvananthapuram, Kerala, India','Indrans is a Malayalam film actor and costume designer, working mainly in comedy roles. He has appeared in over 250 films. Indrans, a tailor by profession, debuted in the film Choothattam both as a costume designer and as an actor. The producer, TMN Charley, offered him a chance to assist in costume designing. Although he had the opportunity to meet many filmmakers, including evergreen hero Prem Nazir, Sattar, Pappu, Jose Prakash and Jayabharathi, he concentrated on designing costumes for several years in the industry, acting in minor roles on screen. Soon, Indrans started getting cast by well-known directors including Padmarajan, Venu Nagavally, Shaji N. Karun, Sibi Malayil and K. Madhu. CID Unni Krishnan was a turning point in his career. His brand of comedy clicked among the audiences and he went on to become a popular comedian in Kerala, and has worked steadily as an actor. As a comedy actor he has made most use of his slender, lean figure and typical accent to win over the audiences. He created his own style in cinema. Renowned directors Adoor Gopalakrishnan and T.V. Chandran also offered him roles.',NULL,NULL),(2360,'Joe Gelchion',NULL,'',NULL,NULL),(2361,'Andy Truschinski',NULL,'',NULL,NULL),(2362,'Patrick Adamson',NULL,'',NULL,NULL),(2363,'Carol Miranda',NULL,'',NULL,NULL),(2364,'Marty Kintu',NULL,'',NULL,NULL),(2365,'Paolo Calia',NULL,'',NULL,NULL),(2366,'Shera Li','Lanzhou，Gansu Province，C','','1988-07-20',NULL),(2367,'Jennifer Onvie',NULL,'Born in California, raised in Michigan.  Graduated from Michigan State University Honors College with Majors in PreMed, Psychology,  and a Bioethics/Humanities/Society Minor.\n\nCurrently living and working in New York City','1987-10-12',NULL),(2368,'Frank Langella','Bayonne, New Jersey, USA','Frank A. Langella, Jr. (born January 1, 1938) is an American stage and film actor.\n\nDescription above from the Wikipedia article Frank Langella, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1938-01-01',NULL),(2369,'AnnaMaria Demara','Toronto, Ontario, Canada','AnnaMaria Demara was born in Toronto, Ontario, Canada. She is known for her work on Check, Please! ( 2015).',NULL,NULL),(2370,'Hal Jay',NULL,'',NULL,NULL),(2371,'Alexei Putintsev',NULL,'',NULL,NULL),(2372,'Jo Prestia','Porto Empedocle (AG), Sicilia, Italia','Jo Prestia (born 5 June 1960 in Porto Empedocle) is an Italian born French kick boxer and actor. He appeared in more than seventy films since 1996 and is best known for his performance as Le Tenia in the controversial 2002 film, Irréversible.\n\nSource: Article \"Jo Prestia\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1960-06-05',NULL),(2373,'Ho-Sung Pak','Chicago, Illinois, USA','From Wikipedia, the free encyclopedia.  \n\nHo Sung Pak (born November 8, 1967) is an American film actor, martial artist, action choreographer, writer, and producer. Pak, a Korean American, was born in Seoul, South Korea. Not only did he play as the main villain of the first Mortal Kombat game, Shang Tsung, but he also played the Mortal Kombat champion Liu Kang for the first game and Mortal Kombat II. He was a stunt coordinator for the movie Teenage Mutant Ninja Turtles II: The Secret of the Ooze as well as a stunt double for Raphael; he later reprised his role of stunt double in the movie Teenage Mutant Ninja Turtles III. In 1995, he and fellow MK actors Daniel Pesina, Katalin Zamiar, and Dr. Phillip Ahn, M.D. all appeared in a fighting game produced exclusively for the Atari Jaguar titled Thea Realm Fighters, but it was never released after Atari ceased production on the failed system later that year. In 2003, he played the leading role in the martial arts movie The Book of Swords. In it he portrayed Lang, an Asian cop who after witnessing the death of his brother during a drugbust gone wrong, leaves town only to come back three years later for revenge. The movie also starred MK actors Daniel Pesina, Katalin Zamiar and Richard Divizio. In a nod to his Mortal Kombat alter ego Liu Kang, Pak is shown wearing a red headband during the final part of the movie, while the other three actors are also seen in similar MK clothing/roles throughout the movie. In 2004 Pak starred in the martial film Lesser of Three Evils, directed by Wayne A. Kennedy, also starring Roger Guenveur Smith, Peter Greene, Rosa Blasi and Sherilyn Fenn. The film was produced by Ho-Sung Pak, Wayne A. Kennedy and Matthew Chausse who created together the film company GenOne. It was released in 2009 under the title Fist of the Warrior. During the 1995-1997 show WMAC Masters, his ki-symbol was \"Superstar\", which is a translation of his given Korean name. His older brother, Ho Young Pak (\"Star Warrior\"), as well as fellow Mortal Kombat actors Chris Casamassa (\"Red Dragon\"), Hakim Alston (Machine) and Richard Branden (Yin Yang Man) also appeared on the show.\n\nDescription above from the Wikipedia article Ho-Sung Pak, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1967-11-08',NULL),(2374,'Konstantin Fedorov',NULL,'',NULL,NULL),(2375,'Rebekah Hart Franklin',NULL,'',NULL,NULL),(2376,'Xin Sarith Wuku',NULL,'',NULL,NULL),(2377,'Earl Dwire','Missouri, USA','','1883-10-02','1940-01-16'),(2378,'Clement Boegler',NULL,'',NULL,NULL),(2379,'Jayson Ward Williams',NULL,'',NULL,NULL),(2380,'John Wilmot',NULL,'',NULL,NULL),(2381,'Mercedes Leggett',NULL,'',NULL,NULL),(2382,'Natalie Tong','Hong Kong, China','','1981-05-03',NULL),(2383,'Dilshad Vadsaria','Karachi, Pakistan','Dilshad Vadsaria was born in Karachi, Pakistan, of Portuguese and Indian descent. She moved with her family to the US at the age of six and spent her childhood in various parts of the country, including Chicago, Richmond (Virginia) and Philadelphia, Pennsylvania. She eventually moved to New York to study acting.','1985-09-14',NULL),(2384,'Dennis St John','Lambeth, London, England, UK','Dennis St John was an actor.','1928-09-27','2007-11-06'),(2385,'Robert Segari',NULL,'',NULL,NULL),(2386,'Emma Jane Kraft',NULL,'',NULL,NULL),(2387,'Alexandra Beaton','Toronto, Ontario, Canada','','1994-12-05',NULL),(2388,'Mikhail Zhigalov','Kuybyshev, RSFSR, USSR','','1942-05-02',NULL),(2389,'Malcolm Barrett','Brooklyn - New York - USA','Malcolm Barrett (born 1980) is an American actor known for playing the role of scientist and time traveler Rufus Carlin in Timeless on NBC.\n\nHe was born and raised in Brooklyn, NY and attended Stuyvesant High School in Manhattan. He has appeared as a series regular on Fox\'s The Sketch Show and Luis.\n\nBarrett played the character \"Dr. Lem Hewitt\" on the ABC television show, Better Off Ted and was a supporting character in the Academy Award-winning The Hurt Locker.\n\nBarrett has had recurring appearances on the New York-based Law & Order franchise. He was featured as a squatter and drug dealer in an episode of The Sopranos and also guest starred in the pilot episode of It\'s Always Sunny in Philadelphia, the series finale of The Office as one of Dunder/Mifflin\'s new employees, and in an episode of Monk as a lottery fanatic. He also had a small role in the movie Larry Crowne, as one of Tom Hanks\' character\'s classmates. He has also appeared in several television commercials, including national spots for Hummer and AT&T. The AT&T spot, which features Barrett shooting baskets in a sports bar, received frequent airplay during the 2008 NCAA Men\'s Division I Basketball Tournament. Barrett began playing the role of Rufus Carlin in the Fall of 2016 in the NBC series, Timeless.\n\nBarrett is a spoken word artist and hip hop performer who has recorded under the aliases \"Tourette\'s,\" \"Verbal,\" and \"The Velvet Rope.\" He appeared on the 2002 EP Timber, by electronic recording artist M Pinto. He is currently working on his debut album entitled The Backpacker\'s Guide to the Galaxy.','1980-04-22',NULL),(2390,'Kerry Wieder',NULL,'',NULL,NULL),(2391,'Ôfuji',NULL,'',NULL,NULL),(2392,'Lisandro Boccacci','Buenos Aires, Argentina','Born in Buenos Aires, Argentina November 16th of 1986. A descendant of Giovani Boccaccio and survivors of WWI & II. His mother Liliana Irene Boccacci was a ballet dancer and instructor, native to Argentina. His father Tomas Alberto Boccacci was a computer programmer for different airlines and metro rail companies also native to Argentina. His grandfather Alberto Tomas Boccacci was the first Chemical Engineer from Argentina and on his mother\'s side, his grandfather Nilson Jaurigui was a farmer native to Argentina, he was a founder of a town called Loberia where the family today still has farmland. He was introduced to Charlie Chaplin\'s movie City Lights by his grandfather as a little boy that got him hooked wanting to make and act in films. Lilo spent some time going to school in Valbone, France, Buenos Aries, Argentina and in Miami Florida where his family survived the destructive force of Hurricane Andrew. Coming from modest means and surviving his encounter with cancer at 13 years old, Lisandro dreamed of one day being a leading man in Hollywood movies. First studied theater at Union High school in Tulsa, Oklahoma where he ran lights and sound and created the sets during stagecraft classes. He was too shy to act at the time. He obtained his Associates at the Tulsa Community College where he studied theater and film. He continued his theater and film studies at the University of Tulsa where he had a major role as a filmmaker creating green screen sequences for TU 1984, the 4th stage play created in the United States and Rocky Horror Picture Show. He obtained his bachelor\'s at the University of Tulsa with a minor in Entrepreneurship. During his time in education, he battled cancer two more times with surgeries and radiation treatments. Aside from education, he started making films when he was little and finished his first no budget feature film on his own at the age of 15 with a handheld camera. Three of his no budget movies have premiered at Cinemark by Tulsa and is quickly moving up in the professional world. He is a director/writer alumnus for the Taliesin Nexus program which include mentors like Paul Guay (Liar Liar) and Bill Marsilii (DeJavu) in Los Angeles California. He has training by certified CSA, The Actor Factory in Norman, Oklahoma and will continue to do so. National Award-Winning Filmmaker. Multiple award-winning pencil sketch artist. He resides in Tulsa, Oklahoma, a huge fan of the Outsiders House Museum, known to take the tours multiple times and the person credited with coming up with the idea of creating Lenticular images with Tulsa Past creator Patrick McNicholas, which is published once a month in Tulsa People. Supporter and collaborator for creating awareness for Gold Star Families and Gold Star Families Monument. He is known for working as an extra and is fortunate to have been part of many huge productions that come to Oklahoma. Lisandro has a mix bag of experience of working as a zero-budget indie filmmaker on his own, a solid education, in which he plans to continue his studies at Harvard, the experience working as a PA for four years and the drive to break into acting. Lisandro is now working hard to find an agent, manager, representation and his next leading role. His first leading role in a low budget film is Stray Kids which is completed and moving on to distribution and release soon.','1986-11-16',NULL),(2393,'Woodrow Luttrell',NULL,'',NULL,NULL),(2394,'Jane Gail','Salem, New York, USA','From Wikipedia, the free encyclopedia\n\nJane Gail, born Ethel S. Magee in Salem, New York, was an early American silent movie and stage actress.\n\nGail is best remembered for her role in the silent film Traffic in Souls (1913), and the adaptations of Dr. Jekyll and Mr. Hyde (1913), where she gained worldwide fame as Dr. Jekyll\'s (King Baggot) imperiled fiancée. She also appeared in the 1912 version of Jekyll and Hyde, but as an extra.\n\nA veteran of 19 film appearances between 1912 and 1920, Gail first got her acting start on the Broadway stage, appearing in two productions, The Rack and The City. She was only 30 years old when she made her last film, Bitter Fruit (1920). She never appeared on the silver screen after that. Gail died in St. Petersburg, Florida, on January 30, 1963. She was 72 years old.','1890-08-16','1963-01-30'),(2395,'George MacKay',' London, England, UK','George MacKay (born March 13, 1992) is an English actor. His first acting job was Peter Pan at the age of 10 and since then he has kept on acting. George is best known for his roles in \'Sunshine on Leith, \'For Those in Peril\', \'Pride\', \'Captain Fantastic\' and the recently Golden Globe and Bafta best picture winner \'1917\'. His stage work is equally impressive; he has been on \'Ah, Wilderness\' at the Young Vic and \'The Caretaker\' with Timothy Spall and Daniel Mays at the Old Vic Theatre.','1992-03-13',NULL),(2396,'Jill Ito',NULL,'',NULL,NULL),(2397,'Anu Hasan','Trichy, Tamil Nadu, India','Anu Hasan is a Tamil film and television actress and anchor, best known for playing the title role in her feature film debut \"Indira\". She was a host of the celebrity talk show \"Koffee with Anu\" on the Tamil channel \"Vijay\" for three seasons.','1970-07-15',NULL),(2398,'Brandi Coleman','New Orleans, Louisiana, USA','','1982-03-30',NULL),(2399,'Wei Zongwan','Shanghai，China','','1938-11-24',NULL),(2400,'Aaron Ashmore','Richmond, British Columbia, Canada','Aaron Ashmore (born October 7th, 1979) is a Canadian film and television actor. He is the identical twin brother of actor Shawn Ashmore.','1979-10-07',NULL),(2401,'Kazuki Namioka','Osaka, Osaka Prefecture, Japan','Kazuki Namioka was born on August 2, 1978 in Osaka, Japan. He is an actor, known for 13 Assassins (2010), The Fast and the Furious: Tokyo Drift (2006) and Kamen Rider Gaim (2013).','1978-08-02',NULL),(2402,'Lucky Johnson',NULL,'',NULL,NULL),(2403,'Sathyan Sivakumar','Semmedu, Coimbatore, India','Sathyan is a Tamil film actor and comedian. He is the only son of veteran producer, Madhampatty Sivakumar and is the nephew of noted actor Sathyaraj, whilst Sibiraj is his cousin. Making his acting debut in 1999 with a lead role in Ilayavan, he subsequently has been appearing mainly in supporting and comedic roles in over fifty Tamil films.','1975-06-11',NULL),(2404,'Jason Burke',NULL,'',NULL,NULL),(2405,'Sam Cig',NULL,'',NULL,NULL),(2406,'Masaaki Daimon','Takasago, Hyogo Prefecture, Japan','Masaaki Daimon is an actor, known for Godzilla contre Mecanik Monster (1974), Shurayukihime (1973) and Tempyo no iraka (1980).','1949-03-10',NULL),(2407,'Jean Pierre Prats',NULL,'',NULL,NULL),(2408,'Tanya van Graan','South Africa','','1983-12-13',NULL),(2409,'Ma Qiankun',NULL,'Qiankun Ma is an actor.',NULL,NULL),(2410,'Joy Mathew','Chalissery, Kerala, India','Joy Mathew is an Indian film director, film and theatre actor, playwright, and political activist.\n\nHe is best known for playing the lead role in John Abraham\'s 1986 film Amma Ariyan which was voted one of the Top 10 Indian films by British Film Institute. In 2012, he made his directorial debut with the film Shutter which portrays unexpected incidents happening in two days and a night in the city of Kozhikode. The film had its Indian premiere at the 17th International Film Festival of Kerala and international premiere at the 9th Dubai International Film Festival. It won the Silver Crow Pheasant Award for Best Feature Film (Audience Prize) at the 17th International Film Festival of Kerala. He has written more than 20 plays in Malayalam including Athirthikkal (1989), Sankadal (1996), Pretoria – 18 Oct (1996) and Chille 73 (1997). He was honoured by Kerala Sahitya Academy and kerala Sangeeta Nataka Academy for two of his plays in 1995 and 1996. He won the Kerala Sahitya Akademi Award for the play Madhya Dharanazhi (1996).','1961-09-20',NULL),(2411,'Tara Carroll',NULL,'',NULL,NULL),(2412,'Kerim Troeller','Geneva, Switzerland','Classically trained at LAMDA - The London Academy of Music and Dramatic Art; Swedish actor Kerim Troeller\'s rise to success is an inspirational and humbling story. He made it on his own without an agent for 6 years, from being homeless, broke, working 30 odd jobs, writing/producing/starring in, even directing his own films, to being a rising star in Hollywood.  Born in Geneva, Switzerland to an American father and Turkish mother, Kerim spent most of his life in Stockholm, Sweden, where he calls home, but has also lived in Switzerland, Canada, Japan, Malta, Italy, Turkey, Boston, Los Angeles, New York, and London, speaking English, Swedish, Turkish, studying Italian and formerly fluent in Japanese.','1990-10-22',NULL),(2413,'Olga Morgunova',NULL,'',NULL,NULL),(2414,'Chow Lim-Kan',NULL,'',NULL,NULL),(2415,'Eddie Graham','Detroit, Michigan USA','','1899-02-22','1974-09-20'),(2416,'Brenda Williams','Norman, Oklahoma, USA','','1974-03-04',NULL),(2417,'Betty Phillips','Calgary, Alberta, Canada','In her mid-teens she sang leading roles in musicals at Richmond High School and also sang in a girls\' choir organized by Burton Kurth; in the early 1940s she studied voice with in turn Mignon Duke Gidy, Avis Phillips, and Phylis Inglis and piano with Phyllis Schuldt. She appeared at TUTS for the first time in a 1946 production of Robin Hood and subsequently played leads in more than 20 TUTS productions until 1960; she is best remembered for the role of Mrs. Anna in The King and I. Phillips\' radio career began in 1948 with a CBC Vancouver light classical series and has included regular appearances 1953-65 on the CBC\'s \'Leicester Square to Broadway\'; variety work in 1955 on the BBC; solo, recital, and folksong performances on the CBC; and many British Columbia school broadcasts 1970-2. On CBC TV she sang Rosalinda in Die Fledermaus in 1954, co-starred 1956-7 with Ernie Prentice on \'Lolly-too-dum,\' and was hostess 1965-7 for \'Bazaar.\' Phillips has performed at the Vancouver International Festival and with the Vancouver Symphony Orchestra and has appeared in Vancouver Opera productions (Flora in La Traviata, 1961; Nicklausse in Tales of Hoffmann, 1961; Clotilde in Norma, 1963; Vera Boronell in The Consul, 1964; Zulma in The Italian Girl in Algiers, 1965; and the Witch in Hansel and Gretel, 1966). She has performed in musical comedy throughout Canada - on tour (1967) with One Hundred Years of Musical Comedy, at the 1968 and 1969 Charlottetown Festival; in Anne of Green Gables and Johnny Belinda, and at Winnipeg\'s Rainbow Stage in Fiddler on the Roof (1971). She sang locally in Theatre-in-the-Park productions of The Sound of Music (1974) and Fiddler on the Roof (1975), while studying 1972-6 at the University of British Columbia. As an actress she has played many roles at Bastion Theatre, Victoria, and the Arts Club Theatre, Vancouver, and has also appeared at Persephone Theatre, Saskatoon and at Citadel Theatre, Edmonton. In the first Vancouver Playhouse Theatre Co season (1963) she appeared as Madame Dubonnet in The Boy Friend and has continued to act for that company over the years. She has been in over 40 Canadian and US movies, some of them feature films and the others made for television. In 1962, Phillips married the actor, writer, and librettist Peter Haworth, who has collaborated with Leonard Wilson, Healey Willan, and the English composer Robert Simpson.','1917-06-12','2012-02-10'),(2418,'Matthew Van Wettering',NULL,'',NULL,NULL),(2419,'Katie McClellan',NULL,'',NULL,NULL),(2420,'Dr. Ishari. K. Ganesh',NULL,'',NULL,NULL),(2421,'Quinton Jackson','Memphis, Tennessee, USA','From Wikipedia, the free encyclopedia\n\nQuinton Ramone \"Rampage\" Jackson (born June 20, 1978) is an American mixed martial artist, actor and former professional wrestler, who most recently fought in the Bellator MMA and won the Bellator MMA: Season Ten Light Heavyweight Tournament. He is a former UFC Light Heavyweight Champion and unified the Pride Middleweight Championship belt. Due to his eccentric personality and aggressive fighting style, Jackson became a star in Japan during his tenure with Pride FC and following his move to the UFC, he helped pioneer MMA\'s growth into a worldwide sport.\n\nDescription above from the Wikipedia article Quinton Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1978-06-20',NULL),(2422,'George Konyeaso',NULL,'',NULL,NULL),(2423,'Xavier Lemaître','Bordeaux, Gironde, France','Xavier Lemaitre is a french born actor. He formerly worked for Cartier  as high jewelery sales manager, then decided to quit at the age of 39  and took acting classes with Raymod Aquaviva. He turned pro two years  later. He is now represented by Jerome Platon for Art\'One talent agency.  He is the father of two children: Zoe and Charlotte.','1966-01-10',NULL),(2424,'Kevin Michael Murphy',NULL,'',NULL,NULL),(2425,'Buakai Tonyala',NULL,'',NULL,NULL),(2426,'Anthony Jensen',NULL,'',NULL,NULL),(2427,'Peter Patrikios','Philadelphia, Pennsylvania, USA','Peter Patrikios was born and raised in Philadelphia, Pennsylvania. He is the son of Greek parents, Christos and Christina Patrikios. After earning his B.A. in Biopsychology from Franklin & Marshall College and one semester of medical school, Peter began his acting career in the Philadelphia Theatre community. He was soon performing on stage in New York City in such venues as, \"The Nuyorican Poets Cafe\" and \"Here\" (PSNBC). Over the years, Peter has appeared in many films and television shows playing roles that range from comedic to sinister.',NULL,NULL),(2428,'Shizuka Midorikawa','Saitama, Japan','','1988-06-24',NULL),(2429,'Law Kar-Ying','Guangzhou, Guangdong, China','Dr Law Kar-ying BBS MH (born September 22, 1946) is a Hong Kong Cantonese opera singer and actor.','1947-08-27',NULL),(2430,'Kan Wang',NULL,'','1960-11-28',NULL),(2431,'Renee O\'Connor','Katy, Texas, USA','Renee O\'Connor, born Evelyn Renee O\'Connor on February 15, 1971, in Katy, Texas, is an American actress, producer, and director. She is best known for her role as Gabrielle in the television series \"Xena: Warrior Princess.\"\n\nO\'Connor began her acting career at a young age, appearing in various theater productions. Her breakthrough came when she was cast as Gabrielle, the loyal and adventurous sidekick to Xena, in \"Xena: Warrior Princess\" (1995-2001). The show achieved widespread popularity and developed a dedicated fan base. O\'Connor\'s portrayal of Gabrielle showcased her versatility as an actress, as her character evolved from an innocent village girl to a formidable warrior in her own right.\n\nFollowing the success of \"Xena,\" O\'Connor continued to work in the entertainment industry. She appeared in other television shows such as \"Boogeyman\" and \"Ark.\" O\'Connor also took on roles in independent films, demonstrating her range and willingness to explore different genres and characters.\n\nIn addition to acting, O\'Connor has worked behind the scenes as a producer and director. She has directed and produced various projects, including short films and web series. O\'Connor\'s passion for storytelling extends beyond acting, as she actively participates in creating and promoting engaging content.\n\nBeyond her professional endeavors, O\'Connor has been involved in charitable work and has used her platform to raise awareness for causes close to her heart. She has engaged in fundraising efforts for organizations supporting cancer research and other charitable initiatives.\n\nRenee O\'Connor\'s portrayal of Gabrielle in \"Xena: Warrior Princess\" left a lasting impact on fans and solidified her place in popular culture. Her talent, dedication, and involvement in various creative endeavors continue to inspire and resonate with audiences.','1971-02-15',NULL),(2432,'Julien Arruti','Rueil-Malmaison, Hauts-de-Seine, France','','1978-11-25',NULL),(2433,'Zuhair Haddad',NULL,'',NULL,NULL),(2434,'Johnny Pemberton','Rochester, Minnesota, USA','John deJarnette Pemberton III is an American actor, comedian, podcast host and streamer from Rochester, Minnesota. He is best known for his role as the titular Son of Zorn in the short-lived Fox sitcom, and has also appeared as the recurring character Bo Thompson in the NBC sitcom Superstore.\n\nDescription above from the Wikipedia article Johnny Pemberton, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1981-06-01',NULL),(2435,'Chiwa Saito','Saitama Prefecture, Japan','Chiwa Saito (斎藤 千和, Saitō Chiwa) is a Japanese voice actress employed by I\'m Enterprise. Saitō is one half of the voice acting duo \"coopee\", along with Natsuko Kuwatani. In the \"Divine Design\" arc of the Getbackers drama CDs, she voices a character who battles the character voiced by Kuwatani. She is a member of the voice acting group \"MORE PEACH SUMMER SNOW\", alongside Haruna Ikezawa, Mamiko Noto and Ryo Hirohashi. The group began as \"MORE PEACH SUMMER\", with Ikezawa, Saitō and Noto; all four voiced characters in the Keroro Gunso anime. The quartet\'s name is based on the names of their respective Sgt. Frog characters: Angol Mois (Noto), Momoka Nishizawa (Ikezawa), Natsumi Hinata (Saitō), and Koyuki Azumaya (Hirohashi).','1981-03-12',NULL),(2436,'Renji Panicker','Nedumudi, Kerala, India','Renji Panicker is an Indian journalist, script writer, producer, actor, and director best known for his Malayalam films. He made his debut as a director with Bharatchandran IPS in 2005.\n\nA firebrand script-writer and director of Malayalam cinema, Renji  Panicker, popularly known as Renji began his career as a journalist.  After completing his master\'s degree in journalism from Kerala University, Renji started off as a reporter for several magazines and publications. It was during an interview, while working for Chithrabhumi, a film magazine, that he met director Shaji Kailas,  which led him into the world of cinema and within a short time became  one of the most guaranteed scriptwriters of Malayalam cinema. Renji  scripted several commercially successful films for Shaji Kailas,  including Dr. Pasupathy (1990), Thalastaanam (1992), Sthalathe Pradhana Payyans (1993), Ekalavyan (1993), Mafia (1993), Commissioner (1994), and The King (1995). It was the Renji Panicker-Shaji Kailas team that turned actor Suresh Gopi into a bankable lead actor during the early-1990s. He\'s also popular for his collaboration with director Joshiy, which includes the films Lelam (1997) and Pathram  (1999). He later switched over as a film director and has directed two  films. He is also one of the managing director of the Malayalam  newspaper Metrovaartha.\n\nRenji has acted in several cameo roles for his own films. However, he  gained popularity as an actor for his full-length role in the film Ohm Shanthi Oshaana (2014). He has gone on to act in other successful films, including Njaan (2014), Munnariyippu (2014), Aadu (2015), Premam (2015), Loham (2015), and Jacobinte Swargarajyam (2016).','1958-01-21',NULL),(2437,'Mam Smith',NULL,'Mam Smith is an actress, stuntwoman, aerialist, choreographer,and dancer. In preparation for her professional career she studied classical dance and competed as an elite gymnast. Mam attended New York University\'s Tish School of the Arts for dance and Theater. Upon graduation from NYU, Mam performed at Lincoln Center and Radio City Music Hall with AntiGravity and toured through out the United States as a featured dancer with the Doug Elkins Dance Co. Mam has appeared in numerous print and Television advertisements. She is a Founding Company Member, Principal Performer and Associate Choreographer for AntiGravity. As such, her work with the Broadway Musical \"Nine\" garnished the show two Tony awards and a broadcast mention. As an Associate Choreographer, Mam also designed Mariah Carey\'s aerials for the 2003 Charmbracelet world tour. Ms. Smith received a Masters degree in communications from Emerson College in Boston.',NULL,NULL),(2438,'Natasha Dee Davis',NULL,'',NULL,NULL),(2439,'William Schaff',NULL,'',NULL,NULL),(2440,'Wang Mingzong',NULL,'',NULL,NULL),(2441,'Stéphanie Dumoulin-Shaw',NULL,'',NULL,NULL),(2442,'Tobin Streamland',NULL,'',NULL,NULL),(2443,'Ron Selmour',NULL,'',NULL,NULL),(2444,'Amy Molloy','Belfast, Ireland','',NULL,NULL),(2445,'Chrisdine King',NULL,'',NULL,NULL),(2446,'Monica Hernandez',NULL,'',NULL,NULL),(2447,'Adam Grimes','Burlington, Vermont, USA','','1976-06-18',NULL),(2448,'Monte Blue','Indianapolis, Indiana, USA','From Wikipedia, the free encyclopedia\n\nMonte Blue (January 11, 1887 – February 18, 1963) was a movie actor who began his career as a romantic leading man in the silent film era, and later progressed to character roles.\n\nBlue was born as Gerard Montgomery Bluefeather in Indianapolis, Indiana. His father was half French, half Cherokee Indian. One of five children, his father died and his mother could not raise five children alone. Along with another brother, they both admitted to the Indiana Soldiers\' and Sailors\' Children\'s Home. This did not stop him working his way through to Purdue University.\n\nWhen growing up, Blue built up his physique to become a football player (he grew to six feet three inches tall). He not only played football, but he was also a fireman, railroad worker, coal miner, cowpuncher, ranch hand, circus rider, lumberjack, and finally, a day laborer at the studios of D. W. Griffith.\n\nHe had no theatrical experience when he came to the screen. In his first movie, The Birth of a Nation (1915), he was a stuntman and an extra in the movie. In his next movie, he starred in another small part in the movie, Intolerance (1916). Gradually moving to supporting roles for both D. W. Griffith and Cecil B. DeMille, Blue earned his breakthrough role as Danton in Orphans of the Storm, starring sisters, Lillian Gish and Dorothy Gish. Then he rose to stardom as a rugged romantic lead along with top leading actresses such as Clara Bow, Gloria Swanson, and Norma Shearer. His most prolific female screen partner was Marie Prevost with whom he made several films in the mid 20s at Warner Brothers. Blue\'s finest silent screen performance was as the alcoholic doctor who finds paradise in MGM\'s White Shadows in the South Seas (1928). Blue became one of the few silent stars to survive the talkie revolution. However, he lost his investments in the stock market crash of 1929.\n\nHe rebuilt his career as a character actor, working until his retirement in 1954. One of his more memorable roles was the sheriff in Key Largo. He divorced his first wife in 1923 and married Tova Jansen in 1924. He had two children, Barbara Ann and Richard Monte. During the later part of his life, Monte Blue was an active Mason and the advance man for the Hamid-Morton Shrine Circus; while on business in Milwaukee, Wisconsin, he had a heart attack because of complications from influenza, dying at age 76.\n\nMonte Blue has a star on the Hollywood Walk of Fame at 6286 Hollywood Blvd.\n\nDescription above from the Wikipedia article Monte Blue, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1887-01-10','1963-02-18'),(2449,'Venus Terzo','Montreal, Quebec, Canada','Venus Terzo (born 17 October 1967) is a Canadian actress.','1967-10-17',NULL),(2450,'Usman Ojibara',NULL,'',NULL,NULL),(2451,'Manisha Koirala','Kathmandu, Nepal','Manisha Koirala is a Nepali actress who mainly appears in Bollywood, though she has worked in several South Indian and her native country\'s films.\n\nNoted for her acting prowess, Koirala is the recipient of several accolades, including four Filmfare Awards-and is one of India\'s most well-known actresses.\n\nShe made her Bollywood debut with Saudagar (1991) and establish herself as one of the leading actresses in the 1990s with such films as 1942: A Love Story (1994), Akele Hum Akele Tum (1995), Agni Sakshi (1996) and Gupt (1997). Koirala gained particular recognition for her willingness to experiment with a variety of strong, dramatic roles, and she delivered several acclaimed performances in a range of films that did well with critics, including Bombay (1995), Khamoshi: The Musical (1996), Dil Se.. (1998), Mann (1999), Lajja (2001), Company (2002), and Escape from Taliban (2003).  She was appointed as the Goodwill Ambassador for the United Nations Population Fund in 1999 and 2015, and was involved in the relief works after the Nepal earthquake 2015. She promotes various causes such as women\'s rights, prevention of violence against women, prevention of human trafficking and cancer awareness.','1970-08-16',NULL),(2452,'David Talbolt',NULL,'',NULL,NULL),(2453,'Kurt Russell','Springfield, Massachusetts, USA','Kurt Vogel Russell (born March 17, 1951) is an American actor. He began acting on television at the age of 12 in the western series The Travels of Jaimie McPheeters (1963–1964). In the late 1960s, he signed a ten-year contract with The Walt Disney Company, where he starred as Dexter Riley in films, such as The Computer Wore Tennis Shoes (1969), Now You See Him, Now You Don\'t (1972), and The Strongest Man in the World (1975). According to Robert Osborne of Turner Classic Movies, he became the studio\'s top star of the 1970s.\n\nRussell was nominated for a Golden Globe Award for Best Supporting Actor – Motion Picture for his performance in Mike Nichols\' Silkwood (1983). In the 1980s, he starred in several films directed by John Carpenter, including anti-hero roles such as army hero-turned-robber Snake Plissken in the futuristic action film Escape from New York (1981), its sequel Escape from L.A. (1996), the horror film The Thing (1982), and the kung-fu comedy action film Big Trouble in Little China (1986). For his portrayal of rock and roll superstar Elvis Presley in Elvis (1979), he was nominated for the Primetime Emmy Award for Outstanding Lead Actor in a Limited or Anthology Series or Movie.\n\nRussell starred in various other films, including Used Cars (1980), The Best of Times (1986), Overboard (1987), Tango & Cash (1989), Backdraft (1991), Tombstone (1993), Stargate (1994), Executive Decision (1996), Breakdown (1997), Vanilla Sky (2001), Miracle (2004), Sky High (2005), Death Proof (2007), The Hateful Eight (2015) and Once Upon a Time in Hollywood (2019). He also appeared in the Fast & Furious franchise as Mr. Nobody, having starred in Furious 7 (2015), The Fate of the Furious (2017), and F9 (2021), portrayed Ego in the Marvel Cinematic Universe (MCU) installments Guardians of the Galaxy Vol. 2 (2017) and What If...? (2021), and subsequently portrayed Santa Claus in The Christmas Chronicles (2018) and The Christmas Chronicles 2 (2020).','1951-03-17',NULL),(2454,'Sol Gorss','Cincinnati, Ohio, USA','Sol Gorss was born on March 22, 1908 in Cincinnati, Ohio, USA. He is known for his work on \"Climax! (1954)\", \"Flowing Gold (1940)\" and \"China Girl (1942)\". He died on September 10, 1966 in Los Angeles, California, USA.','1908-03-22','1966-09-10'),(2455,'Patrick Gilmore','Edmonton, Alberta, Canada','Patrick Gilmore (born June 1, 1976) is a Canadian actor best known for playing the role of Dale Volker in the science fiction series Stargate Universe. He has also been seen in other science fiction shows such as Battlestar Galactica and Eureka, as well as playing Trennan in Riese. He is one of the first actors to appear in all three Stargate TV series, along with Richard Dean Anderson, Amanda Tapping, Michael Shanks, Ona Grauer, and Gary Jones. Dale Volker began as a simple side character, but Patrick\'s excellent portrayal of Volker impressed show-runners and Volker has subsequently been given more screen time and more back story. A similar situation occurred with the character of Dr. Carson Beckett, played by Paul McGillion. Patrick also portrays entrepreneur Tom Drexler in the new AMC television series The Killing\n\nPatrick is the son of professional hockey player Tom Gilmore, and brother of Scott Gilmore, Executive Director and one of the founders of Peace Dividend Trust. Patrick is a graduate of the University of Alberta with a degree in English Literature.\n\nDescription above from the Wikipedia article Patrick Gilmore, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1976-06-01',NULL),(2456,'Ellen David','Montreal, Quebec, Canada','',NULL,NULL),(2457,'Cheon Ho-jin','Busan, South Korea','','1960-09-05',NULL),(2458,'Vincent Cheng',NULL,'',NULL,NULL),(2459,'Jia Hongwei','中国,辽宁,大连','','1978-11-26',NULL),(2460,'Léandro Léo Pereira',NULL,'',NULL,NULL),(2461,'Giovane de Nardo',NULL,'',NULL,NULL),(2462,'Georgi Martirosyan','Rostov-na-Donu, USSR (Russia)','','1948-01-31',NULL),(2463,'Andrew Pleavin','London, England, UK','','1968-04-13',NULL),(2464,'Luigi D\'Ecclesia',