udgment Day (1991), Gone in 60 Seconds (2000) and Predator (1987).','1946-01-01',NULL),(2480,'Andrea Fazio',NULL,'',NULL,NULL),(2481,'Dominic Maglione',NULL,'',NULL,NULL),(2482,'Robert Clohessy','The Bronx, New York City, New York, USA','Robert Clohessy (born June 10, 1958) is an American actor, known for playing Correctional Officer Sean Murphy on the HBO drama Oz. He was also a cast member in the final season of Hill Street Blues.\n\nHe has had recurring roles in the ABC daytime drama All My Children, Guiding Light, and appeared in the short lived Fox show New Amsterdam. He also played a semi-minor role in the film \"Across the Universe\", playing the part of Jude\'s long-lost father. He was also a series regular in short-lived shows such as Laurie Hill who at that time starred a then-unknown Ellen Degeneres.\n\nHe played the role of \"Mike\" in the Broadway Roundabout Theatre Company revival of Pal Joey, from November 2008 through February 2009. He is currently seen on HBO\'s new show Boardwalk Empire.','1958-06-10',NULL),(2483,'Marie Wagenman',NULL,'',NULL,NULL),(2484,'Cham Nou',NULL,'',NULL,NULL),(2485,'J.R. Esposito',NULL,'JR Esposito was born on 13 July 1971 in the USA. He is an actor, known for Barbarian (2022), A Christmas Story Christmas (2022) and Memory (2022). He has been married to Natasha Roth since 20 June 2015.','1971-07-13',NULL),(2486,'Hannah Sulak',NULL,'',NULL,NULL),(2487,'Ding Wen-Bin',NULL,'',NULL,NULL),(2488,'Fernando Guillén Cuervo','Barcelona, Barcelona, Catalonia, Spain','','1963-03-11',NULL),(2489,'Nilson Nicola',NULL,'',NULL,NULL),(2490,'Márcio Cassoni',NULL,'',NULL,NULL),(2491,'Mike Seal','Tijuana, Mexico','Mike Seal is a Mexican mixed martial artist who has fought for Strikeforce, Bellator MMA, Sengoku Raiden Championship and King of the Cage.','1977-07-30',NULL),(2492,'Robert Armstrong','Saginaw, Michigan, USA','From Wikipedia, the free encyclopedia.\n\nRobert Armstrong (November 20, 1890 – April 20, 1973) was an American film actor best remembered for his role as Carl Denham in the 1933 version of King Kong by RKO Pictures. He uttered the famous exit quote, \"\'Twas beauty killed the beast,\" at the film\'s end. Months later, he starred as Carl Denham again in the sequel, Son of Kong, released the same year.\n\nIn the late 1950s, Armstrong appeared as Sheriff Andy Anderson on Rod Cameron\'s syndicated western-themed television series, State Trooper.\n\nDescription above from the Wikipedia article Robert Armstrong, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1890-11-19','1973-04-20'),(2493,'Toby Levins','Adelaide, Australia','Toby Levins was born on June 10, 1981 in Adelaide, Australia. He is known for his work on Godzilla (2014), The Age of Adaline (2015) and Rogue (2013).','1981-06-10',NULL),(2494,'Tex Phelps',NULL,'',NULL,NULL),(2495,'Sara Giacalone',NULL,'',NULL,NULL),(2496,'Shawn Webb',NULL,'',NULL,NULL),(2497,'Marc Evan Jackson','Buffalo, New York, USA','Marc Evan Jackson was born on August 21, 1970 in Buffalo, New York, USA. He is an actor.','1970-08-21',NULL),(2498,'Jack Landry','Knoxville, Tennessee, USA','Jack Landry was born on October 6, 1978, in Knoxville, Tennessee, USA. He is an actor and producer, known for Contraband (2012), 2 Guns (2013) and The Bay (2012). He has been married to Weatherly Dean Brewer since June 4, 2005.','1978-10-06',NULL),(2499,'Gabi Singh',NULL,'',NULL,NULL),(2500,'Val Kilmer','Los Angeles, California, USA','Val Edward Kilmer (born December 31, 1959) is an American actor. Originally a stage actor, Kilmer became popular in the mid-1980s after a string of appearances in comedy films, starting with Top Secret! (1984), then the cult classic Real Genius (1985), as well as blockbuster action films, including a role in Top Gun and a lead role in Willow.\n\nDuring the 1990s, Kilmer gained critical respect after a series of films that were also commercially successful, including his roles as Jim Morrison in The Doors, Doc Holliday in 1993\'s Tombstone, Batman in 1995\'s Batman Forever, Chris Shiherlis in 1995\'s Heat and Simon Templar in 1997\'s The Saint. During the early 2000s, Kilmer appeared in several well-received roles, including The Salton Sea, Spartan, and supporting performances in Kiss Kiss Bang Bang, Alexander, and as the voice of KITT in Knight Rider.\n\nFrom Wikipedia, the free encyclopedia','1959-12-31',NULL),(2501,'Jeffrey Jones','Buffalo, New York, USA','Jeffrey Duncan Jones (born September 28, 1946, 6 feet 4 inches [1.94 m]) is an American character actor, best known for his roles as Emperor Joseph II in Amadeus (1984), Edward R. Rooney in Ferris Bueller\'s Day Off (1986), Charles Deetz in Beetlejuice (1988), Dr. Skip Tyler in The Hunt for Red October (1990), Eddie Barzoon in The Devil\'s Advocate (1997), and A. W. Merrick in both Deadwood (2004–2006) and Deadwood: The Movie (2019).\n\nJones was born in Buffalo, New York, and studied acting at the Putney School, the London Academy of Music and Dramatic Art, and Lawrence University. He began his acting career in small parts in film and television in the 1970s. In his best-known roles as Emperor Joseph II in Amadeus, Charles Deetz in Beetlejuice, and Edward R. Rooney in Ferris Bueller\'s Day Off, his dead-pan expression and distinctive face bring a comic flavor to his characters through their reactions to the situations in which they find themselves, more so than the wit in their scripted lines.\n\nJones has also had a successful career on stage, appearing in productions of The Crucible, The Importance of Being Earnest, and The Glass Menagerie. He has been nominated for two Tony Awards, for Best Featured Actor in a Play for his performance in The Crucible (1988) and Best Featured Actor in a Musical for his performance in The Secret Garden (1991).\n\nIn 2002, Jones was arrested on charges of child pornography. He pleaded guilty to one count of possession of child pornography and was sentenced to two years of probation. He has not appeared in any major film or television roles since his arrest.\n\nDespite his personal troubles, Jones is still considered to be one of the most talented character actors of his generation','1946-09-28',NULL),(2502,'George Babluani',NULL,'',NULL,NULL),(2503,'Chad Hessler',NULL,'',NULL,NULL),(2504,'Bill Oberst Jr.','South Carolina, USA','Bill Oberst Jr. is an American actor known for his disturbing onscreen presence, often playing dark and conflicted characters on film and television. \n\nOberst is a veteran stage actor who came to Hollywood in 2008 and quickly began to be cast in horror and thriller films. Notable exceptions were the 2011 Hallmark Channel TV-movie THE SHUNNING and its 2012 sequel THE CONFESSION (in which director Michael Landon Jr. cast Oberst in the film\'s male lead role of an Amish farmer) and an award-winning turn as General William Tecumseh Sherman in the History Channel\'s docudrama SHERMAN\'S MARCH. Oberst has also toured theatrically in a first-person stage recreation of the teachings of Jesus Of Nazareth and in a string of one-man shows whose subjects included President John F. Kennedy, Mark Twain and humorist Lewis Grizzard. He remains best known as a horror genre actor, however.\n\nBill Oberst Jr.\'s trademark piercing star and rough-hewn face have led him to be cast as monsters, murderers, vampires and cannibals, often in minimal wardrobe. His oddly shaped torso and partially-exposed ribcage are almost as recognizable to genre fans as his face. Oberst is often quoted as saying that he believes the human body\'s capacity to disturb on film is just as strong as its capacity to entice. In 2011, Oberst was seen by over 60 million internet viewers worldwide as the cyber stalker in the Facebook application TAKE THIS LOLLIPOP, (http://www.takethislollipop.com) which broke records to become the fastest-growing application in Facebook history and the most popular horror-themed application in internet history. \n\nIn person, his quiet demeanor and interest in things spiritual seem sharply at odds with the roles he plays. A native Southerner, Oberst is a fulltime actor living in Los Angeles. \n\nFrom Wikipedia, the free encyclopedia','1965-11-21',NULL),(2505,'Jin-ho Seo',NULL,'',NULL,NULL),(2506,'Ashlyn McEvers','Dallas, Texas, USA','','1995-08-23',NULL),(2507,'Sharon Taylor','Vancouver, British Columbia, Canada','','1981-06-05',NULL),(2508,'Elma Vann',NULL,'',NULL,NULL),(2509,'Savitha Reddy',NULL,'',NULL,NULL),(2510,'Kenneth Miller',NULL,'',NULL,NULL),(2511,'Rick Tae','Hong Kong','','1973-07-07',NULL),(2512,'Victor Formosa',NULL,'',NULL,NULL),(2513,'Tim Bell',NULL,'Tim Bell is known for Looking for Alaska (2019), Antebellum (2020) and Bill & Ted Face the Music (2020).',NULL,NULL),(2514,'Jim B. Smith','Lamoni, Iowa, USA','','1924-08-20','2009-05-07'),(2515,'Douglas Rosa',NULL,'',NULL,NULL),(2516,'Cynthia Koh','Singapore','Cynthia Koh’s potential and flair for acting have been duly recognized even before her glamour days. In fact, the saccharine sweet actress made her small screen debut in The Dating Game while still undergoing training in the 10th  Professional Drama Performers’ Training Course organized by the then Singapore Broadcasting Corporation in 1992.  Over the years, the petite actress continuously outshines with her acting skills to transcend into the leading lady.\n\nThe multi-talented actress also made her debut in stage performance in the critically acclaimed Men At Forty-Eight in 1997.  Her acting skill was further recognised when she bagged the Best Actress award in Star Awards ’99 with her breakthrough performance in Stepping Out where she played a long-suffering woman fighting against her fate. The same role also earned her a nomination in the same category at the Asian Television Awards. She is also one of the first Singaporean actress to ever shave her head for a role.\n\nEffectively bilingual, Cynthia made her cross over to English drama when she was cast in the award-winning local series, Growing Up, which was immediately followed by another lead role in @Moulmein High, a high school drama, making her a huge idol amongst teengers across the island.\n\nTo date, Cynthia has not only handled diversified roles both in Chinese and English, but has also tried her hands at hosting and singing, all, to favourable reviews. A thespian actress, it is little wonder why she is a hot favourite amongst directors and producers alike. She was in two 100-episode long Chinese drama, Holland V and Portrait of Home as leading roles.\n\nHer past productions include The Little Nyonya in 2008, a storyline with a Peranakan setting that spans over 70 years starting from the 1930s which recorded the highest rating in local TV history for the past 15 years. She was also cast in Crescendo, a Singaporean Musical Drama about Xinyao in 2015. And in 2019, Cynthia’s outstanding performance Say Cheese earned her another nomination for Best Supporting Actress in Star Awards 2019 and also in Asia Pacific’s most prestigious Awards for Creative Excellence - Asian Academy Creative Awards.','1974-03-25',NULL),(2517,'Charles W Harris III',NULL,'',NULL,NULL),(2518,'Sun Chun','Jinan, Shandong, China','','1956-07-04',NULL),(2519,'Greg Backstrom',NULL,'',NULL,NULL),(2520,'Viktor Sukhorukov','Orekhovo-Zuevo, RSFSR, USSR','Viktor I. Sukhorukov (born 10 November 1951) is a Russian actor. He has appeared in over 50 films and television shows since 1974. He starred in Happy Days, which was screened in the Un Certain Regard section at the 1992 Cannes Film Festival.','1951-11-10',NULL),(2521,'J.K. Simmons','Detroit, Michigan, USA','Jonathan Kimble Simmons (born January 9, 1955) is an American actor. He has been cited as one of the greatest contemporary character actors, and has appeared in over 200 film and television roles since his debut in 1986. He is an Academy Award, BAFTA Award, Golden Globe Award, Screen Actors Guild Award, and Critics Choice Award winner, among other accolades.\n\nHis film roles include J. Jonah Jameson in Sam Raimi\'s Spider-Man trilogy (2002–2007), tobacco industry executive B.R. in Thank You for Smoking (2005), Mac MacGuff in Juno (2007), music instructor Terence Fletcher in Whiplash (2014), Bill in La La Land (2016), William Frawley in Being the Ricardos (2021), and Commissioner James Gordon in the DC Extended Universe films Justice League (2017), Zack Snyder\'s Justice League (2021), and Batgirl (2022). He reprised his role as Jameson in various Marvel media unrelated to the Sam Raimi trilogy, including multiple animated series and the Marvel Cinematic Universe/Sony\'s Spider-Man Universe films Spider-Man: Far From Home (2019), Venom: Let There Be Carnage, and Spider-Man: No Way Home (both 2021), and the web series TheDailyBugle.net (2019; 2021).\n\nOn television, he is known for playing Dr. Emil Skoda on the NBC series Law & Order, white supremacist prisoner Vernon Schillinger on the HBO series Oz, and Assistant Police Chief Will Pope on TNT\'s The Closer. From 2017 to 2019, he starred as Howard Silk in the Starz series Counterpart. He has also appeared in a series of commercials for Farmers Insurance and starred in the third season of the IFC comedy series Brockmire. In 2020, he had recurring roles on the miniseries Defending Jacob and The Stand.\n\nAs a voice artist, he is known for voicing Cave Johnson in the video game Portal 2 (2011), Tenzin in The Legend of Korra (2012–2014), Stanford “Ford” Pines in Gravity Falls (2015–2016), Kai in Kung Fu Panda 3 (2016), Mayor Leodore Lionheart in Zootopia (2016), the titular character in Klaus (2019), Pig Baby in Season 4 of the HBO Max animated series Infinity Train (2021), and Nolan “Omni-Man” Grayson in the Amazon Prime action animated series Invincible (2021). He has been the voice of the Yellow M&M since 1996.','1955-01-09',NULL),(2522,'Suri van Sornsen',NULL,'',NULL,NULL),(2523,'Alan Rachins','Cambridge, Massachusetts, USA','Alan Rachins (born October 3, 1942) is an American television actor, best known for his role on LA Law, which earned him Golden Globe and Emmy nominations, as well as Dharma & Greg and The Spectacular Spider-Man.','1942-10-03',NULL),(2524,'André Gower','Culver City, California, USA','','1973-04-27',NULL),(2525,'Meadow Williams','Miami, Florida, USA','','1966-02-10',NULL),(2526,'Al Cliver','Alessandria, Egitto','','1951-07-16',NULL),(2527,'James Gale',NULL,'',NULL,NULL),(2528,'Derek Horse',NULL,'',NULL,NULL),(2529,'Kenny Fullwood','Alexandra, Paisley, Scotland, UK','','1993-03-29',NULL),(2530,'Trent McMullen',NULL,'',NULL,NULL),(2531,'Wheeler Oakman','Washington, District of Columbia, USA','','1890-02-21','1949-03-19'),(2532,'Shane John Kruger',NULL,'',NULL,NULL),(2533,'Radoje Jelić',NULL,'',NULL,NULL),(2534,'Kazuya Matsui',NULL,'',NULL,NULL),(2535,'Paul Sun-Hyung Lee','Daejeon, South Korea','','1972-08-16',NULL),(2536,'Chantal Ladesou','Roubaix, Nord, France','Chantal Ladesou (born 5 May 1948) is a French actress and comedian.\n\nLadesou met her husband Michel Ansault and with whom she had three children, two boys, Alix (who died in a car accident), Julien and a daughter, the actress Clémence Ansault. Her son Julien Ansault is married to Pauline Lefèvre.\n\nShe was revealed to the public in participating to the TV Show La Classe in 1987.\n\nSource: Article \"Chantal Ladesou\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1948-05-05',NULL),(2537,'Austin Hébert',NULL,'',NULL,NULL),(2538,'Chihara Junia','Kyoto, Japan','','1974-03-30',NULL),(2539,'Jim Varney','Lexington, Kentucky, USA','James Albert \"Jim\" Varney Jr. (June 15, 1949 – February 10, 2000) was an American actor, voice artist, and comedian, best known for his role as Ernest P. Worrell, who was used in numerous television commercial campaigns and movies in the following years, giving Varney fame nationally in the United States.','1949-06-15','2000-02-10'),(2540,'Alex Ivanovici',NULL,'Alex Ivanovici is an Italian-Canadian actor. He is known for his roles as Ephor #2 in 300 (2006), Bartolomeo d\'Alviano in Assassin\'s Creed: Brotherhood (2010), Rick Trager in Outlast (2013), Quarantine Doctor in X-Men: Days of Future Past (2014), Doc in Rainbow Six: Siege (2015), Talos Rucker in Deus Ex: Mankind Divided (2016), and Cosmo/Lipless in Marvels: Guardians of the Galaxy (2021).',NULL,NULL),(2541,'Cole Hauser','Santa Barbara, California, USA','Cole Kenneth Hauser (born March 22, 1975) is an American film and television actor. He\'s best known for his movie roles as Col. Stevens in Transcendence, Roma in Olympus Has Fallen, Mike Collins in A Good Day to Die Hard, William Cartwright in Tyler Perry\'s The Family That Preys, Lupus Grobowski in The Break-up, Carter Verone in 2 Fast 2 Furious, James \'Red\' Atkins in Tears of the Sun, Staff Sgt. Vic Bedford in Hart\'s War, William Johns in Pitch Black, Billy McBride in Good Will Hunting, Benny O\'Donnell in Dazed and Confused, and Jack Connors in School Ties.\n\nHis best known TV roles are as Rip Wheeler on Paramount TV\'s western drama Yellowstone, Charlie Siringo on Lifetime TV\'s The Lizzie Borden Chronicles, Ethan Kelly on Audience Network\'s drama Rogue, US Marshall Jimmy Godfrey on NBC\'s drama Chase, and Officer Randy Willitz on ABC\'s police drama High Incident.\n\nHis paternal grandfather was Dwight Hauser, a screenwriter, actor and film producer. His maternal grandfather was Milton Sperling, a screenwriter and film producer for 20th Century Fox and Warner Bros. His great-grandfather was Harry Warner, who was a studio executive, one of the founders of Warner Bros.(with his 3 younger brothers), and a major contributor to the development of the film industry.','1975-03-22',NULL),(2542,'Rob Riggle','Louisville, Kentucky, USA','Robert A. Riggle Jr. (born April 21, 1970) is an American comedian, actor and retired United States Marine Corps Reserve Lieutenant Colonel. Riggle has amassed many notable television credits and has also earned roles in several feature films, including Le Lorax (2012) and 21 Jump Street (2012). After graduating from the University of Kansas with a B.A. in Theater and Film, Riggle joined the Marines and earned a Master\'s degree from Webster University in Public Administration. A featured cast member onSaturday Night Live (1975) during the 2004/2005 season, Riggle then joined Comedy Central\'s The Daily Show (1996) in 2006 as a correspondent. Riggle\'s numerous television appearances, including credits on Chappelle\'s Show (2003), 30 Rock (2006) and The Office (2005) would lead to big-screen roles in FVery Bad Trip (2009) and Very Bad Cops (2010). When he is not on set or traveling across the United States performing stand-up comedy, Rob Riggle lives in Los Angeles.','1970-04-21',NULL),(2543,'Marianne M. Arreaga','San Francisco, California, USA','Marianne M. Arreaga is an actress and stuntwoman.',NULL,NULL),(2544,'Taylor Sheridan','Cranfills Gap, Texas, USA','Taylor Sheridan (born May 21, 1970) is an American actor, screenwriter and director. He is most known for his role as David Hale on the FX television series Sons of Anarchy, and for writing the screenplay of the Denis Villeneuve-directed Sicario (2015), for which he received a Writers Guild of America Award nomination for Best Original Screenplay.\n\nHe also wrote the screenplay for Hell or High Water (2016), starring Jeff Bridges, Chris Pine and Ben Foster, which was released in August 2016 and earned Sheridan an Academy Award nomination for Best Original Screenplay. Wind River, starring Jeremy Renner and Elizabeth Olsen and the script for which he also penned, was released in August 2017. He is the brother of journalist John Gibler.','1970-05-21',NULL),(2545,'Kenda Henthorn',NULL,'',NULL,NULL),(2546,'Gary Glushon',NULL,'',NULL,NULL),(2547,'Jade Chynoweth','Park City, Utah, USA','Jade Chynoweth is an American actress and dancer. She is known for her roles as young Artemisia in the 2014 epic historical fantasy war film 300: Rise of an Empire and Carmen in the 2016 superhero film Batman v Superman: Dawn of Justice, for her recurring role as Kathleen Nolan on the TNT television series The Last Ship and Odalie Allen on the YouTube Premium series Step Up: High Water.','1998-08-21',NULL),(2548,'Arina Gasanova',NULL,'',NULL,NULL),(2549,'Max Martini','Kingston, New York, USA','Maximilian Carlo \"Max\" Martini (born December 11, 1969) is an American film, theater and television actor known for his roles as Corporal Fred Henderson in Saving Private Ryan, Wiley in Level 9, First Sergeant Sid Wojo in The Great Raid, and as Sergeant Mack Gerhardt on the military television drama, The Unit.','1969-12-11',NULL),(2550,'Kyle Connors',NULL,'',NULL,NULL),(2551,'Veronique-Natale Szalankiewicz',NULL,'',NULL,NULL),(2552,'Tso Shiao-Hu','Taiwan','','1973-12-17',NULL),(2553,'Rachel Riley','San Luis Obispo, California, USA','','1986-01-11',NULL),(2554,'Barry Blueian',NULL,'',NULL,NULL),(2555,'Richard Brooker','London, England, UK','Richard Brooker (November 20, 1954 – April 8, 2013) was an actor most well known for playing Jason Voorhees in Friday the 13th Part III. Aside from playing Jason, but Brooker had an illustrious career as an actor and director as well. HIs most well known directorial effort was for Bill Nye the Science Guy.','1954-11-20','2013-04-08'),(2556,'Sofia Chicorelli Serna',NULL,'','2006-06-28',NULL),(2557,'Roberto \'Sanz\' Sanchez','Havana, Cuba','','1965-01-04',NULL),(2558,'Tony Caprari',NULL,'Tony Caprari is an actor.',NULL,NULL),(2559,'Brian J. White','Boston, Massachusetts, USA','Bian Joseph White (born April 21, 1975) is an American actor, producer, model, dancer, and stockbroker. White was born near Boston, Massachusetts, the son of Estelle Bowser, a financial advisor, and Jo Jo White, a basketball player for the Boston Celtics, sports executive, and restaurateur. He is the oldest of six children. White attended Newton South High School and was a graduate of Dartmouth College, where he was a member of the Beta Theta Pi fraternity. White married his wife, Paula Da Silva, in 2010. They reside in Los Angeles, California.  Description above from the Wikipedia article Brian White, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1975-04-21',NULL),(2560,'Gianna Yeager',NULL,'',NULL,NULL),(2561,'Joseph Michael Harris',NULL,'',NULL,NULL),(2562,'Randall J. Bacon',NULL,'',NULL,NULL),(2563,'Dawn Bradfield','Irlanda','Dawn Bradfield was born on July 25, 1970 in Ireland. She is an actress, known for King Arthur (2004), \'71 (2014) and Disco Pigs (2001)','1970-07-25',NULL),(2564,'Cylk Cozart','Knoxville, Tennessee, USA','Cylk Cozart (born February 1, 1957) is an American actor who has appeared in over 30 films and 20 television shows.','1957-02-01',NULL),(2565,'Igor Meshcherin',NULL,'','1968-09-06',NULL),(2566,'Tyrone Keogh',NULL,'',NULL,NULL),(2567,'Wu Zun','Bandar Seri Begawan, Brunei','Wu Chun Chinese: 吳尊; pinyin: Wú Zūn (born 10 October 1979 Goh Kiat Chun) is a Bruneian actor, singer, and model. He was a member of Fahrenheit, a Taiwanese Mandopop vocal quartet boy band, from its debut in 2005 to June 2011 singing bass. Wu Chun has appeared Taiwanese dramas, such as Tokyo Juliet (2006), Hanazakarino Kimitachihe (2006), Romantic Princess (2007), Hot Shot (2008), Sunshine Angel (2011), and Kindaichi Case Files (2012-2013). In 2014, he appeared in the reality television program, Dad is Back with his daughter, Nei Nei. His film appearances include The Butterfly Lovers (2008), Lady of the Dynasty (2014), NEST 3D, with Li Bingbing and Kellan Lutz (English); and My Other Home, with Stephon Marbury and Jessica Jung (English). In 2016, he was cast in the Chinese drama, Martial Universe. As a model, Wu Chun has appeared in magazines, such as Esquire, Elle for Men, Men\'s Health Magazine, Harper\'s BAZAAR Magazine, GQ, and Reader\'s Digest. Wu Chun is a business owner in the Brunei fitness and health industry. His businesses include Bake Culture (Taiwan based artisan bakery), The Energy Kitchen (creativity healthy gourmet), Fitness Zone (largest and biggest health club in Brunei since 2003),[1] and WoMen Hair Salon (team of professionals for international celebrities). In China, he is the director of TV commercial advertisements for InterContinental Hotel. Wu Chun has a number of commercial and charitable endorsements.','1979-10-10',NULL),(2568,'Agik Steve Gumilar',NULL,'',NULL,NULL),(2569,'Tony Anthony','Clarksburg, West Virginia, USA','','1937-10-16',NULL),(2570,'Leonard Tenisci',NULL,'',NULL,NULL),(2571,'Georgi Stanislavov',NULL,'','1978-04-22',NULL),(2572,'Steven Cree','Kilmarnock, Ayrshire, Scotland, UK','Steven Cree is a Scottish film, television and theater  actor and writer, known for Outlaw King (2018), Brave (2012) and Outlander (2014). He has been married to Kahleen Crawford since May 29, 2016.','1981-02-28',NULL),(2573,'Andrew Morgado',NULL,'Andrew Morgado is an American voice actor, film writer, ADR mixer and sound editor. He is best known for voicing characters in animated films, animation and video games, such as Cliffjumper in Bumblebee (2018), Sanjar Nandi in The Outer Worlds (2019) and Kouichi Adachi in Yakuza: Like a Dragon (2020).','1980-08-07',NULL),(2574,'Vineeth Sreenivasan','Kuthuparamba, Kerala, India','Vineeth Sreenivasan is an Indian playback singer, lyricist, film actor, director, and screenwriter best known for his work in Malayalam cinema. Vineeth is the son of actor and screenwriter Sreenivasan. He started off his film career as a playback singer for films.  He made his debut singing Kasavinte Thattamittu for the film Kilichundan Mampazham (2003). He\'s also well known for music albums such as Coffee @ Mg Road (2008). Vineeth made his acting debut in Cycle (2008). His well known performances include in films Makante Achan (2009), Traffic (2011), Chappa Kurish (2011), Ormayundo Ee Mukham (2014), Oru Vadakkan Selfie (2015), and Kunjiramayanam (2015). In 2010,\n\nVineeth made his directorial debut with Malarvadi Arts Club. His second film as a director was Thattathin Marayathu (2012) which turned out to be a blockbuster at the box-office. His third film was Thira (2013), in which he introduced his younger brother Dhyan Sreenivasan. He scripted for Oru Vadakkan Selfie (2015) which become among the top 10 grossing Malayalam films. And his fourth film Jacobinte Swargarajyam (2016) released on April 8, 2016 to positive reviews and is a commercial success as well.','1985-10-01',NULL),(2575,'Sulistyo Kusumawati',NULL,'',NULL,NULL),(2576,'Thaíde','São Paulo, São Paulo, Brazil','','1967-11-05',NULL),(2577,'Joshua Sinclair','New York City, New York, USA','','1953-05-07',NULL),(2578,'Emily Bates',NULL,'',NULL,NULL),(2579,'Bo Roberts',NULL,'',NULL,NULL),(2580,'Yasmine Aker','Dubai, United Arab Emirates','Yasmine Aker is an actress, singer, and songwriter based out of Los Angeles, California. She was born in Dubai, United Arab Emirates to Iranian parents and later moved to Canada. She began performing at an early age, starring in school plays and community events. She sang soprano with the Voices of Bahá Choir for a performance at Carnegie Hall, New York, during the Conference of the Arts 2002. She has a passion for public service and was awarded the TD Canada Trust Scholarship for Community Leadership. Yasmine studied psychology at York University and the University of Western Ontario in London.\n\nAfter competing in the Miss World franchise as the titleholder, Miss London 2006, and Miss World Canada Photogenic 2006, she turned her sights back to her childhood dream of pursuing a career in film and television. She has starred in various motion pictures and television shows in Canada and the United States. Yasmine embarked on a solo singing career in 2009 with the Grammy-nominated Canadian production team KUYA, who have worked with international stars such as Alessia Cara, Nelly Furtado, Akon, and Genuwine. She has since released three albums, her latest album titled \"Unvarnished\". Her musical sound combines elements from her Middle Eastern roots, pop, neo-soul, and electronica. Yasmine moved to Los Angeles in 2011 to continue her work in film and television.',NULL,NULL),(2581,'Richard Grieco','Watertown, New York, US','From Wikipedia, the free encyclopedia.\n\nRichard John Grieco, Jr. (born March 23, 1965) is an American actor and former fashion model.\n\nDescription above from the Wikipedia article Richard Grieco, licensed under CC-BY-SA, full list of contributors on Wikipedia','1965-03-23',NULL),(2582,'Jorge H. Guzman',NULL,'',NULL,NULL),(2583,'Bonnie Bentley','Palestine, Texas, USA','','1979-06-19',NULL),(2584,'Eugene Magana',NULL,'',NULL,NULL),(2585,'Sonwabisile Jehoshaphat Ngoma',NULL,'',NULL,NULL),(2586,'Liisa Evastina','Helsinki, Finland','','1980-11-20',NULL),(2587,'Joakhim Sigue',NULL,'Joakhim Sigue is known for 3 Days to Kill (2014), Épouse-moi mon pote (2017) and Take-Away Romance (2014).',NULL,NULL),(2588,'Wayne Knight','New York City, New York, USA','Wayne Elliot Knight (born August 7, 1955) is an American actor. In television, he played Newman on Seinfeld (1992–1998) and Officer Don Orville on 3rd Rock from the Sun (1996–2001). He also voiced Igor on Toonsylvania (1998–1999), Mr. Blik on Catscratch (2005–2007) and Baron Von Sheldgoose on Legend of the Three Caballeros (2018).\n\nIn film, he played Dennis Nedry in Jurassic Park (1993), which earned him a Saturn Award for Best Supporting Actor nomination. He also portrayed Pete \"Piccolo\" Dugan in Dead Again (1991), John Correli in Basic Instinct (1992), Stan Podolak in Space Jam (1996) and Zach Mallozzi in Rat Race (2001) and provided the voices of Tantor in Tarzan (1999), Al McWhiggin in Toy Story 2 (1999) and The Elf Elder in Tom and Jerry: The Lost Dragon (2014).','1955-08-07',NULL),(2589,'Nils Allen Stewart',NULL,'Nils Allen Stewart (Born July 19th, 1961) is an American Actor and stuntman with nearly 300 credits to his name on-screen and for stunt work. When on screen he is often typecast as a thug, henchmen, enforcer or some kind of tough role. He is perhaps best remembered for his role as Orlando, The righthand man of Dorian Tyrell (played Peter Greene), in the 1994 Oscar nominated comedy The Mask which starred Jim Carrey and Cameron Diaz.  Stewart began his acting career with roles in such films as the action film \"Cop and A Half\" (1993) with Burt Reynolds, the Dan Aykroyd comedy \"Coneheads\" (1993) and the action flick \"The Shadow\" (1994) with Alec Baldwin. He also appeared in the Robert Patrick action picture \"Double Dragon\" (1994) and the action movie \"Soul of the Avenger\" (1995) with Mark Pellegrino. In the nineties and the early 2000s, Stewart devoted his time to various credits, such as \"The Chamber\" (1996) starring Chris O\'Donnell, \"The Quest\" (1996) and \"Meet Wally Sparks\" (1997). He also worked on \"Hitman\'s Run\" (2000) starring Eric Roberts. Stewart continued to exercise his talent in the early 2000s, taking on a mix of projects like \"Undisputed\" (2002), the Adam Sandler and Jack Nicholson box office smash \"Anger Management\" (2003) and \"Brick\" with Joseph Gordon-Levitt (2006). His credits also expanded to \"Eragon\" with Ed Speleers (2006) and \"Man of Faith\" (2006) starring Damian Chapa. Most recently, Stewart worked on the Thomas Horn adventure for the whole family \"Space Warriors\" (2013). He is married to Renee Steward and they have 4 children. He is the father of Booboo and Fivel Stewart.','1961-07-19',NULL),(2590,'Aidan Whytock',NULL,'',NULL,NULL),(2591,'James Handy','New York City, New York, USA','James Handy is an actor.',NULL,NULL),(2592,'Marc Andréoni','France','Marc Andréoni was born on February 8, 1961 in France. He is an actor and writer, known for 3 Days to Kill (2014), Léon: The Professional (1994) and District B13 (2004).','1961-02-08',NULL),(2593,'William Posley',NULL,'',NULL,NULL),(2594,'Aparna Balamurali','Thrissur, Kerala, India','Aparna Balamurali is an Indian actress and playback singer who works mostly in Malayalam and Tamil cinema. She is known for her roles in Maheshinte Prathikaaram, Sunday Holiday and Soorarai Pottru. She won the National Film Award for the Best Actress for playing Bommi in Sudha Kongara’s hugely successful film Soorarai Pottru.','1993-05-11',NULL),(2595,'Carlson Young','Fort Worth, Texas, U.S.','Carlson Elizabeth Young is an American actress and filmmaker. She was born in Fort Worth, Texas, to Susan Young and Marshall Young, a geologist. She attended the University of Southern California, where she studied Creative Writing, before leaving to film the first season of Scream: The TV Series (2015).','1990-10-29',NULL),(2596,'Tim Aydelott',NULL,'',NULL,NULL),(2597,'Ethan Hawke','Austin, Texas, USA','Ethan Green Hawke (born November 6, 1970) is an American actor, writer and director. He made his feature film debut in 1985 with the science fiction movie Explorers, before making a supporting appearance in the 1989 drama Dead Poets Society which is considered his breakthrough role. He then appeared in such films as White Fang (1991), A Midnight Clear (1992), and Alive (1993) before taking a role in the 1994 Generation X drama Reality Bites, for which he gained critical acclaim. In 1995, he starred in the romantic drama Before Sunrise, and later in its sequel Before Sunset (2004).\n\nIn 2001, Hawke was cast as a rookie police officer in Training Day, for which he received a Screen Actors Guild and Academy Award nomination in the Best Supporting Actor category. Other films have included the science fiction feature Gattaca (1997), the title role in Michael Almereyda\'s Hamlet (2000), the action thriller Assault on Precinct 13 (2005), and the crime drama Before the Devil Knows You\'re Dead (2007).\n\nHawke has appeared in many theater productions including The Seagull, Henry IV, Hurlyburly, The Cherry Orchard, The Winter\'s Tale and The Coast of Utopia, for which he earned a Tony Award nomination. He made his directorial debut with the 2002 independent feature Chelsea Walls. In November 2007 Hawke directed his first play, Jonathan Marc Sherman\'s Things We Want. Aside from acting, he has written two novels, The Hottest State (1996) and Ash Wednesday (2002). Between 1998 and 2004, Hawke was married to actress Uma Thurman.\n\nDescription above from the Wikipedia article Ethan Hawke, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1970-11-06',NULL),(2598,'Tommy Clark',NULL,'',NULL,NULL),(2599,'Kelly Frye','Houston, Texas','Kelly Frye was born on December 6, 1984 in Houston, Texas, USA. She is an actress, known for Roommates(2007), Burn (2007) and Twilight\'s Grace (2006).','1984-12-06',NULL),(2600,'Cindy',NULL,'',NULL,NULL),(2601,'Phillip V. Caruso','New Orleans, Louisiana, USA','','1956-01-01',NULL),(2602,'Lauren Dunton',NULL,'',NULL,NULL),(2603,'Kevin Pollak','San Francisco, California, USA','Kevin Pollak is an American actor, impressionist, game show host, and comedian. He started performing stand-up comedy at the age of 10 and touring professionally at the age of 20. In 1988, Pollak landed a role in George Lucas\' Willow, directed by Ron Howard, and began his acting career.','1957-10-30',NULL),(2604,'Hiroyuki Yoshino','Chiba, Japan','Hiroyuki Yoshino is a Japanese voice actor affiliated with Sigma Seven. He uses the alias Shun Kazama for adult works.','1974-02-06',NULL),(2605,'Heather McComb','Barnegat, New Jersey, USA','From Wikipedia, the free encyclopedia.\n\nHeather McComb (born March 2, 1977) is an American actress.\n\nMcComb started acting at age 2 in a commercial for Publisher\'s Clearing House. When she appeared in the telefilm \"Generation X\" in 1996, she became the first actress to portray the X-Men character of Jubilee on screen. She joined the cast of Party of Five in 1998, playing the part of Maggie.\n\nMcComb married actor James Van Der Beek on July 5, 2003. They are followers of the New Age version of Kabbalah and regular attendees of the Kabbalah Centre. On June 10, 2009, it was confirmed that the couple had split.','1977-03-02',NULL),(2606,'Alan Poe',NULL,'',NULL,NULL),(2607,'Vinitha Koshy',NULL,'',NULL,NULL),(2608,'Brian Krause','El Toro, California, USA','Brian Jeffrey Krause (born February 1, 1969) is an American actor. He is known for his role as Leo Wyatt on The WB television series Charmed (1998–2006) and for portraying the lead role of Charles Brady in the 1992 horror film Sleepwalkers.','1969-02-01',NULL),(2609,'Professor Toru Tanaka','Honolulu, Hawaii, USA','Was an American professional wrestler, professional boxer, college football player, soldier, actor, and martial artist who, in fighting rings, was also known as Professor Toru Tanaka, or simply Professor Tanaka. He also taught martial arts in Dallas,Texas. His skills were taught to young men with potential for football greatness. He was located directly across from Southern Methodist University. His students included many All American football players including David Randle. Randle’s training began on his 5th birthday. Randle went on to become one of the most awarded high school football players in Texas history. After high school he played at SMU for one season in 1981. He then transferred to UCLA, where he was part of 2 Rose Bowl victories in 1983 and 1984. Randle always honored Professor Tanaka with the most important influence in the football techniques he used his entire life. (Wikipedia)','1930-01-06','2000-08-22'),(2610,'Rafael Alonso','Madrid, Madrid, Spain','','1920-07-06','1998-10-24'),(2611,'Janean Christine Mariani',NULL,'',NULL,NULL),(2612,'Tanya Frank',NULL,'',NULL,NULL),(2613,'Jobeth Wagner','Mount Shasta, California, USA','','1985-06-20',NULL),(2614,'Kent McQuaid',NULL,'',NULL,NULL),(2615,'Reece Ritchie','Lowestoft, Suffolk, England, UK','Reece Ritchie (born 23 July 1986) is an English actor.','1986-07-23',NULL),(2616,'Ari Kilian',NULL,'',NULL,NULL),(2617,'Donnie Yen','Guangzhou, Guangdong province, China','Donnie Yen (Chinese: 甄子丹; born 27 July 1963) is a Hong Kong actor, martial artist, film director, action choreographer and film producer. Apart from being a well-known film and television actor in Hong Kong, Yen has also gained international recognition for appearing in many films together with other prominent and internationally-known actors such as Jackie Chan, Jet Li and Michelle Yeoh. He is considered to be Hong Kong\'s top action star; director Peter Chan mentioned that he \"is the \'it\' action person right now\" and \"has built himself into a bona fide leading man, who happens to be an action star.\"','1963-07-27',NULL),(2618,'Sophie Choudry','Manchester, Greater Manchester, England, UK','Sophia Choudry is a British singer, host and actress based in India. She has been active primarily in Hindi language films and is also a former MTV India VJ and occasional model, and television presenter.','1983-02-08',NULL),(2619,'Brie Larson','Sacramento, California, USA','Brie Larson (born Brianne Sidonie Desaulniers; October 1, 1989), is an American actress and filmmaker. She\'s best known for her role as Carol Danvers / Captain Marvel in Captain Marvel (2019) and reprise her role in other MCU films and series. She\'s also known for her roles as Elizabeth Zott in the miniseries Lessons in Chemistry (which she also executive produced), Tess in Fast X, Eva Ansley in Just Mercy, Jeannette Walls in The Glass Castle, Mason Weaver in Kong: Skull Island, Joy \"Ma\" Newsome in Room, Kim Townsend in Trainwreck, Amy Phillips in The Gambler, Monica Martello in Don Jon, Cassidy Roy in The Spectacular Now, Molly Tracey in 21 Jump Street, Helen in Rampart, Envy Adams in Scott Pilgrim vs. the World, Kate Gregson on Showtime\'s United States of Tara, Beatrice \"The Bear\" Leep in Hoot, and Emily Stewart on WB\'s sitcom Raising Dad.\n\nShe appeared as a regular in the 2001 sitcom Raising Dad and briefly dabbled with a music career, releasing the album Finally Out of P.E. in 2005. She played supporting roles in the comedy films 13 Going on 30 (2004), Hoot (2006), Scott Pilgrim vs. the World (2010), and 21 Jump Street (2012), and appeared as a sardonic teenager in the television series United States of Tara (2009–2011).\n\nHer breakthrough came with a leading role in the acclaimed independent drama Short Term 12 (2013), and she continued to take on supporting parts in the romance The Spectacular Now (2013) and the comedy Trainwreck (2015). For playing a kidnapping victim in the drama Room (2015), she won the Academy Award for Best Actress.\n\nThe 2017 adventure film Kong: Skull Island marked her first big-budget release, followed by Free Fire, The Glass Castle, Unicorn Store, and Basmati Blues, the same year. She then starred as Carol Danvers / Captain Marvel in the 2019 Marvel Cinematic Universe superhero film Captain Marvel. She reprised her role in other MCU films including Avengers: Endgame, Shang-Chi and the Legend of the Ten Rings, Avengers: Quantum Encounter, and The Marvels, as well as in the series Ms. Marvel. She then starred in and executive produced the comedy-drama Apple TV+ miniseries Lessons in Chemistry (2023). She also starred in Fast X (2023).\n\nShe has co-written and co-directed two short films, and made her feature film directorial debut with the independent comedy-drama Unicorn Store (2017). For producing the virtual reality series The Messy Truth VR Experience (2020), she won a Primetime Emmy Award.','1989-10-01',NULL),(2620,'John Kapelos','London, Ontario, Canada','John Kapelos (born March 8, 1956) is a Canadian actor from London, Ontario. He is best known for his portrayals of janitor Carl Reed in The Breakfast Club and Detective Donald Schanke in Forever Knight.','1956-03-08',NULL),(2621,'Richard Lothian',NULL,'',NULL,NULL),(2622,'Aleksander Karastoyanov',NULL,'',NULL,NULL),(2623,'Ward Bond','Benkelman, Nebraska, USA','From Wikipedia, the free encyclopedia\n\nWardell Edwin Bond (April 9, 1903 – November 5, 1960) was an American film character actor whose rugged appearance and easygoing charm were featured in more than 200 films, as well as in the NBC television series Wagon Train from 1957 to 1961. Among his best-remembered roles are Bert the cop in Frank Capra\'s It\'s a Wonderful Life (1946) and Captain Clayton in John Ford\'s The Searchers (1956).','1903-04-09','1960-11-05'),(2624,'Boris Klyuev','Moscow, USSR (Russia)','','1944-07-13','2020-09-01'),(2625,'Michael Shannon','Lexington, Kentucky, USA','Michael Corbett Shannon (born August 7, 1974) is an American actor, producer, musician, and theatre director. He has been nominated twice for the Academy Award for Best Supporting Actor for his roles in the Sam Mendes period drama Revolutionary Road (2008) and the Tom Ford psychological thriller Nocturnal Animals (2016). He earned Screen Actors Guild Award and Golden Globe Award nominations for his role in 99 Homes (2014), and a Tony Award nomination for Best Featured Actor in a Play for the Broadway revival of Eugene O\'Neill\'s Long Day\'s Journey into Night (2016).\n\nShannon made his film debut in 1993 with Groundhog Day and received widespread attention for his performance in 8 Mile (2002). He is known for his on-screen versatility, performing in both comedies and dramas such as Pearl Harbor (2001), Bad Boys II (2003), Bug (2006), Before the Devil Knows You\'re Dead (2007), Bad Lieutenant: Port of Call New Orleans (2009), The Iceman (2012), Premium Rush (2012), The Night Before (2015), The Shape of Water (2017) and Knives Out (2019). He played Superman\'s Kryptonian adversary General Zod in Man of Steel (2013) and Batman v Superman: Dawn of Justice (2016), and is set to reprise the role in The Flash (2022). Shannon is a frequent collaborator of Jeff Nichols, appearing in all of his films: Shotgun Stories (2007), Take Shelter (2011), Mud (2012), Midnight Special, and Loving (both 2016). He is also known for his role as Nelson Van Alden in the HBO period drama series Boardwalk Empire (2010–2014), for which he was nominated for three Screen Actors Guild Awards. In 2021, he had a main role in the Hulu drama miniseries Nine Perfect Strangers.','1974-08-07',NULL),(2626,'Nandu Poduval',NULL,'',NULL,NULL),(2627,'Trudi Hanley',NULL,'',NULL,NULL),(2628,'Geraldine Singer',NULL,'',NULL,NULL),(2629,'Kathy Imrie',NULL,'',NULL,NULL),(2630,'Nathaniel Benton',NULL,'',NULL,NULL),(2631,'Nao Nagasawa','Tokyo, Japan','She has since released a best album and girlsBOX-related album in March 2008. She was best known for her role as Nanami Nono/Water Ninja Hurricane Blue in the 2002 Super Sentai Series Ninpuu Sentai Hurricanger, and reprised her Role on three more occasions in the Super Sentai Teamup Specials: Bakuryuu Sentai Abaranger Vs. Hurricanger, GoGo Sentai Boukenger vs Super Sentai and in the 25th and 26th episodes of the 35th Super Sentai series Kaizoku Sentai Gokaiger. She is currently active as an actress. She is mostly seen in Japanese action movies playing strong characters and she still often makes appearances in Super Sentai series.','1984-01-05',NULL),(2632,'Lennox Brown','Port Antonio, Jamaica','','1966-02-12',NULL),(2633,'Adam Clark',NULL,'Adam Clark is an actor and director.',NULL,NULL),(2634,'Anne Speed',NULL,'',NULL,NULL),(2635,'Angelo Boscariol','Italy','','1931-08-05','2004-07-11'),(2636,'Janeline Hayes','Tacoma, Washington, USA','',NULL,NULL),(2637,'Eduardo Bronks',NULL,'',NULL,NULL),(2638,'Carly Pope',' Vancouver, British Columbia, Canada','Carly Pope (born August 28, 1980) is a Canadian actress.\n\nDescription above from the Wikipedia article  Carly Pope, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1980-08-28',NULL),(2639,'John Billingsley','Media, Pennsylvania, USA','From Wikipedia, the free encyclopedia.\n\nJohn Billingsley (born May 20, 1960, height 5\' 9½\" (1,77 m)) is an American actor, known for his role as Doctor Phlox on the television series Star Trek: Enterprise.\n\nJohn Billingsley was born in Media, Pennsylvania, and subsequently lived in Huntsville, Alabama and Slidell, Louisiana before his family settled in Weston, Connecticut.\n\nBillingsley is married to fellow actor Bonita Friedericy. She first became interested in him after seeing him perform in a stage production of Great Expectations. Friedericy appeared with Billingsley in \"Regeneration\", a 2003 episode of Star Trek: Enterprise in which she played Rooney. The couple of have subsequently appeared in other productions together.','1960-05-20',NULL),(2640,'Hayabusa Tenkomori',NULL,'',NULL,NULL),(2641,'Joel Virgel',NULL,'',NULL,NULL),(2642,'Tihirah Taliaferro',NULL,'',NULL,NULL),(2643,'Bob Constance',NULL,'',NULL,NULL),(2644,'Declan Hannigan',NULL,'',NULL,NULL),(2645,'Aya Sugimoto','Sakyo-ku, Kyoto City, Kyoto, Japan','Aya Sugimoto (July 19, 1968 -) is a Japanese TV personality, actress, dancer and author born in Kyoto. She also had a mildly successful J-pop career in the late 1980s-early 1990s.\n\nDescription above from the Wikipedia article Aya Sugimoto, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1968-07-19',NULL),(2646,'Brian Lafontaine',NULL,'',NULL,NULL),(2647,'Anna Mae Wills','Berlin, Germany','From Wikipedia, the free encyclopedia.\n\nAnna Mae Routledge - (born December 23, 1981), is a Canadian actress. She is best known for her role as Celeste Jeansen in the Disney Channel Original Movie, 16 Wishes.\n\nDescription above from the Wikipedia article Anna Mae Routledge, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1981-12-23',NULL),(2648,'Chase Allen',NULL,'',NULL,NULL),(2649,'Julieta Espinoza',NULL,'',NULL,NULL),(2650,'Leo Rossi','Trenton, New Jersey, USA','Leo Rossi  (born 1946) is an American character actor and writer with over 100 credits to his name, often playing authority figures, gangsters and other villains. He is known for his role as Budd Scarlotti in the 1981 horror film Halloween II and as Turkell from the 1990 horror sequel Maniac Cop 2. His other films include Heart Like a Wheel (1983), River\'s Edge (1986), The Accused (1988), Relentless (1989) and Analyze This (1999). Rossi starred on the 1980s short-lived TV series Partners in Crime and appeared in made-for-TV movies.\n\nDescription above from the Wikipedia article Leo Rossi, licensed under CC-BY-SA, full list of contributors on Wikipedia','1946-06-26',NULL),(2651,'Jaz Martin','Yorkshire, England','',NULL,NULL),(2652,'Daniel Cudmore','Squamish, British Columbia, Canada','Daniel Cudmore (born January 20, 1981) is a Canadian actor and stuntman. He is perhaps best known for his roles as the superhero Peter Rasputin / Colossus in the X-Men film series, and as Volturi Felix in The Twilight Saga film series.','1981-01-20',NULL),(2653,'Erika Degraffinreaidt',NULL,'',NULL,NULL),(2654,'Paige Baxter',NULL,'',NULL,NULL),(2655,'Cedric Comps',NULL,'',NULL,NULL),(2656,'Gábor Bodis',NULL,'',NULL,NULL),(2657,'Simon MacCorkindale','Ely, Cambridgeshire, England, UK','Simon Charles Pendered MacCorkindale was a British actor, film director, writer and producer. He spent much of his childhood moving around due to his father serving as an Officer with the Royal Air Force. Poor eyesight prevented him following a similar career in the RAF, so he instead planned to become a theatre director. Training at the Theatre of Arts in London, he started work as an actor, making his West End debut in 1974. He went on to appear in numerous roles in television, including the series I, Claudius and Jesus of Nazareth, before starring as Simon Doyle in the film Death on the Nile. This proved to be a breakthrough role and allowed him to move to the United States, where he appeared in a variety of films and TV series including Quatermass, The Riddle of the Sands, The Sword and the Sorcerer, and Jaws 3-D.\n\nIn 1983, MacCorkindale starred in the short-lived series Manimal as the lead character, Dr. Jonathan Chase, before taking up the longer-running role of lawyer Greg Reardon in Falcon Crest. Throughout the late 1980s and 1990s he directed and produced many stage, TV and film productions through his company Amy International Artists, such as the film Stealing Heaven (1988). Moving to Canada, he starred as Peter Sinclair in the series Counterstrike for three years. He returned to the United Kingdom in 2002 and joined the cast of the BBC medical drama Casualty, appearing in the role of Harry Harper for six years until 2008.','1952-02-12','2010-10-14'),(2658,'Rikki Klieman','Chicago, Illinois, USA','','1948-01-01',NULL),(2659,'Robert Maaser','Strausberg, Germany','Maaser was born in Strausberg, Germany, to Silvia and Thomas Maaser, a former MiG-29 pilot. He started artistic gymnastics at the age of 3. Six years later he started martial arts and wheel gymnastics. Until today he is the most successful competitor in the history of the sport with 14 world champion titles, 2 world cup wins and more than 50 national titles as well as the title as the youngest ever world champion at age 14.','1990-07-19',NULL),(2660,'Joey Luthman','Dayton, Ohio, USA','Joseph Gregory Wagner \"Joey\" Luthman (born January 14, 1997) is an American teen actor, best known for portraying Young Physical Phil in the popular ABC TV series, October Road.\n\nFrom Wikipedia, the free encyclopedia','1997-01-14',NULL),(2661,'Flor de Maria Chahua',NULL,'Flor de Maria Chahua was born in Jesús María District, Lima, Peru. Flor de Maria is an actor and director, known for Drag Me to Hell (2009), Kings (2017) and Get the Life (2016).',NULL,NULL),(2662,'Laura Spencer','Oklahoma City, Oklahoma, USA','Laura Spencer (born May 8, 1986) is an American actress and producer.','1986-05-08',NULL),(2663,'Michael Sercerchi',NULL,'',NULL,NULL),(2664,'Anupam Kher','Shimla, Himachal Pradesh, India','Anupam Kher (born March 7, 1955) is an Indian actor, director and producer who works primarily in Hindi-language films. He has appeared in nearly 400 films and 100 plays. He has played a variety of characters including numerous critically acclaimed leading or parallel roles. The Government of India honoured him with the Padma Shri in 2004 and the Padma Bhushan in 2016 for his contribution in the field of Indian cinema and arts.  Kher is known internationally for Bend It Like Beckham (2002), Bride and Prejudice (2004) and The Mistress of Spices (2005). In 2012, he co-starred in the Academy Award-winning Silver Linings Playbook.','1955-03-07',NULL),(2665,'Jeffery Thomas Johnson',NULL,'Jeffery Thomas Johnson is an American actor for film and television.',NULL,NULL),(2666,'Orlin Pavlov','Sofia - Bulgaria','Orlin Pavlov (born Orlin Orlinov Pavlov; April 23, 1979) is an Bulgarian pop musician best known during the 2002-2007 as the lead vocalist of the pop band Kaffe. The popularity of \"Kaffe\" during that period won him several awards - \"Annual BG Awards\", an \"MM TV music awards\", \"Golden stag\", etc.\n\nOrlin Pavlov was born in Sofia, Bulgaria to a family of musicians. Both his parents were opera singers during the 60\'s through the 80\'.\n\nIn 2010 Orlin Pavlov decided to pursue his solo career to become one of the most beloved Bulgarian singers.\n\nOne of Orlin Pavlov\'s other passions is Jazz. Inspired by singers like Frank Sinatra, Nat King Cole, Michael Bubble and Jamie Cullum he have organized several very successful \"Unplugged\" live concerts.\n\nDuring the years Orlin Pavlov have never forgotten his first passion - acting. During his school years he was actively involved in theater and dance classes and programs..\n\nIn addition to his singing career Orlin Pavlov is also pursuing a career in acting. He appeared in several movies and TV series. Among the productions are \"Home wars\" and \"Payoff\".\n\nIn 2014 he played the lead role in Nikolay Iliev\'s movie \"Living Legends\".','1979-04-23',NULL),(2667,'Richard Dormer','Portadown, County Armagh, Northern Ireland, UK ','Richard Dormer is a Northern Irish actor, playwright and screenwriter.  He was born in Lisburn, Northern Ireland. After to being accepted to the Royal College of Art Richard accepted a scholarship at the RADA school of acting in London. After living and working in London, he returned to Northern Ireland. He lives in Belfast and is married to director Rachel O\'Riordan.  Dormer is perhaps best known for his performance as Northern Irish Snooker star, Alex Higgins in Hurricane, which he wrote and starred in. The production received praise from critics and even from Higgins himself and saw Richard win The Stage award for best actor in 2003. He is currently the bookie\'s third favourite to play Higgins in the scheduled film of his life behind Cillian Murphy and Jonathan Rhys Meyers. In 2004 Richard won the Irish Times Best Actor Award for his performance in Frank McGuinness\'s Observe the Sons of Ulster Marching Towards the Somme and in 2005 completed a season with Sir Peter Hall at the Theatre Royal and performed Bath in the George Bernard Shaw play, You Can Never Tell, William Shakespeare\'s,Much Ado About Nothing, Noël Coward\'s play, Private Lives, and in a production of Samuel Beckett\'s Waiting for Godot.  Since, Dormer has written a number of plays including The Half and Gentleman\'s Tea Drinking Society which were produced through Belfast\'s Ransom theatre company. He has also provided the voices for over twenty BBC Radio 4 plays, documentaries and advertising campaigns.  Following a run of film castings playing secondary characters, he was cast as the lead in the 2012 Good Vibrations which tells the story of Northern Ireland personality and punk rock visionary Terri Hooley. The film premièred at the 2012 Cannes Film Festival and was awarded \'best film\' at the Galway film awards. 2012 also saw Dormer taking over the role of Lord Beric Dondarrion, known as the \"Lightning Lord\", the leader of the \"Brotherhood Without Banners\" for Season 3 of HBO series Game of Thrones.','1969-11-11',NULL),(2668,'Heather Henderson',NULL,'',NULL,NULL),(2669,'Edward Burns','Woodside, Queens County, New York, USA','Edward Fitzgerald Burns (born January 29, 1968) is an American actor, writer, and filmmaker. He first came to attention for The Brothers McMullen (1995), his ultra low-budget independent film that went on to be a worldwide hit. Other film appearances include Saving Private Ryan (1998), The Holiday (2006), Man on a Ledge (2012), Friends with Kids (2012), and Alex Cross (2012). Burns directed movies such as She\'s the One (1996), Sidewalks of New York (2001), and The Fitzgerald Family Christmas (2012). On television, he starred as Bugsy Siegel in the TNT crime drama series Mob City and as Terry Muldoon in TNT\'s Public Morals.\n\nFrom Wikipedia, the free encyclopedia.','1968-01-29',NULL),(2670,'Marcello Meconizzi',NULL,'',NULL,NULL),(2671,'Luke Wilson','Dallas, Texas, USA','Luke Cunningham Wilson (born September 21, 1971) is an American actor, director and writer. He is the younger brother of actors Owen Wilson and Andrew Wilson.\n\nHe is known for his roles in films such as Bottle Rocket, Idiocracy, The Royal Tenenbaums, Blue Streak, My Dog Skip, Old School, Alex & Emma, Legally Blonde 1 & 2, Charlie\'s Angels 1 & 2, The Family Stone, Hoot, Vacancy, 3:10 to Yuma, The Goldfinch, and All the Bright Places. His television credits include the series Enlightened, Roadies and DC\'s Stargirl as well as hosting the reality docuseries Emergency Call.','1971-09-21',NULL),(2672,'Gabriel Malema',NULL,'',NULL,NULL),(2673,'He Xiang','Xinjiang, China','He Xiang graduated from the Beijing Sports University Affiliated Competitive Sports School and won the Xinjiang Wushu Championship three consecutive times. In 2002, he served as a martial artist in the martial arts drama \"Seven Swords Under Tianshan\". In 2008, he participated in the selection TV event \"The Descendants of the Dragon\" and entered the top 16. He was later accepted as an apprentice by Jackie Chan and became one of the \"New Seven Little Fortunes\"','1990-05-08',NULL),(2674,'Michael Rouse',NULL,'',NULL,NULL),(2675,'Harry L. Fraser','San Francisco, California, USA','From Wikipedia, the free encyclopedia.\n\nHarry L. Fraser (31 March 1889 - 8 April 1974) was an American film director. He directed over 80 films between 1925 and 1951, including the 1934 John Wayne film Randy Rides Alone and the Frank Buck cliffhanger serial Jungle Menace (1937). He had a small acting role in the John Wayne film \'Neath the Arizona Skies. He also wrote screenplays, including Chick Carter, Detective (1946).\n\nIn his autobiography, Fraser described filming the scene in Jungle Menace during which a boa constrictor attacks the heroine Dorothy (Charlotte Henry). The villain has tied Dorothy hand and foot and she thrashes about wildly, terrified when she suddenly sees the huge snake:\n\n\"The snake was in no hurry. Slowly he slithered across the girl\'s body, while she screamed and struggled. He turned, looking for a spot to slip under her to make his first wrap. I motioned to the reptile crew to get ready, and a split-second later gave them the signal to move in. But now, the maddened snake fought them and did its best to coil around one of the men. Before that happened, however, I had cut, and we had a good cliff-hanger with our terror-stricken heroine to close the episode.\"\n\nDescription above from the Wikipedia article Harry L. Fraser, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1889-03-31','1974-04-08'),(2676,'Spero Stamboulis','Hartford, Connecticut, USA','','1969-06-29',NULL),(2677,'Mo Zinal',NULL,'',NULL,NULL),(2678,'Ice Cube','Los Angeles, California, USA','O\'Shea Jackson Sr., better known by his stage name Ice Cube, is an American rapper, record producer, actor, screenwriter, film producer, and director. He began his career as a member of the hip-hop group C.I.A. and later joined N.W.A.','1969-06-15',NULL),(2679,'Lisa Lu','Beijing, China','Lisa Lu Yan (simplified Chinese: 卢燕; traditional Chinese: 盧燕; pinyin: Lú Yàn; born July 8, 1927) is a Chinese-born American actress and singer. She won the Golden Horse Awards three times in the 1970s.','1927-01-19',NULL),(2680,'Matt Herring',NULL,'',NULL,NULL),(2681,'Allyson Cristofaro',NULL,'Allyson Cristofaro is an actor born in Taunton, Massachusetts who is best known for her performances as Olivia in 13 Minutes and Renise in Breaking Them Up. She had moved around the East Coast including Hooksett, New Hampshire and Marietta, Georgia, but ended up in Oklahoma City, Oklahoma where she is continuing her acting career.',NULL,NULL),(2682,'Benjamin Adams',NULL,'',NULL,NULL),(2683,'Patty Hannock',NULL,'Patty Hannock is known for 3 Days to Kill (2014), Hitch (2012) and 360 (2011).',NULL,NULL),(2684,'Bruce A. Young','Wilmette, Illinois, USA','Bruce A. Young (born April 22, 1956) is an American television and film actor who is perhaps best known for his role as Capt. Simon Banks in the UPN sci-fi police drama The Sentinel. He also played mercenary M.B. Nash in Jurassic Park III. In addition, he played the character of Moselle, a pool player who loses to Vince (played by Tom Cruise), in The Color of Money. His other film and television credits include Basic Instinct, Into Temptation, E/R, Highlander: The Series, Quantum Leap, NYPD Blue, Undisputed, Cold Case, Ghost Whisperer, Risky Business, Grey\'s Anatomy and Prison Break. Another notable role Young played was a self-defense instructor in the movie \"Enough\".\n\nDescription above from the Wikipedia article Bruce A. Young, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1956-04-22',NULL),(2685,'Edgar Arreola',NULL,'',NULL,NULL),(2686,'Alexandra Castillo','Santiago, Chile','Alexandra Castillo is a Chilean-Canadian film and television actress and dancer.','1971-06-14',NULL),(2687,'Damian Lau Chung-Yan','Hong Kong, China','Damian Lau Chung-yan (Chinese: 劉松仁, born 14 October 1949) is a Hong Kong film and television actor, executive producer and film director. Lau has starred in many television drama series of various genres, produced by Hong Kong\'s TVB and ATV.','1949-10-14',NULL),(2688,'John Kokken','Mumbai, Maharashtra, India','John Kokken aka Anish John Kokken is an Indian film actor, who works mainly in Telugu and Tamil cinemas.','1981-03-27',NULL),(2689,'Krishna','Kainakary, Alappuzha','Krishna is an Indian film actor who appears mainly in the Malayalam cinema industry.','1983-03-23',NULL),(2690,'Tony Sanford',NULL,'',NULL,NULL),(2691,'Billy Slaughter','New Orleans, Louisiana, USA','William H. Slaughter is an American film and television actor, best known for his roles in The Campaign and Focus.','1980-06-03',NULL),(2692,'J. Bryan Morse',NULL,'',NULL,NULL),(2693,'Howard Crampton','New York City, New York, USA','From Wikipedia, the free encyclopedia.  \n\nHoward Crampton (12 December 1865 – 15 June 1922) was an American actor of the silent era. He appeared in 73 films between 1913 and 1922.\n\nHe was born in New York, New York.\n\nDescription above from the Wikipedia article Howard Crampton, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1865-12-11','1922-06-15'),(2694,'Lisa Codrington',NULL,'Lisa Codrington, a renowned actor and writer in Toronto, earned acclaim with a Governor General’s Award for Drama nomination and received the K.M. Hunter Theater Award and the Carol Bolt Award for Playwrights. Her impressive writing credits encompass acclaimed works like \"The Prescription – 21 Black Futures\" (Obsidian/CBC), \"The Adventures of the Black Girl in Her Search for God\" (Shaw Festival, Karamu House), \"Up the Garden Path\" (Obsidian Theatre), \"The Aftermath\" (Groundswell Festival, Femfest), \"The Colony – Opera to Go\" (Tapestry), and \"Cast Iron\" (Nightwood Theatre & Obsidian Theatre). Her acting roles span across Letterkenny, Orphan Black, Schitt\'s Creek, The Handmaid\'s Tale, Bad Blood, Anne with an E, CBC\'s Children Ruin Everything, and Amazon Prime\'s The Lake. Currently, Lisa\'s actively developing two new plays while serving as a playwright in residence at Why Not Theatre, showcasing her prolific talent and dedication to the craft.',NULL,NULL),(2695,'Juan Gaspard','United States of America','',NULL,NULL),(2696,'Nobuyuki Hiyama','Hatsukaichi, Hiroshima, Japan','Nobuyuki Hiyama (檜山 修之, Hiyama Nobuyuki, born August 25, 1967) is a Japanese voice actor from Hatsukaichi City, Hiroshima Prefecture. He is affiliated with Arts Vision.','1967-08-25',NULL),(2697,'Victoria Paige Watkins','Gulfport, Mississippi, USA','Victoria Paige Watkins was born on September 3, 2008 in Gulfport, Mississippi, USA. She is an actress, known for The Hunger Games: The Ballad of Songbirds and Snakes (2023), Red Notice (2021) and Armored (2024).','2008-09-03',NULL),(2698,'Farouk Valley-Omar','Worcester, South Africa','Farouk Valley-Omar is a South African stage, film and television actor and director.',NULL,NULL),(2699,'Billy L. Sullivan','New York, USA','','1980-05-24',NULL),(2700,'Shauna Small',NULL,'',NULL,NULL),(2701,'Fred Ochs',NULL,'',NULL,NULL),(2702,'Chalit Fuengarom',NULL,'Toom Chalit Fuengarom is a Thai actor, singer, and MC. He started working in the entertainment industry in 1977. He formed a singing pop/jazz duo with his singer/songwriter brother Charat Fuengarom. He has won several awards including the Mekhala award for outstanding actors.','1948-10-30',NULL),(2703,'Danny Glover','San Francisco, California, USA','Danny Lebern Glover (born July 22, 1946) is an American actor, film director, and political activist. He is best known for his co-starring lead role as Sergeant Roger Murtaugh in the Lethal Weapon film series.\n\nGlover has had a variety of film, stage, and television roles. He starred as the husband to Whoopi Goldberg\'s character, Celie in the celebrated literary adaptation of The Color Purple, and as Lieutenant James McFee in the film Witness. He had leading roles in other films including To Sleep with Anger, Predator 2, Angels in the Outfield, and Operation Dumbo Drop. He won the Independent Spirit Award for Best Male Lead for his starring role in Charles Burnett\'s To Sleep with Anger.\n\nAlso, he has had prominent supporting roles in Silverado, Witness, A Rage in Harlem, Dreamgirls, Shooter, Death at a Funeral, Beyond the Lights, Sorry to Bother You, The Last Black Man in San Francisco, The Dead Don\'t Die, Lonesome Dove and Jumanji: The Next Level. Glover earned top billing for the first time in Predator 2, the sequel to the science fiction action film Predator.  During his career, he has also made several cameos, appearing, for example, in the Michael Jackson video \"Liberian Girl\" of 1987.\n\nIn 1994, he made his directorial debut with the Showtime channel short film Override. Also in 1994, Glover and actor Ben Guillory founded the Robey Theatre Company in Los Angeles, focusing on theatre by and about black people.','1946-07-22',NULL),(2704,'Lyndall Grant','Fort Worth, Texas, USA','',NULL,NULL),(2705,'Charles Hudson',NULL,'',NULL,NULL),(2706,'Christopher A. Smith',NULL,'',NULL,NULL),(2707,'Panudej Watanasuchat',NULL,'',NULL,NULL),(2708,'Robert Miano','New York City, New York, U.S.','From Wikipedia, the free encyclopedia.\n\nRobert Miano (born September 25, 1942) is an American actor.\n\nDescription above from the Wikipedia article Robert Miano, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1942-09-25',NULL),(2709,'Joe Roche',NULL,'',NULL,NULL),(2710,'Elektra Anastasi',NULL,'','1986-05-19',NULL),(2711,'Grant Bowler','Auckland, New Zealand','Grant Bowler (born 18 July 1968) is a New Zealand-Australian actor who has made appearances on American, Australian, New Zealand, and Canadian movies and television shows. He is known for playing the role of Constable Wayne Patterson in Blue Heelers and also appeared as Wilhelmina Slater\'s love interest Connor Owens in Ugly Betty. In November 2010, he was announced as the host of The Amazing Race Australia which will air on the Seven Network in 2011.\n\nBowler was married to South African actress Roxane Wilson from 2001 to 2011 and has two children.','1968-07-18',NULL),(2712,'Ellen Whyte',NULL,'',NULL,NULL),(2713,'Mario Feliciani',' Milan, Italy','Mario Feliciani (12 March 1918 – 11 August 2008) was an Italian actor and voice actor.\n\nBorn in Milan, after completing his classical education Feliciani attended the Accademia dei filodrammatici obtaining the diploma. He made his stage debut in 1941, with the theatrical company \"Palcoscenico\". Later he was part of various companies, obtaining his first personal successes in 1946, with the drama La luna è tramontata.\n\nFrom 1947 to 1952 he was a member of the Piccolo Teatro\'s stage company directed by Giorgio Strehler. He had also a very long and important collaboration on stage with Vittorio Gassman, also performing tours abroad with him. In the 1970s he came back to Piccolo Teatro for two important works, Santa Giovanna dei macelli (1970–71) and Le case del vedovo (1975-76).\n\nFeliciani was also very active in films, on television and as a voice actor, on the radio and in the dubbing.\n\nMarried to the actress Giuliana Pogliani, after obtaining the annulment Feliciani was married to actress Vittoria Martello.\n\nSource: Article \"Mario Feliciani\" from Wikipedia in English, licensed under CC-BY-SA 3.0.','1918-03-12','2008-08-11'),(2714,'Manuel Gallardo','Cardeña, Córdoba, Spain','','1935-05-03','2020-08-21'),(2715,'Douglas M. Griffin','New Orleans, Louisiana, USA','Douglas M. Griffin was born on November 17, 1966 in New Orleans, Louisiana, USA. He is an actor, known for Hap and Leonard (2016), Maggie (2015) and Deepwater Horizon (2016).','1966-11-17',NULL),(2716,'Sérgio Ricardo','Marília, São Paulo, Brazil','João Lutfi (18 June 1932 – 23 July 2020), known professionally as Sérgio Ricardo, was a Brazilian actor, musician, playwright and filmmaker, better known for being responsible for the soundtrack of Glauber Rocha\'s \"Deus e o Diabo na Terra do Sol\" (\"Black God, White Devil\").\n\nBorn in a Lebanese-Brazilian family in Marília, São Paulo, and brother to famed director of photography Dib Lutfi, João got his stage name from TV businessmen who wanted to rebrand him as a leading man with an iconic name during his early gigs as an actor. He\'s maily associated with the Cinema Novo (Brazilian New Wave) movement, but stayed active until 2018.\n\nDuring the Cinema Novo days, Ricardo directed short film \"Menino da Calça Branca\" (1961) and \"Esse Mundo É Meu\" (1963), his feature-length debut. Among other notorious works in his career as a filmmaker is \"A Noite do Espantalho\", which shows Ricardo\'s talent as a polymath by mixing filmmaking with folk music and other elements of Brazilian popular culture, such as \"cordel\" literature.\n\nRicardo moved to the Vidigal slum, in Rio de Janeiro, by choice in the 1970s, where he lived until his death in 2020. \"Bandeira de Retalhos\" (2018), his last film, was adapted by a theatre play also written by him and chronicles the life in 1970s Vidigal.','1932-06-18','2020-07-23'),(2717,'Peter Epstein',NULL,'Peter Epstein is a stuntman, stunt actor, and stunt coordinator who performed stunts in Star Trek.',NULL,NULL),(2718,'Sid Haig','Fresno, California, USA','Sid Haig was an American film actor known for blaxploitation films of the 1970s as well as his role as Captain Spaulding in Rob Zombie\'s horror films House of 1000 Corpses and The Devil\'s Rejects. He has appeared in many television programs during his career.','1939-07-14','2019-09-21'),(2719,'Ivy George','Los Angeles, California, USA','Ivy George was born on May 16th in Los Angeles, CA to Martin George and Christa Nelson George. Ivy started her acting career in musical theatre at the age of 5. Her first professional acting job came at 6 years old in a scene opposite Robin Williams. Ivy has two younger siblings.','2007-05-16',NULL),(2720,'Elisabeth Etienne',NULL,'',NULL,NULL),(2721,'Laura Allen','Portland, Oregon, USA','Laura Allen (born March 21, 1974) is an American actress.\n\nAllen was born in Portland, Oregon, the daughter of Julie and David Allen. She grew up on Bainbridge Island, Washington,[1] as the middle child of three sisters: older Jennifer (Jenny) and younger Lindsay. She attended Wellesley College as a Sociology major and graduated in 1996. She worked with the NYPD as a domestic violence counselor before pursuing acting.\n\nShe and Bruce Weyman married at the Relais Palazzo del Capitano in Pienza, Italy, on September 23, 2006. They have two children. Son, Harper Edward Weyman.\n\nDescription above from the Wikipedia article Laura Allen, licensed under CC-BY-SA, full list of contributors on Wikipedia','1974-03-21',NULL),(2722,'Paulo Gabriel',NULL,'',NULL,NULL),(2723,'Howie Long','Charlestown, Massachusetts, USA','From Wikipedia, the free encyclopedia.\n\nHoward \"Howie\" Matthew Moses Long (born January 6, 1960 in Charlestown, Massachusetts) is an American former National Football League defensive end and actor. He was inducted into the Pro Football Hall of Fame in 2000. He is currently a studio analyst for Fox Network\'s NFL coverage.\n\nDescription above from the Wikipedia article Howie Long, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1960-01-06',NULL),(2724,'Billy Gallo','Brooklyn, New York, USA','','1966-11-07',NULL),(2725,'Swen Temmel','Graz, Austria','','1991-08-25',NULL),(2726,'Craig Stanghetta',NULL,'',NULL,NULL),(2727,'Bjorn Steinbach','Port Elizabeth, South Africa','Bjorn Jorg Walter Steinbach hails from Port Elizabeth, South Africa. He graduated from Grey High School in 2002 and then in 2003 attended school at the University of Cape Town to study psychology. In 2005, he was on Fear Factor: South Africa. He left UCT and enrolled in City Varsity in 2006 to pursue acting. He also enrolled in the summer program at the Esper Studio in New York in 2008. His first project was a short film called Small Killing (2008) that was filmed and aired in South Africa. Bjorn got his first U.S. break on a project called Generation Kill (2008), an HBO original 7 part mini-series about the 1st Recon Marine Battallion that was sent in during the first phase of the war in Iraq. He portrayed Cpl. Michael Stinetorf in all 7 episodes. Since then he has worked on the made for TV movie, Natalie Holloway (2009) which aired on USA, and The Philanthropist (2009) which aired on NBC.','1985-10-20',NULL),(2728,'Yousuf Azami',NULL,'',NULL,NULL),(2729,'Josh Duhon',NULL,'',NULL,NULL),(2730,'David Wenham','Marrickville, Sydney, Australia','David Wenham (born 21 September 1965) is an Australian actor who has appeared in movies, television series and theatre productions. He is known in Hollywood for his roles as Faramir in The Lord of the Rings film trilogy, Carl in Van Helsing and Dilios in 300. He is also known in his native Australia for his role as Diver Dan in SeaChange.\n\nDescription above from the Wikipedia David Wenham, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1965-09-21',NULL),(2731,'James Owen',NULL,'',NULL,NULL),(2732,'Jason Sims-Prewitt',NULL,'',NULL,NULL),(2733,'Sharon Posey',NULL,'',NULL,NULL),(2734,'Nathalie Boltt','South Africa','Nathalie Boltt (born 19 July 1973) is a South African actress known for Riverdale and District 9. Her initial break into acting was in her birth country, South Africa, as Joey Ortlepp on the SABC 3 drama Isidingo from 2001 to 2004.\n\nInternationally, she portrayed Penelope Blossom on The CW\'s teen drama series Riverdale from 2017 to 2023. She has been seen in the films District 9, Demonic, and the 2005 television remake of The Poseidon Adventure. She also voices the character of DottyWot in the New Zealand children\'s series The WotWots.\n\nDescription above from the Wikipedia article Nathalie Boltt, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1973-07-19',NULL),(2735,'Xie Gang','Tianjin, China','','1953-01-01',NULL),(2736,'Yolanda Whitaker','Los Angeles, California, USA','Yolanda Whitaker, better known by her stage name Yo-Yo, has been among the most sophisticated and unpredictable female MCs around. She doesn\'t take an overtly feminist tack but urges young women to show sexual restraint and use their minds as well as their bodies.','1971-08-04',NULL),(2737,'Maxine Taylor',NULL,'',NULL,NULL),(2738,'Mustafa Haidari',NULL,'',NULL,NULL),(2739,'Daniel Mays','Epping, Essex, England, UK','Daniel Mays was born on March 31, 1978 in Epping, Essex, England as Daniel Alan Mays. He is an actor, known for The Adventures of Tintin: The Secret of the Unicorn (2011), The Bank Job (2008) and Atonement (2007). He has performed five plays at the Royal Court Theatre in London including two in the theatre\'s 50th Anniversary year in parts that were specifically written for him. He won the Best Actor prize at the Palmare Television Festival 2003 for his performance in the hard hitting improvised BBC film Rehab. He has made two films with the acclaimed British director Mike Leigh. All or Nothing (2002) and the 1950s abortion drama, Vera Drake (2004), which received 3 Academy Award Nominations, the Golden Lion Award for Best Film, 3 Bafta Awards and 6 British Independent Film Awards including Best British Independent Film. Son of Toni Mays.','1978-03-31',NULL),(2740,'Arshia Mandavi',NULL,'',NULL,NULL),(2741,'Don Baldwin',NULL,'',NULL,NULL),(2742,'Babou Ceesay','London, England, UK','','1979-01-01',NULL),(2743,'Julie McCullough','Honolulu, Hawaii, USA','Julie McCullough was born on January 30, 1965 in Honolulu, Hawaii, USA. She is an actress and writer, known for The Blob (1988), 2012: Ice Age (2011) and Top of the World (1997). She was previously married to David Sutcliffe.','1965-01-30',NULL),(2744,'Yasiin Bey','Brooklyn, New York, USA','Yasiin Bey (/jæˈsiːn ˈbeɪ/; born Dante Terrell Smith, December 11, 1973), formerly known as Mos Def, is an American retired rapper, singer-songwriter, and actor.\n\nRegarded as one of hip hop\'s most introspective and insightful artists, Mos Def, has shaped a career that transcends music genres and artistic medium. With the release of \"Universal Magnetic\" (1996), he became an underground favorite in the hip-hop world, leading to his legendary collaboration with Talib Kweli. The two formed Black Star whose debut album, Mos Def and Talib Kweli Are Black Star, would become one of the most critically acclaimed hip-hop albums. He followed with his 1999 solo debut, Black On Both Sides, which was certified gold and credited by critics as bringing hip hop back to its soapbox roots.\n\nHe was a former child actor in television films, sitcoms, and theater, and continued acting as an adult after launching his rap career. He appeared in Spike Lee\'s Bamboozled, MTV\'s Carmen: A Hip Hopera, 2002\'s critically acclaimed Monster\'s Ball, Showtime, and the 2002 romantic comedy Brown Sugar, for which he received an NAACP Image Award nomination. He hosted Def Poetry Jam from 2002 to 2007.\n\nHe completed his Broadway debut in 2002 in the Tony-nominated, Pulitzer Prize-winning, Topdog/Underdog. He then re-teamed with Topdog playwright, Suzan Lori Parks and director George Wolfe for the off-Broadway play Fucking A, for which he earned an Obie Award.\n\nIn 2003, he starred in The Italian Job alongside Ed Norton, Mark Wahlberg and Charlize Theron. In 2004, he starred opposite Alan Rickman in the critically acclaimed HBO movie Something the Lord Made, for which he received a 2004 Emmy Nomination for Outstanding Lead Actor In A Miniseries Or A Movie. He was also nominated for both a Golden Globe Award (Best Performance by an Actor in a Mini-Series or Motion Picture) and Golden Satellite Award (Best Actor in a Miniseries or a Motion Picture Made for Television) for the same role.\n\nHe continued his music career by releasing his highly anticipated and critically acclaimed sophomore solo release, The New Danger (2004). The first single, \"Sex, Love and Money\" earned him a 2005 Grammy nomination for Best Alternative/Urban Performance, and the album has been certified gold by the RIAA.\n\nThe following year, he appeared alongside Bruce Willis in the crime thriller 16 Blocks (2006), in Dave Chappelle’s Block Party, and had a cameo appearance in Talladega Nights: The Ballad of Ricky Bobby. Also in 2006, he released his third solo album, True Magic.\n\nThe next year, he appeared in the 2007 PBS historical documentary, Prince Among Slaves, and in 2008 he played the role of Chuck Berry in Cadillac Records. In 2009, he released the album The Ecstatic, which proved to be his second highest-charting album to date. He then appeared in the urban comedy Next Day Air, and (as himself) in the 2010 mockumentary film I’m Still Here, starring Joaquin Phoenix.\n\nMos Def announced in September of 2011 that he changed his name to Yasiin Bey, and would go by it henceforth. In the first month of 2016, Bey declared his retirement from both the film and music industries.\n\nIn 2014, About.com listed him 14th on its \"50 Greatest Rappers of All Time\".','1973-12-11',NULL),(2745,'Marv Blauvelt',NULL,'',NULL,NULL),(2746,'Eddie Perez','New York City, New York, USA','Eddie Perez is a Los Angeles based Director, 2nd Unit Director, and Stunt Coordinator. He is a multiple award winner for his short-film The Test of Time and a \"4-time nominee 3-time Emmy winner\" for Shameless. He also won the SAG Award for \"Outstanding Performance by a Stunt Ensemble\" on Star Trek into Darkness. Working on over 300 projects as a director, stunt coordinator and/or performer, recent notable projects include Snowfall, Perceptual Grace, Once Upon A Time in Hollywood, Deadpool and Sicario. Eddie\'s goal is to put the scripted vision on film using the most creative techniques available to fit the story. Eddie was born in New York and graduated with a degree in education and a minor in biology from Long Island University focusing on sports medicine. . He worked as head of security for Pink Floyd & Duran Duran as head of security , as well as numerous other artist. He studied under stuntman Paul Stader and Greg Elam. He studied acting under Peter Flood.',NULL,NULL),(2747,'Desislava Irons',NULL,'',NULL,NULL),(2748,'Conrad Pla','Madrid, Spain','Conrad Pla (born October 24th, 1966) is a Canadian actor and former professional kickboxer. He is best known for starring in the television series ReGenesis (2004).','1966-10-24',NULL),(2749,'Talia Russo',' Toronto, Ontario, Canada ','','1980-03-20',NULL),(2750,'David Fox','Swastika, Ontario, Canada','David Fox (born 1941 in Swastika, Ontario) is a Canadian actor. He is best known for his role as schoolteacher Clive Pettibone in Road to Avonlea, and for a variety of roles on television. He also was the voice of Captain Haddock in The Adventures of Tintin.\n\nIn 1996 he was nominated for a Genie Award for the film When Night is Falling, and in 2008 he was nominated for a Gemini Award for the television miniseries Across the River to Motor City.\n\nDescription above from the Wikipedia article David Fox (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia','1941-01-01',NULL),(2751,'Adam Karchmer',NULL,'',NULL,NULL),(2752,'Velizar Peev',NULL,'Velizar Peev is an actor and a stunt performer.','1982-09-03',NULL),(2753,'Dale Midkiff','Chance, Maryland, USA','From Wikipedia, the free encyclopedia.  \n\nDale Alan Midkiff (born July 1, 1959) is an American actor.\n\nDescription above from the Wikipedia article Dale Midkiff, licensed under CC-BY-SA, full list of contributors on Wikipedia','1959-07-01',NULL),(2754,'Zhao Yao-Dong',NULL,'',NULL,NULL),(2755,'James Remar','Boston, Massachusetts, USA','James Remar (born December 31, 1953) is an American actor. He has appeared in movies, video games, and TV shows. He is perhaps best known as Richard, the on-off tycoon boyfriend of Kim Cattrall\'s character in Sex and the City, as Ajax in The Warriors, as the homicidal maniac Albert Ganz in the 1982 comedy/thriller 48 Hrs., Dutch Shultz in The Cotton Club, Lord Raiden in Mortal Kombat: Annihilation and more recently as Harry Morgan in Dexter.\n\nFrom Wikipedia, the free encyclopedia','1953-12-31',NULL),(2756,'Stephen Norris',NULL,'',NULL,NULL),(2757,'Stanley Wong','Louisiana, USA','','1987-06-08',NULL),(2758,'Woody Harrelson','Midland, Texas, USA','Woodrow Tracy Harrelson (born July 23, 1961) is an American actor and playwright. He is the recipient of several accolades, including a Primetime Emmy Award and two Screen Actors Guild Awards, in addition to nominations for three Academy Awards and four Golden Globe Awards.\n\nHarrelson first became known for his role as bartender Woody Boyd on the NBC sitcom Cheers (1985–1993), for which he won a Primetime Emmy Award for Outstanding Supporting Actor in a Comedy Series from a total of five nominations. He went on to receive three Academy Award nominations: Best Actor for The People vs. Larry Flynt (1996), and Best Supporting Actor for both The Messenger (2009) and Three Billboards Outside Ebbing, Missouri (2017). Harrelson was also nominated for a Primetime Emmy Award for Outstanding Lead Actor in a Drama Series for his role as Marty Hart in the crime anthology series True Detective (2014).','1961-07-23',NULL),(2759,'Weston Cage Coppola','Los Angeles, California, USA','Weston Cage Coppola boasts a multifaceted career as an actor, recording artist, music producer, and mixed martial artist. His acting credits include starring and co-starring roles in films like \"D-Day,\" \"211,\" \"Get Gone,\" and the recent \"Mojave Diamonds.\" Notably, he\'s contributed to the scores of major films like \"Drive Angry\" (2011) and \"Ghost Rider.\" His upcoming album single, \"The Wolf,\" anticipates a strong debut in the music industry. As a father, he cherishes his four children: Cyress, Venice, Lucian, and Sorin. Weston Cage Coppola\'s lineage ties back to his father, Nicolas Cage, and his great uncle, the renowned filmmaker Francis Ford Coppola.','1990-12-26',NULL),(2760,'Brendan Murray',NULL,'',NULL,NULL),(2761,'Toni Ellwand','Sicily, Italy','',NULL,NULL),(2762,'Maéva Nadon',NULL,'',NULL,NULL),(2763,'James Michalopolous',NULL,'',NULL,NULL),(2764,'Serge Chambon',NULL,'',NULL,NULL),(2765,'Mayilsamy','Sathyamangalam, Tamil Nadu, India','Mayilsamy is an Indian Tamil comedian actor who prominently plays supporting roles.','1965-10-10','2023-02-19'),(2766,'Brian Markinson','Brooklyn, New York,  USA','From Wikipedia, the free encyclopedia\n\nBrian Markinson is a Canadian film and televisionactor.','1961-09-01',NULL),(2767,'Joseph Lawrence',NULL,'',NULL,NULL),(2768,'Tim Connolly',NULL,'Tim Connolly is a stuntman and actor. He was a stunt performer in Man of Steel and Birds of Prey','1981-05-07',NULL),(2769,'Connie Nielsen','Elling, Frederikshavn, Denmark','Connie Inge-Lise Nielsen (born 3 July 1965) is a Danish actress. She is known for her roles in the English language films Gladiator, The Devil\'s Advocate, Basic, and The Ice Harvest.\n\nDescription above from the Wikipedia article Connie Nielsen, licensed under CC-BY-SA, full list of contributors on Wikipedia.','1965-07-03',NULL),(2770,'Yuki Oikawa',NULL,'',NULL,NULL),(2771,'Laure Gouget',NULL,'',NULL,NULL),(2772,'Qi Kui','中国, 黑龙江, 佳木斯','','1981-08-07',NULL),(2773,'Han Lei',NULL,'',NULL,NULL),(2774,'Sanchana Natarajan','Chennai, Tamil Nadu, India','Sanchana Natarajan is an Indian model and actress who has appeared in Tamil and Telugu films. Having appeared in small roles in films including Irudhi Suttru (2016) and 2.0 (2018), Sanchana rose to fame with her role in Balaji Mohan\'s web series As I\'m Suffering From Kadhal (2017).','1995-12-31',NULL),(2775,'Dorit Sauer',NULL,'',NULL,NULL),(2776,'Allison King',NULL,'',NULL,NULL),(2777,'Jesse Hutch','Alberta, Canada','Sharing the same Birth place as Marvel Character Wolverine, Jesse James Hutch was born in Alberta Canada. At the age of ten he watched his first film, the animated movie \"The Hobbit\", and was instantly hooked on the art of story telling. Through out high school Jesse was known as \"Hardcore\" Hutch, because of his outdoor adrenaline hobbies which included: white water rafting, white water kayaking, free climbing and mountain biking. Often times these hobbies were recorded on video and turned into short movies. At one point in Hutch\'s High School History class he Acted and played out a hostage take over scenario for a presentation. The teacher was apprehended, smoke grenades went off, paintball guns were used and the fire alarm went off. His marks for presentation were high, minus a few points because of the fire department being called.\n\nA collector of Movie Posters, some would say Hutch was an \"Actor\" even as a young boy, It was in 2001 that the title of \"Thespian\" became a professional one.\n\nHis first official audition, which he booked, was for Dark Angel(FOX) in which he played the role of a Mutant, his second audition for Wolf Lake(CBS), which he also booked, had to be passed on due to a filming conflict with Dark Angel. Many Lead roles include that of:\n\nRomantic Comedy Teacher(Hallmark) My Boyfriends Dogs, Race Car Driver(Jordan Wells) 20th Century Fox: Joy Ride 3, Luke Bailey: Cedar Cove Season 2(Hallmark), Navy Seal: True Justice(Reelz), College Hunk: About a Girl(N Network), Hard Working Mans Man on The Hallmark Romantic Comedy Let it Snow, starring alongside Candace Cameron Bure(Full House).\n\nRoles on TV Series such as Almost Human, Once Upon A Time, American Dreams, Smallville, Kyle xy & Heartland are but a few of Hutch\'s recognizable credits alongside Feature films such as: The Butterfly Effect, Freddy vs Jason, Scary Movie 3 & Joy Ride 3.\n\nPerforming almost all of his own stunts to date, Hutch has always had an attraction to Action and Adrenaline. Kick Boxing & Muay Thai are some of his past training.\n\nJesse Hutch\'s most important Lead roles are: Husband,Father, Son, Brother & Wild Man.  - IMDb Mini Biography','1981-01-01',NULL),(2778,'Camilla Belle','Los Angeles, California, USA','Camilla Belle Routh (born October 2, 1986), known professionally as Camilla Belle, is an American actress, director, and producer.','1986-10-02',NULL),(2779,'Velizar Binev','Sofia, Bulgaria','Educated at National Academy of Theatrical and Cinema Arts - Sofia, Bulgaria 1991 Master of Arts. Spoken languages: Bulgarian, English and Russian. - IMDb Mini Biography By: Velizar Binev','1967-03-08',NULL),(2780,'Mark Wahlberg','Boston, Massachusetts, USA','Mark Robert Michael Wahlberg (born June 5, 1971), former stage name Marky Mark, is an American actor, businessman, and former rapper. His work as a leading man spans the comedy, drama, and action genres. He has received multiple accolades, including a BAFTA Award, and nominations for two Academy Awards, three Golden Globe Awards, nine Primetime Emmy Awards, and three Screen Actors Guild Awards.\n\nWahlberg was born in Boston, Massachusetts in 1971. During his early life, he perpetrated several crimes. In the 1990s, Wahlberg was a member of the music group Marky Mark and the Funky Bunch, with whom he released the albums Music for the People (1991) and You Gotta Believe (1992). Wahlberg made his screen debut in Renaissance Man (1994) and had his first starring role in Fear (1996). He received critical praise for his performance as porn actor Dirk Diggler in Boogie Nights (1997).\n\nIn the early 2000s, he ventured into big-budget action movies, such as The Perfect Storm (2000), Planet of the Apes (2001), and The Italian Job (2003). He was nominated for the Academy Award for Best Supporting Actor for playing a police officer in the crime drama The Departed (2006). He was nominated for the Golden Globe Award for Best Actor for the sports drama biopic The Fighter (2010), in which he starred as Micky Ward. In the 2010s, he landed successful comedy roles with The Other Guys (2010), Ted (2012), Ted 2 (2015), Daddy\'s Home (2015), and Daddy\'s Home 2 (2017). He also became the protagonist in two films in the Transformers live-action film franchise, Transformers: Age of Extinction and Transformers: The Last Knight. He was the world\'s highest-paid actor in 2017.\n\nWahlberg served as executive producer of five HBO series: the comedy-drama Entourage (2004–2011), the period crime drama Boardwalk Empire (2010–2014), the comedy-dramas How to Make It in America (2010–2011) and Ballers (2015–2019), and the documentary McMillions (2020). He is co-owner of the Wahlburgers chain and co-starred in the reality TV series about it. He received a star on the Hollywood Walk of Fame in 2010.','1971-06-05',NULL),(2781,'José Manuel Martín','Casavieja, Spain','','1924-05-24',NULL),(2782,'Charly Bravo','Casablanca, Morocco','Ramón Carlos Mirón Bravo, known as Charly Bravo (1943-2020) was a Spanish film actor known for his supporting roles in more than 200 films, many of them Westerns, in addition to films such as George Millius\' Conan the Barbarian alongside Arnold Schwarzenegger, El Lute: Camina o Revienta from Vicente Aranda or Laberinto de Pasiones from Pedro Almovodar.','1943-03-06','2020-06-23');
